INSERT INTO `dayspecialtb` (`dayid`, `wan_date`, `wan_desc`, `wan_detail`, `wan_pra`, `wan_kating`, `wan_tongchai`, `wan_atipbadee`) VALUES
(4, '2019-02-05', 'วันนี้เป็น วันอธิบดี วันธงชัย เป็นวันดีใช้เพื่อทำให้เกิดความเจริญก้าวหน้า เข้ารับตำแหน่ง แต่งงาน วางศิลาฤกษ์ ลงเสาเข็ม ลงเสาเอก ยกศาลพระภูมิ ปลูกบ้านเรือน หรือเปลี่ยนชื่อเปลี่ยนนามสกุล และวันธงชัยเป็นวันที่ดีที่สุด ยามที่ดีที่สุด เหมาะแก่การทำมงคล ที่จะให้ผลสำเร็จสูงสุด มีชัยชนะเป็นมิ่งขวัญของหมู่คณะ มีโชคชัย ใช้สำหรับการยกทัพเคลื่อนย้ายกำลัง หรือขึ้นบ้านใหม่ หรือย้ายที่นั่งที่นอนและทำงานใหม่ ', 'แต่เนื่องจากวันนี้เป็นกระทิงวัน* และเป็นอัคนิโรธบ้าน* ถ้าเลือกได้ ไม่ควรทำการมงคลใดๆโดยเฉพาะที่เกี่ยวกับบ้านเรือน เพราะจะทำให้วุ่นวายและอาจมีอุบัติเหตุเภทภัยแลเกิดเรื่องปัญหาทุกข์ร้อนใจกายเกิดในวันนั้นและหรือในภายภาคหน้าได้ ที่สำคัญ วันนี้แม้จะดีเพียงใดห้ามโดยเฉพาะคนเกิดวันอาทิตย์ใช้เด็ดขาด  และห้ามคนเกิดวันเสาร์บางท่านใช้  แต่คนเกิดวันเสาร์บางท่านก็ใช้ได้ก็มี', 0, 1, 1, 1),
(5, '2019-02-06', 'ขึ้น 2 ค่ำ เดือน 3 ปีจอ วันนี้เป็นวันดี ใช้เพื่อทำให้เกิดความลาภผลและสร้างความเจริญก้าวหน้าราบรื่นรุ่งเรืองให้แก่ตน เหมาะกับการทำงานติดต่อสื่อสารกับต่างถิ่นต่างแดน ', 'แต่เนื่องจากวันนี้เป็นอัครนิโรธตกลงที่ป่า* ถ้าเลือกได้ห้ามเข้าป่า ห้ามไปเที่ยวไปเดินป่าเขา ห้ามตัดป่าไม้และต้นไม้ และไม่ควรทำการมงคลใดๆโดยเฉพาะที่เกี่ยวกับป่า เพราะจะทำให้วุ่นวายและอาจมีอุบัติเหตุเภทภัยแลเกิดเรื่องเจ็บป่วยมีปัญหาทุกข์ร้อนใจกายเกิดในวันนั้นและหรือในภายภาคหน้าได้ แม้วันนี้จะดีเพียงใด ป้องกันดีกว่าแก้ไขห้ามคนเกิดวันอังคารและวันพุธกลางคืนใช้ฤกษ์เด็ดขาด', 0, 0, 0, 0),
(6, '2019-02-07', 'ขึ้น 3 ค่ำ เดือน 3 ปีจอ เนื่องจากวันนี้เป็นวันอุบาทว์* เป็นกระทิงวัน* จัดว่าเป็นวันไม่ดี เป็นวันเสี่ยงมาก เจ้ากรรมนายเวรแรง พลังอุบัติเหตุแรง พลังวิบัติแรง อาจทำให้เกิดการทะเลาะวิวาท มีความวุ่นวาย มีอุปสรรคปัญหามีเรื่องทุกข์ร้อนใจกายเกิดได้ง่าย และอาจมีอุบัติเหตุเภทภัยมีเรื่องร้ายๆเกิดขึ้นกะทันหันได้ง่าย ', 'และวันนี้เป็นอัคนิโรธน้ำ* ถ้าเลือกได้ ไม่ควรไปเที่ยวน้ำหรือน้ำตกรวมทั้งน้ำทะเล ฝนตกลมแรงพายุเข้าอย่าออกไปไหน วันแรงแบบนี้ระวังโรคภัยและอุบัติเหตุที่เกิดจากน้ำมาเกี่ยวข้อง และไม่ทำการมงคลใดๆโดยเฉพาะที่เกี่ยวกับน้ำ เพราะจะทำให้วุ่นวายและอาจมีอุบัติเหตุเภทภัยแลเกิดเรื่องปัญหาทุกข์ร้อนใจกายเกิดในวันนั้นและหรือในภายภาคหน้าได้ ', 0, 1, 0, 0),
(7, '2019-02-08', 'ขึ้น 4 ค่ำ เดือน 3 ปีจอ วันนี้เป็น วันอธิบดี วันธงชัย แต่เนื่องจากติด*ดิถีมหาสูญ* และเป็นอัคนิโรธภูเขา ขอท่านจงหลีกเลี่ยงการเที่ยวป่าขึ้นเขา และวันนี้ถ้าเลือกได้ ถ้าเลี่ยงได้ ท่านไม่ควรทำการมงคลใดๆทั้งปวง ต้องมีสติและระมัดระวัง', 'เพราะวันนี้มีพลังวิบัติ อาจจะทำให้เกิดโทษจนทำให้ชีวิตวิบัติวุ่นวายและอาจมีอุบัติเหตุเภทภัยเกิดขึ้นได้ง่าย รวมทั้งอาจมีปัญหาทุกข์ร้อนใจกายบังเกิดขึ้นด้วย', 0, 0, 0, 0),
(8, '2019-02-09', 'ขึ้น 5 ค่ำ เดือน 3 ปีจอ วันนี้เป็นวันดีมาก ควรแก่การทำการมงคล.....แต่ไม่ควรเดินทางและไม่ควรจัดงานแต่ง งานบวช งานหมั้น เปิดร้าน เปิดบริษัท สร้างบ้าน ยกเสาเอก ขึ้นบ้านใหม่และย้ายบ้านย้ายร้านใหม่ หรือแม้แต่เปลี่ยนชื่อ....ใหม่ในวันนี้ เพราะวันนี้เป็นวันเสาร์ โบราณเชื่อว่า หากทำการมงคลหรือทำธุรกิจการงานสำคัญๆในวันนี้ มักจะทำให้เกิดโทษมากกว่าดี มักทำให้ขาดความสุข ไม่มีความมั่นคงยืนยาว ในชีวิตและธุรกิจการงานนั้น', 'และเพราะวันนี้เป็นอัครนิโรธที่ดิน จึงไม่ควรซื้อที่ดินห้ามแบ่งปันที่ดิน ห้ามรังวัดที่ดินในวันนี้ มิเช่นนั้นจะเกิดปัญหาหรือความวิบัติได้ในภายหลัง', 0, 0, 0, 0);
