INSERT INTO `miracledo_desc` (`mira_id`, `activity`, `mira_day`, `mira_desc`) VALUES
(1, 'สระผม', 'sunday', 'ดี สระผมวันนี้ โบราณเชื่อว่าจะช่วยเสริมมงคลในเรื่องสุขภาพแลช่วยบรรเทาจากการเจ็บไข้ได้ป่วย และช่วยเสริมส่งให้มีอายุยืนยาวขึ้น '),
(2, 'สระผม', 'monday', 'ดี มีมงคล โบราณเชื่อว่าสระผมวันนี้จะช่วยดึงดูดโชคลาภเงินทองมาให้'),
(3, 'สระผม', 'tuesday', 'ดี สระผมวันนี้ โบราณเชื่อว่าจะช่วยส่งเสริมให้ชีวิตโชคดีมีชัยเหนือคู่แข่งและศัตรูได้'),
(4, 'สระผม', 'wednesday', 'ไม่ดี สระผมวันนี้ โบราณเชื่อว่า จะทำให้เจ็บไข้ได้ป่วย และจะส่งผลให้ชีวิตของคุณมีแต่ความถดถอยและยุ่งยากลำบากใจกาย มักมีปากมีเสียง มีเรื่องมีความ มีคดี เกิดทะเลาะขัดแย้ง มักมีปัญหาเกี่ยวกับเอกสารสัญญา'),
(5, 'สระผม', 'thursday', 'ดีมาก โบราณเชื่อว่า หากสระผมในวันนี้จะทำให้มีสง่าราศี เทวดาจะรักษาและเป็นสิริมงคลแก่ตัว จะเป็นที่รักของผู้คน'),
(6, 'สระผม', 'friday', 'ดี สระผมวันนี้ โบราณเชื่อว่า จะช่วยทำให้ชีวิตคุณอยู่เย็นเป็นสุขมากกว่าทุกข์ร้อน'),
(7, 'สระผม', 'saturday', 'ดีมาก โบราณเชื่อว่า หากมีการสระผมในวันนี้จะทำให้มีเสน่ห์ เป็นที่รักใคร่ของคนทั่วไปเสมอ หากคิดหวังสิ่งใดมักจะสมหวังดังปราถนา'),
(8, 'karee', 'abpramongkol', 'ไม่ดี วันนี้เป็นวันอัปมงคลของตัวท่านเอง จึงไม่ควรทำกิจกรรมสำคัญดีที่สุด แต่ควรสวดมนต์ไหว้พระสร้างบุญบารมี'),
(9, 'ตัดผม', 'sunday', 'ดี ตัดผมวันนี้ โบราณเชื่อว่า จะช่วยเสริมมงคลให้มีชีวิตยืนยาวขึ้น และช่วยเสริมส่งให้มีสุขภาพร่างกายแข็งแรงปราศจากโรคภัยไข้เจ็บ'),
(10, 'ตัดผม', 'monday', 'ดีมาก ตัดผมวันนี้ โบราณเชื่อว่าจะช่วยส่งเสริมให้คุณมีเสน่ห์ และส่งเสริมมีโชคดีมีโชคลาภบังเกิดผล'),
(11, 'ตัดผม', 'tuesday', 'ไม่ดี ตัดผมวันนี้ โบราณเชื่อว่า จะทำให้มีเรื่องทะเลาะวิวาทบาดหมาง จะทำให้มีศัตรูปองร้ายใส่ความ ระวังจะมีอุบัติเหตุเลือดตกยางออก'),
(12, 'ตัดผม', 'wednesday', 'ไม่ดี ตัดผมวันนี้ โบราณเชื่อว่าจะทำให้ชีวิตถดถอย มักมีปากมีเสียง มีเรื่องมีความ มีคดี มีปัญหาเรื่องเกี่ยวกับเอกสารสัญญา'),
(13, 'ตัดผม', 'thursday', 'ดีมาก ควรตัดผมวันนี้ โบราณเชื่อว่าเทพเทวาและสิ่งศักดิ์สิทธิ์จะรักษาคุ้มครองและอวยพรอวยชัยให้คุณอยู่เย็นเป็นสุข จะเกิดสิริมงคลแก่ตน '),
(14, 'ตัดผม', 'friday', 'ดีมาก ควรตัดผมวันนี้ โบราณเชื่อว่าจะช่วยส่งเสริมให้ชีวิตคุณโชคดีมีโชคลาภเงินทองและจะมีเสน่ห์เป็นที่นิยมรักใคร่แก่คนทั้งปวง'),
(15, 'ตัดผม', 'saturday', 'ดีมาก ควรตัดผมวันนี้ โบราณเชื่อว่าจะช่วยส่งเสริมให้ชีวิตโชคดีมีโชคลาภสุขสมหวัง คิดการใดๆมักได้สมประสงค์ '),
(16, 'ตัดเล็บ', 'sunday', 'ไม่ดี ห้ามตัดเล็บวันนี้ เพราะโบราณเชื่อว่าตัดเล็บวันนี้จะทำให้ถูกนินทาว่าร้ายใส่ความ มากมีศัตรูปองร้าย'),
(17, 'ตัดเล็บ', 'monday', 'ดีมาก ควรตัดเล็บวันนี้ โบราณเชื่อว่าจะช่วยให้คุณมีเสน่ห์และส่งเสริมให้คุณโชคดีมีโชคลาภเงินทองเกิด'),
(18, 'ตัดเล็บ', 'tuesday', 'ไม่ดี ห้ามตัดเล็บวันนี้ เพราะคนโบราณเชื่อว่าวันนี้เป็นเป็นวันดุ ถ้าหากใครตัดเล็บในวันนี้จะทำให้หมดราศี และอาจต้องมีเรื่องให้เสียทรัพย์ มีเรื่องทะเลาะ จะทำให้เจ็บป่วย หรือมีเหตุให้มีเลือดตกยางออก'),
(19, 'ตัดเล็บ', 'wednesday', 'ดี ควรตัดเล็บในวันนี้ โบราณเชื่อว่าหากใครตัดเล็บในวันนี้จะเป็นมงคลแก่ตน ในด้านคุ้มครองปกป้องจากสิ่งชั่วร้าย สิ่งไม่ดีต่าง ๆ ไม่ให้มากล้ำกรายได้'),
(20, 'ตัดเล็บ', 'thursday', 'ไม่ดี ห้ามตัดเล็บในวันนี้ เพราะโบราณเชื่อว่าวันนี้เป็นวันครู ผู้ใดตัดเล็บในวันนี้ จะทุกข์ร้อนใจกาย มักได้รับความเดือดร้อนมีเรื่องยุ่งยากวุ่นวายและมีอุปสรรคปัญหาเกิดแก่ชีวิต'),
(21, 'ตัดเล็บ', 'friday', 'ดีมาก ควรตัดเล็บในวันนี้ โบราณเชื่อว่าผู้ใดที่ตัดเล็บในวันนี้ ตำราว่าจะเสน่ห์ จะมีโชคลาภเงินทองอุดมสมบูรณ์ และเป็นสิริมงคลแก่ตัว'),
(22, 'ตัดเล็บ', 'saturday', 'ไม่ดี ห้ามตัดเล็บในวันนี้ โบราณเชื่อว่าใครก็ตามที่ตัดเล็บในวันนี้ จะส่งผลเสียต่อสุขภาพ มักล้มป่วยไม่สบายเป็นโรคภัยต่างๆ ระวังมีอุบัติเหตุ ชีวิตมักมีอุปสรรคปัญหาเกิดขึ้น จนทำให้เกิดทุกข์ เครียด คิดมาก'),
(23, 'ผ้าใหม่', 'sunday', 'ดี ควรนุ่งผ้าใหม่วันนี้ โบราณเชื่อว่าจะโชคดีมีชัยต่อศัตรูคู่แข่ง แต่...ไม่ควรเริ่มต้นทำอะไรใหม่ๆ ที่ยุ่งยากและหวังผลในระยะยาวในวันนี้'),
(24, 'ผ้าใหม่', 'monday', 'ดี ควรนุ่งผ้าใหม่ในวันนี้ โบราณเชื่อว่าจะทำให้มีเสน่ห์เป็นที่รักของคนทั้งหลาย'),
(25, 'ผ้าใหม่', 'tuesday', 'ไม่ดี ไม่ควรนุ่งผ้าใหม่ในวันนี้ โบราณเชื่อว่าจะทำให้มีทุกข์เกิด ศัตรูจะปองร้าย มักมีการเจ็บป่วยไข้ หรือเกิดอุบัติเหตุมีเลือดตกยางออก'),
(26, 'ผ้าใหม่', 'wednesday', 'ดี ควรนุ่งผ้าใหม่ในวันนี้ โบราณเชื่อว่าจะทำให้คุณโชคดีมีความสุข'),
(27, 'ผ้าใหม่', 'thursday', 'ดีมาก ควรนุ่งผ้าใหม่ในวันนี้ เพราะโบราณเชื่อว่าเทวดาและสิ่งศักดิ์สิทธิ์จะคุ้มครองอวยพรให้ และจะทำให้มีความสุขสมบูรณ์ มีสิริมงคลเกิดแก่ตัว'),
(28, 'ผ้าใหม่', 'friday', 'ดีมาก ควรนุ่งผ้าใหม่ในวันนี้ และควรมีสีสันสดใส เพราะโบราณเชื่อว่าจะทำให้โชคดีมีโชคลาภมีทรัพย์สินเงินทองบังเกิดแก่ตน ห้ามสำหรับคนเกิดวันอาทิตย์แม้จะดีเพียงใด'),
(29, 'ผ้าใหม่', 'saturday', 'ไม่ดี ไม่ควรนุ่งผ้าใหม่ในวันนี้ เพราะโบราณเชื่อว่าจะทำให้ชีวิตมีทุกข์โศกโรคภัยและมีอุปสรรคปัญหาต่างๆเกิดขึ้น แม้จะฤกษ์ดีเพียงใดก็ไม่ควรเริ่มต้นอะไรใหม่ๆ ที่ยุ่งยากและหวังผลระยะยาวในวันนี้');
