(1, '0000-00-00 00:00:00', 'คุณนิน', '5', 'มหัศจรรย์ตัวเลขลิขิตชีวิต', 'https://2.bp.blogspot.com/-zN9sBu4fGdw/U9Nq6AqU83I/AAAAAAAAAmw/3B8P-P0qeSY/s1600/10520897_537391606361450_431638234_n.jpg', 'มหัศจรรย์ตัวเลขลิขิตชีวิต บอกเราได้ทุกอย่าง แม้ยังไม่เปิดดวง นี้คือ ประสบการณ์ในการทำงานของเราเพียงบางส่วนเท่านั้น ถ้าใครสนใจก็ติดตามจากหนังสือของเราหรือบทความของเราเรื่อยๆนะคะ ถ้ามีเวลาจะพยายามอัพข้อมูลให้ดูให้ศึกษาระวังตัวกัน', '<p>มหัศจรรย์ตัวเลขลิขิตชีวิต บอกเราได้ทุกอย่าง แม้ยังไม่เปิดดวง นี้คือ ประสบการณ์ในการทำงานของเราเพียงบางส่วนเท่านั้น ถ้าใครสนใจก็ติดตามจากหนังสือของเราหรือบทความของเราเรื่อยๆนะคะ ถ้ามีเวลาจะพยายามอัพข้อมูลให้ดูให้ศึกษาระวังตัวกัน</p>\r\n    <hr>\r\n\r\n    <img class=\"ui fluid image\"  src=\"https://4.bp.blogspot.com/-F5OF6g37z40/UetrHij_cJI/AAAAAAAAAe8/eRn6jBQRm60/s640/20-7-2556+21-35-53.png\">\r\n    <img class=\"ui fluid image\"  src=\"https://3.bp.blogspot.com/-pPnBY9kifE8/UetrNkrfA_I/AAAAAAAAAfE/DOXNfTwHF0c/s640/20-7-2556+21-37-30.png\">\r\n    <img class=\"ui fluid image\"  src=\"https://4.bp.blogspot.com/-8jSQ_6VkWqQ/UetrqVL5DAI/AAAAAAAAAfM/0rHTT4YLbEo/s640/21-7-2556+1-16-50.png\">\r\n\r\n    <img class=\"ui fluid image\"  src=\"https://3.bp.blogspot.com/-jGc4Bk8dlTQ/U9Nq6cjAb3I/AAAAAAAAAm4/fz3mLyucdzI/s1600/10559062_537391519694792_2106927164_n.jpg\">\r\n    <img class=\"ui fluid image\"  src=\"https://2.bp.blogspot.com/-JxTB9ZuLs_o/U9Nq6SUgMnI/AAAAAAAAAm0/aseTrLfRCPw/s1600/10559073_537391586361452_1414431594_n.jpg\">\r\n    <img class=\"ui fluid image\"  src=\"https://2.bp.blogspot.com/-txkM1DPV9lQ/U9Nq7d07gjI/AAAAAAAAAnE/Nes0ZsGo1tI/s1600/10563402_537391569694787_1229946982_n.jpg\">\r\n    <img class=\"ui fluid image\"  src=\"https://4.bp.blogspot.com/-ptcApDzd-wQ/U9Nq76xyjDI/AAAAAAAAAnQ/mNMb9AoZCAo/s1600/10564641_537391666361444_253707126_n+(1).jpg\">\r\n    <img class=\"ui fluid image\"  src=\"https://1.bp.blogspot.com/-azj2FrndfEY/U9Nq8WILp4I/AAAAAAAAAnU/cXWr29iosX4/s1600/10565734_537391639694780_642895251_n.jpg\">\r\n    <img class=\"ui fluid image\"  src=\"https://4.bp.blogspot.com/-I84wBor6qyc/U9Nq83pGIXI/AAAAAAAAAnk/ZuqNPy8N5BM/s1600/10565756_537391536361457_697976786_n.jpg\">\r\n    <img class=\"ui fluid image\"  src=\"https://1.bp.blogspot.com/-shLBWX-kZBg/U9Nq9c9gdQI/AAAAAAAAAnw/M6N9SS6i8Mo/s1600/10567534_537391616361449_1611724382_n.jpg\">\r\n    <img class=\"ui fluid image\"  src=\"https://4.bp.blogspot.com/-ZprNJqAQDao/U9Nq-Rya95I/AAAAAAAAAoA/wxLW0F2LvLs/s1600/10568711_537391556361455_1856204953_n.jpg\">\r\n    <img class=\"ui fluid image\"  src=\"https://2.bp.blogspot.com/-jwoS8rXntSw/U9Nq-3PNtpI/AAAAAAAAAoE/zxsMNW1U3vg/s1600/10569155_537391599694784_1959026061_n.jpg\">\r\n    <img class=\"ui fluid image\"  src=\"https://4.bp.blogspot.com/-HjUV0wWKAVw/U9Nq-wyuEkI/AAAAAAAAAoM/QD0-oQQq2sc/s1600/10570596_537391596361451_1310540480_n.jpg\">\r\n\r\n</div>', 1, NULL, NULL, NULL, NULL, NULL),
(9, '2013-07-29 08:36:00', 'คุณนิน', '', 'เปลี่ยนเบอร์โทร เปลี่ยนชื่อ เปลี่ยนทะเบียนรถแล้ว ดีจริงหรือ มีคำตอบครับ', 'https://www.ananya.in.th/views/assets/images/namedee.jpg', 'มีหลายท่านถามว่า ถ้าใช้เบอร์โทรศัพท์ดีแล้วชีวิตจะดีขึ้นไหม ถ้าใช้เบอร์ดีแล้ว มันจะช่วยได้จริงรึเปล่า ถ้าเปลี่ยนทะเบียนรถแล้วจะดีขึ้นจริงเหรอ ถ้าเปลี่ยนชื่อแล้วชีวิตจะดีขึ้นจริงรึเปล่า ?......', '<p>@@ผมขอตอบว่า ดีขึ้นแน่นอนครับถ้าได้เบอร์ดี ทะเบียนดี และชื่อที่ดีจริงๆ อย่างน้อยถ้าเปลี่ยนอย่างใดอย่างหนึ่งดีขึ้นแนะแต่อาจรอนานหน่อยจึงจะเห็น หรือ ถ้าเปลี่ยนพร้อมกันหมด รับรองเห็นเร็วและดีแน่นอนครับ โดยผมเน้นความสำคัญและน้ำหนักความสำคัญไปที่ เบอร์โทรก่อน ตามด้วย - ชื่อเล่น-ชื่อจริงสกุล(ใช้ตัวไหนบ่อยเน้นตัวนั้น) และสุดท้าย ทะเบียนรถ ตามด้วยเลขที่บ้าน เพราะอะไร เรามาดูเหตุผลกัน (เดี๋ยว ผมจะแบ่งปันประสบการณ์จริงๆเลยนะครับในช่วงท้าย)</p>\r\n\r\n<p>เหตุผล ทำไม่ผมถึงให้ความสำคัญกับเบอร์โทรศัพท์มงคลในการส่งผลที่แรงและเร็วกว่าอย่างอื่น นั่น เพราะ อะไรที่เรา ถ้ายิ่งใช้บ่อยๆจะยิ่งดียิ่งเร็วยิ่งแรง เหมือนกับชีวิตเราครับ ิวิ่งบ่อยๆก็ผอม กินบ่อยๆก็อ้วน ทำดีบ่อยๆก็ได้ดี ทำชั่วบ่อยๆก็โดนสนองเข้าซักวัน เช่นกันครับ โบราญท่านยังว่า พูดดีเป็นศรีแก่ปาก พูดมากปากจะเป็นสี ใครที่พูดดี พูดและคิดแต่เรื่องดีๆ บ่อยๆ ชีวิตก็จะเจอแต่เรื่องดีๆ บ่อยๆ แต่ถ้าใครพูดไม่ดีบ่อยๆ พูดแต่เรื่องไม่ดีไม่งามไม่เป็นมงคลบ่อยๆ เดี๋ยวก็เจอครับ สิ่งเหล่านี้ก็เหมือนกัน</p>\r\n\r\n<p>ที่นี้มาเจาะกันว่าทำไม ผมถึงเลือกเบอร์โทร แล้วคุณละครับ ระหว่างเบอร์โทร ชื่อ ทะเบียนรถ ถามว่าอะไรแรงกว่า สำคัญกว่า พวกคุณว่าอะไร ?.... ลองคิดตามนะครับ ถ้าเป็นสมัยก่อนผมให้ความสำคัญกับ--ชื่อเล่น ตามด้วย--ชื่อ-สกุลมาเป็นอันดับหนึ่ง แต่สมัยนี้ผมให้เบอร์โทร เพราะอะไร ?...</p>\r\n<p>@@อันดับหนึ่ง คือ เบอร์โทรศัพท์มงคล เพราะทุกวันนี้เราต้องใช้โทรศัพท์ ใช้วันละตั้งหลายรอบ ทั้งโทรเข้าโทรออก ลองนับดูซิครับกี่ครั้ง</p>\r\n<p>@@อันดับสอง คือ ชื่อเล่น ชื่อจริงนามสกุล ถ้าชื่อดี แล้วมีเบอร์ดี จะเสริมกันอย่างมาก เพราะอะไรเพราะลองนับดูครับในหนึ่งวันมีคนเรียกชื่อเรากี่ครั้งแล้วถ้ามีคนโทรมา หรือเราโทรไปมันมีการเรียกชื่อกันรึเปล่า หรือนึกถึงชื่อเรารึเปล่า ต่อมา คือทะเบียนรถ</p>\r\n<p>@@อันดับสาม ทะเบียนรถมงคลครับ ผมให้ความสำคัญรองลงมาเพราะมันเห็นผลช้ากว่าช้าเพราะอะไร เพราะวันหนึ่งเราใช้รถแค่ขับไปและขับกลับครับ (ยกเว้นนักธุรกิจที่ต้องขับรถบ่อยอันนั้นต้องเปลี่ยนฮะ) แต่แม้เขาจะแสดงผลช้ากว่าแต่เมื่อถึงเวลาเขาก็แสดงนะครับเพราะฉะนั้นต้องเปลี่ยนออก</p>\r\n<p>@@สุดท้าย คือ เลขที่บ้านครับ อันนี้ส่งผลแรงเหมือนกันครับเพราะอยู่กับเรามานาน และเราต้องนอนบ้านทุกวัน ถ้าใช้บ่อยก็เร็วถ้าไม่บ่อยก็ส่งผลอ่อนๆครับ ตามจังหวะชีวิตและพื้นดวงครับ ผมให้ความสำคัญสุดท้ายเพราะเปลี่ยนยากแก้ยากครับแม้จะแก้โดยการทำป้ายใหม่แต่นั่น คือ แค่ช่วยลดแรงให้เบาลงครับ เพราะเลขที่เดิมยังอยู่ ถ้าจะให้ดีจริงๆต้องเปลี่ยนเลย และเอาเลขอย่างอื่นมาช่วยดึงดวง (เบอร์โทร ชื่อ ทะเบียนรถ) ครับ</p>\r\n\r\n<p>ผมขอแชร์เรื่องเบอร์โทรจากประสบการณ์จริงของตัวเองให้เพื่อนได้อ่านและได้พิจารณาดูละกันครับ สมัยก่อนผมกับแฟนทำงานที่บริษัทเอกชนแห่งหนึ่ง บริษัทนี้มีการแข่งขันสูงมาก และยังมีการเล่นพรรคเล่นพรรคกันด้วย ดังนั้นในการทำงานจึงต้องมีการวางแผน และรอบคอบไม่ให้มีช่องโหว่ให้เขาเล่นงานได้ เป็นการทำงานที่เครียดครับ อ่อ ต้องบอกก่อนว่าผมศึึกษาโหราศาสตร์และศาสตร์ของตัวเลขมาประมาณเกือบ 10 ปีได้และตอนนั้นผมพึ่งเริ่มศึกษาศาสตร์เหล่านี้ได้ไม่กี่ปีครับ ซึ่ง เมื่อพอมีความรู้บ้าง ผมเองจะดูดวงละเอียดให้ตัวเองทุกปีถ้าดีก็เสริมไม่ดีก็จะหาทางป้องกันเอาไว้เกิดไม่เกิดช่างมัน แต่ขอให้ได้ทำจะได้ไม่เสียใจภายหลัง ถ้าถามว่าเชื่อไหม เชื่อครับ แต่เชื่ออย่างมีเหตุและผล ผมเชื่อว่าชีวิตเราถูกกำหนดถูกลิขิตมาแล้วด้วยแรงบุญและแรงกรรมจากอดีตชาติ\r\nแต่ผมเชื่อว่า เราสามารถเปลี่ยนแปลงชะตาชีวิตที่ถูกกำหนดไว้แล้วได้ ป้องกันและแก้ไขได้ เปลี่ยนหนักให้เป็นเบาได้ เราหนีได้ ด้วยพลังแรงบุญปัจจุบันแรงบุญจากอดีตมาเสริมเติมกันทำให้แรงบุญมีมากกว่าแรงกรรมครับ </p><p>ถามว่า@@แล้วเราจะรู้ จะหนี จะเปลี่ยนได้อย่างไร</p>\r\n<p>ตอบ@@ ก็รู้ด้วยโหราศาสตร์และศาสตร์จากตัวเลขยังไงละครับ ศาสตร์เหล่านี้บอกเราได้ บอกล่วงหน้าได้เป็นปีๆ ถึงหลายปี บอกทางแก้ให้เราด้วย โดยเฉพาะศาสตร์ของตัวเลข ผมนับถือมากเพราะเป็นศาสตร์ที่ได้ผลจริง เป็นศาสตร์ที่ช่วยให้เราหนีดวงได้ ยืดเวลาให้เราได้ ให้เราได้มีสร้างบุญให้มากกว่ากรรมและเป็นยังเป็นศาสตร์ที่ช่วยเบิกบุญมาเติมให้บุญใหม่เพื่อจะได้มีมากขึ้นเพื่อเอามาใช้กันและแก้ด้วยรหัสตัวเลขรหัสกรรมของเรา เอาละครับบ่นมามากแล้ว ต่อต่อ ต่อครับ</p>\r\n\r\n<p>ผลจากการเปิดดวง ดูดวงให้ตัวเอง พร้อมกับเปิดดวงให้เพื่อนอีกสองคน มีความแตกต่างกันกันไปตามพื้นดวง แต่มีสิ่งหนึ่งที่เหมือนกัน คือ ปีนั้นๆพวกผมดวงตกแต่ไม่หนักมาก คือ ดวงปานกลาง เด่นๆที่เหมือนกัน คือ มีปัญหาในการทำงานต้องตกงาน ส่วนดวงด้านอื่นๆของผม ที่เด่น คือ การงานจะรุ่ง เงินจะเยอะจะโดนศัตรูเล่นงาน มีปากมีเสียง จะมีอุบัติเหตุ เอาแล้ว ผมเชื่อครับ แต่ตอนนั้นงานยุ่งจริงๆปลีกตัวไม่ได้ แต่สิ่งแรกที่ทำผมไปถวายผ้าไตรจีวรก่อนเลย ต่อมาผมจึงหาทางป้องกันอย่างเร่งด่วนและรวดเร็วที่สุดตามศาสตร์ที่ผมเชื่อเพื่อจะได้มีเวลาให้เขาได้แสดงผล โดยผมกับแฟนเลือกเปลี่ยนเบอร์ก่อนสิ่งอื่นใด ตอนนั้นหาได้เบอร์ดีปานกลาง ดีสองคู่ท้ายดี ผลรวมดี เน้นที่ช่วยเสริมเรื่องการงาน การเงิน มีคนเอ็นดูช่วยเหลือ ซึ่งตอนนั้นยังไม่เปลี่ยนชื่อ(เปลี่ยนไม่ทันไม่มีเวลาเพราะต้องเดินทางกลับบ้านต่างจังหวัด)ทะเบียนรถก็ยังไม่เปลี่ยนเพราะต้องไปเปลี่ยนที่ขนส่งจังหวัดที่ตัวเองซื้อแถมยุ่งยากเพราะยังผ่อนไม่หมด ผมเลยเอาที่ง่ายๆก่อน</p>\r\n\r\n<p>พอถึงจังหวะของมันก็เจอจริงๆครับเงินไหลเข้าเยอะมาก ได้ตำแหน่งงานที่สูงขึ้นแต่มีปัญหาหนักโดนใส่ร้ายเขาจะไล่ออก แต่สุดท้ายผมก็รอดเพราะเขาพิจารณาที่ผลงานด้วย และมีคนช่วยไว้ ผมรอด แต่เชื่อไหมครับเพื่อนอีกสองคนไม่รอด ตกงานโดนไล่ออก ครับนั่นคือเรื่องจริง ผมยังงง ไม่หาย คือเจอปัญหาจริงตามดวงแต่ไม่เป็นไร (ไม่ตกงานแต่เครียดมาก 555+) ดูซิครับ ต่างกันไหม อ่อ ลืมไป\r\nถามว่าแล้วมีอุบัติเหตุเกิดขึ้นจริงตามดวงไหม จริงครับ ปีนั้นโดนสามครั้งแต่ไม่เป็นไร รถเสียหายคนปลอดภัย แต่ในความเป็นจริงแล้ว ปีเดียวไม่น่าจะโดนบ่อยขนาดนั้นจริงไหมครับ แต่ผมไม่แปลกใจครับ เพราะส่วนหนึ่งมันมาจากทะเบียนรถด้วย เดี๋ยวมาเล่าให้ฟังครับ เอาละวันนี้พอแค่นี้ก่อนครับ เดี๋ยววันหลังจะแชร์เคสทะเบียนรถของผมให้ฟังกันครับคิดดูว่า แฟนผมจากแต่ก่อนเขาไม่เชื่อศาสตร์นี้เลยเขาหาว่าไร้สาระเลอะเทอะ แต่ตอนนี้เขาหันมาศึกษาและสนใจศาสตร์เหล่านี้เพราะเขาเจอด้วยตัวเองมาเต็ม เอาเป็นว่าแม้ทะเบียนรถเขาจะส่งผลช้าแต่ถ้าเขาได้แสดงผล แสบจริงๆครับ</p>\r\n', NULL, 1, NULL, NULL, NULL, NULL),
(2, '0000-00-00 00:00:00', 'คุณนิน', '4', '“บิ๊ก” ดีทูบี ย้อนรอยอดีตนักร้องชื่อดัง', 'https://ananya.in.th/views/assets/images/bigb2b.jpg', '“บิ๊ก” ดีทูบี ทำไมถึงดังและดับในระยะเวลารวดเร็ว เรามาดูชื่อสกุล และทะเบียนรถที่เกี่ยวข้องกับเขาในช่วงเวลาที่เกิดเหตุให้พรากจากกันคะ', '<p>“บิ๊ก” ดีทูบี ย้อนรอยอดีตนักร้องชื่อดัง\r\n    ย้อนรอยอดีตนักร้องชื่อดัง “บิ๊ก” ดีทูบี ทำไมถึงดังและดับในระยะเวลารวดเร็ว เรามาดูชื่อสกุล และทะเบียนรถที่เกี่ยวข้องกับเขาในช่วงเวลาที่เกิดเหตุให้พรากจากกันคะ</p>\r\n    <hr>\r\n\r\n    <p> @@ตัวเลขในทะเบียนรถ@@ <br>\r\n        ---ทะเบียนรถที่ขับในวันเกิดเหตุ คือ วพ4973=68-4973=24=37 (อันตรายมาก) <br>\r\n        @@ตัวเลขในชื่อสกุล@@ <br>\r\n        ---ชื่อเล่น “บิ๊ก” เลขศาสตร์ 14 พลังเงา 40 <br>\r\n        --- เลขศาสตร์ <br> อภิเชษฐ์ = 37 กิตติกรเจริญ = 40     [ผลรวมชื่อ + สกุล] = 77 <br>\r\n        --- พลังเงา <br>    อภิเชษฐ์ =  83  กิตติกรเจริญ = 114 [ผลรวมชื่อ + สกุล] = 197 <br>\r\n\r\n        *** ชื่อสกุลร้ายแรงมาก</p>\r\n\r\n    <img class=\"ui fluid image\"  src=\"https://2.bp.blogspot.com/-LvepZMLLeH0/UfVguKLrYFI/AAAAAAAAAfs/-0UFXYOby60/s640/29-7-2556+0-10-49.png\"\r\n         alt=\"\">\r\n\r\n    <p>สังเกต ตัวเลขในทะเบียนรถในชื่อสกุลนะคะ ซวยซ้ำซวยซ้อน เราไม่แปลกใจเลยว่าทำไมน้องถึงไม่รอดทั้งทีน่าจะรอดทั้งๆที่ไม่น่าจะร้ายแรง เสียดายจริงๆ ถามว่าทำไมเหรอคะตามมาดูคำตอบกันคะ\r\n        จากทะเบียนรถ 4973 สังเกตแค่ลำพังเลขเรียงไม่ต้องเจาะไปที่ผลรวมก็ร้ายแล้ว ร้ายทุกตัวเอาเป็นว่าถ้าเป็นเรา เราจะไม่ขับเด็ดขาดรถคันนี้ ยิ่งถ้าเลขทะเบียนรถมาตรงกับชื่อสกุล(37,77,83) ซึ่งเป็นเลขร้ายแรงด้วยแล้วผลของมันจะร้ายแรงเพิ่มเป็นเท่าตัวมาเร็วขึ้นแรงขึ้น ถึงผลรวมตัวเลขจะได้ 24 แต่มันช่วยเรื่องเงินเสน่ห์ความโด่งดังเท่านั้น ไม่ได้คุ้มครองชะตา พอมาดูผลรวมทั้งหมวดทั้งตัวเลขซึ่งได้ 37 อืม อันตรายมากเพราะผลรวมตรงกับเลขเรียงคู่ท้าย แถมยังมาตรงกันกับตัวเลขในชื่อสกุลอีก ผลนั่นหรือ มันจึงพรากน้องเขาไปก่อนเวลาอันควรไงละ ใครนี้เลขนี้วนเวียนในชีวิตอย่าประมาทเด็ดขาดไม่ใช่มันคุณดวงแข็งคุณดวงดี ไม่ใช่! มันเกิดแน่นอนเพียงแต่มันรอวาระของมันเท่านั้นเอง</p>\r\n\r\n    <p>โดยหลักๆเราจะเห็นเด่นๆ คือ 37,73,77 เลขนี้ใครเกี่ยวข้องต้องระวัง รับรองชีวิตนี้คุณนี้ไม่พ้นการผ่าตัด การนอนโรงพยาบาล หนีไม่พ้นอุบัติเหตุ แน่นอน สุขภาพระวังไว้เลย แถมมีวิญญาณตามติด หนี้สินจะล้นพ้น เลขล้มละลายรุ่งเร็วร่วงเร็วร่วงมาแทบไม่เหลือแม้ชีวิต เลขกินผัวกินเมียใครดวงอ่อนคนนั้นไปก่อน (ความร้ายมีอีกเยอะเดี๋ยวจะบอกในหนังสือเรานะคะ) </p>\r\n\r\n    <p>เป็นโชคร้ายของน้องที่เจอเลขมหาอุบาทว์แถมยังมาเจอ เลขอย่าง 83,16,17,19,97,13,11,40,68 อีก ไม่มีเลขคุ้มครองโผล่มาซักตัวมีแต่เลขร้ายกับร้ายกระหน่ำซ้ำเติมไม่มีเลขคานมีแต่เลขกระทืบซ้ำ แล้วจะเหลืออะไร แม้ตามดวงจะบอกว่าแค่ดวงตกไม่ถึงฆาตแต่ถ้าเจอเลขแบบนี้เข้าไป ถึงรอดก็ไม่มีวิญญาณแล้วคะ(ตามข่าวเลย) จากประสบการณ์ทำงานของเราขอยืนยันว่าตัวเลขไม่เคยหลอกใครไม่ว่าจะดีหรือร้ายมันแสดงผลแน่นอนเมื่อวาระกรรมมาถึง </p>\r\n\r\n    <p>@@หากจะเลือกใช้เลขจงมองให้รอบอย่ามองแค่ส่วนดีเพียงน้อย ส่วนเสียที่มีมากมายอยู่จงพึ่งระวัง อย่ามองเรื่องเงินเป็นสำคัญ ควรให้ความสำคัญกับชีวิตลมหายใจและความสุขของตัวเองที่สุด และอย่าเชื่อพ่อค้าแม่ค้าว่าเลขนั่นดีเลขนี้ดีแต่ให้เชื่อตัวเองด้วยการหาความรู้และข้อมูลใส่ตัวด้วยจะดีที่สุด@@</p>\r\n    \r\n    <p>ขอบุญกุศลใดๆที่เกิดจากการเผยแพร่ข้อมูลความรู้นี้เพื่อที่เหล่าคนที่สนใจผู้ไม่มีความรู้ไม่เข้าใจ ให้เกิดความรู้ความกลัวเกิดการระวังในชีวิตและทรัพย์สินของตัวเองมากขึ้นจงส่งไปถึงคุณ บิ๊ก อภิเชษฐ์  กิตติกรเจริญ และด้วยอานิสงค์ผลบุญนี้จงหนุนนำให้ดวงจิตและดวงวิญญาณดวงนี้หากกำลังได้รับทุกข์ขอให้พ้นจากทุกข์หากกำลังได้รับสุขขอจงมีความสุขยิ่งๆขึ้นไปและขอดวงจิตและดวงวิญญาณดวงนี้จงได้ก้าวข้ามสู่ภพภูมิที่ดียิ่งๆขึ้นไปด้วยเทิด สาธุ สาธุ สาธุ</p>', NULL, NULL, 1, 1, NULL, NULL),
(3, '0000-00-00 00:00:00', 'คุณนิน', '3', 'ทำนายดวงชื่อสกุล คุณปัญญา นิรันดร์กุล', 'https://ananya.in.th/views/assets/images/panya.jpg', 'วันนี้ผมจะยกตัวอย่างชื่อของบุคคลผู้มีชื่อเสียงท่านหนึ่งที่มีชื่อดี นามสกุลดี ทำให้ชีวิตมีความสุขร่ำรวยรุ่งเรืองจนไม่มีใครปฏิเสธได้ว่าไม่รู้จัก ทั้งนี้ผมขอยืนยันว่าทั้งหมด คือ ความจริงที่ทำนายออกจากตัวเลขครับ', '    <p>\"คุณปัญญา นิรันดร์กุล\"</p>\r\n    <p> ชื่อจริง : ปัญญา(เลขเรียง 24442=ผลรวม 15 พลังเงาชื่อ 41 สุดยอดครับคนจะรวยพื้นดวงมาดีชื่อยังดีทุกอย่างไปอ่านความหมายเพิ่มเติมได้เลยครับ)</p>\r\n    <p> นามสกุล : นิรันดร์กุล(44) ผลรวมได้ 59 </p>\r\n    <p> ชื่อเล่น : ตา (4 เลขของความฉลาด) </p>\r\n    <p> จากการดูชื่อคร่าวๆโดยยังไม่ได้ไปเปิดพื้นดวงนะครับ ทำให้ทราบว่าชื่อของคุณปัญญาทั้งเลขเรียง เลขผลรวม เลขพลังเงา ล้วนดีทั้งนั้นทำให้ประสบความสำเร็จในหน้าที่การงานได้เป็นอย่างดี งานที่เหมาะ คือ งานที่ต้องใช้วาจา วาจามีเสน่ห์น่าเชื่อถือ ซึ่งเป็นอทธิพลของเลข 15 แถมยังมีเลข 24 42 ถึงสองคู่ในชื่อเรียงทายได้ว่าคนคนนี้พูดอะไรทำอะไรเป็นเงินเป็นทองไปหมด เงินทองไหลมาเทมา อ่อ นามสกุล 44 ช่วยเสริมเรื่องการงานการเงินได้ดีมากครับ สำเร็จทุกอย่าง เสียอย่างเดียวคือ ระวังอารมย์เพราะเป็นคนขี้ใจน้อย </p>\r\n\r\n<br>\r\n    <p>สุดท้ายขอเตือนนิดหนึ่งครับ </p>\r\n    <p>  @@สิ่งที่จะเตือน คือ หลังจากดูชื่อแล้วสังเกตุเห็นในชื่อ-สกุลมีพลังเงาของเลข 16 (เลขอาภัพรักมีปัญหาเรื่องความรักแต่รวย) และ 11 แฝงอยู่ ถามว่าอันตรายไหม ก็อันตรายครับโดยเฉพาะ 11 เพราะเป็นเลขล้มละลายเมื่อมันได้ออกมาแม้ว่าจะมีชื่อที่ดี แต่คุณตา ปัญญาก็ควรระวังไว้ด้วยครับ อย่าไว้ใจคนอย่าไว้ใจใครเขาจะหักหลังจะมีคดีความ มีเรื่องให้ต้องคิดมาก ต้องใช้สมองอย่างหนักเก็บกด อมทุกข์ ยังไงก็ตามดวงคุณปัญญาคงไม่ถึงขั้นล้มละลายดอกครับเพราะมีชื่อซึ่งมีพลังมากทั้งชื่อจริงชื่อเล่นค้ำไว้อยู่ เพียงแต่ให้ระวังช่วงบั้นปลายอาจจะล้มเหลวในธุรกิจ เสื่อมถอย หรือ ถูกลวงถูกหลวงหักหลังกัน ทรัพย์สินจะวินาศไป เงินไม่หมดครับแต่จะลดน้อยลงถ้าไม่ระวัง ให้ระวังนะครับ ไม่ต้องเป็นห่วง ถ้าทำบุญบ่อยๆก็ไม่ต้องห่วงอะไรเพราะเรามีชื่อที่เป็นพลังพอที่จะดึงดวงได้ไม่ให้เลวร้ายไปมากกว่านี้ได้ </p>\r\n\r\n    <p>ผมต้องขอโทษคุณปัญญาด้วยหลังจากที่ผมเอาชื่อของคุณปัญญามาวิเคราะห์โดยไม่ได้ขออนุญาติเป็นการส่วนตัว แต่ผมก็ขอบอกกล่าวขออนุญาติไว้นะที่นี้ด้วยทั้งนี้ทั้งนั่นจุดประสงค์เพื่อเป็นวิทยาทานแ่คนทั่วไปครับ กุศลใดๆที่บังเกิดนั่นขอผลบุญจงส่งให้คุณปัญญาโชคดีมีสุขตลอดไปครับ </p>', NULL, NULL, 1, NULL, NULL, NULL),
(4, '0000-00-00 00:00:00', 'คุณนิน', '2', 'วิธีการหาทะเบียนรถมงคลให้เหมาะกับตน', 'https://ananya.in.th/views/assets/images/car.jpg', 'สาเหตุที่โพสเพราะลูกค้าถามเรื่องทะเบียนรถมาเยอะว่าดูอย่างไร?.....หลายท่านอาจสงสัยว่า จะรู้ได้อย่างไร.......... ว่าทะเบียนรถดีหรือไม่ดี มีมงคลหรือไม่มีมงคล ต่างกันยังไง มีอะไรที่ต้องพิจารณาบ้าง ทำไมจึงมีทะเบียนรถดี', '    <p>1. เพราะทะเบียนรถที่ดีจริงๆเป็นทะเบียนรถที่มีความมงคลจริง 100% นั้นหายาก บางทะเบียนหาไม่ได้อีกแล้ว เมื่อเวลาเปลี่ยนยิ่งนานยิ่งหายากทั้งตัวหมวดและตัวเลข เช่น 4กธ4245,4กฮ4145,4กธ4542</p>\r\n\r\n    <p>2. เพราะทะเบียนรถมงคลที่ดีที่สุด ปลอดภัยที่สุด ดี 100% ช่วยเสริมดวงเรื่องเงิน งาน ความรักและคุ้มครองชีวิตได้ดีจริงๆ ไม่มีเสนียดนั้น ต้องประกอบด้วยองค์ที่ครบถ้วนดังนี้</p>\r\n\r\n    <p> ===2.1 สำคัญมากทะเบียนรถต้องถูกโฉลกกับเจ้าชะตา ทั้งตัวหมวดตัวอักษร และตัวเลข โดยต้องดูจากวันเดือนปีเกิด เวลาเกิด จังหวัดที่เกิดของเจ้าชะตาเท่านั้น และที่สำคัญห้ามลืม ต้องไม่ใช่เลขกรรม หรือเลขร้ายอันตรายตรงกับเลขอื่นๆ ที่ติดตามในชีวิตตนอยู่แล้ว เช่น ในเบอร์โทรศัพท์ ในชื่อเล่น ในชื่อจริงนามสกุล บ้านเลขที่ ซึ่งมีเลขร้าย เช่น 26 13 34 33 37 70 39 18 80 66 67 และ...ฯลฯ อยู่แล้ว ดังนั้น ทะเบียนรถ ที่จะใช้ ต้องไม่มีเลขร้าย 26 13 34 33 37 70 39 18 80 66 67 และ....ฯลฯ เพิ่มขึ้นมาอีกเด็ดขาด เพราะจะทำให้เจ้าชะตา ต้องเจอกับเรื่องร้ายๆที่มีความหมายตรงตามเลขร้ายบ่อยขึ้น เร็วขึ้น แรงขึ้น เป็นต้น</p>\r\n\r\n    <p>===2.2 สำคัญมากเลขเรียงต้องดี ไม่มีเลขคู่อันตราย สลับหน้าสลับหลังแล้วต้องดี เช่น ทะเบียน 4กธ4245 ทะเบียนนี้ เลขเรียงดีมากเพราะได้ 414-4245 สลับหน้า สลับหลังก็ยังดีมาก ไม่มีเลขเสนียดจัญไรตามติดเลย แต่ถ้าเป็นทะเบียนรถ 4กต4245 ผลจะตรงกันข้าม แม้จะเป็นเลขเลข 4245 เหมือนกันก็ตาม แต่เพราะตัวหมวด 4 กต ไม่มีมงคล แถมเมื่อแปลงออกมาเป็นเลขแล้วไม่ดีมาก เพราะเลขเรียงติดเลขร้ายแรง 413-4245 คือ 13 และ 34  ซึ่งอนาคตจะมีผลร้ายๆเกิดตรงเลข 13 ,34 ในไม่ช้าแน่นอน หรือ ถ้าเป็นทะเบียน 4กธ9339 (414-9338) นี้อันตรายมาก เพราะเลขเรียงไม่ดีมาก เพราะติดเลขร้ายแรง 49(13) 93(12) 33 38 หนักเลย ซึ่งเลขร้ายเหล่านี้จะมีผลกับเจ้าของมากขึ้น โดยเฉพาะถ้าเป็นเลขร้ายหรือมีความหมายที่ไปตรงกับเลขร้ายๆ ที่มีอยู่แล้วในเบอร์โทรศัพท์ ชื่อเล่น ชื่อจริงนามสกุล บ้านเลขที่ ถ้าเป็นเช่นนั้นความรุนแรงของเลขจะเพิ่มขึ้น แม้มีเลขดีอยู่บ้างพอสมควร ความดีก็จะลดทอนลง และชีวิตเขาก็จะต้องเจอทั้งเรื่องดีและร้ายตรงเลขแน่นอน</p>\r\n\r\n    <p>===2.3 สำคัญผลรวมเลขต้องดี ไม่ใช่เลขร้ายอันตราย และต้องไม่ใช่เลขกรรมที่ตามติด เช่น ทะเบียน 4กธ4245 ทะเบียนนี้ผลรวมดีมากๆ 4+2+4+5 เพราะได้ 15 แต่ถ้าเป็นทะเบียน 4กธ9338 อันตรายมากเพราะมีเลขเรียงร้าย แถมผลรวมเลขยังร้ายอีก 9+3+3+8 เพราะได้เลข 23 หรือ ทะเบียนรถ 4กธ999 นี่ก็อันตราย 9+9+9 เพราะได้ 27 เช่นกัน</p>\r\n\r\n    <p> ===2.4 สำคัญผลรวมหมวดต้องดี ไม่ใช่เลขร้ายอันตราย และต้องไม่ใช่เลขกรรมที่ตามอยู่ เช่น ทะเบียน 4กธ4245 ทะเบียนนี้ผลรวมหมวดดีมาก 4+1+4+4+2+4+5 เพราะได้ 24 แต่ถ้าเป็นทะเบียน 4กฉ999 นี้เสี่ยงอันตรายมากเพราะได้ผลรวมเลข 27 แถมเสี่ยงและอันตรายเพิ่มมากขึ้นเมื่อผลรวมหมวดได้เลขร้ายเพิ่ม เช่น ทะเบียน 4กฉ999 จะได้ผลรวมหมวด 4+1+5+9+9+9+=37</p>\r\n\r\n    <p>  === 2.5 ตัวเลขและตัวอักษรหมวดของทะเบียน เมื่อนำมาแตกเป็นตัวเลขแล้วต้องได้คู่ดี ไม่ใช่เลขร้าย ไม่ใช่เลขกรรมที่ตามติด เช่น 4กธ4245 จะได้ 414 นี้ดีมากๆ แต่ถ้าเป็น 4กต4245 นี้อันตราย เพราะได้ 413</p>\r\n\r\n    <p> ===2.6 เลขตัวแรกกับเลขตัวสุดท้ายของทะเบียนรถเมื่อจับคู่กัน และนำมาบวกกันแล้ว ต้องได้เลขดี เช่น ทะเบียน 4245 เลขตัวแรกคือ 4 เลขตัวสุดท้าย คือ 5 เมื่อจับคู่กันได้ 45 และเมื่อบวกกันยังได้ 9 ซึ่งเป็นเลขศุภเคราะห์อีกนี่ดีมาก ยิ่งถ้าทะเบียนใดได้เลข45 รวมกันได้ 9 ทะเบียนนี้จะยิ่งดีมากขึ้น คุ้มครองเยี่ยมขึ้น</p>\r\n\r\n    <p> ==2.7 สุดท้ายทะเบียนรถที่ดีที่สุดปลอดภัยที่สุด ต้องได้ทั้งครบทุกด้าน คือ เงินงาน ความรัก ความสุข และที่สำคัญต้องมีเลขคุ้มครองชะตา ช่วยยืดอายุ ต่อเวลา เสริมสุขภาพและช่วยให้แคล้วคลาดได้ด้วย(ไม่ซวยหนักดวงถึงฆาตหนักจริงๆจะรอดได้)โดยต้องมีคู่หนึ่งคู่ใดเป็นเลขคุ้มครองไว้\r\n    สรุปแล้วทะเบียนที่ดีที่สุด เป็นเลขดี 100% ไม่มีเสนียดติด ต้องมีคุณสมบัติต้องได้เลขดีครบทั้งหมดทุกข้อจากที่กล่าวมา</p>\r\n\r\n    <img class=\"ui fluid image\" \r\n        src=\"https://2.bp.blogspot.com/-i6WYKJPLdng/VuX49MANWFI/AAAAAAAAAvw/S7kTSkBTbiQ68qvex-AllRa1lCU9AKH2g/s400/10600392_759303594170249_629297283816860095_n.jpg\"\r\n        alt=\"\"> <br><br>  <img class=\"ui fluid image\"\r\n        src=\"https://2.bp.blogspot.com/-McaP1aBYMac/VuX4-8U7nRI/AAAAAAAAAv0/Kujkl1z3CNY-l3lH9T2iY71qXgPPwkkOw/s400/4515-large.png\"\r\n        alt=\"\">', NULL, NULL, NULL, 1, NULL, 1),
(5, '2556-10-01 10:54:00', 'คุณนิน', '1', 'ศาสตร์ตัวเลข กับคุณวิกรม กรมดิษฐ์', 'https://4.bp.blogspot.com/-N9kElrB63XU/Uk-VtfJ_kyI/AAAAAAAAAgo/Z1BVw6GjDZ8/s1600/download.jpg', 'นักธุรกิจเยี่ยมยุทธ นักขายมือหนึ่ง นักวางแผนชั้นยอด ผู้มีวิสัยทัศน์ มีความอดทนเป็นยอด กว่าจะก้าวมาจนถึงทุกวันนี้เขาผ่านการล้มเหลวมาแล้วกี่ครั้งผ่านมรสุมชีวิตมาไม่น้อย', '    <p> นักธุรกิจเยี่ยมยุทธ นักขายมือหนึ่ง นักวางแผนชั้นยอด ผู้มีวิสัยทัศน์ มีความอดทนเป็นยอด กว่าจะก้าวมาจนถึงทุกวันนี้เขาผ่านการล้มเหลวมาแล้วกี่ครั้งผ่านมรสุมชีวิตมาไม่น้อย กว่าจะเป็นเศรษฐีพันล้านหมื่นล้านเจ้าของนิคมอุตสาหกรรมอมตะนครที่ชลบุรี ระยอง และเวียดนามได้ เขาผ่านการเป็นหนี้เป็นสินถึงห้าหกพันล้านในยุคฟองสบู่แตก (สำหรับบางคนเป็นหนี้แค่ไม่กี่แสนกี่ล้านบาทอย่าพึ่งท้ออย่าพึ่งร้องห่มร้องไห้เลย)</p>\r\n\r\n    <p> แม้ในชีวิตเขาจะมีมุมมืดที่ยากจะยอมรับได้ แต่...เขาก็ถือเป็นคนที่มีความคิดดีเป็นคนดีคนหนึ่ง ด้วยพื้นดวงด้วยบุคลิกส่วนตัวและความคิดความอ่าน บวกความเป็นคนมองโลกในแง่บวกมีความทะเยอทะยานของเขา ทำให้เขาผงาดมาเป็น 1 ใน 40 คนที่รวยที่สุดในประเทศไทยได้ และตลอดหลายปีมานี้เขาก็ได้เข้ามาโลดแล่นในวงการหนังสือ วงการสื่อให้เราท่านได้เห็นได้รู้จักกันไม่น้อย ซึ่งนับว่าชายผู้นี้ได้รับการยอมรับและยกย่องนับถือในสังคมมากอีกคนหนึ่งทีเดียว\r\n    .....เอาละ ทีนี้เรามาดูกันว่าศาสตร์ตัวเลขและพลังเงาจะส่งผลกับชีวิตของเขาหรือไม่ เรามาดูกันว่าเวรกรรมจะส่งผลกับคนได้จริงหรือเปล่า โดยก่อนอื่นเราขอแจ้งให้ทุกท่านทราบตรงกันก่อนว่า คุณวิกรมเคยผ่านการเปลี่ยนชื่อมาแล้วหลายครั้ง โดยชื่อแรกชื่อ “ติ้นฟ้ง” ต่อมาก็เป็น “อาทิตย์” จนมาหยุดที่ชื่อ “วิกรม” ส่วนนามสกุลแต่ก่อน คือ “คูวัชระเจริญ” ใช้มาจนถึงน่าจะประมาณปี 2547-48 จึงเปลี่ยนมาใช้ “กรมดิษฐ์” (นี้คือการคาดเดาของเราเพราะเมื่อปี 2535 เขาผู้นี้ก็ยังใช้นามสกุล คูวัชระเจริญอยู่จนมาถึงปี 2546 ) แต่พอมาปี 2548-49 เราจึงได้ยิน ชื่อ วิกรม กรมดิษฐ์ เอาละเมื่อทราบแล้ว เรามาดูคำทำนายและตัวเลขของคนผู้นี้กันดีกว่าคะ</p>\r\n\r\n    <p> ชื่อสกุลเก่า วิกรม คูวัชระเจริญ</p>\r\n    <p> เลขศาสตร์ 20+46=66</p>\r\n    <p> พลังเงา     64+99=163</p>\r\n\r\n    <p> สังเกตจากตัวเลขที่ออกมาชื่อนี้ดีมากบอกได้เลยคนคนนี้เป็นคนคนมีบุญมากทีเดียวที่บังเอิญเปลี่ยนชื่อเองแล้วได้ตัวเลขที่ลงตัวแบบนี้ เอาเป็นว่าไม่ต้องเปิดพื้นดวงก็พอทำนายได้ว่ายังไงคนนี้ก็รวย ยังไงคนนี้ก็จะพบกับความสำเร็จแน่นอน เพราะอะไร ทุกท่านลองดูตัวเลขที่ออกมาซี ทั้งเลขศาสตร์ทั้งพลังเงาชื่อสกุลมันมีเลขดีเกือบเต็ม 100% เพราะได้เลขดีหลายคู่ คือ 46,64,99,63 ซึ่งนับว่าเป็นเลขพลังเต็มมากเพราะมันจะช่วยให้คนๆนั้นมีเสน่ห์มากเป็นคนมีโชค มีความโชคดีในทุกๆเรื่อง เหมาะที่จะค้าขายทำธุรกิจเป็นเจ้าของธุรกิจเพราะจะทำให้ขายได้ขายดีมีชั้นเชิงมีเสน่ห์ในการขาย ขายจนรวย ส่วนเรื่องเงินงานความรักไม่ต้องห่วงความรักไม่ขาด ห่วงแค่จะเจ้าชู้ รักอิสระเกินไป(ถ้าใครเคยฟังเคยอ่านประวัติของเขาจะรู้ได้ในส่วนของเรื่องความรัก) แต่...ดีที่ฉลาดคิดฉลาดทำพูดทำมองโลกในแง่ดี เป็นคนมีศีลธรรม เพราะมีพลังสิ่งศักดิ์สิทธิ์คุ้มครองและหนุนนำอยู่ด้วยเลข 99 เลขอีกตัว คือเลข 20 ที่ดีสำหรับชาย แต่ร้ายสำหรับหญิง เลขนี้ถ้าชายใช้จะสำเร็จได้ แต่ต้องมีคนอื่นช่วยหนุน ทำงานคนเดียวไม่ได้สำเร็จยาก ชื่อนี้ตัวเลขแบบนี้คนแบบนี้ยังไงก็รวยยังไงก็สำเร็จ ถึงจะล้มลุกคลุกคลานไปตามจังหวะชีวิตและกรรมปัจจุบันที่ทำแต่สุดท้ายก็สำเร็จได้แน่นอนถ้ามีดลขดีเยอะ</p>\r\n\r\n    <p> ซึ่งแม้จะมีเลขเสียบ้างตรงเลข 66(12) เพราะจะทำให้เขามีปัญหาความรัก รักซ้อน เจ้าชู้มากรักทีเดียว มีปัญหาสุขภาพ มีคนมาเบียดเบียนช่วยใช้เงิน มีคดีความ ธุรกิจการงานสะุดุดกะทันหัน แต่ข้อดีของเลขนี้ก็ดีตรงที่ช่วยเสริมความรวยเสริมการเงินได้ ส่วนอีกเลขที่เสียอีกที่ คือเลข 16 แฝงในส่วนของ 163 เลขนี้มักเจอในคนรวย และคนมีเงินมีฐานะ เลขนี้จะช่วยเสริมเรื่องการเงินได้ดี แต่คนคนนั้นมักมีปัญหาเครียดเก็บกด กดดัน มีปัญหาสุขภาพ มีปัญหาคดีความ มีคนเกลียดชังกลั่นแกล้ง มีมุมมืด มีวิญญาณก่อกวน มีปัญหาเจ็บป่วย มีความผิดพลาดจากการทำหรือการตัดสินใจที่ผิด(10 ชีวิต) มีปัญหาเรื่องความรักนั่นเอง</p>\r\n\r\n    <p>  ชื่อสกุลใหม่ วิกรม กรมดิษฐ์</p>\r\n    <p> เลขศาสตร์ 20+37=57</p>\r\n    <p> พลังเงา     64+100=164</p>\r\n\r\n    <p> สังเกตเห็นอะไรไหมคะ เมื่อเขาเปลี่ยนนามสกุล เขาเปลี่ยนอะไรเข้ามา เขาเปลี่ยนอะไรออกไป สังเกตุว่าเขาเปลี่ยนสิ่งศักดิ์สิทธิ์ออก แต่เปลี่ยนเอาวิญญาณเอากรรมเก่าเข้ามาเกาะกุมดวง เป็นไปได้หรือไม่ที่ 10 ชีวิตที่เขาเคยพูดในรายการโทรทัศน์รายการหนึ่งรึเปล่าที่มาดลใจให้เขาเปลี่ยนเอาสิ่งเลวร้ายเข้ามาแทน สิ่งเลวร้ายมาจากไหนก็มาจากเลข 37 มาจากเลข 57(12) เลข 16 ไงละ ตอนนี้สิ่งเลวร้ายมีพลังมากกว่าสิ่งศักดิ์สิทธิ์ที่คุ้มครองเขาอยู่ แต่ถามว่าความร่ำรวยลดลงไหม ไม่ลดนะคะเพราะ 64 ยังอยู่ 100 ก็มี แถมเพิ่ม 64 มาอีกหนึ่งคู่ ส่วน 37 ก็ใช่ว่าจะไม่รวย รวยคะแต่กรรมเยอะถ้าดวงอ่อนก็ตายด้วยโรคร้ายและอุบัติเหตุ มีเกณพ์บาดเจ็บหรือผ่าตัด ถ้าดวงแข็งก็ทุกข์ทรมานด้วยโรคร้ายโรคมะเร็ง มักมีปัญหาสุขภาพที่ท้อง ต่อมลูกหมาก ลำไส้ กระดูก หัว ข้อ ขา หลัง หัวใจ เสี่ยงล้มเหลวล้มละลายหมดตัวได้ อาจต้องเริ่มต้นใหม่อยู่เสมอถ้ายังมีชีวิตรอด สรุปคืแรวย.....แต่</p>\r\n\r\n    <p> จากตัวเลขชุดใหม่ที่เปลี่ยนเข้ามาทำให้เราทราบว่าผู้ชายคนนี้จะเจ้าชู้มากขึ้น เหนื่อยมากขึ้น มีภาระที่ต้องรับผิดชอบมากขึ้น มีปัญหาด้านสุขภาพเพ่งเล็งแน่นอน อย่างเบาคือ โรคผิวหนัง ความดัน อย่างหนัก อาจถึงขั้นต้องผ่าตัด อัมพาต หรือต้องทุกข์ทรมานจากโรคเรื้อรัง หรือ เกิดอุบัติเหตุ ทำอะไรมักมีปัญหาอุปสรรคติดขัดมากขึ้น ต้องระวังความพลิกผันที่สามารถเกิดขึ้นอย่างฉับพลันได้ ระวังจะล้มเหลวล้มละลายหนี้สินพอกพูน มีปัญหาคดีความ มีเรื่องมีราวฉาวโฉ่ และตกต่ำลงในบั้นปลายชีวิต เพราะความดื้อ ความเอาแต่ใจ ความมีทิฐิที่มีมากขึ้น จะทำให้เกิดความขมขื่น อยู่ในสภาพกลืนไม่เข้าคายไม่ออก ต้องแบกรับภาระเพราะคนอื่น อีกทั้งต่อไปจะถูกใส่ร้ายป้ายสี มีความขัดแย้งมีการสูญเสียเกิดขึ้น และเขาจะต้องตกไปในวงจรอุบาท ถูกเอาเปรียบ ถูกเบียดบังเอาเงินเอาความดีความชอบเอาตำแหน่ง ทำให้ขาดความมั่นคงในหน้าที่การงาน มีปัญหาในเรื่องความรัก เลขแบบนี้ห้ามไว้ใจเรื่องความรักและโลกีย์เด็ดขาดไม่งั้นจะนำพาซึ่งความเดือดร้อนได้อย่างไม่คาดคิด</p>\r\n\r\n    <p> อย่างที่บอกคนรวยก็มีทุกข์ของคนรวย คนจนก็มีทุกข์ของคนจน ต่างกรรมต่างวาระ ใครจะคิดละว่า เรื่องเล็กๆของคนจน คนรวยอาจมองเป็นเรื่องใหญ่ เช่นกันเรื่องเล็กของคนรวย คนจนอาจมองเป็นเรื่องใหญ่ (จริงๆไม่อยากใช้คำว่าจน แต่ขอใช้ให้เห็นความแตกต่างที่ชัดแจ้งละกัน) งง ไหม ถ้างง เอ้า เช่นจากประสบการณ์การทำงาน ส่วนใหญ่ คนรวยมักให้ความสำคัญกับความรักและสุขภาพ แต่คนจนมักให้ความสำคัญกับเรื่องของปากท้องมากกว่าสุขภาพหรือความรัก เป็นต้น (หมายเหตุ คนจนที่ว่าไม่ใช่จนกรอบนะคะที่สำคัญไม่ใช่ จน แล้วโง่ด้วย แต่เป็นคนจนแบบคนฉลาด ไม่ใช่พวกคลั่งบ้าฆ่าตัวตายเพราะความรัก )</p>\r\n\r\n    <p> @@ระวังให้ดี พอบอกว่าเลข 46,64,63,36, 100 คือเลขคนรวย หลายคนอาจคิดจะโกยเข้าตัวเต็มกำลัง อ่านให้จบก่อนนะ ก่อนตัดสินใจทำอะไร ใช้อะไร</p>\r\n   <p> ----เลข 46,64 ดีจริง รวยจริง รวยจากการค้าขายจากธุรกิจการงาน แต่จะเจ้าชู้รักอิสระ ฉลาดเห็นแก่ตัวมากขึ้นตามนิสัยพ่อค้า ถ้าจะใช้ให้เลือกใช้ 46 ดีกว่า 64 เพราะเสริมเงินได้เท่ากันแต่มีความเที่ยงธรรมมากกว่า เห็นแก่ตัวน้อยกว่า และมีเสน่ห์ต่อเพศตรงข้ามมากแต่ไม่ถึงขั้นเจ้าชู้เหมือน 64 แต่หากจะใช้ ไม่ว่า 46 หรือ 64 อย่ามีเกินสองคู่ เดี๋ยวจะคุมจิตด้านมืดไม่อยู่ เดี๋ยวจะโลภเกินไป หรือเพื่อป้องกันตัวเองให้หา 59,95,45,54,41,51 มาคุมจะช่วยให้มีสติมากขึ้น</p>\r\n\r\n    <p> ----เลข 36,63 เป็นเลขดีมากพลังแรงผลของตัวเลขมันจะชักนำคู่ครอง ชักนำเงินทองเข้าสู่ผู้ที่ได้ครอบครองได้อย่างยอดเยี่ยม การงานก็ก้าวหน้าเร็วมาก ทำอะไรก็มักจะสำเร็จและโดดเด่น เงินทองไม่ขาดมือแน่นอน เหมาะกับทุกอาชีพ ถ้าใครมีคู่แล้ว หากใช้คนรักก็จะรักเรามากขึ้น มีโอกาสได้แต่งงานสูงมาก แถมยังมีเสน่ห์มากขึ้น ใครเห็นใครก็รัก แต่คนที่ใช้เลขสองตัวนี้ได้ต้องเช็คดวงก่อนเสมอเพราะถ้าดวงเคยผ่าตัดหรือดวงมีเกณฑ์เจ็บหรือตายด้วยอุบัติเหตุห้ามใช้ และถ้าจะใช้ต้องระวังต้องมีสติให้มาก เพราะจะเอาแต่ใจและเจ้าอารมณ์มากขึ้นหากจะใช้เราแนะนำให้เลือกใช้เลข 63 หรือ ถ้าชอบความแรงของ 36 ควรใช้ควบคู่กับ 24,59,95,45,41,51,56 ด้วยเพื่อปรับอารมณ์ควบคุมสติ คุ้มครองชะตาได้ด้วย</p>\r\n\r\n    <p> คะจำกันได้ไหมที่เราเฝ้าบอก ว่าเลข 46, 64 มันคือเลขคนรวย เลขนำโชค เลขของพ่อค้าวาณิช ส่วนเลข 63, 36 มันก็คือเลขของคนรวยเลขนำเงินนำทองนำรักมันคือเลขของนักธุรกิจเช่นกัน และวันนี้เราจึงเอามาเป็นตัวอย่างมาให้คุณๆท่านๆได้ดูได้มาให้พิสูจน์ว่าสิ่งที่เราพูดมันจริงแค่ไหน</p>', NULL, NULL, 1, NULL, NULL, NULL),
(6, '2012-12-19 09:37:00', 'คุณนิน', NULL, 'เสียงสะท้อนบางส่วนจากลูกค้า', 'https://1.bp.blogspot.com/-XxmV-q6vAJU/UNH6WK21YlI/AAAAAAAAALg/O1ihiKS2Kkk/s640/247289_290971524336794_86394897_n.jpg', 'เสียงสะท้อนบางส่วนจากลูกค้าของเราหลังจากเปลี่ยนเบอร์โทรศัพท์', '<img class=\"ui fluid image\"  src=\"https://1.bp.blogspot.com/-XxmV-q6vAJU/UNH6WK21YlI/AAAAAAAAALg/O1ihiKS2Kkk/s640/247289_290971524336794_86394897_n.jpg\"\r\n     alt=\"\">\r\n\r\n<img class=\"ui fluid image\"  src=\"https://4.bp.blogspot.com/-A4Ans51elV8/UNH6TD0MIRI/AAAAAAAAAKw/lINsqrImumo/s640/19-12-2555%2B19-37-33.png\">\r\n<img class=\"ui fluid image\"  src=\"https://3.bp.blogspot.com/-Sfafn4PDTHU/UNH6Tt_lZ3I/AAAAAAAAAK8/xZXLiSpUW5k/s640/19-12-2555%2B19-56-39.png\">\r\n<img class=\"ui fluid image\"  src=\"https://3.bp.blogspot.com/-OcMH_l4Ud8Q/UNH6USTmYXI/AAAAAAAAALI/38q3gx9rLD4/s640/19-12-2555%2B20-02-11.png\">\r\n<img class=\"ui fluid image\"  src=\"https://2.bp.blogspot.com/-b6Tc1njur6M/UNH6t3DCpoI/AAAAAAAAALo/eWHPLh74oRs/s640/480683_291441257623154_282577734_n.jpg\">\r\n<img class=\"ui fluid image\"  src=\"https://2.bp.blogspot.com/-dE707kydcSY/UNH6VBVO_1I/AAAAAAAAALU/r07RvPsVP9U/s640/19-12-2555%2B19-53-44.png\">\r\n', 1, NULL, NULL, NULL, NULL, NULL),
(7, '2013-12-02 05:18:00', 'คุณนิน', NULL, 'ข้อความบางส่วนจากลูกค้าที่ใช้เบอร์มงคลของเรา', 'https://2.bp.blogspot.com/-n2kNiGVyRVo/URo_cPkD9yI/AAAAAAAAAUo/ScgOd5mVnr8/s640/12-2-2556+19-30-32.png', 'ขออนุญาตนำข้อความบางส่วนมาเผยแพร่นะครับ และสาเหตุที่ทำไมต้องปิดชื่อและหน้าลูกค้าไว้', 'ขออนุญาตนำข้อความบางส่วนมาเผยแพร่นะครับ และสาเหตุที่ทำไมต้องปิดชื่อและหน้าลูกค้าไว้ นั่นเพราะลูกค้าส่วนใหญ่ที่ใช้เบอร์มงคลของเรา เขามีสังคม มีวิถีชีวิตของแต่ละบุคคลต่างกันไป บางคนต้องการรักษาความเป็นส่วนตัว และเพื่อป้องกันข้อครหาต่างๆจากสังคมคนรอบข้างครับ ส่วนคุณซึ่งกำลังอ่านข้อมูลบทความอยู่  ณตอนนี้ด้วยความหวังดีและจริงใจครับ ขอให้ทุกคนทุกท่านโปรดใช้วิจารณญาณให้ดีนะครับ อย่าเชื่อจนโง่งมงาย จงเชื่ออย่างมีเหตุมีผล อย่าเชื่อตามเขาว่ามา \r\n\r\n\r\n<img class=\"ui fluid image\"  src=\"https://2.bp.blogspot.com/-n2kNiGVyRVo/URo_cPkD9yI/AAAAAAAAAUo/ScgOd5mVnr8/s640/12-2-2556+19-30-32.png\">\r\n<img class=\"ui fluid image\"  src=\"https://2.bp.blogspot.com/-z5aXOyUUjLY/URo_hhgED1I/AAAAAAAAAUw/1Y1UrYhZW1A/s640/12-2-2556+19-24-33.png\">\r\n<img class=\"ui fluid image\"  src=\"https://1.bp.blogspot.com/-uVuw4KSmdjQ/URo_lnr7fQI/AAAAAAAAAU4/IRMUKGaH9SA/s640/12-2-2556+19-36-59.png\">\r\n<img class=\"ui fluid image\"  src=\"https://3.bp.blogspot.com/-rj5qpSZ-OMU/URo_yMm_L2I/AAAAAAAAAVI/4O4daJz3eyA/s640/12-2-2556+19-40-02.png\">\r\n<img class=\"ui fluid image\"  src=\"https://4.bp.blogspot.com/-HwzuAR1l21M/URo_r_x70II/AAAAAAAAAVA/uvJ19lyfQBw/s640/12-2-2556+19-46-31.png\">', 1, 0, 0, 0, 0, NULL),
(8, '2013-05-03 12:06:00', 'คุณนิน', NULL, 'REVIEW FEEDBACK จากลูกค้าเบอร์มงคลทะเบียนรถมงคลของเรา', 'https://2.bp.blogspot.com/-ATJvaz-ZU3Q/UTZUD_bGCdI/AAAAAAAAAWQ/WV7Wvz8BmRM/s400/2-3-2556+17-01-27.png', 'นี้คือ ผลสะท้อนกลับจากลูกค้าบางส่วนของเรา ที่เรานำมาเสนอไม่ได้ต้องการโอ้อวดว่าเราดี เราเก่งอะไร แต่อยากให้ลูกค้า และหรือผู้บริโภคที่เชื่อในศาสตร์ของเรา และหรือกำลังอ่านข้อความอยู่ หรือ กำลังหาข้อมูลอยู่ได้รับทราบถึงข้อมูลและผลงานของเรา', '\r\n<img class=\"ui fluid image\"  src=\"https://3.bp.blogspot.com/-OXjqmmGoe1I/UTZJRUGlD3I/AAAAAAAAAVg/IcXHPeWniUo/s400/5-3-2556+23-31-09.png\">\r\n<img class=\"ui fluid image\"  src=\"https://4.bp.blogspot.com/-A3yLwsLDBI8/UTZJxL817JI/AAAAAAAAAV4/Jmv-BH9BL_I/s400/6-3-2556+2-22-13.png\">\r\n<img class=\"ui fluid image\"  src=\"https://2.bp.blogspot.com/-4hj2Vw_Lg7k/UTZJy4DIhsI/AAAAAAAAAWA/3meGSZSvSUs/s400/6-3-2556+2-33-39.png\">\r\n<img class=\"ui fluid image\"  src=\"https://1.bp.blogspot.com/-2oW2QhgH0q0/UTZJsGAFxyI/AAAAAAAAAV0/hLrOcAk82Yc/s400/6-3-2556+2-17-27.png\">\r\n\r\n<p>นี้คือ ผลสะท้อนกลับจากลูกค้าบางส่วนของเรา ที่เรานำมาเสนอไม่ได้ต้องการโอ้อวดว่าเราดี เราเก่งอะไร แต่อยากให้ลูกค้า และหรือผู้บริโภคที่เชื่อในศาสตร์ของเรา และหรือกำลังอ่านข้อความอยู่ หรือ กำลังหาข้อมูลอยู่ได้รับทราบถึงข้อมูลและผลงานของเรา</p>\r\n\r\n<p>และ ณ ที่นี้เราขอประกาศว่า หากใครก็ตามที่ยังไม่เข้าไปดูข้อมูล ยังไม่เข้าไปรู้จักตัวตนของเราใน เฟสบุ๊คหรือยังไม่ศึกษารายละเอียดดีพอ แล้วจะมาขอเปิดดวงกับเรา จะมาซื้อเบอร์กับเรา จากนี้ไปเราจะไม่ขาย จะไม่เปิดดวงให้ เพื่อป้องกันข้อครหาต่างๆ เหตุผลเพราะมีบางท่านมาอ่าน REVIEW ของลูกค้าท่านอื่นแล้ว อยากได้ผลเหมือนคนอื่นเขา แต่ตัวเองกลับไม่ได้เชื่อ ไม่ศรัทธา ไม่มีความมั่นใจ มีแต่ความกลัว ความระแวง จนบางครั้งก็ทำลายความรู้สึกและมิตรภาพดีๆไปได้ ขอท่านจงระลึกไว้ว่า เราคือ มิตร เราเคยเป็นคนที่เคยเจ็บเคยทุกข์มาเช่นกันกับคุณ เราทำเว็บขึ้นมาเพื่อช่วย เพื่อต้องการเผยแพร่ศาสตร์นี้ให้คนที่กำลังตกทุกข์ได้ยาก จะได้ช่วยเหลือตัวเองได้ มันคือศาสตร์ในตำราที่ผ่านการพิสูจน์มาแล้วด้วยประสบการณ์ชีวิตของเราและคนรอบข้างแม้แต่ลูกค้าของเรา เรารู้ว่าเงินของคุณมีค่าเช่นเดียวกับเงินของเรา ดังนั้น หากท่านยังไม่เชื่อ ไม่ศรัทธา ไม่มั่นในตัวเรา ไม่มั่นใจในศาสตร์ของเรา จงอย่าเสียเวลามาคุย มาซื้อ มาเปิดดวงกับเรา เพราะคุณก็กำลังทำให้เราสูญเสียไปกับคุณเช่นกัน มันไร้ประโยชน์</p>', 1, NULL, NULL, NULL, NULL, NULL),
(10, '2013-07-29 08:36:00', 'คุณนิน', NULL, 'เปลี่ยนเบอร์โทร เปลี่ยนชื่อ เปลี่ยนทะเบียนรถแล้ว ดีจริงหรือ มีคำตอบครับ', 'https://www.ananya.in.th/views/assets/images/namedee.jpg', 'มีหลายท่านถามว่า ถ้าใช้เบอร์โทรศัพท์ดีแล้วชีวิตจะดีขึ้นไหม ถ้าใช้เบอร์ดีแล้ว มันจะช่วยได้จริงรึเปล่า ถ้าเปลี่ยนทะเบียนรถแล้วจะดีขึ้นจริงเหรอ ถ้าเปลี่ยนชื่อแล้วชีวิตจะดีขึ้นจริงรึเปล่า ?......', '<p>@@ผมขอตอบว่า ดีขึ้นแน่นอนครับถ้าได้เบอร์ดี ทะเบียนดี และชื่อที่ดีจริงๆ อย่างน้อยถ้าเปลี่ยนอย่างใดอย่างหนึ่งดีขึ้นแนะแต่อาจรอนานหน่อยจึงจะเห็น หรือ ถ้าเปลี่ยนพร้อมกันหมด รับรองเห็นเร็วและดีแน่นอนครับ โดยผมเน้นความสำคัญและน้ำหนักความสำคัญไปที่ เบอร์โทรก่อน ตามด้วย - ชื่อเล่น-ชื่อจริงสกุล(ใช้ตัวไหนบ่อยเน้นตัวนั้น) และสุดท้าย ทะเบียนรถ ตามด้วยเลขที่บ้าน เพราะอะไร เรามาดูเหตุผลกัน (เดี๋ยว ผมจะแบ่งปันประสบการณ์จริงๆเลยนะครับในช่วงท้าย)</p>\r\n\r\n<p>เหตุผล ทำไม่ผมถึงให้ความสำคัญกับเบอร์โทรศัพท์มงคลในการส่งผลที่แรงและเร็วกว่าอย่างอื่น นั่น เพราะ อะไรที่เรา ถ้ายิ่งใช้บ่อยๆจะยิ่งดียิ่งเร็วยิ่งแรง เหมือนกับชีวิตเราครับ ิวิ่งบ่อยๆก็ผอม กินบ่อยๆก็อ้วน ทำดีบ่อยๆก็ได้ดี ทำชั่วบ่อยๆก็โดนสนองเข้าซักวัน เช่นกันครับ โบราญท่านยังว่า พูดดีเป็นศรีแก่ปาก พูดมากปากจะเป็นสี ใครที่พูดดี พูดและคิดแต่เรื่องดีๆ บ่อยๆ ชีวิตก็จะเจอแต่เรื่องดีๆ บ่อยๆ แต่ถ้าใครพูดไม่ดีบ่อยๆ พูดแต่เรื่องไม่ดีไม่งามไม่เป็นมงคลบ่อยๆ เดี๋ยวก็เจอครับ สิ่งเหล่านี้ก็เหมือนกัน</p>\r\n\r\n<p>ที่นี้มาเจาะกันว่าทำไม ผมถึงเลือกเบอร์โทร แล้วคุณละครับ ระหว่างเบอร์โทร ชื่อ ทะเบียนรถ ถามว่าอะไรแรงกว่า สำคัญกว่า พวกคุณว่าอะไร ?.... ลองคิดตามนะครับ ถ้าเป็นสมัยก่อนผมให้ความสำคัญกับ--ชื่อเล่น ตามด้วย--ชื่อ-สกุลมาเป็นอันดับหนึ่ง แต่สมัยนี้ผมให้เบอร์โทร เพราะอะไร ?...</p>\r\n<p>@@อันดับหนึ่ง คือ เบอร์โทรศัพท์มงคล เพราะทุกวันนี้เราต้องใช้โทรศัพท์ ใช้วันละตั้งหลายรอบ ทั้งโทรเข้าโทรออก ลองนับดูซิครับกี่ครั้ง</p>\r\n<p>@@อันดับสอง คือ ชื่อเล่น ชื่อจริงนามสกุล ถ้าชื่อดี แล้วมีเบอร์ดี จะเสริมกันอย่างมาก เพราะอะไรเพราะลองนับดูครับในหนึ่งวันมีคนเรียกชื่อเรากี่ครั้งแล้วถ้ามีคนโทรมา หรือเราโทรไปมันมีการเรียกชื่อกันรึเปล่า หรือนึกถึงชื่อเรารึเปล่า ต่อมา คือทะเบียนรถ</p>\r\n<p>@@อันดับสาม ทะเบียนรถมงคลครับ ผมให้ความสำคัญรองลงมาเพราะมันเห็นผลช้ากว่าช้าเพราะอะไร เพราะวันหนึ่งเราใช้รถแค่ขับไปและขับกลับครับ (ยกเว้นนักธุรกิจที่ต้องขับรถบ่อยอันนั้นต้องเปลี่ยนฮะ) แต่แม้เขาจะแสดงผลช้ากว่าแต่เมื่อถึงเวลาเขาก็แสดงนะครับเพราะฉะนั้นต้องเปลี่ยนออก</p>\r\n<p>@@สุดท้าย คือ เลขที่บ้านครับ อันนี้ส่งผลแรงเหมือนกันครับเพราะอยู่กับเรามานาน และเราต้องนอนบ้านทุกวัน ถ้าใช้บ่อยก็เร็วถ้าไม่บ่อยก็ส่งผลอ่อนๆครับ ตามจังหวะชีวิตและพื้นดวงครับ ผมให้ความสำคัญสุดท้ายเพราะเปลี่ยนยากแก้ยากครับแม้จะแก้โดยการทำป้ายใหม่แต่นั่น คือ แค่ช่วยลดแรงให้เบาลงครับ เพราะเลขที่เดิมยังอยู่ ถ้าจะให้ดีจริงๆต้องเปลี่ยนเลย และเอาเลขอย่างอื่นมาช่วยดึงดวง (เบอร์โทร ชื่อ ทะเบียนรถ) ครับ</p>\r\n\r\n<p>ผมขอแชร์เรื่องเบอร์โทรจากประสบการณ์จริงของตัวเองให้เพื่อนได้อ่านและได้พิจารณาดูละกันครับ สมัยก่อนผมกับแฟนทำงานที่บริษัทเอกชนแห่งหนึ่ง บริษัทนี้มีการแข่งขันสูงมาก และยังมีการเล่นพรรคเล่นพรรคกันด้วย ดังนั้นในการทำงานจึงต้องมีการวางแผน และรอบคอบไม่ให้มีช่องโหว่ให้เขาเล่นงานได้ เป็นการทำงานที่เครียดครับ อ่อ ต้องบอกก่อนว่าผมศึึกษาโหราศาสตร์และศาสตร์ของตัวเลขมาประมาณเกือบ 10 ปีได้และตอนนั้นผมพึ่งเริ่มศึกษาศาสตร์เหล่านี้ได้ไม่กี่ปีครับ ซึ่ง เมื่อพอมีความรู้บ้าง ผมเองจะดูดวงละเอียดให้ตัวเองทุกปีถ้าดีก็เสริมไม่ดีก็จะหาทางป้องกันเอาไว้เกิดไม่เกิดช่างมัน แต่ขอให้ได้ทำจะได้ไม่เสียใจภายหลัง ถ้าถามว่าเชื่อไหม เชื่อครับ แต่เชื่ออย่างมีเหตุและผล ผมเชื่อว่าชีวิตเราถูกกำหนดถูกลิขิตมาแล้วด้วยแรงบุญและแรงกรรมจากอดีตชาติ\r\nแต่ผมเชื่อว่า เราสามารถเปลี่ยนแปลงชะตาชีวิตที่ถูกกำหนดไว้แล้วได้ ป้องกันและแก้ไขได้ เปลี่ยนหนักให้เป็นเบาได้ เราหนีได้ ด้วยพลังแรงบุญปัจจุบันแรงบุญจากอดีตมาเสริมเติมกันทำให้แรงบุญมีมากกว่าแรงกรรมครับ </p><p>ถามว่า@@แล้วเราจะรู้ จะหนี จะเปลี่ยนได้อย่างไร</p>\r\n<p>ตอบ@@ ก็รู้ด้วยโหราศาสตร์และศาสตร์จากตัวเลขยังไงละครับ ศาสตร์เหล่านี้บอกเราได้ บอกล่วงหน้าได้เป็นปีๆ ถึงหลายปี บอกทางแก้ให้เราด้วย โดยเฉพาะศาสตร์ของตัวเลข ผมนับถือมากเพราะเป็นศาสตร์ที่ได้ผลจริง เป็นศาสตร์ที่ช่วยให้เราหนีดวงได้ ยืดเวลาให้เราได้ ให้เราได้มีสร้างบุญให้มากกว่ากรรมและเป็นยังเป็นศาสตร์ที่ช่วยเบิกบุญมาเติมให้บุญใหม่เพื่อจะได้มีมากขึ้นเพื่อเอามาใช้กันและแก้ด้วยรหัสตัวเลขรหัสกรรมของเรา เอาละครับบ่นมามากแล้ว ต่อต่อ ต่อครับ</p>\r\n\r\n<p>ผลจากการเปิดดวง ดูดวงให้ตัวเอง พร้อมกับเปิดดวงให้เพื่อนอีกสองคน มีความแตกต่างกันกันไปตามพื้นดวง แต่มีสิ่งหนึ่งที่เหมือนกัน คือ ปีนั้นๆพวกผมดวงตกแต่ไม่หนักมาก คือ ดวงปานกลาง เด่นๆที่เหมือนกัน คือ มีปัญหาในการทำงานต้องตกงาน ส่วนดวงด้านอื่นๆของผม ที่เด่น คือ การงานจะรุ่ง เงินจะเยอะจะโดนศัตรูเล่นงาน มีปากมีเสียง จะมีอุบัติเหตุ เอาแล้ว ผมเชื่อครับ แต่ตอนนั้นงานยุ่งจริงๆปลีกตัวไม่ได้ แต่สิ่งแรกที่ทำผมไปถวายผ้าไตรจีวรก่อนเลย ต่อมาผมจึงหาทางป้องกันอย่างเร่งด่วนและรวดเร็วที่สุดตามศาสตร์ที่ผมเชื่อเพื่อจะได้มีเวลาให้เขาได้แสดงผล โดยผมกับแฟนเลือกเปลี่ยนเบอร์ก่อนสิ่งอื่นใด ตอนนั้นหาได้เบอร์ดีปานกลาง ดีสองคู่ท้ายดี ผลรวมดี เน้นที่ช่วยเสริมเรื่องการงาน การเงิน มีคนเอ็นดูช่วยเหลือ ซึ่งตอนนั้นยังไม่เปลี่ยนชื่อ(เปลี่ยนไม่ทันไม่มีเวลาเพราะต้องเดินทางกลับบ้านต่างจังหวัด)ทะเบียนรถก็ยังไม่เปลี่ยนเพราะต้องไปเปลี่ยนที่ขนส่งจังหวัดที่ตัวเองซื้อแถมยุ่งยากเพราะยังผ่อนไม่หมด ผมเลยเอาที่ง่ายๆก่อน</p>\r\n\r\n<p>พอถึงจังหวะของมันก็เจอจริงๆครับเงินไหลเข้าเยอะมาก ได้ตำแหน่งงานที่สูงขึ้นแต่มีปัญหาหนักโดนใส่ร้ายเขาจะไล่ออก แต่สุดท้ายผมก็รอดเพราะเขาพิจารณาที่ผลงานด้วย และมีคนช่วยไว้ ผมรอด แต่เชื่อไหมครับเพื่อนอีกสองคนไม่รอด ตกงานโดนไล่ออก ครับนั่นคือเรื่องจริง ผมยังงง ไม่หาย คือเจอปัญหาจริงตามดวงแต่ไม่เป็นไร (ไม่ตกงานแต่เครียดมาก 555+) ดูซิครับ ต่างกันไหม อ่อ ลืมไป\r\nถามว่าแล้วมีอุบัติเหตุเกิดขึ้นจริงตามดวงไหม จริงครับ ปีนั้นโดนสามครั้งแต่ไม่เป็นไร รถเสียหายคนปลอดภัย แต่ในความเป็นจริงแล้ว ปีเดียวไม่น่าจะโดนบ่อยขนาดนั้นจริงไหมครับ แต่ผมไม่แปลกใจครับ เพราะส่วนหนึ่งมันมาจากทะเบียนรถด้วย เดี๋ยวมาเล่าให้ฟังครับ เอาละวันนี้พอแค่นี้ก่อนครับ เดี๋ยววันหลังจะแชร์เคสทะเบียนรถของผมให้ฟังกันครับคิดดูว่า แฟนผมจากแต่ก่อนเขาไม่เชื่อศาสตร์นี้เลยเขาหาว่าไร้สาระเลอะเทอะ แต่ตอนนี้เขาหันมาศึกษาและสนใจศาสตร์เหล่านี้เพราะเขาเจอด้วยตัวเองมาเต็ม เอาเป็นว่าแม้ทะเบียนรถเขาจะส่งผลช้าแต่ถ้าเขาได้แสดงผล แสบจริงๆครับ</p>', NULL, 1, NULL, NULL, NULL, NULL),
(11, '2013-07-29 08:36:00', 'คุณนิน', NULL, 'เปลี่ยนเบอร์โทร เปลี่ยนชื่อ เปลี่ยนทะเบียนรถแล้ว ดีจริงหรือ มีคำตอบครับ', 'https://www.ananya.in.th/views/assets/images/namedee.jpg', 'มีหลายท่านถามว่า ถ้าใช้เบอร์โทรศัพท์ดีแล้วชีวิตจะดีขึ้นไหม ถ้าใช้เบอร์ดีแล้ว มันจะช่วยได้จริงรึเปล่า ถ้าเปลี่ยนทะเบียนรถแล้วจะดีขึ้นจริงเหรอ ถ้าเปลี่ยนชื่อแล้วชีวิตจะดีขึ้นจริงรึเปล่า ?......', '<p>@@ผมขอตอบว่า ดีขึ้นแน่นอนครับถ้าได้เบอร์ดี ทะเบียนดี และชื่อที่ดีจริงๆ อย่างน้อยถ้าเปลี่ยนอย่างใดอย่างหนึ่งดีขึ้นแนะแต่อาจรอนานหน่อยจึงจะเห็น หรือ ถ้าเปลี่ยนพร้อมกันหมด รับรองเห็นเร็วและดีแน่นอนครับ โดยผมเน้นความสำคัญและน้ำหนักความสำคัญไปที่ เบอร์โทรก่อน ตามด้วย - ชื่อเล่น-ชื่อจริงสกุล(ใช้ตัวไหนบ่อยเน้นตัวนั้น) และสุดท้าย ทะเบียนรถ ตามด้วยเลขที่บ้าน เพราะอะไร เรามาดูเหตุผลกัน (เดี๋ยว ผมจะแบ่งปันประสบการณ์จริงๆเลยนะครับในช่วงท้าย)</p>\r\n\r\n<p>เหตุผล ทำไม่ผมถึงให้ความสำคัญกับเบอร์โทรศัพท์มงคลในการส่งผลที่แรงและเร็วกว่าอย่างอื่น นั่น เพราะ อะไรที่เรา ถ้ายิ่งใช้บ่อยๆจะยิ่งดียิ่งเร็วยิ่งแรง เหมือนกับชีวิตเราครับ ิวิ่งบ่อยๆก็ผอม กินบ่อยๆก็อ้วน ทำดีบ่อยๆก็ได้ดี ทำชั่วบ่อยๆก็โดนสนองเข้าซักวัน เช่นกันครับ โบราญท่านยังว่า พูดดีเป็นศรีแก่ปาก พูดมากปากจะเป็นสี ใครที่พูดดี พูดและคิดแต่เรื่องดีๆ บ่อยๆ ชีวิตก็จะเจอแต่เรื่องดีๆ บ่อยๆ แต่ถ้าใครพูดไม่ดีบ่อยๆ พูดแต่เรื่องไม่ดีไม่งามไม่เป็นมงคลบ่อยๆ เดี๋ยวก็เจอครับ สิ่งเหล่านี้ก็เหมือนกัน</p>\r\n\r\n<p>ที่นี้มาเจาะกันว่าทำไม ผมถึงเลือกเบอร์โทร แล้วคุณละครับ ระหว่างเบอร์โทร ชื่อ ทะเบียนรถ ถามว่าอะไรแรงกว่า สำคัญกว่า พวกคุณว่าอะไร ?.... ลองคิดตามนะครับ ถ้าเป็นสมัยก่อนผมให้ความสำคัญกับ--ชื่อเล่น ตามด้วย--ชื่อ-สกุลมาเป็นอันดับหนึ่ง แต่สมัยนี้ผมให้เบอร์โทร เพราะอะไร ?...</p>\r\n<p>@@อันดับหนึ่ง คือ เบอร์โทรศัพท์มงคล เพราะทุกวันนี้เราต้องใช้โทรศัพท์ ใช้วันละตั้งหลายรอบ ทั้งโทรเข้าโทรออก ลองนับดูซิครับกี่ครั้ง</p>\r\n<p>@@อันดับสอง คือ ชื่อเล่น ชื่อจริงนามสกุล ถ้าชื่อดี แล้วมีเบอร์ดี จะเสริมกันอย่างมาก เพราะอะไรเพราะลองนับดูครับในหนึ่งวันมีคนเรียกชื่อเรากี่ครั้งแล้วถ้ามีคนโทรมา หรือเราโทรไปมันมีการเรียกชื่อกันรึเปล่า หรือนึกถึงชื่อเรารึเปล่า ต่อมา คือทะเบียนรถ</p>\r\n<p>@@อันดับสาม ทะเบียนรถมงคลครับ ผมให้ความสำคัญรองลงมาเพราะมันเห็นผลช้ากว่าช้าเพราะอะไร เพราะวันหนึ่งเราใช้รถแค่ขับไปและขับกลับครับ (ยกเว้นนักธุรกิจที่ต้องขับรถบ่อยอันนั้นต้องเปลี่ยนฮะ) แต่แม้เขาจะแสดงผลช้ากว่าแต่เมื่อถึงเวลาเขาก็แสดงนะครับเพราะฉะนั้นต้องเปลี่ยนออก</p>\r\n<p>@@สุดท้าย คือ เลขที่บ้านครับ อันนี้ส่งผลแรงเหมือนกันครับเพราะอยู่กับเรามานาน และเราต้องนอนบ้านทุกวัน ถ้าใช้บ่อยก็เร็วถ้าไม่บ่อยก็ส่งผลอ่อนๆครับ ตามจังหวะชีวิตและพื้นดวงครับ ผมให้ความสำคัญสุดท้ายเพราะเปลี่ยนยากแก้ยากครับแม้จะแก้โดยการทำป้ายใหม่แต่นั่น คือ แค่ช่วยลดแรงให้เบาลงครับ เพราะเลขที่เดิมยังอยู่ ถ้าจะให้ดีจริงๆต้องเปลี่ยนเลย และเอาเลขอย่างอื่นมาช่วยดึงดวง (เบอร์โทร ชื่อ ทะเบียนรถ) ครับ</p>\r\n\r\n<p>ผมขอแชร์เรื่องเบอร์โทรจากประสบการณ์จริงของตัวเองให้เพื่อนได้อ่านและได้พิจารณาดูละกันครับ สมัยก่อนผมกับแฟนทำงานที่บริษัทเอกชนแห่งหนึ่ง บริษัทนี้มีการแข่งขันสูงมาก และยังมีการเล่นพรรคเล่นพรรคกันด้วย ดังนั้นในการทำงานจึงต้องมีการวางแผน และรอบคอบไม่ให้มีช่องโหว่ให้เขาเล่นงานได้ เป็นการทำงานที่เครียดครับ อ่อ ต้องบอกก่อนว่าผมศึึกษาโหราศาสตร์และศาสตร์ของตัวเลขมาประมาณเกือบ 10 ปีได้และตอนนั้นผมพึ่งเริ่มศึกษาศาสตร์เหล่านี้ได้ไม่กี่ปีครับ ซึ่ง เมื่อพอมีความรู้บ้าง ผมเองจะดูดวงละเอียดให้ตัวเองทุกปีถ้าดีก็เสริมไม่ดีก็จะหาทางป้องกันเอาไว้เกิดไม่เกิดช่างมัน แต่ขอให้ได้ทำจะได้ไม่เสียใจภายหลัง ถ้าถามว่าเชื่อไหม เชื่อครับ แต่เชื่ออย่างมีเหตุและผล ผมเชื่อว่าชีวิตเราถูกกำหนดถูกลิขิตมาแล้วด้วยแรงบุญและแรงกรรมจากอดีตชาติ\r\nแต่ผมเชื่อว่า เราสามารถเปลี่ยนแปลงชะตาชีวิตที่ถูกกำหนดไว้แล้วได้ ป้องกันและแก้ไขได้ เปลี่ยนหนักให้เป็นเบาได้ เราหนีได้ ด้วยพลังแรงบุญปัจจุบันแรงบุญจากอดีตมาเสริมเติมกันทำให้แรงบุญมีมากกว่าแรงกรรมครับ </p><p>ถามว่า@@แล้วเราจะรู้ จะหนี จะเปลี่ยนได้อย่างไร</p>\r\n<p>ตอบ@@ ก็รู้ด้วยโหราศาสตร์และศาสตร์จากตัวเลขยังไงละครับ ศาสตร์เหล่านี้บอกเราได้ บอกล่วงหน้าได้เป็นปีๆ ถึงหลายปี บอกทางแก้ให้เราด้วย โดยเฉพาะศาสตร์ของตัวเลข ผมนับถือมากเพราะเป็นศาสตร์ที่ได้ผลจริง เป็นศาสตร์ที่ช่วยให้เราหนีดวงได้ ยืดเวลาให้เราได้ ให้เราได้มีสร้างบุญให้มากกว่ากรรมและเป็นยังเป็นศาสตร์ที่ช่วยเบิกบุญมาเติมให้บุญใหม่เพื่อจะได้มีมากขึ้นเพื่อเอามาใช้กันและแก้ด้วยรหัสตัวเลขรหัสกรรมของเรา เอาละครับบ่นมามากแล้ว ต่อต่อ ต่อครับ</p>\r\n\r\n<p>ผลจากการเปิดดวง ดูดวงให้ตัวเอง พร้อมกับเปิดดวงให้เพื่อนอีกสองคน มีความแตกต่างกันกันไปตามพื้นดวง แต่มีสิ่งหนึ่งที่เหมือนกัน คือ ปีนั้นๆพวกผมดวงตกแต่ไม่หนักมาก คือ ดวงปานกลาง เด่นๆที่เหมือนกัน คือ มีปัญหาในการทำงานต้องตกงาน ส่วนดวงด้านอื่นๆของผม ที่เด่น คือ การงานจะรุ่ง เงินจะเยอะจะโดนศัตรูเล่นงาน มีปากมีเสียง จะมีอุบัติเหตุ เอาแล้ว ผมเชื่อครับ แต่ตอนนั้นงานยุ่งจริงๆปลีกตัวไม่ได้ แต่สิ่งแรกที่ทำผมไปถวายผ้าไตรจีวรก่อนเลย ต่อมาผมจึงหาทางป้องกันอย่างเร่งด่วนและรวดเร็วที่สุดตามศาสตร์ที่ผมเชื่อเพื่อจะได้มีเวลาให้เขาได้แสดงผล โดยผมกับแฟนเลือกเปลี่ยนเบอร์ก่อนสิ่งอื่นใด ตอนนั้นหาได้เบอร์ดีปานกลาง ดีสองคู่ท้ายดี ผลรวมดี เน้นที่ช่วยเสริมเรื่องการงาน การเงิน มีคนเอ็นดูช่วยเหลือ ซึ่งตอนนั้นยังไม่เปลี่ยนชื่อ(เปลี่ยนไม่ทันไม่มีเวลาเพราะต้องเดินทางกลับบ้านต่างจังหวัด)ทะเบียนรถก็ยังไม่เปลี่ยนเพราะต้องไปเปลี่ยนที่ขนส่งจังหวัดที่ตัวเองซื้อแถมยุ่งยากเพราะยังผ่อนไม่หมด ผมเลยเอาที่ง่ายๆก่อน</p>\r\n\r\n<p>พอถึงจังหวะของมันก็เจอจริงๆครับเงินไหลเข้าเยอะมาก ได้ตำแหน่งงานที่สูงขึ้นแต่มีปัญหาหนักโดนใส่ร้ายเขาจะไล่ออก แต่สุดท้ายผมก็รอดเพราะเขาพิจารณาที่ผลงานด้วย และมีคนช่วยไว้ ผมรอด แต่เชื่อไหมครับเพื่อนอีกสองคนไม่รอด ตกงานโดนไล่ออก ครับนั่นคือเรื่องจริง ผมยังงง ไม่หาย คือเจอปัญหาจริงตามดวงแต่ไม่เป็นไร (ไม่ตกงานแต่เครียดมาก 555+) ดูซิครับ ต่างกันไหม อ่อ ลืมไป\r\nถามว่าแล้วมีอุบัติเหตุเกิดขึ้นจริงตามดวงไหม จริงครับ ปีนั้นโดนสามครั้งแต่ไม่เป็นไร รถเสียหายคนปลอดภัย แต่ในความเป็นจริงแล้ว ปีเดียวไม่น่าจะโดนบ่อยขนาดนั้นจริงไหมครับ แต่ผมไม่แปลกใจครับ เพราะส่วนหนึ่งมันมาจากทะเบียนรถด้วย เดี๋ยวมาเล่าให้ฟังครับ เอาละวันนี้พอแค่นี้ก่อนครับ เดี๋ยววันหลังจะแชร์เคสทะเบียนรถของผมให้ฟังกันครับคิดดูว่า แฟนผมจากแต่ก่อนเขาไม่เชื่อศาสตร์นี้เลยเขาหาว่าไร้สาระเลอะเทอะ แต่ตอนนี้เขาหันมาศึกษาและสนใจศาสตร์เหล่านี้เพราะเขาเจอด้วยตัวเองมาเต็ม เอาเป็นว่าแม้ทะเบียนรถเขาจะส่งผลช้าแต่ถ้าเขาได้แสดงผล แสบจริงๆครับ</p>\r\n', NULL, 1, NULL, NULL, NULL, NULL),
(12, '2013-07-29 08:36:00', 'คุณนิน', NULL, 'เปลี่ยนเบอร์โทร เปลี่ยนชื่อ เปลี่ยนทะเบียนรถแล้ว ดีจริงหรือ มีคำตอบครับ', 'https://www.ananya.in.th/views/assets/images/namedee.jpg', 'มีหลายท่านถามว่า ถ้าใช้เบอร์โทรศัพท์ดีแล้วชีวิตจะดีขึ้นไหม ถ้าใช้เบอร์ดีแล้ว มันจะช่วยได้จริงรึเปล่า ถ้าเปลี่ยนทะเบียนรถแล้วจะดีขึ้นจริงเหรอ ถ้าเปลี่ยนชื่อแล้วชีวิตจะดีขึ้นจริงรึเปล่า ?......', '<p>@@ผมขอตอบว่า ดีขึ้นแน่นอนครับถ้าได้เบอร์ดี ทะเบียนดี และชื่อที่ดีจริงๆ อย่างน้อยถ้าเปลี่ยนอย่างใดอย่างหนึ่งดีขึ้นแนะแต่อาจรอนานหน่อยจึงจะเห็น หรือ ถ้าเปลี่ยนพร้อมกันหมด รับรองเห็นเร็วและดีแน่นอนครับ โดยผมเน้นความสำคัญและน้ำหนักความสำคัญไปที่ เบอร์โทรก่อน ตามด้วย - ชื่อเล่น-ชื่อจริงสกุล(ใช้ตัวไหนบ่อยเน้นตัวนั้น) และสุดท้าย ทะเบียนรถ ตามด้วยเลขที่บ้าน เพราะอะไร เรามาดูเหตุผลกัน (เดี๋ยว ผมจะแบ่งปันประสบการณ์จริงๆเลยนะครับในช่วงท้าย)</p>\r\n\r\n<p>เหตุผล ทำไม่ผมถึงให้ความสำคัญกับเบอร์โทรศัพท์มงคลในการส่งผลที่แรงและเร็วกว่าอย่างอื่น นั่น เพราะ อะไรที่เรา ถ้ายิ่งใช้บ่อยๆจะยิ่งดียิ่งเร็วยิ่งแรง เหมือนกับชีวิตเราครับ ิวิ่งบ่อยๆก็ผอม กินบ่อยๆก็อ้วน ทำดีบ่อยๆก็ได้ดี ทำชั่วบ่อยๆก็โดนสนองเข้าซักวัน เช่นกันครับ โบราญท่านยังว่า พูดดีเป็นศรีแก่ปาก พูดมากปากจะเป็นสี ใครที่พูดดี พูดและคิดแต่เรื่องดีๆ บ่อยๆ ชีวิตก็จะเจอแต่เรื่องดีๆ บ่อยๆ แต่ถ้าใครพูดไม่ดีบ่อยๆ พูดแต่เรื่องไม่ดีไม่งามไม่เป็นมงคลบ่อยๆ เดี๋ยวก็เจอครับ สิ่งเหล่านี้ก็เหมือนกัน</p>\r\n\r\n<p>ที่นี้มาเจาะกันว่าทำไม ผมถึงเลือกเบอร์โทร แล้วคุณละครับ ระหว่างเบอร์โทร ชื่อ ทะเบียนรถ ถามว่าอะไรแรงกว่า สำคัญกว่า พวกคุณว่าอะไร ?.... ลองคิดตามนะครับ ถ้าเป็นสมัยก่อนผมให้ความสำคัญกับ--ชื่อเล่น ตามด้วย--ชื่อ-สกุลมาเป็นอันดับหนึ่ง แต่สมัยนี้ผมให้เบอร์โทร เพราะอะไร ?...</p>\r\n<p>@@อันดับหนึ่ง คือ เบอร์โทรศัพท์มงคล เพราะทุกวันนี้เราต้องใช้โทรศัพท์ ใช้วันละตั้งหลายรอบ ทั้งโทรเข้าโทรออก ลองนับดูซิครับกี่ครั้ง</p>\r\n<p>@@อันดับสอง คือ ชื่อเล่น ชื่อจริงนามสกุล ถ้าชื่อดี แล้วมีเบอร์ดี จะเสริมกันอย่างมาก เพราะอะไรเพราะลองนับดูครับในหนึ่งวันมีคนเรียกชื่อเรากี่ครั้งแล้วถ้ามีคนโทรมา หรือเราโทรไปมันมีการเรียกชื่อกันรึเปล่า หรือนึกถึงชื่อเรารึเปล่า ต่อมา คือทะเบียนรถ</p>\r\n<p>@@อันดับสาม ทะเบียนรถมงคลครับ ผมให้ความสำคัญรองลงมาเพราะมันเห็นผลช้ากว่าช้าเพราะอะไร เพราะวันหนึ่งเราใช้รถแค่ขับไปและขับกลับครับ (ยกเว้นนักธุรกิจที่ต้องขับรถบ่อยอันนั้นต้องเปลี่ยนฮะ) แต่แม้เขาจะแสดงผลช้ากว่าแต่เมื่อถึงเวลาเขาก็แสดงนะครับเพราะฉะนั้นต้องเปลี่ยนออก</p>\r\n<p>@@สุดท้าย คือ เลขที่บ้านครับ อันนี้ส่งผลแรงเหมือนกันครับเพราะอยู่กับเรามานาน และเราต้องนอนบ้านทุกวัน ถ้าใช้บ่อยก็เร็วถ้าไม่บ่อยก็ส่งผลอ่อนๆครับ ตามจังหวะชีวิตและพื้นดวงครับ ผมให้ความสำคัญสุดท้ายเพราะเปลี่ยนยากแก้ยากครับแม้จะแก้โดยการทำป้ายใหม่แต่นั่น คือ แค่ช่วยลดแรงให้เบาลงครับ เพราะเลขที่เดิมยังอยู่ ถ้าจะให้ดีจริงๆต้องเปลี่ยนเลย และเอาเลขอย่างอื่นมาช่วยดึงดวง (เบอร์โทร ชื่อ ทะเบียนรถ) ครับ</p>\r\n\r\n<p>ผมขอแชร์เรื่องเบอร์โทรจากประสบการณ์จริงของตัวเองให้เพื่อนได้อ่านและได้พิจารณาดูละกันครับ สมัยก่อนผมกับแฟนทำงานที่บริษัทเอกชนแห่งหนึ่ง บริษัทนี้มีการแข่งขันสูงมาก และยังมีการเล่นพรรคเล่นพรรคกันด้วย ดังนั้นในการทำงานจึงต้องมีการวางแผน และรอบคอบไม่ให้มีช่องโหว่ให้เขาเล่นงานได้ เป็นการทำงานที่เครียดครับ อ่อ ต้องบอกก่อนว่าผมศึึกษาโหราศาสตร์และศาสตร์ของตัวเลขมาประมาณเกือบ 10 ปีได้และตอนนั้นผมพึ่งเริ่มศึกษาศาสตร์เหล่านี้ได้ไม่กี่ปีครับ ซึ่ง เมื่อพอมีความรู้บ้าง ผมเองจะดูดวงละเอียดให้ตัวเองทุกปีถ้าดีก็เสริมไม่ดีก็จะหาทางป้องกันเอาไว้เกิดไม่เกิดช่างมัน แต่ขอให้ได้ทำจะได้ไม่เสียใจภายหลัง ถ้าถามว่าเชื่อไหม เชื่อครับ แต่เชื่ออย่างมีเหตุและผล ผมเชื่อว่าชีวิตเราถูกกำหนดถูกลิขิตมาแล้วด้วยแรงบุญและแรงกรรมจากอดีตชาติ\r\nแต่ผมเชื่อว่า เราสามารถเปลี่ยนแปลงชะตาชีวิตที่ถูกกำหนดไว้แล้วได้ ป้องกันและแก้ไขได้ เปลี่ยนหนักให้เป็นเบาได้ เราหนีได้ ด้วยพลังแรงบุญปัจจุบันแรงบุญจากอดีตมาเสริมเติมกันทำให้แรงบุญมีมากกว่าแรงกรรมครับ </p><p>ถามว่า@@แล้วเราจะรู้ จะหนี จะเปลี่ยนได้อย่างไร</p>\r\n<p>ตอบ@@ ก็รู้ด้วยโหราศาสตร์และศาสตร์จากตัวเลขยังไงละครับ ศาสตร์เหล่านี้บอกเราได้ บอกล่วงหน้าได้เป็นปีๆ ถึงหลายปี บอกทางแก้ให้เราด้วย โดยเฉพาะศาสตร์ของตัวเลข ผมนับถือมากเพราะเป็นศาสตร์ที่ได้ผลจริง เป็นศาสตร์ที่ช่วยให้เราหนีดวงได้ ยืดเวลาให้เราได้ ให้เราได้มีสร้างบุญให้มากกว่ากรรมและเป็นยังเป็นศาสตร์ที่ช่วยเบิกบุญมาเติมให้บุญใหม่เพื่อจะได้มีมากขึ้นเพื่อเอามาใช้กันและแก้ด้วยรหัสตัวเลขรหัสกรรมของเรา เอาละครับบ่นมามากแล้ว ต่อต่อ ต่อครับ</p>\r\n\r\n<p>ผลจากการเปิดดวง ดูดวงให้ตัวเอง พร้อมกับเปิดดวงให้เพื่อนอีกสองคน มีความแตกต่างกันกันไปตามพื้นดวง แต่มีสิ่งหนึ่งที่เหมือนกัน คือ ปีนั้นๆพวกผมดวงตกแต่ไม่หนักมาก คือ ดวงปานกลาง เด่นๆที่เหมือนกัน คือ มีปัญหาในการทำงานต้องตกงาน ส่วนดวงด้านอื่นๆของผม ที่เด่น คือ การงานจะรุ่ง เงินจะเยอะจะโดนศัตรูเล่นงาน มีปากมีเสียง จะมีอุบัติเหตุ เอาแล้ว ผมเชื่อครับ แต่ตอนนั้นงานยุ่งจริงๆปลีกตัวไม่ได้ แต่สิ่งแรกที่ทำผมไปถวายผ้าไตรจีวรก่อนเลย ต่อมาผมจึงหาทางป้องกันอย่างเร่งด่วนและรวดเร็วที่สุดตามศาสตร์ที่ผมเชื่อเพื่อจะได้มีเวลาให้เขาได้แสดงผล โดยผมกับแฟนเลือกเปลี่ยนเบอร์ก่อนสิ่งอื่นใด ตอนนั้นหาได้เบอร์ดีปานกลาง ดีสองคู่ท้ายดี ผลรวมดี เน้นที่ช่วยเสริมเรื่องการงาน การเงิน มีคนเอ็นดูช่วยเหลือ ซึ่งตอนนั้นยังไม่เปลี่ยนชื่อ(เปลี่ยนไม่ทันไม่มีเวลาเพราะต้องเดินทางกลับบ้านต่างจังหวัด)ทะเบียนรถก็ยังไม่เปลี่ยนเพราะต้องไปเปลี่ยนที่ขนส่งจังหวัดที่ตัวเองซื้อแถมยุ่งยากเพราะยังผ่อนไม่หมด ผมเลยเอาที่ง่ายๆก่อน</p>\r\n\r\n<p>พอถึงจังหวะของมันก็เจอจริงๆครับเงินไหลเข้าเยอะมาก ได้ตำแหน่งงานที่สูงขึ้นแต่มีปัญหาหนักโดนใส่ร้ายเขาจะไล่ออก แต่สุดท้ายผมก็รอดเพราะเขาพิจารณาที่ผลงานด้วย และมีคนช่วยไว้ ผมรอด แต่เชื่อไหมครับเพื่อนอีกสองคนไม่รอด ตกงานโดนไล่ออก ครับนั่นคือเรื่องจริง ผมยังงง ไม่หาย คือเจอปัญหาจริงตามดวงแต่ไม่เป็นไร (ไม่ตกงานแต่เครียดมาก 555+) ดูซิครับ ต่างกันไหม อ่อ ลืมไป\r\nถามว่าแล้วมีอุบัติเหตุเกิดขึ้นจริงตามดวงไหม จริงครับ ปีนั้นโดนสามครั้งแต่ไม่เป็นไร รถเสียหายคนปลอดภัย แต่ในความเป็นจริงแล้ว ปีเดียวไม่น่าจะโดนบ่อยขนาดนั้นจริงไหมครับ แต่ผมไม่แปลกใจครับ เพราะส่วนหนึ่งมันมาจากทะเบียนรถด้วย เดี๋ยวมาเล่าให้ฟังครับ เอาละวันนี้พอแค่นี้ก่อนครับ เดี๋ยววันหลังจะแชร์เคสทะเบียนรถของผมให้ฟังกันครับคิดดูว่า แฟนผมจากแต่ก่อนเขาไม่เชื่อศาสตร์นี้เลยเขาหาว่าไร้สาระเลอะเทอะ แต่ตอนนี้เขาหันมาศึกษาและสนใจศาสตร์เหล่านี้เพราะเขาเจอด้วยตัวเองมาเต็ม เอาเป็นว่าแม้ทะเบียนรถเขาจะส่งผลช้าแต่ถ้าเขาได้แสดงผล แสบจริงๆครับ</p>', NULL, 1, NULL, NULL, NULL, NULL);
