(13, '2013-03-02 10:57:00', 'คุณนิน', NULL, 'ทำนายดวงคุณอั้ม พัชราภา ไชยเชื้อ', 'https://ananya.in.th/views/assets/images/aum.jpg', 'วันนี้ เราจะขออนุญาตทำนายดวงคุณอั้ม พัชราภา ไชยเชื้อ นะครับ เห็นหมอดูหลายท่านทำนายไว้เยอะ เรามาดูว่าผมทำนายแล้วมันจะตรงกันรึเปล่าแต่ตรงไม่ตรงต้องใช้เวลาพิสูจน์', '<p>ชื่อจริง : พัชราภา (84 24 11 1รวมเท่ากับ 21) ไชยเชื้อ (29 82 27 62 รวมเท่ากับ 38) ผลรวมชื่อนามสกุล คือ 59\r\n    <br>พลังเงา : ชื่อเท่ากับ 70 นามสกุลเท่ากับ 40 ชื่อเล่น 25\r\n    <br>ทำนายชื่อเล่น : อั้ม (ุ54 25 ผลรวมเท่ากับ 17(8)\r\n    <br>บ้านเลขที่ : 72 / 519 หมู่ 16 ผลรวมได้ 24\r\n    <br>เลขประจำดวงคือ 24 25 27 11 12 17\r\n\r\n<p>ทำนายชื่อจริง : พัชราภา (84 24 11 1รวมเท่ากับ 21) ไชยเชื้อ (29 82 27 62 รวมเท่ากับ 38) ผลรวมชื่อนามสกุล คือ 59\r\n    บุคคลผู้นี้เป็นคนมีชื่อเสียง เด่นดังมีโชคเรื่องการเงินเป็นคนมีเสน่ห์เข้าวงสังคมมักจะเป็นคนเด่นมีคน ยกย่องให้เกียรติกล่าวขาน แต่จะเป็นคนมีสองลักษณะในตัวเองการแสดงออกภายนอกมักจะเป็นคนอ่อนแอ แต่สภาพภายในเป็นคนกล้าแข็งเรียกว่าเป็นซ่อนบุคลิกของตัวเองได้อย่างแนบ เนียน ยากที่ใครจะอ่านใจได้ อากัปกริยาที่แสดงออกภายนอก มักจะอำพรางความรู้สึกที่แท้จริงไว้ เป็นคนที่มีทั้งความนิ่มนวล อ่อนไหวได้ง่าย แต่ในขณะเดียวกันก็แฝงไปด้วยความหยิ่งถือตัว เอาแต่ใจตนเอง เป็นคนเด็ดเดี่ยวกล้าตัดสินใจ โดยที่ผู้อื่นคาดคิดไม่ถึง ชีวิตต้องระวังจุดแตกหักกลางคัน ทำให้เกิดมุมหักเหได้ง่าย มักจะมีเรื่องที่ทำให้ตกอยู่ในความเศร้า ทุกข์ใจ ชีวิตรักชีวิตสมรสไม่แน่นอน ถ้ามีแฟนก็ต้องคบและเลิกหลายครั้งหลายคน ถ้าได้แต่งงานมักจะได้แต่งงานไม่น้อยกว่าหนึ่งครั้งเพราะเรื่องชู้สาวคาว โลกีย์ ชีวิตช่วง 34- 36 จนบั้นปลายจะมีสิ่งที่ไม่ คาดคิดที่เกิดขึ้นแบบฉับพลันเปลี่ยนรูปแบบ เปลี่ยนวิถีชีวิตให้เปลี่ยนไปในทางตรงกันข้ามทำให้ชีวิตและอนาคตไม่แน่นอน</p>\r\n\r\n<p>สิ่งที่ต้องระวังและจะทำให้ชีวิตหักเหและตกต่ำ คือ ผู้ชายซึ่งเป็นกาลกิณีต่อชีวิตตัวเอง ขออย่าได้หมกมุ่นเรื่องชู้สาว หรือการกระทำที่ผิดศีล ให้ระวังเหล้ายา การพนัน และอบายมุขทุกอย่าง อย่าเชื่อตัวเองมากเกินไป อย่าหมกมุ่นอยู่กับไสยศาสตร์ เวทมนต์คาถา เพราะมันจะส่งผลร้ายต่อชีวิต ให้ระงับความมีนิสัยโกรธง่าย อารมณ์ฉุนเฉียว เป็นคนเจ้าอารมณ์ไว้ เพราะนี้คือปัญหาที่จะทำให้เราหมดศรีหมดราคาต่อเพศตรงข้าม แต่ในอีกมุมหนึ่งการที่เจ้าของดวงมีความเชื่อในไสยศาสตร์ก็มีผลดีที่ช่วยค้ำ ดวงไว้ให้เสมอแต่มันก็จะแว้งมาทำร้ายเราได้เมื่อเราผิดต่อครูบาอาจารย์ แนะนำว่าเจ้าของดวงควรหันหน้าเข้าหาธรรมะที่แท้จริงมันจะช่วยได้ยั่งยืนกว่า ไม่แว้งกัดเราด้วย</p>\r\n\r\n<p>อยากจะเตือนต่อเจ้าของดวงหรือผู้ที่รักและหวังดีกับคุณอั้ม ขอให้บอกกล่าวเธอว่าชีวิตของเธอมีดวงที่จะประสบอุบัติเหตุร้ายแรงหรือเกิด ความคิดชั่ววูบแบบกะทันหันตลอดชีวิตผ่านมามีแต่ความราบรื่นแต่ตอนนี้วาระ กรรมมาถึงแล้วอย่าประมาทอย่าคิดมากจนอาจทำร้ายตัวเองได้ทั้งทางตรงทางออ้ม แบบคาดไม่ถึงจนอาจต้องนอนโรงพยาบาลหรือ ถ้าไม่เชื่อไม่ป้องกันก็อาจจะถึงขั้นเสียชีวิตเลยที่เดียวแต่โดยรวมนิสัย แล้วเจ้าของดวงเป็นคนไม่ประมาทมักไปเสริมดวงไว้สม่ำเสมอ ที่ผมทำนายผมไม่ได้อยากดังครับแต่อยากช่วยและสนใจตามกระแส ถ้าใครอยากรู้ว่าคุณอั้มเธอมีความสุขหรือทุกข์ให้ดูที่ดวงตานะครับ ตาของเธอจะบอกทุกอย่างได้ตรงกับเลขที่ออกเลยทีเดียว ผมหวังอยากจะให้เจ้าของดวงนั้นให้ระวังอย่างมากโดยเฉพาะ\r\nในช่วงอายุ 33 ปี (ปัจจุบันปี 2555 ) ช่วงต้นปีดวงกำลังดีและยังดังเด่นด้านการเงินการงานไม่ติดขัด แต่จะป่วยไข้หรืออาจเสียเงินเสียทองของหายหรือมีบริวารนำความมาให้ ห้ามเดินทางตอนกลางคืน และระวังจะมีบุตรอย่างไม่ได้ตั้งใจนะครับ ระวังหมายถึงให้ระวังถ้าไม่ ระวังก็เกิดแน่นอนแต่ถ้าระวังก็ฝืนดวงได้ขอให้เข้าใจตรงกันนะครับ ช่วงปลายปีจะมีติฉินคนนินทาเราได้\r\nอายุ 34 จะ มีปัญหาเรื่องงานทั้งงานในวงการและงานส่วนตัว โดยเฉพาะกิจการส่วนตัวโดยมีผู้ชายเข้ามาเกี่ยวข้องให้ตกต่ำ ถ้าคบกับอยู่ใครก็จะมีเรื่องให้ทะเลาะจิตตกจนแตกหักได้ในปีนี้\r\nอายุ 35 -36 อย่า ไปทะเลาะกับใครอย่าไปคิดมากอย่าไปยึดติดอย่าไปเศร้าและให้ระวัง อุบัติเหตุกะทันหันจะมีเรื่องฟื้นไฟมาเกี่ยวข้องด้วยและระวังจะตกต่ำมีปัญหา เรื่องการงานเพราะผู้ชายหรืออาจต้องสูญเสียบุคคลอันเป็นที่รักไป ถ้าฝ่าฟันจนรอดปลอดภัยมาได้ (ทุกอย่างที่กล่าวมาถ้า แก้จะช่วยผ่านวาระกรรมได้อย่างน้อยจากหนักให้เป็นเบา ถ้าทำบุญดีๆก็อาจจะไม่เกิดขึ้นเลย ถ้าใครที่รักคุณอั้มได้อ่านหรือคุณอั้มได้อ่านเองขอให้หาเวลาไปถวายผ้า ไตรจีวรกับพระสายวัดป่าพร้อมกรวดน้ำแผ่เมตตาบ่อยๆนะครับ แม้จะไม่เชื่อแต่ผมขอให้ทำมัน ไม่เสียหลายหรอกครับ ทำบุญกับพระหมดน้อยกว่ากระเป๋าหนึ่งใบของคุณแลกกับความสุขทั้งชีวิตมันคุ้ม แสนคุ้มครับ )\r\nอายุ 37 เป็นต้นไปจะกลับมาดังอีกครั้ง แต่อายุ 40 ระวังจะเจ็บป่วยแต่ยังเด่นดังมีเงินทองได้รับรางวัลเหมือนเดิม</p>\r\n\r\n<p>ทำนายผลของพลังเงา : ชื่อเท่ากับ 70 นามสกุลเท่ากับ 40 ผลรวมเท่ากับ 110 ชื่อเล่น 25</p>\r\n\r\n<p>คน เลขนี้จะมีทั้งเรื่องดีและเรื่องร้ายคละเคล้ากันไป ยามได้ดีมีสุข ก็จะมีเรื่องทุกข์เข้ามาเกี่ยวพันอยู่เสมอแต่มีส่วนดีมากคือทำให้มีความ เจริญก้าวหน้ารุ่งเรือง หาเงินเก่ง สามารถมีฐานะที่ดีได้ แต่ส่วนเสียคือ สิ่งที่ได้มานั้นต้องฟันฝ่าอุปสรรคอย่างมากมาย ต้องเหน็ดเหนื่อยอย่างมาก และมักพบกับความยุ่งยากและพบเจอกับปัญหาบ่อย ๆ จะต้องมีเรื่องและปัญหาเข้ามาในชีวิตเป็นประจำ มีปัญหาเรื่องคู่ครอง ต้องอมทุกข์ มีปัญหาที่บอกใครไม่ได้ คิดมาก เก็บกด ระวังจะเป็นโรคประสาทชีวิตอยู่กับอุปสรรคซึ่งเป็นอุปสรรคที่คนอื่นอาจคิดว่า เรื่องเล็กแต่คนๆนี้กลับคิดว่าเรื่องใหญ่ จนอาจทำให้เป็นโรคภัยที่ร้ายแรง ระวังจะถูกปล้นจี้คดโกง ในช่วงดวงตกหรือบั้นปลายชีวิตให้ระวังอุบัติเหตุแบบเฉียบพลันไม่ทันตั้งตัว จากการทำงานการจ้องปองร้ายและอาจมีการคิดมากจนคิดทำร้ายตัวตายได้ถ้าไม่ทำใจ กับ ความเสื่อมและความผิดหวังรักลวง  ขอให้หันหน้าเข้าหาธรรมอย่าอยู่กับปัญหามากเกินไปครับจะดีเอง\r\nนิสัย อีกอย่างเจ้าของดวงเป็นคนที่เสียคือใครว่านิดหน่อยก็ไม่ได้เจ้าอารมณ์ ชอบเถียง หยิ่งถือตัว มีศักศรีเยอะ และมักเก็บเอาเรื่องต่างๆไปเสียใจ มักจิตใจไม่สงบ ว้าวุ่น ลังเล ไม่มีความเชื่อมั่นในตัวเอง ชอบน้อยใจเสียใจไม่เป็นเรื่อง ดูละครเรื่องเศร้า ก็กลั้นน้ำตาไม่อยู่ ชีวิตมีแต่ อมทุกข์ อมเศร้า เก็บกด คนรักคนใกล้ชิดมักไม่รักจริงตีตนออกห่างหลอกลวง ชีวิตไม่สดใส แต่มียังมีข้อดีคือมีพลังแห่งการเคลื่อนไหว เพราะไม่ชอบย่ำเท้าอยู่กับที่ มักอยู่ไม่ติดบ้าน ต้อง มีเหตุให้ออกนอกบ้านอยู่เสมอ เป็นคนเก็บเงินเก่ง บริหารเงินเป็น ส่งเสริมหนุนนำให้ชีวิตพบกับความสำเร็จได้ ชะตาชีวิตถ้าปลงได้ ทำใจได้ หันหน้าเข้าหาธรรมไม่ลุ่มหลงมัวเมาในกามาในอบายมุขในรสรักชีวิตจะสุขสบายดี มาก จะมีฐานะมั่นคงร่ำรวยไม่เสื่อมถอย ชอบการเดินทาง หรือเป็นนักธุรกิจที่เก็งกำไร แต่ไม่ชอบให้ใครบังคับ ยุ่งเกี่ยวกับชีวิตส่วนตัว เป็นนักคิดนักฝัน และจินตนาการกว้างไกล ดังนั้นถ้าแก้จุดบอดจุดดวงดับและชีพดับได้ ชีวิตนี้ก็สบายเลยครับ</p>\r\n\r\n<p>ทำนายชื่อเล่น : อั้ม (ุ54 25 ผลรวมเท่ากับ 17(8) เลขอาภัพรัก)\r\nชื่อ อั้ม จะเสริมดวงให้ดังให้อุดมสมบูรณ์ด้วยทรัพย์สินเงินทอง แต่ภายในก็มีเรื่องทุกข์ใจให้ต้องคิดมากอยู่ร่ำไป ถ้ามีคู่ก็มักจะทะเลาะเบาะแว้งเพราะความเห็นไม่ลงรอยกัน ปัญหาการนอกใจกัน ไปหาอ่านความหมายเพิ่มเติมได้ตามตัวเลขได้เลยนะครับ สังเกตว่าเลขดวงอาภัพรักคุณอั้มออกมาเยอะมากถ้าไม่แก้ยังไงก็ไม่มีความสุข ไม่สมหวังในรักครับ นอกจากจะปลงให้ได้ แล้วเอาส่วนดีของชีวิตในส่วนอื่นเช่นเงินทอง ชื่อเสียงความดีงามเป็นหลักยึดแทนความรักระหว่างหญิงชาย หรือเอาความรักของครอบครัวเป็นที่ตั้งก็จะช่วยได้ครับ</p>\r\n\r\n<p>ทำนายตาม วัน เดือน ปีเกิด : 5 ธันวาคม 2521 5 12 25 21 =18 (พื้นดวง)\r\nเลขอาภัพรักออกมาอีกแล้ว จากเลขที่ออกคนเกิดวันเดือนปีนี้มีพื้นดวงดีเด่นดังร่ำรวยในชีวิตนับว่าราบ รื่นดี การงานสำเร็จดีมากแต่ดวงอับด้านความรัก อมทุกข์ อมโศก มีดีคือเป็นคนพูดดีครับ มีวาจาเป็นเลิศ คนเขารักเขาเอ็นดูเขาช่วยเหลือก็ด้วยคำพูด แต่เจ้าตัวก็เป็นคนเจ้าอารมณ์หงุดหงิดง่าย ปากคอเฉือดเฉือนชอบทะเลาะเช่นกันในบางจังหวะอารมณ์ นั่นเป็นด้วยอิทธิพลของเลข 12 อีกทั้งดวงนี้มีคนอิจฉาริษยาเยอะครับมีคนจ้องเล่นงานกลั้นแกล้งอยู่ ดวงคุณอั้มมีเลข 12 เยอะ มากดังนั้นผมขอเตือนให้ระวังดวงจะถูกคนที่เรารักคนที่เราไว้ใจใกล้ชิด คิดร้ายปองร้ายทำลายทั้งชีวิตและชื่อเสียงของเราได้ทั้งโดยตั้งใจหรือไม่ ตั้งใจ</p>\r\n\r\n<p>จากบุคลิกที่แสดงออกคนภายนอกอาจจะดูว่าคุณอั้มเธอมีความสุขแต่จริงๆไม่ใช่ ครับ ชีวิตเธอนั้นเป็นคนคิดมากคิดลึกคิดจุกคิดจิกครับดูคำทำนายจากด้านบนเลย ดวงอาภัพปรับปลงไม่ได้ในเรื่องความรัก ชีวิตจะมีปัญหานอกใจ รักซ้อนซ่อนเงื่อน แม้ได้แต่งงานก็ต้องเลิกแน่นอนครับ ดวงคุณอั้มนั้นมีผู้ชายเป็นกาลกิณีนะครับจะตกต่ำและเดือดร้อนเมื่อมีผู้ชาย เข้ามาพัวพัน ควรแล้วที่จะอยู่โสด ถ้า ไปคบกับใครแต่งกับใครยังไงก็ต้องเลิกแน่นอนซ้ำร้ายเมื่ออายุมากจะมีคนไม่ จริงใจเข้ามาเกี่ยวพันด้วยครับให้ระวังดีๆถ้าจะคบต้องคบแบบซิลๆครับหรืออยู่ กันแบบลับๆ คบกันแบบเปิดเผยนอนกันคนละที่แบบนี้จะช่วยให้อยู่กันได้นานขึ้น แต่ผมว่าอย่าไป ให้ใจมากดีกว่าครับผู้ชายสมัยนี้ไว้ใจไม่ได้ เราสวยเรารวยเราเก่งอย่าไปแคร์ครับ ชีวิตเรามีความสุขได้โดยไม่ต้องมีผู้ชายเลยก็ได้ ส่วนในเรื่องธุรกิจการค้าส่วนตัวก็อย่าไปคิดมากครับดวงคุณอั้มจับอะไรก็รวย ครับ แต่ก็ต้องระวังด้วย จำไว้ว่า ถ้าคุณอั้มจะทำธุรกิจขอให้ทำเพราะตัวเองรัก ตัวเองชอบและเป็นเป็นสิ่งคิดที่มาจากตัวเองไม่ใช่คนอื่นชักชวนให้ทำ รับรองรุ่งครับ</p>\r\n\r\n<p>ทำนายจากบ้านเลขที่ : 72 / 519 หมู่ 16 ผลรวมได้ 24\r\nบ้านหลังนี้มีสิ่งศักสิทธิ์คุ้ม ครองดีมากเป็นเทพของสูงค่าที่ช่วยคุ้มครอง และอำนวยอวยชัยนำเงินทองข้าวของมาให้เจ้าของบ้าน ช่วยส่งเสริมในเรื่องหน้าที่การงาน ด้านการบันเทิงได้อย่างดีเยี่ยม (ดูคำทำนายเพิ่มเติม คือเลข 24 และเลข 6) แต่เนื่องจากเลขดวงมันมาออกอีกแล้วจึงส่งผลให้เจ้าของบ้านนี้จะมีปัญหา เรื่องความรัก ดวงอาภัพรักยิ่งชื่อของคุณอั้มได้เลข 17 ด้วย แล้วยิ่งซ้ำเติมไปกันใหญ่ ครับคุณอั้มเป็นคนสวย น่ารัก หุ่นดี เซ็กซี่ แต่ถ้าชายใดได้อยู่ใกล้อยู่ด้วยนานๆ เขาจะเหนื่อยหน่ายอันเกิดจากอารมณ์ หรือชอบบ่นชอบว่าจนทำให้ไร้เสน่ห์ได้ (เพราะอิทธิพล ของเลขด้วยมันแรงมันออกมาเยอะ) จากตัวเลขแม้จะเงินมากมายจนร่ำรวยแต่คุณอั้มก็มีภาระที่ต้องรับผิดชอบสูง เช่นกันอย่าลืมครับเวลาเราตกต่ำจะพึ่งใครก็ไม่มีมีแต่คนมาพึ่งเรา ถ้าไม่ระวังบั้นปลายระวังจะโดนหลอกโดนโกงทำให้มีหนี้มีสิน และสุดท้ายต้องอยู่อย่างโดดเดี่ยวไร้คนเข้าใจ แต่ก็มีในแง่ที่ดีบ้างคือเขาจะช่วยค้ำให้เจ้าของบ้านดวงดีรุ่งโรจน์มีเงิน และดวงแข็งแต่เวลาดวงตกมาก็เอาไม่อยู่เหมือนกันครับ</p>\r\n<p>ด้วยรักและหวังดีครับ</p>', NULL, NULL, 1, NULL, NULL, NULL),
(14, '2013-05-07 12:37:00', 'คุณนิน', NULL, 'ณเดชน์ คูกิมิยะ ทำไม? ถึงดังรวยและทำไมจึงเจอปัญห', 'https://4.bp.blogspot.com/--gbk-QfR9Qc/UdZtpk0UC4I/AAAAAAAAAcE/Mk7mA_iSrX4/s243/%E0%B8%81%E0%B8%81%E0%B8%81%E0%B8%81%E0%B8%81.jpg', 'เด็กหนุ่มจากอีสานหน้าตาหล่อเหลา เมื่อก้าวเข้าสู่วงการบันเทิงไทยทำไมถึงดังเปรี้ยงปร้าง แรงสุดฉุดไม่อยู่ แต่', '\r\n<p>@@ ณเดชน์ คูกิมิยะ ทำไม? ถึงดังรวยและทำไมจึงเจอปัญหา.......... @@\r\n\r\n<p>เด็กหนุ่มจากอีสานหน้าตาหล่อเหลา เมื่อก้าวเข้าสู่วงการบันเทิงไทยทำไมถึงดังเปรี้ยงปร้าง แรงสุดฉุดไม่อยู่ แต่--ความดังและเงินทองที่ไหลมามหาศาลทำไมต้องสะดุดเพราะเรื่องฉาวจากสตรี--เราลองมาดูกันว่ามันจะมีส่วนเกี่ยวข้องกับเลขศาสตร์กับพลังเงาหรือเปล่าและต่อไปชีวิตเขาต้องระวังอะไรอีกบ้าง งั้นวันนี้เราเจาะดูจากชื่อสกุลของเขากันว่าทำไมถึงดัง ทำไมถึงรวย และทำไมถึงซวยเพราะสตรี มันเพราะเลขอะไรมันชื่อ หรือสกุล  หรือ ชื่อเล่น\r\n\r\n\r\n    <br>ชื่อเล่น  แบรี่\r\n    <br>เลขศาสตร์ชื่อเล่น16**\r\n    <br>พลังเงาชื่อเล่น 37**\r\n\r\n    <p>ชื่อ นามสกุล ณเดชน์ คูกิมิยะ\r\n\r\n    <p>เลขศาสตร์  24+32**=56\r\n\r\n<p>เพลังเงา       51+85**=136 (แฝงด้วย 13**)</p>\r\n<p>เ** หมายถึง เลขอันตราย เสี่ยงต่อสุขภาพ ความสำพันธ์ ความสำเร็จ</p>\r\n\r\n<p>สังเกตว่าชื่อ “ณเดชน์” ได้เลขศาสตร์ชื่อ 24 แถมยังมีพลังเงาชื่อแรง คือเลข 51 เฉพาะชื่อบอกได้เลยชายคนนี้ไม่ว่าทำอะไรไม่ว่าอยู่วงการไหนๆ โดยเฉพาะในวงการมายาด้วยแล้ว เขาจะดังจะประสบความสำเร็จและจะมีเงินทองร่ำรวยมากแถมมีเสน่ห์เป็นที่รักใคร่ของผู้คนและของผู้ใหญ่แน่นอน เพราะอะไร เพราะเลข 24 และเลข 51 มันคือดาวการเงิน ดึงดูดเงินมันคือดาวมหาเสน่ห์ บ่งถึงความอุดมสมบูรณ์ในทุกๆด้าน ไม่ว่าจะเป็นงานเงินความรัก อีกทั้งยังช่วยปรับให้มองโลกในแง่ดี มีจิตใจดีได้ด้วย นับเป็นโชคดีมากเพราะเป็นชื่อที่มีพลังมาก ยิ่งถ้าทำอะไรด้วยตัวเองจะยิ่งเยี่ยม</p>\r\n\r\n<p>แถมผลรวมชื่อสกุลทั้งพลังเงาและเลขศาสตร์ก็ได้เลขที่ดีด้วยเพราะได้เลข 56,36 ซึ่งเป็นเลขมหาเสน่ห์ เสริมความร่ำรวยด้วยแล้ว บอกได้เลยยังไงก็รวย ทำอะไรก็รวยเด็กคนนี้ถ้าทำอะไรด้วยตัวเอง ติดต่อสื่อสารด้วยตัวเอง รับรองไม่มีปัญหา แม้แค่เขาออกหน้าทุกอย่างก็ราบรื่นไปได้สวย พูดกับใครใครเขาก็รัก เอ็นดู เมตตา อยากช่วย อยากให้งานให้เงิน</p>\r\n\r\n<p>“ณเดชน์” ดัง ดี รวย เพราะชื่อ และผลรวมของชื่อสกุล (24,15,56,36)</p>\r\n\r\n<p>---แต่ต้องระวังอย่าประมาทผลอีกด้านเลข 51,24,36,56 ด้วย เพราะ สองเลขแรก ห้ามบุคคลที่ใช้เลขนี้ใช้พรที่เขาให้มาไปในทางที่ผิดเด็ดขาดและต้องหมั่นเติมบุญ  (อย่าเหลิง)ไม่งั้นจะตกต่ำในบั้นปลาย และสองเลขหลัง -36,56 ห้ามบุคคลที่ใช้อย่าประมาทในความสัมพันธ์ (อย่าเผลอเจ้าชู้อย่าเล่นกับไฟ) และต้องระวังพลังแฝงของเลข 11 พลังขัดแย้งและล้ม เหลวพลัดพรากอย่างฉับพลันไว้ด้วย อีกอย่างชีวิตชายคนนี้มีเลข 12,21 แฝงอยู่เยอะทีเดียวสิ่งที่ต้องระวังเพิ่มเข้ามาคือ เรื่องสุขภาพและเรื่องชู้สาวเรื่องฉาวโฉ่เสื่อมเสียเพราะคนใกล้ชิดเพราะ เพศตรงข้าม ตัวเลขต่างแต่มีพลังส่งเสริมกันระหว่าง 32 กับ 12,21 ผลคือซึ่งตอนนี้ก็โดนแล้ว</p>\r\n\r\n\r\n<p>@@แม้ชีวิต “ณเดชน์”จะโชคดีมากมายแต่ชีวิตนี้ก็ยังมีจุดเสีย(ไม่มีใครสมบูรณ์เต็มร้อย) @@</p>\r\n<p>เพราะในส่วนของนามสกุล มันได้เลขศาสตร์ 32  และได้พลังเงานามสกุล 85  เลข 32 ถ้าอยู่กับใครบุคคลภายใต้อิทธพลจะมีความผิดพลาดได้ง่าย มีทุกข์ในใจ ความรักฉาบฉวย ระวังจะมีเรื่องฉาว จะมีเรื่องเสื่อมเสียตกต่ำลง มีเหตุให้เสียเงินเสียทองเสียงานเพราะสตรี มีปัญหาสุขภาพ (ช่วงล่าง) มีโรคภัยไขเจ็บเบียดเบียนอย่างเรื้อรัง สุขภาพไม่ค่อยดี และให้ระวังอุบัติเหตุไว้ด้วย  งานทุกอย่างหากไม่ลงมือทำงานเองมักจะประสบกับความล้มเหลวผิดวพลาด จึงต้องระวัง ถ้าเป็นชายใช้ยิ่งต้องระวังจะถูกสตรีสร้างปัญหาสร้างความทุกข์มาให้อย่างร้ายแรง คนเลข 32 มักจะกำพร้า แต่ยังดีที่มีผู้ใหญ่ให้ความอุปถัมภ์ มีเสน่ห์\r\nพลังเงานามสกุลได้ 85 แฝงด้วยเลข 13 ผลคือ ระวังการหลงผิด ลืมตัว เอาแต่ใจตัวเอง มักจะเห็นกงจักรเป็นดอกบัว จะพาชีวิตไปสูความหายนะ  มักจะกำพร้าและขาดที่พึ่ง เพศตรงข้ามจะสร้างปัญหามาให้ มักมีอุปสรรค มีความขัดแย้ง ขัดใจกันภายในครอบครัวและคนรัก ระวังเรื่องมือที่สาม(อย่าห่วงมากนะคะเพราะมีชื่อดีอยู่ แต่อย่าประมาทเด็ดขาดเพราะถ้าประมาทจะพลาดอย่างที่เป็นอยู่ตามหน้าข่าวหนังสือพิมพ์ที่พึ่งซาไป ซึ่งนับว่าสุญเสียเยอะทีเดียว)</p>\r\n\r\n<p>---และที่สำคัญ ต้องระวังให้มากถ้าใช้นามสกุล “คูกิมิยะ” แล้วมีคนเรียกชื่อ “แบรี่” บ่อยๆ เพราะพลังเลขร้ายมันจะผนึกกำลังเล่นงานเราในช่วงดวงตกได้อย่างน่ากลัว เพราะชื่อแบรี่มันเป็นเลขร้ายแรงเสี่ยงต่อสุขภาพ คดีความ อุบัติเหตุ ความผิดพลาด ความสัมพันธ์ ซึ่ง เป็นไปตามกฎที่เรา Numberniceic บอกไว้เสมอว่าว่า ไม่ว่าเลขดีหรือร้ายที่แวดล้อมในชีวิตเราเมื่อถึงวาระของมันมันย่อมทำหน้าที่และแสดงผลแน่นอนไม่วันใดก้วันหนึ่ง มากน้อยตามช่วงจังหวะชีวิต</p>\r\n\r\n<p>---โดยเฉพาะในชีวิตของ ณเดชน์ เราจะเห็นชัดเจนเพราะหลายเรื่องเกิดขึ้นแล้ว ซึ่งตรงตามความหมายของตัวเลขที่ออกมา ส่วนในหลายเรื่องที่ยังไม่เกิด เราไม่รู้ก็จงอย่าประมาท  เพราะชีวิตมีเลข 32,85,13,16,37,48,84,12,21 ในชีวิตถ้ามันแสดงผลเต็มที่ผลคือ จะทำให้ชีวิตไม่สดใส ทำสิ่งใด ก็มีแต่อุปสรรคมาขวางกั้น (สังเกตุถ้าใครตามข่าวจะรู้ว่าเด็กคนนี้จะมีข่าวมาสกัดดาวรุ่งตลอดแต่ก็รอดมาทุกครั้งยังดังได้เพราะมีเลขดีมากกว่าเลขร้าย) เลขเหล่านี้ถ้าเกี่ยวข้องกับผู้ใดให้พึงระวัง การขัดแย้ง ขัดใจ จะมีเรื่องให้ทะเลาะเบาะแว้ง  ชีวิตมีมุมหักเหอยู่ตลอดเวลามักจะขึ้นๆลงๆ รุ่งเร็วร่วงเร็วถ้าไม่ระวัง ชีวิตไม่ค่อยราบรื่นนัก ชีวิตรักไม่สมหวัง มีปัญหาชู้สาว ต้องพลัดพรากจากคนในครอบครัว จากคนที่รัก มีศัตรูจ้องทำลาย ที่สำคัญ หากยังมีคนใกล้ชิดเรียกชื่อเล่น “แบรี่ หรือ ป๋าแว่น”บ่อยๆ แถมยังใช้นามสกุลนี้อยู่ เด็กหนุ่มคนนี้ จะเจอปัญหาหนักขึ้นแรงขึ้น ผลคือจะเป็นคนสองบุคลิก มีเหตุให้เก็บกด กดดัน อึดอัด มีทุกข์ในใจที่บอกใครไม่ได้  มีคดีความ มีความผิดพลาดเกิดขึ้นอย่างไม่ตั้งใจ หรือมีการตัดสินใจผิดพลาดเกิดขึ้น มีปัญหาเกี่ยวกับสุขภาพ เจ็บป่วย ระวังการผ่าตัด อุบัติเหตุรุนแรง การพลัดพราก มีโอกาสถูกทำร้ายร่างกาย </p>\r\n\r\n<p>ถ้าดวงตกมาต้องระวังให้มากต้องทำบุญไว้ตั้งแต่เนิ่นๆเพราะในชื่อสกุลแม้มีเลขคุ้มครองอยู่ก็กำลังอ่อนมากเพราะอยู่ในส่วนท้ายของเลขเรียงชื่อ  ดังนั้นเราจึงมีทางแก้ง่ายเพื่อช่วยลดความพลังความรุนแรงในส่วนร้ายๆ ดังนี้</p>\r\n<br>. ต้องหมั่นทำบุญกรวดน้ำแทนหากยังชอบใช้ชื่อแบรี่หรือป๋าแว่นอยู่ เพราะคงเปลี่ยนนามสกุลไม่ได้ มันติดตลาดแล้ว\r\n<br>2. ใช้เบอร์โทรหรือทะเบียนรถที่มีเลขคุ้มครองไว้และเป็นเลขมงคลเสริมดวงเพื่อป้องกันพลังร้ายเดิมเสริมพลังดีให้ยิ่งรุ่ง\r\n<br>3.  ถ้าจะให้ดีที่สุดห้ามให้คนเรียกชื่อแบรี่หรือป๋าแว่นเด็ดขาดเพื่อไม่ให้พลังร้ายมันแสดงตัวรุนแรง  หาไม่แล้วต่อไปอาจจะไม่ได้เสียแค่เงินเสียแค่งาน\r\n\r\n<p>จากตัวเลขและจากปัญหาจริงที่ทยอยเกิดขึ้นมาบ้างแล้วในชีวิตของเด็กหนุ่มคนนี้ทั้งที่เรารู้และไม่รู้ แต่เท่าที่รู้ก็นับว่าตรงกับความหมายของตัวเลขที่ออกมาทีเดียว ซึ่งก็สามารถเป็นตัวอย่างให้เราท่านได้เห็นผลเสียของตัวเลขได้อย่างดีทีเดียวอย่างล่าสุด แทนที่จะได้เงินได้งานหลักหลายล้านกลับไม่ได้ แถมต้องเสียงานไปหลายงานเพราะเป็นเหตุพ่วงต่อกันมา หนังที่เขาแสดง ซึ่งแสดงได้ดีมากแต่ก็ต้องมาพลาดพลั้งไปเพราะกระแสข่าวลบๆ ทั้งจากคนแวดล้อมตัวเองและจากนางเอกของเรื่อง จนกลายเป็นหนังขาดทุน ทั้งทีไม่น่าจะเป็น </p>\r\n\r\n<p>ทริคและทริป เกี่ยวกับตัวเลข by Numberniceic</p>\r\n\r\n<p>เลข 85 และ 32,58,32 ถ้าใครได้เลขนี้มาตั้งแต่กำเนิด รับรองว่า 80% กำพร้าแน่นอน ยิ่งมีเยอะก็สามารถทำนายได้เลยว่ากำพร้าแน่นอน หรือถ้าพึ่งได้เลขนี้มาเมื่อโตแล้วหรือแก่แล้ว และใช้มานานหลายปีก็สามารถทำนายได้เลยว่าบุคคลผู้นี้มีปัญหาภายในครอบครัวแน่นอน อาภัพ อย่างเบาคือ ปัญหาทะเลาเบาะแว้งมีปากมีเสียงกัน ไม่ค่อยถูกกันไม่ลงรอยกัน อย่างหนัก คือ เจ้าชู้  มีปัญหามือที่สาม มีชู้ ครอบครัวแตกแยก พลัดพรากจากกัน และหรือคนคนนั้นจะมีปัญหาในครอบครัว เช่น มีพ่อมีแม่มีญาติมีแฟนก็เหมือนไม่มี ชีวิตเหมือนอยู่ตัวคนเดียว ไม่ลงรอยกันในหมู่ญาติหรือในครอบครับ เป็นต้น (เราต้องดูเลขอื่นประกอบด้วย ถ้าใครอยากรู้เบื้องลึกเกี่ยวกับตัวเลขต้องติดตามหนังสือของเรานะคะ)</p>', NULL, NULL, 1, NULL, NULL, NULL),
(15, '2013-05-07 03:40:00', 'คุณนิน', NULL, 'เจมส์ จิรายุ ตั้งศรีสุข', 'https://4.bp.blogspot.com/-RHyOnQ9S0jo/UdaoV18zHiI/AAAAAAAAAes/L3YueYUeIJQ/s300/9dd6cb58bc2b11e2bd6e22000aaa07e4_7_1368675972__medium.jpg', 'มาแรงแซงโค้ง ดารานักแสดงรุ่นพี่หลายคน ดังไม่หยุดฉุดไม่อยู่จริงๆสำหรับหนุ่มน้อยคนนี้ \" เจมส์ จิรายุ ตั้งศรีสุข\" หรือ เจมส์ จิรายุ ', '<p>มาแรงแซงโค้ง ดารานักแสดงรุ่นพี่หลายคน ดังไม่หยุดฉุดไม่อยู่จริงๆสำหรับหนุ่มน้อยคนนี้ \" เจมส์ จิรายุ ตั้งศรีสุข\" หรือ เจมส์ จิรายุ ทำไมน้องถึงดังเปรี้ยงขนาดนี้ แสดงละครเรื่องเดียว แต่แจ้งเกิดโดยไว เรามาดูกันมาว่าหนุ่มคนนี้มันมีอะไรดี นอกจากหน้าตาอันหล่อเหลาแล้ว(บางคนหล่อ บางคนสวยแต่ก็ไม่ดัง) ซึ่งวันนี้เราจะไม่ขอกล่าวถึงดวงกำเนิด ไม่เจาะไปถึงเลขเรียงนะครับ ขอเจาะไปที่ ชื่อสกุล ชื่อเล่น โดยเราจะดูที่เลขศาสตร์ พลังเงาก็พอ ซึ่งเราจะดูว่าพลังของตัวเลขมันส่งเสริมเกี่ยวข้องกันกับชีวิตน้องหรือไม่ อย่างไร</p>\r\n    <br>ชื่อเล่น       เจมส์\r\n    <br>เลขศาสตร์   29\r\n    <br>พลังเงา      54\r\n\r\n<p>ทำนายชื่อเล่น ชื่อนี้ดีจะรุ่งดีรุ่งเร็วก้าวหน้าเพราะมีโชคช่วยมีสิ่งศักสิทธิ์คุ้มครอง แต่---ก็ต้องระวังอุบัติเหตุไว้ให้หนักเพราะพลังอุบัติเหตุแรงมาก ชีวิตมักหักกลาง ระวังไฟระวังระเบิด เมื่อรุ่งอย่าประมาทจงแบ่งบุญ (เจมส์เรืองศักดิ์ก็โดนมาแล้วเมื่อคราวเครื่องบินตก ตกแล้วแล้วมันก็ดีที่รอด แต่ผมว่าสู้ไม่ตกไม่เจออุบัติเหตุจะดีกว่า) นอกจากนี้ให้ระวังชีวิตจะอมทุกข์ ระทมขมขื่นเพราะเพศตรงข้ามสร้างให้ เหมือนมีความสุข และจงเข้าใจส่วนใหญ่หน้าชื่นอกตรม นิสัยส่วนตัวแล้วเป็นคนทะเยอทะยานไม่ยอมคน มั่นใจในตัวเอง ถือตัวเองเป็นที่ตั้ง จนบางครั้งเหมือนคนอวดดี ออกเอาแต่ใจ ระวังจะผิดพลาดเกิดแรงต้าน มีคนไม่ชอบหน้าและมีศัตรูได้ง่าย สิ่งที่ต้องระวังคือเพื่อนที่ไม่ซื่อ ปัญหาและความทุกข์อันเกิดจากเพศตรงข้าม ระวังคนรักจะหักหลังนอกใจทิ้งไป</p>\r\n\r\n\r\n    <br>ชื่อจริง       จิรายุ ตั้งศรีสุข\r\n    <br>เลขศาสตร์   24+39=63\r\n    <br>พลังเงา       50+106=156(15)\r\n\r\n<p>ทำนายชื่อสกุลจริง จะเห็นว่าตัวเลขที่ ทำให้น้องเขาโด่งดังเป็นพรุแตก  มันมาจากชื่อของเขาดีมากนี้เอง เพราะได้เลขศาสตร์ 24 แถมได้พลังเงา 50 แถมยังมาเจอผลรวมของชื่อสกุลและผลรวมของพลังเงาชื่อสกุลส่งเสริมเข้าไปอีก เพราะได้  63 และ 156 ยิ่งสุดยอด และแม้ชื่อเล่น \"เจมส์\" จะไม่ดีเท่าไหร่แต่ก็มีส่วนเสริมในด้านดีที่เป็นไปในทางเดียวกัน คือ มีโชคมีความสำเร็จเร็วแรง จากตัวเลขดีทั้งหลายที่ออกมาซึ่งนับว่าดีถึง 75% ผลจะเป็นอย่างไรเหรอครับผมบอกเลยว่าสุดยอด!! ดวงจะรวยจะดังมีเสน่ห์มีคนรักคนเมตตาสนับสนุน ตามตัวเลขเลย มีโอกาสสูงที่เขาจะดังทั้งเมืองไทยและต่างประเทศ ถ้าเข้าหาผู้ใหญ่เป็น ควบคุมอารมณ์ตัวเองได้รับรองดังดีไม่มีตกจะได้ทั้งงานและเงินจะได้จะมีทุกอย่างตามที่หวัง มากกว่าที่หวังด้วยซ้ำเพราะชีวิตนี้มีโชคช่วยมีเสน่ห์ยิ่งทำดีจะยิ่งได้ยิ่งรุ่ง มีแต่คนอยากช่วย อยากอุ้มชู อนาคตจะร่ำรวยเป็นร้อยล้านพันล้านไม่ธรรมดา(ต้องเช็คพื้นดวงประกอบ อีกที เพราะไม่แน่ใจว่าชื่อสกุลนี้ได้มาแต่กำเนิด หรือ พึ่งมาตั้งชื่อใหม่ก่อนเข้าวงการรึเปล่า)</p>\r\n\r\n<p>ชื่อสกุลนี้ไม่ได้ดีจำกัดอยู่ที่วงการมายาเท่านั้นแม้ไปทำทำธุรกิจการงาน อื่นใดที่ถูกโฉลกกับดวงด้วยแล้วก็จะสำเร็จได้อย่างงดงาม----แต่ก็อย่าประมาท ระวังจะทุกข์จะวุ่นวายเดือดร้อนเพราะความเจ้าชู้เพราะเสน่ห์เพราะอารมย์ของ ตัวเองได้ ต้องระวังไม่ระวังจะมีเรื่องฉาวให้เขาได้เม้าท์กันให้แซด และระวังจะตกต่ำลงในบั้นปลาย----เพราะมีเลขไม่ดีในนามสกุลแถมเลขเรียงก็ไม่ ดี จึงมี...............</p>\r\n\r\n<p>ข้อเสียที่ต้องระวัง คือ ระวังความกดดัน ความแข็งกร้าวเจ้าอารมณ์ เอาแต่ใจในบางจังหวะ ระวังอารมณ์ชั่ววูบอันเกิดจากจิตใจถูกกดดันมากเกินไป จะทำให้ตัวเองเสีย คนอื่นเสีย ให้ระวังจะมีชื่อมือที่ 3 จะเข้ามาก้าวก่ายในชีวิต ทำให้เกิดความระส่ำระส่ายในชีวิตรักและครอบครัว ระวังเรื่องชู้สาว ที่น่าแปลกแต่จริงคือคนที่ใช้เลขนี้ส่วนใหญ่แม้จะหล่อจะรวยแต่ก็มักจะไม่มีความรัก หารักแท้ยาก คบกันมานานเนิ่นก็มีเหตุให้พลัดพรากกันอยู่ดี ที่สำคัญต้องระวัง สุขภาพ ความเครียด กลุ้ม คิดมาก วิวาทบาดหมาง ประสาทกิน คนในบ้าน คนใกล้ชิดมักจะนำปัญหามาให้ มีภาระที่ต้องรับผิดชอบคนอื่น เหนื่อยเพื่อคนอื่น แต่ไม่ค่อยทำเพื่อตัวเอง มีแต่คนมาเบียดบังหวังผลประโยชน์จากเรามากกว่าจริงใจ มีคนปองร้าย หวังร้าย หวังทำลาย ระวังอุบัติเหตุ ชะตานี้อย่าไว้ใจใครโดยเฉพาะเพศตรงข้าม เพื่อนที่ไม่ซื่อบางคน(แต่ก็มีเพื่อนแท้หลายคน) ถ้ายังใช้ชื่อเจมส์อยู่บ่อยๆ ขอจงระวังอุบัติเหตุ ระวังไฟ ระวังระเบิดไว้ให้หนักในช่วงชีวิตหนึ่ง โดยเฉพาะช่วงที่ชีวิตกำลังรุ่งระวัง ชีวิตจะหักกลาง เกิดสะดุด(เสริมดวงแก้ดวงไว้จะได้รุ่งไม่มีตก ถึงคราวดวงตกมาจะได้โดนไม่หนัก)</p>\r\n\r\n<p>เอา เป็นว่าหนุ่มน้อยคนนี้เลขร้ายที่มีแม้ไม่ร้ายแรงแต่ไม่ควรประมาท เพราะถึงคราวซวยมาบังเอิญไปใช้เบอร์โทรอันตราย ทะเบียนรถอันตรายเข้าจากที่ควรเจอร้ายแค่ 50% อาจจะเจอเป็น 100 % ก็ได้เพราะอย่าลืมว่าในชื่อนี้ นามสกุลนี้ ยังไม่มีเลขคุ้มครองเลยแม้จะมีเลขคุ้มครองในชื่อเล่น 54 แต่อย่าลืมว่าเลข 54 มันก็มีพลังอุบัติเหตุด้วยเช่นกัน ดังนั้นจึงไม่ควรประมาทอย่างยิ่ง</p>\r\n\r\n<p>วิธีป้องกันและแก้ไข</p>\r\n    <br>1. ให้เปลี่ยนชื่อเล่นหรือนามสกุลออก(คงยากเพราะติดตลาดแล้ว)\r\n    <br>2. ถ้าทำข้อแรกไม่ได้ ให้หมั่นทำบุญกรวดน้ำและอย่าประมาท\r\n    <br>3. ถ้าทำข้อแรกและข้อสองไม่ได้ สิ่งที่พอจะลดพลังร้ายได้ คือ อย่าสะสมเลขอันตรายเข้ามาในชีวิตเพิ่มเด็ดขาด\r\n    <br>4. และให้ใช้เบอร์มือถือมงคลที่ช่วยคุ้มครองและเสริมเงินเสริมความโด่งดังให้ตัวเอง\r\n    <br>5. และให้ใช้ทะเบียนรถที่เน้นช่วยคุ้มครองและส่งเสริมความสำเร็จเป็นหลัก\r\n\r\n', NULL, NULL, 1, NULL, NULL, NULL),
(16, '2014-04-21 04:13:00', 'คุณนิน', NULL, 'ศาสตร์ตัวเลข กับใบเตย อาร์สยาม', 'https://2.bp.blogspot.com/-xNNOsVvZmdg/U1T8VdxE6TI/AAAAAAAAAh8/lRT6DFZNcZI/s1600/%E0%B9%83%E0%B8%9A%E0%B9%80%E0%B8%95%E0%B8%A2+(1).jpg', 'ใบเตย อาร์สยาม สาวสวยเสียงดีเซ็กซี่ สาวคนนี้โด่งดังและฉาว เธอประสบความสำเร็จอย่างสูงในหน้าที่การงานที่ทำ เป็นคนน่ารัก มีเสน่ห์', '\r\n<p>@@ศาสตร์ตัวเลข กับใบเตย อาร์สยาม @@</p>\r\n\r\n\r\n<p>ใบเตย อาร์สยาม สาวสวยเสียงดีเซ็กซี่ สาวคนนี้โด่งดังและฉาว เธอประสบความสำเร็จอย่างสูงในหน้าที่การงานที่ทำ เป็นคนน่ารัก มีเสน่ห์ มีชื่อเสียงโด่งดัง มีเงินมากมาย รวยเป็นร้อยล้าน มีคนมีผู้ใหญ่เมตตาเอ็นดูสนับสนุนให้งานให้โอกาส แต่……ด้วยกรรมกำหนดด้วยตัวเลขที่ตาม ชีวิตนี้แม้จะโชคดีมากมายแต่ก็อาภัพรัก ทำให้มากรัก จะมีคู่มากกว่าหนึ่งคน ซวยเพราะเพศตรงข้าม ฉาวเพราะเพศตรงข้าม มีแฟนกี่คนก็มักจะโดนนอกใจ หักหลังแม้จะสวยเซ็กซี่แต่ก็ไม่มีคนจริงใจรักจริงรักเดียว ชีวิตรักชีวิตครอบครัวไม่ปกติ มีเกณฑ์เลิกราบ้านแตก จะประสบอุบัติเหตุ และอาจถึงขั้นผ่าตัดได้ในที่สุด ชีวิตมักจะต้องถูกเบียนเบียนทั้งในงานและเงิน มีคนอิจฉาหวังร้ายจะทำลายเสมอ มีแต่คนไม่จริงใจหวังผลประโยชน์วิ่งเข้าหา</p>\r\n\r\n<p>“ใบเตย” สาวคนนี้เราเคยเอ่ยถึงบ่อย และใช้ยกเป็นเคสตัวอย่างบ่อย โดยเฉพาะถ้าใครที่ได้คุยกับเราแล้วมีรหัสตรงกับน้องเขาเราก็จะยกตัวอย่าง ลูกค้า VIP ของเรา เราก็ยกตัวอย่างให้ฟังบ่อยเพื่อให้เขามองภาพออก (ที่เรายกตัวอย่างเพราะเราชื่นชอบน้องเป็นพิเศษและลูกค้า VIP ของเราหลายท่าน เราก็เล่าเป็นเคสตัวอย่างให้ฟังบ่อยๆเล่าก่อนที่จะฉาว และหลังฉาวบ้างตอนคบกับ วี และมีเรื่องกับ กิ๊ก วี..วีรภาพ ซึ่งบางท่านก็มาแย้งมาแลกเปลี่ยนกับเราว่าที่น้องดังเพราะน้องไปเปลี่ยนเบอร์…....ถึงดังได้ขนาดนี้และความรักเขาก็สมหวังดี(พึ่งคบกับดีเจแมน)..........ตอนนั้นเรื่องในปัจจุบันมันยังไม่เกิดจะแย้งไปเขาจะหาว่าเราอคติและ....ได้.....เราจึงได้แต่บอกว่าแค่ชื่อสกุลน้องเขาก็ดังได้ มีเงินได้ รวยได้ แต่จะไม่สมหวังในรัก อาภัพ และจะมีแต่เรื่องฉาวเพราะผู้ชาย และ..จะเจ็บป่วยมีภัยอุบัติเหตุ จนสุดท้ายอาจถึงขั้นต้องผ่าตัด และถึงเขาจะเปลี่ยนเบอร์ไปแต่ถ้าชื่อสกุลไม่เปลี่ยนก็ยังเหมือนเดิมและเบอร์ที่เปลี่ยนก็ไม่รู้ว่าเบอร์อะไรถ้าใช้เลขไม่แรงไม่ถูกโฉลกก็ดับดาวช่วยลดปัญหาที่ตามติดในชื่อสกุลในดวงเขาไม่ได้ ช่วยให้ปัญหาบางเบาลงไม่ได้ ซึ่งในตอนนั้นเมื่อปัญหาในชีวิตของน้องเขามันยังไม่เกิด เราก็ได้แต่บอกให้ลูกค้าของเราคอยตามดูว่าต่อไปว่าชีวิตน้องเขาจะเป็นตามที่เราพูดหรือไม่......เพราะอนาตคมันจะพิสูจน์ได้เอง ซึ่ง.....นั่นคือข้อแย้งของเรา....</p>\r\n\r\n<p>เราพูดก่อนที่เรื่องฉาวๆของน้องในปัจจุบันจะออกมา ก่อนที่จะฉาวเพราะคุณทักษิณ ก่อนที่จะฉาวเพราะแฟนคนล่าสุดไปขอนอนด้วยกับสาวอื่น ก่อนที่จะฉาวเพราะมีนักร้องดาราคนนั้นคนนี้ไปเกาเหลาไปพาดพิงกับน้องเขา ก่อนที่น้องจะป่วยมีปัญหาที่มดลูกมีเลือดไหลไม่หยุด ก่อนที่จะล้มก้นกระแทก ก่อนที่ป้ายโฆษณาจะหล่นทับ</p>\r\n\r\n\r\n<p>------ดังนั้นหากน้องเขามีการเปลี่ยนเบอร์จริงก็แสดงให้เห็นแล้วว่า เบอร์ที่เปลี่ยนนั้นช่วยหยุดความฉาวความเจ็บ-ป่วย อาภัพรักไม่ได้ เพราะการเปลี่ยนตัวเลขเปลี่ยนเบอร์เราต้องตรวจพื้นดวงของเขาก่อนเสมอ เราจึงจะแก้ปัญหาเขาได้ถูกจุดนั่น จึงจะช่วยลดปัญหาตามตัวเลขตามดวง นั่นจึงจะช่วยลดวิบากกรรมให้เบาบางลงได้ หากน้องเขาไม่สามารถเปลี่ยนแปลงอะไรได้เลยจริงๆ\r\n\r\n<p>ในวันนี้เวลามันได้พิสูจน์แล้วว่าตัวเลขมีผลจริง มันแสดงผลแล้ว เรื่องฉาวของน้องเขาเกิดขึ้นแล้ว และฉาวจริงๆถึงขั้นนั่งร้องไห้ออกสื่อ ถึงขั้นมีคนมาด่าว่า มาแฉ เรื่องฉาวเรื่องร้ายมันเกิดติดต่อกันติดๆ ป่วยแล้ว เจ็บแล้ว ดังคำที่เราได้เคยบอกไว้ เราจึงจะเฉลยว่า ทำไมน้องถึงดังมีเงินและถึงมีชีวิตแบบนี้ มีความซวยแบบนี้ ตามมาดูกัน(เอาแค่ตัวเลขไม่ลงถึงพื้นดวงนะคะ)</p>\r\n\r\n\r\n\r\n<p>ชื่อเล่น : ใบเตย (62238=21)</p>\r\n\r\n    <br>ชื่อในวงการ : ใบเตย อาร์สยาม\r\n    <br>เลขศาสตร์   : 21+41*=62\r\n    <br>พลังเงา        : 47+82=129\r\n\r\n    <br>ชื่อจริง-นามสกุล : สุธีวัน ทวีสิน\r\n    <br>เลขศาสตร์          : 34+30=64*\r\n    <br>พลังเงา               : 65*+65*=130\r\n\r\n<p>พลังเงา มีเลข 65X2,64,41 ซึ่งน้องโชคดีมีเลข 65 ซึ่งมีพลังแรงแต่ก็แฝงพลังร้าย เลขนี้มันอยู่ในส่วนที่มีพลังมากผลจึงส่งเสริมให้โด่งดังมีชื่อเสียงได้อย่างยอดเยี่ยม แถมยังมีเสน่ห์ (อาจเจ้าชู้) มีเงิน รวย มีโอกาสดีๆวิ่งเข้าหามีคนอุปถัมภ์ดังไกลถึงต่างเมืองต่างแดนโดยเฉพาะงานที่ต้องใช้เสียง เพราะมีเลข 41,64 เสริมช่วยอีก อีกทั้งพื้นดวงเขาก็ดีช่วยตามส่งด้วย(งานที่ต้องใช้เสียงต้องใช้ 46 64 41)</p>\r\n\r\n<p>.......แต่....ใบเตย อาร์สยาม...น้องเขาก็โชคร้ายเพราะมีเลขเสียเยอะ ซึ่งทั้งในอดีต ปัจจุบัน หรืออนาคต ตัวเลขจะส่งผลต่อสุขภาพ ความรัก ความสัมพันธ์ ตลอดจนความปลอดภัยในชีวิตและทรัพย์สินด้วย เพราะน้องมีเลข  21 62,47,82,12**,29**,30**,13**,34** เลขเหล่านี้มีผลดีด้านเงิน ความสำเร็จที่รวดเร็วแต่ด้วยข้อเสียที่มีมากกว่าดี จึงทำให้ชีวิตน้องเป็นดังเช่นปัจจุบัน และอนาคตน้องต้องระวังตามตัวเลขคือให้ระวังจะมีอุบัติเหตุเล็กๆบ่อยและระวังอุบัติเหตุรุนแรงกะทันหัน ระวังไฟระวังระเบิดไว้ด้วย และจะมีปัญหาสุขภาพที่มดลูกที่ช่องท้อง ที่ขา ที่ปาก ฟัน ตา กระดูก ระบบประสาท เลือด ติดเชื้อ ต้องมีการผ่าตัดทั้งเสริมสวยและการเจ็บป่วย จะมีปัญหาความรัก อาภัพรักร้างลาหย่าร้าง คนรักนอกใจ ต้องมีคู่มากกว่าหนึ่งคน ถ้าแต่งงาน จะต้องแต่งงานมากกว่า 1 ครั้ง มีเรื่องมีราวทะเลาะเบาะแว้ง มีคดีความ โดนฟ้องหรือโดนจับ มีคนเกลียดชัง อิจฉากลั่นแกล้งใส่ร้ายป้ายสี มีการหักหลังคดโกง มีคนมาเบียดเบียนยักยอก มีคนปองร้าย ประมาณนี้ เรามาดูกันคะว่าน้องจะเจอกับอะไรบ้างในอนาคต</p>', NULL, NULL, 1, NULL, NULL, NULL),
(17, '2013-07-07 11:34:00', 'คุณนิน', NULL, 'ทำนายดวง คุณเสก โลโซ', 'https://ananya.in.th/views/assets/images/sak.jpg', 'วันนี้ขออนุญาตทำนายชะตาชีวิตของคุณเสกโลโซนะครับเพื่อเป็นวิทยาทานนะครับแบบคร่าวนะครับ', '<p>ชื่อสกุลที่ใช้ในการแสดง คือ เสก(10) โลโซ(21) ผลรวมเท่ากับ 31\r\n<p>คลาดเคลื่อนบ้างนิดหน่อยเพราะไม่รู้วันเดือนปีเกิด และไม่ได้ทำนายละเอียดครับ\r\n\r\n<p>คำทำนาย สรุป ทั้งชื่อจริง และชื่อที่ใช้ในการแสดง ภายในปี 2554- เดือน ธันวาคม 2555 คุณเสก ต้องใช้ความพยายามและอดทนเป็นอย่างสูงจะมีปัญหาส่งผลให้ชีวิตพบกับภาวะคับขันลำเค็ญอย่างสุดขีด ถูกศัตรูปองร้าย ถูกกลั่นแกล้ง ถูกอำนาจมืด คุกคาม ถูกทำร้ายโดยไม่ได้ตั้งใจ ชีวิตจะพบกับความผันผวนอย่างรุนแรง\r\nจะถูกปองร้ายจนถึงแก่ชีวิต หรือไม่ก็อาจเกิดอุบติเหตุหรือการเสียชีวิตผิดธรรมชาติ อันเนื่อง จากการแก้ไขปัญหาในหน้าที่การงานทุกกรณี ปัญหาครอบครัวก็จะเกิดจุดแตกหัก มักได้รับทุกข์จากกรรมเก่าที่มองไม่เห็น ถ้าผ่านไปได้ ชีวิตต้องประสบกับการเปลี่ยนแปลงตลอดเวลา ทำให้ชีวิตขึ้น ๆ ลง ๆ หาความแน่นอนไม่ได้ บั้นปลายชีวิตจะลำบากและตกต่ำ มีปัญหาเพราะบริวารให้โทษและเพราะการตัดสินใจของตัวเอง ต้องแก้ไขครับ</p>\r\n\r\n<p>ส่วนคำทำนายของชื่อ เสก (10) เลข 10 ทำให้เป็นคนมีความมั่นใจในตัวเองสูง มีความทะเยอทะยานดี ชอบของแปลกใหม่ ไม่ชอบซ้ำแบบใคร เป็นคนถือเกียรติ ไม่ชอบอยู่ใต้บังคับบัญชาของใคร ชอบทำอะไรที่แปลกแหวกแนวไม่ เหมือนใคร ไม่ค่อยนุ่มนวล กล้าได้กล้าเสีย ชีวิตมักมีอุปสรรค จับงานอะไรมักจะเจอคู่แข่ง มีคนปองร้าย บริวารมักให้โทษ เป็นคนอาภัพ มีศัตรูรอบด้าน บุคคลในครอบครัวมักจะแข็งข้อ ก่อเหตุกระทบกระเทือนใจมาให้ ชีวิตมักจะมีเรื่องระทมขมขื่นแอบแฝงอยู่ มีโรคภัยไข้เจ็บเบียดเบียนอย่างเรื้อรัง โดยเฉพาะโรคหัวใจทุกรูปแบบ\r\nที่สำคัญจะทำให้มีปัญหายุ่งยากภายในครอบครัวมีภาระต้องรับผิดชอบต่อ หน้าที่การงาน ต้องแบกภาระอันใหญ่หลวง ต่อไปบุคคลหมายเลขนี้ส่วนใหญ่ต้องแบกภาระหนี้สินอย่างมากมาย ต้องอยู่โดเดี่ยว หรือ มีคนมากหน้าหลายตาแต่ก็เหมือนไม่มีใครโดดเดี่ยวเดียวตาย พลัดพรากจากกัน มีศัตรูคอยกลั่นแกล้งเสมอ แม้จะประสบความสำเร็จอย่างสวยงามและแหวกแนว แม้จะได้รับการยอมรับและยกย่องจากสังคม แม้จะรุ่งโรจน์ มีลาภ ยศ สรรเสริญ และได้มาอย่างมากมาย แต่บทดวงตก ลาภยศก็สามารถสูญสิ้นได้ในพริบตา ชีวิตจะประสบความสำเร็จเร็จหรือล้มเหลวขึ้นอยู่กับการตัดสินใจของตนเอง ไม่ใช่สิ่งแวดล้อมพาไป สรุปคือทำตัวเองทั้งนั้น</p>\r\n\r\n<p>นามสกุล โลโซ (21) พลังแห่งการพลิกผัน สองบุคลิกตัวจริงแข็งกร้าวต่อหน้าอ่อนแออ่อนไหว อากัปกริยาที่แสดงออกภายนอก มักจะอำพรางความรู้สึกที่แท้จริงไว้ หยิ่งถือตัว เอาแต่ใจตนเอง เป็นคนเด็ดเดี่ยวกล้าตัดสินใจ โดยที่ผู้อื่นคาดคิดไม่ถึง จุดอ่อนแอคือ ชีวิตต้องระวังจุดแตกหักกลางคัน ทำให้เกิดมุมหักเหและตกจากตำแหน่งลาภยศได้ง่าย มักจะมีเรื่องที่ทำให้ตกอยู่ในความเศร้า ทุกข์ใจ ชีวิตสมรสไม่แน่นอน จะได้แต่งงานไม่น้อยกว่าหนึ่งครั้ง มักจะมีสิ่งที่ไม่คาดคิดที่เกิดขึ้นแบบฉับพลันเปลี่ยนรูปแบบ เป็นวิถีชีวิตให้เปลี่ยนไปในทางตรงกันข้าม บ่งถึงความไม่แน่นอนของชีวิตและอนาคต</p>\r\n\r\n<p>ผลรวมของ ชื่อ + นามสกุล เสก โลโซ ได้เลข 31 คำทำนายของ บุคคลที่อยู่ใต้อิทธิพลเลขนี้ชีวิตมักจะหักกลาง มักจะประสบเรื่องสะเทือนใจอย่างรุนแรงในชีวิต ถูกเพื่อนฝูงญาติมิตรดูถูกเหยียดหยาม ถูกสบประมาท ชีวิตมีเรื่องอื้อฉาว นอกใจกัน เพราะตัวเอง ความรักหักเหกลางคัน ชีวิตสมรสไม่แน่นอน มีเมียหลายคน มีปัญหาโรคภัยรุมเร้า อีกทั้งต้องระวังอยากมากเรื่องอุบัติเหตุรถคว่ำ ถูกอาวุธ ถูกคนลอบทำร้าย การผ่าตัด และจะมีปัญหาในการทำงานด้วย จะทำอะไรมักจะไม่ค่อยราบรื่นส่วนใหญ่จะมีอุปสรรคมาคอยขัดขวางอยู่เสมอ ระวังอาจจะเสียชีวิตผิดธรรมชาติ</p>\r\n\r\n\r\n<p>อิทธิพลของเลข 12 21 เป็นเลขของคนมีชื่อเสียงในสังคมประสบความสำเร็จดีมีเงินเหมือนอั้มแต่บั้นปลายจะแย่ลงกว่าเก่า แต่ในอีกแง่หนึ่งก็จะโชคร้ายเพราอิทธิพลของตัวเลข ถ้าพื้นดวงเกิดดี ก็เป็นอะไรไม่มาก  แต่ถ้าพื้นดวงเกิดไม่ดีแล้วยังมีตัวเลขไม่ดี ตัวเลขอัปมงคลเข้ามาพัวพันแล้ว ยิ่งซ้ำหนักเข้าไปอีกครับ ชีวิต !!</p>', NULL, NULL, 1, NULL, NULL, NULL),
(18, '2016-03-23 03:32:00', 'คุณนิน', NULL, 'เหตุการณ์ซ้ำรอยทะเบียนรถอันตราย', 'https://3.bp.blogspot.com/-Idss9H7mbCs/VuXtO-rxUvI/AAAAAAAAAvU/5MC--PFeNf0sgqiLSJIa50eDg8fnI-w-g/s640/1457859627-f3ccdd27d2000e3f9255a7e3e2c48800.jpg', 'เสียดายคนตายไม่ได้อ่าน เหตุการณ์ซ้ำรอยทะเบียนรถอันตราย \"3333\", 911', '<p>เสียดายคนตายไม่ได้อ่าน เหตุการณ์ซ้ำรอยทะเบียนรถอันตราย \"3333\", 911</p>\r\n<p>ความเหมือนของ 2 เหตุการณ์ที่น่าสยดสยองแม้เกิดต่างปี ในเคสนี้เมื่อเราได้อ่านข่าวแล้ว เราก็เสียใจ เสียดายชีวิต เสียดายโอกาส และก็อดแปลกใจไม่ได้ว่า...ทำไมคนรวยๆคนมีเงินถึงชอบเลขร้ายๆ ทำไมคนรวยๆคนมีเงินถึงชอบเลขสวยชอบเลขเรียงชอบเลขตองเลขโฟร์ชอบเลขเบิ้ล ทำไมคนรวยจึงชอบความเร็ว เขาไม่รู้หรือว่าเลขร้ายมันสวยมันเท่ห์แต่อันตรายมากแค่ไหน มันคุ้มกันแล้วเหรอกับเงินกับชีวิตที่ต้องแลกมาที่ต้องเสียไป น่าเสียดาย น่าสงสาร พูดมากไปเขาก็ไม่เชื่อ ไม่เห็นโลงศพไม่หลั่งน้ำ ใครจะเป็นรายต่อไป นี่คงเป็นชะตากรรมของเขา บุญให้รวยแต่กรรมให้เจ็บให้ตาย ฟ้าคงต้องการจัดสมดุล</p>\r\n\r\n<p>??เหตุการณ์ที่ 1 เกิดเมื่อวันที่ 13 เดือน มีนาคม 2559\r\n<p><br>ทะเบียนรถอันตราย ษง-3333 VS ฆย-6911\r\n    <br>ษง-3333 เลขเรียง 42-3333 อันตรายมากๆ\r\n    <br>ผลรวมเลขได้ 12 อันตราย\r\n    <br>ผลรวมหมวดได้ 18 อันตราย\r\n\r\n<p>ฆย-6911 เลขเรียง 38-6911 อันตรายมาก 911\r\n    <br>ผลรวมเลขได้ 17 อันตราย\r\n    <br>ผลรวมหมวดได้ 28 อันตราย\r\n\r\n<p>ผลคือรถพังยับคนเจ็บแถมคู่กรณีเสียชีวิต 2 ศพ ทะเบียนรถ ษง-3333 ทะเบียนซวย ทะเบียนร้าย นอกจากจะนำความวิบัติฉิบหายนำความเจ็บป่วยและความสูญเสียมาให้ผู้เป็นเจ้าของแล้ว ไม่พอ ทะเบียนนี้เขายังนำคดีความมาให้ผู้เป็นเจ้าของตรงเลขจริงๆดีที่ไม่เสียชีวิตไปด้วย และนอกจากนี้แล้วเลขร้ายเขายังเผื่อแผ่ความร้ายจนทำให้คนอื่นเจ็บตายไปด้วยถึง 2 ศพ ซึ่งคู่กรณี ก็มีเลขร้ายอันตรายไม่แพ้กันเลย ฆย-6911 น่าสงสารผู้ไม่รู้จริงๆ ดังรายละเอียดของข่าว</p>\r\n<p> เบนซ์ชนท้ายเก๋งติดแก๊ส! ไฟลุกคลอก2ศพดับคารถ | เดลินิวส์</p>\r\n <p> \"เมื่อวันที่ 13 มี.ค. พ.ต.ท.สมศักดิ์ พลพันขวาง พนักงานสอบสวน สภ.พระอินทร์ราชา จ.พระนครศรีอยุธยา รับแจ้งเหตุรถเบนซ์พุ่งชนท้ายรถเก๋งไฟลุกท่วม มีผู้เสียชีวิต และบาดเจ็บ บริเวณถนนพหลโยธินขาออกช่วงหลัก กม.ที่ 52-53 ใต้ต่างระดับบางปะอิน หมู่ 8 ต.เชียงรากน้อย อ.บางปะอิน จ.พระนครศรีอยุธยา นำกำลังไปตรวจสอบ พร้อมรถดับเพลิงเทศบาลตำบลพระอินทร์ราชา และมูลนิธิร่วมกตัญญู ที่เกิดเหตุพบรถเบนซ์ สีดำ ทะเบียน ษง 3333 กรุงเทพมหานคร หงายท้องล้อชี้ฟ้าด้านหน้าพังยับ ภายในรถพบผู้บาดเจ็บคือนายเจนภพ วีรพร อายุ 37 ปี ห่างไปประมาณ 500 เมตรมีรถเก๋งฟอร์ด สีเทา-ดำ ทะเบียน ฆย 6911 กท. ด้านท้ายถูกชนจนยุบ โดยเพลิงกำลังลุกลามเผาไหม้ตัวรถอย่างรวดเร็ว ชาวบ้านที่เห็นเหตุการณ์พยายามจะช่วยผู้บาดเจ็บออกจากซากรถ แต่ไม่สามารถช่วยได้ เจ้าหน้าที่มาถึงระดมฉีดน้ำสกัดไฟจนผ่านไป 20 นาที เพลิงสงบ โดยภายในรถเก๋งคันดังกล่าวมีศพชาย-หญิงไม่ทราบชื่อ อยู่ในข้างใน ทั้งนี้รถคันดังกล่าวภายในมีการติดตั้งถังแก๊สด้วย\"</p>\r\n\r\n\r\n<p>??เหตุการณ์ที่ 2 เกิดเมื่อวันที่ 27 เดือน เมษายน 2555 <br>\r\nทะเบียนรถ ษข-3333 VS กก-911 สังเกตุตัวเลข <br>\r\nษข-3333 เลขเรียง 42-3333 อันตรายมากๆ <br>\r\nผลรวมเลขได้ 12 อันตราย <br>\r\nผลรวมหมวดได้ 18 อันตราย</p>\r\n\r\n<p>กก-911 เลขเรียง 11-911 อันตรายมาก 911 <br>\r\nผลรวมเลขได้ 11 อันตราย <br>\r\nผลรวมหมวดได้ 13 อันตราย <br>\r\n<p>\r\nฎว-2188 เลขเรียง 56-2188 อันตรายมาก <br>\r\nผลรวมเลขได้ 19 อันตราย <br>\r\nผลรวมหมวดได้ 30 อันตราย <br>\r\nผลคือรถพังยับเยินเป็นเศษเหล็กจนมองแทบไม่ออกว่านั่นคือรถโดยเฉพาะทะเบียน 11-911  แต่เคสนี้ทั้งสองคนเสียชีวิตทั้งคู่แถมยังพ่วงเอาคันอื่นบาดเจ็บและเสียหายไปด้วยเช่นกันดังรายละเอียดของข่าว</p>\r\n\r\n<p>วันที่ 27 เม.ย. พ.ต.ท.ชัยวัฒน์ อินทร์เทศ พนักงานสอบสวน (สบ 2) งานศูนย์ควบคุมจราจรวิภาวดีรังสิต/ทางพิเศษ (สน.วิภาวดี) รับแจ้งเกิดอุบัติเหตุรถชนกันมีผู้ได้รับบาดเจ็บและเสียชีวิต บนโทลล์เวย์ขาออก ช่วงหน้าอาคารที่ทำการหนังสือพิมพ์เดลินิวส์ แขวงตลาดบางเขน เขตหลักสี่ จึงรีบรุดไปตรวจสอบพร้อมมูลนิธิป่อเต็กตึ๊งที่เกิดเหตุพบรถยนต์โตโยต้า ฟอร์จูนเนอร์ สีบรอนซ์เงิน ทะเบียนรถ ษข-3333 กรุงเทพมหานคร จอดอยู่ในสภาพถูกชนจากด้านหลังจนยุบเกือบถึงที่นั่งคนขับ มีผู้เสียชีวิตติดอยู่บริเวณที่นั่งคนขับ ทราบต่อมาชื่อ \"พ.ต.ศักดิภัทร ปทุมารักษ์\" บุตรชายนายชาญชัย ปทุมารักษ์ อดีตกรรมการบริหารพรรคไทยรักไทย และรมช.กระทรวงเกษตรและสหกรณ์ สภาพศพสวมเสื้อยืดคอกลมสีขาว กางเกงขาสั้นสีดำ มีบาดแผลกะโหลกเปิด คอหัก ใกล้กันพบรถเก๋งสปอร์ตยี่ห้อปอร์เช สีบรอนซ์เงิน ทะเบียนรถ กก-911 กรุงเทพมหานคร อยู่ในสภาพจอดขวางถนน มีร่องรอยการเฉี่ยวชนอย่างรุนแรงจนด้านหน้ารถพังยับเยิน มีผู้เสียชีวิตติดคาที่นั่งด้านคนขับ 1 ราย ทราบชื่อ\"นายไทฟ้า ชยวรประภา\" อายุ 54 ปี กรรมการผู้จัดการ บ.บัดดี้ กรุ๊ป จำกัด และเป็นเจ้าของโรงแรมบัดดี้ วิลเลจ ถนนข้าวสาร สภาพศพสวมเสื้อโปโลสีดำ กางเกงยีนส์ขายาวสีฟ้า คอหัก กระดูกแขนขาหักผิดรูป ถัดไปอีกประมาณ 10 เมตร พบรถเก๋งยี่ห้อมาสด้า 2 สีขาว ทะเบียนรถ ฎว-2188 กรุงเทพมหานคร ได้รับความเสียหายด้านหน้ามีร่องรอยการชน มีผู้บาดเจ็บ 1 ราย ทราบชื่อนายอำนาจ กลิ่นอยู่ อายุ 30 ปี เจ้าหน้าที่จึงรีบนำผู้บาดเจ็บส่ง รพ.วิภาวดี</p>\r\n\r\n<p>ความน่าสนใจของสองเคสการณ์นี้ คือ เลขกลุ่มเดิม ตัวเดิมๆ 33 VS 11 เราเข้าใจว่าเลข 1 กับ 3 เขาคือเลขศัตรูกันเจอกันเมื่อไหร่มักเป็นเรื่องเสมอ สุดท้ายต้องมีอันวิบัติฉิบหายในไม่ช้า แต่....ก็ไม่น่าจะเกิดเหตุการณ์ซ้ำรอยเดิมขนาดนี้ ที่น่าแปลกอีกอย่างจากประสบการณ์และสถิติ คือ คนที่ใช้เบอร์โทรศัพท์ หรือมีทะเบียนที่มีเลข 11,33,13,31 เยอะๆมักมีอุบัติเหตุร้ายแรงโดยต้องมีไฟและระเบิดหรือไม่ก็ปืนมาเกี่ยวข้องตลอดเลย น่าแปลกมาก อนาคตเราคอยว่าดูกันว่าจะมีการจับคู่ระหว่าง 3333 กับ 911 ท่านใด</p>\r\n<p>‪#‎สองภาพแรกคือเหตุการณ์ที่เกิดเมื่อปี‬ 2559 #ส่วนสองภาพข้างล่างคือเหตุการณ์เมื่อปี 2555</p>\r\n<p><br>http://www.dailynews.co.th/regional/385450\r\n    <br>http://www.thairath.co.th/content/256716</p>\r\n\r\n<img class=\"ui fluid image\" src=\"https://2.bp.blogspot.com/-Izzq0O4xbYU/VuXt7keyhcI/AAAAAAAAAvc/f7xJMCkb52g57xIAPtV_2m3OM3YOb-y2Q/s1600/NjpUs24nCQKx5e1D8WXhYBTQS6iT3EQRdGd69flA6It.jpg\" />\r\n<p>สภาพทะเบียนรถ ษง-3333 (พลิกว่ำ) ชนทะเบียนรถ ฆย -6911 (ไฟไหม้)</p>\r\n\r\n<img class=\"ui fluid image\" src=\"https://3.bp.blogspot.com/-2Joyx_PvFuc/VuXtR1uN4JI/AAAAAAAAAvY/tpulyyWVCEM1s-YmtEGiq1N5qVz4ECnJw/s400/1457858109_201603131500071-20041019163743.jpg\"/>\r\n<p>ทะเบียนรถ ษง-3333</p>\r\n\r\n<img class=\"ui fluid image\" src=\"https://3.bp.blogspot.com/-2Joyx_PvFuc/VuXtR1uN4JI/AAAAAAAAAvY/tpulyyWVCEM1s-YmtEGiq1N5qVz4ECnJw/s400/1457858109_201603131500071-20041019163743.jpg\"/>\r\n<p>ทะเบียนรถ ฆย-6911</p>\r\n\r\n\r\n<p>สภาพทะเบียนรถ ษข-3333 กับทะเบียนรถ กก-911 และฎว-2188</p>\r\n\r\n<img class=\"ui fluid image\" src=\"https://2.bp.blogspot.com/-9L1X8bYVpyc/VuXqxlfwySI/AAAAAAAAAu4/ciUJSQo76K0tckBIVDbrBYyJPjHEceQEA/s320/13359563971335956611l.jpg\"/>\r\n\r\n<img class=\"ui fluid image\" src=\"https://2.bp.blogspot.com/-zRSyCsEZQgM/VuXq12kOn9I/AAAAAAAAAu8/BJRs81Ej22MoIAiQduwLhibj5EX8IwfAw/s320/174701.jpg\"/>\r\n\r\n<img class=\"ui fluid image\" src=\"https://3.bp.blogspot.com/-yhuZ6k0N-TE/VuXq4BCv0WI/AAAAAAAAAvA/MU0I-9lX4AoLGHxMT-FbXdBvJZc4va0xg/s320/256.jpg.pagespeed.ce.AKsLl_sZXz.jpg\"/>\r\n\r\n<img class=\"ui fluid image\" src=\"https://3.bp.blogspot.com/-1X81r34zNPc/VuXrAv2rydI/AAAAAAAAAvE/zj7m3XY0cIUC0qp_wFGYgdz2NBCIyqlSA/s320/18-12-2555%2B4-48-20.png\"/>\r\n\r\n', NULL, NULL, NULL, 1, NULL, NULL),
(20, '2013-02-12 07:25:00', 'คุณนิน', NULL, 'คำถามที่พบบ่อย ภาพทะเบียนมรณะ ปัญหาทำให้ก่อปัญญา', 'https://3.bp.blogspot.com/-8KmPy4l4PHk/UN6SCUhfWlI/AAAAAAAAAMs/gLeQzKFg-AA/s640/aaaaa.png', 'ทะเบียนรถมงคล ดีจริงหรือ? เบอร์โทรศัพท์มงคลดีจริงหรือ? ชื่อสกุลมงคลดีจริงหรือ บ้านเลขที่มงคลดีจริงหรือ', '<p>ถาม : ทะเบียนรถมงคล ดีจริงหรือ? เบอร์โทรศัพท์มงคลดีจริงหรือ? ชื่อสกุลมงคลดีจริงหรือ บ้านเลขที่มงคลดีจริงหรือ ถ้าเปลี่ยนแล้วจะดีขึ้นจริงหรือ ถ้าไม่เปลี่ยนแล้วจะเป็นยังไง จะเลวร้ายขนาดนั้นเลยหรือ ?</p>\r\n\r\n<p>ตอบ : เจอคำถามแบบนี้ก็ อืม ตอบยังไงดี เอาเป็นว่า คุณยังไม่ต้องเชื่อครับ แต่ให้คุณลองศึกษาหาดูเคสตัวอย่างได้ตามหน้าหนังสือพิมพ์ ข่าววิทยุโทรทัศน์ หรือ แม้กระทั่งตัวคุณเองชีวิตในประจำวันคุณ เพื่อนบ้านคุณ พ่อแม่พี่น้องของคุณได้(เลขมงคลหาดูตัวอย่างยากแต่ เลขมรณะมีตัวอย่างเพียบ) หรือจะดูจากภาพที่ผมจะเอาให้ดู หรือที่ผมเคยโพสไว้ก็ได้ครับ</p>\r\n\r\n<p>ครับจากคำถามดังกล่าว ในบทความนี้เราจึงถือโอกาสเอาภาพอุบัติเหตุรถยนต์มาให้ดู แต่เคสเบอร์โทรมงคล ชื่อสกุลมงคล ทะเบียนรถมงคล ต้องดูจาก Review Feedbackจากลูกค้าเบอร์มงคลที่โพสให้ดูนะครับ และเดี๋ยวผมจะมา up ให้ดูครับ เสียดายที่ลูกค้าส่วนใหญ่เขาไม่ค่อยอยากเปิดเผยตัวตน บางคนบางท่านก็ชอบโทรมาแชร์มากกว่าเพราะกลัวเพื่อนกลัวญาติหาว่างมงาย ที่เปลี่ยนเกือบทั้งหมด และบางคนก็มีทั้งโดนและกลัวเพื่อนและคนใกล้ชิดถามว่าทำไมซื้อเบอร์โทรแพงขนาดนั้น ดังนั้นถ้าผมเอามาเล่าต่อ มันก็ไม่น่าเชื่อถือเพราะไม่มีหลักฐาน ดังนั้นก็พยายามเอาเท่าที่มีที่เขาแชร์ในข้อความให้ มาให้ชมละกันครับ เดี๋ยวจะ Up ขึ้นเรื่อยๆครับ สำหรับ Review Feedbackจากลูกค้าในเคสต่างๆ</p>\r\n\r\n\r\n<p>ถาม : ส่วนภาพที่ผมเอามาให้ชมกันวันนี้ มีสองภาพครับ ซึ่งจะไม่เน้นเบอร์ตอง เพราะโดนบางท่านบางคนมักถามและมักพูดว่าทำไม เน้นและเจาะจงเคสเลขทะเบียนรถตองจัง เช่น 1111,3333,8888,9999ฯล</p>\r\n\r\n<p>ตอบ : ที่เน้นเพราะมันอันตรายไม่อยากให้เสี่ยงและเพราะมันมีภาพข่าวให้ดู ที่สำคัญคนรวยๆเขานิยมกันจัง กลัวว่าคนอย่างเราๆท่านๆจะนิยมผิดๆไปกับเขาด้วย และบางคนก็หาว่าเราเจาะจงเอาตัวเลขทะเบียนรถบางตัวรึเปล่า ครับครั้งนี้ เราเลยเอาเคสเลขทะเบียนรถที่มีเลขอันตรายอื่นๆเอามาให้ดูชมกัน(2 ภาพจะจะ) เพื่อเตือนตนเตือนท่านด้วยความหวังดี ไม่มีอคติครับ แต่เชื่อไหมครับว่าเลขทะเบียนรถอันตรายที่ทำให้มีผู้ประสบเหตุนั้น เยอะมาก นี้เพียงบางส่วนเท่านั้น โดยเราจะเลือกเอาเหตุที่มีภาพประกอบที่ทะเบียนรถยังติดให้เห็นอยู่ และเลือกภาพที่ไม่มีศพผู้เสียชีวิตติดอยู่ เพื่อเป็นการให้เกียรติผู้สูญเสียและป้องกันภาพไม่เหมาะสมนะครับ</p>\r\n\r\nย<p>ังไงขอฝากข้อคิดไว้นิดหนึ่งนะครับว่า  เรา คือ มิตร หน้าที่ คือมาเตือน มาเสนอข้อมูลให้ได้ดูได้ศึกษากัน ถามว่ามีผลประโยชน์ไหม มีครับตอบตามตรง แต่ทั้งคุณและผมต่างก็มีผลประโยชน์ด้วยกันทั้งสิ้นและผมมีจิตที่หวังดี ถ้าคุณไม่เชื่อไม่เปลี่ยนแปลง ผมไม่ว่า แต่ขอจงอย่าประมาท และหมั่นทำบุญทำทานกรวดน้ำแผ่เมตตาเท่านั้น เพื่อให้บุญคุ้มตัว ผมหวังเป็นแค่ลมบางเบาที่ช่วยสะกิดให้คุณหันหลังมามองบ้างซักนิด เผื่อได้เห็นอะไรดีๆที่แม้คุณไม่เชื่อไม่สนใจแต่คุณคงจะสะกิดใจบ้างและระมัดระวังมากขึ้นครับ</p>\r\n\r\n<p>--------------------------------------------------------------------------------------------------------------------------------</p>\r\n<p>ข้อความฝากถึงผู้บริโภค (ลูกค้า) และผู้กำลังสนใจศึกษาศาสตร์ต่างๆ</p>\r\n\r\n<p>ครั้งนี้ผมขอถือโอกาสฝากถึงผู้ที่กำลังอ่านและกำลังศึกษาศาสตร์ของตัวเลขว่า ศาสตร์ทุกศาสตร์ล้วนมีคุณประโยชน์ และมีความเชื่อมโยงพึ่งพิงกัน น้ำพึ่งเรือ เสือพึ่งป่าครับ(เลขศาสตร์ก็ต้องพึ่งโหราศาสตร์ โหราศาสตร์ก็ต้องพึ่งเลขศาสตร์ ) ไม่มีศาสตร์ใดผิดศาสตร์ใดถูก เพราะผมเองใช้ทุกศาสตร์ พร้อมทีจะเรียนรู้ศาสตร์ดีๆ ไม่เคยหลบหลู่ศาสตร์ใดๆ หากว่าทุกฝ่ายทุกคนทุกท่านที่ใช้ศาสตร์และมีความเชื่อแตกต่างกันไป ล้วนใช้ศาสตร์ที่ตัวเองได้ศึกษามาดีแล้ว และมั่นใจว่าวิชาของตัวนั้นดีแล้ว รู้ลึกรู้จริงแล้ว</p>\r\n\r\n<p>ขอจงเชื่อและทำดีต่อไปเพื่อสร้างคุณประโยชน์ให้แก่คน แก่เพื่อนมนุษย์ แก่โลกเถิด ท่านไม่มีความจำเป็นใดต้องไป ปรามาสบาดหมางกัน เป็นศัตรูกัน ทะเลาะกันเลย เราคือเพื่อน คือ มิตร คือ คนที่อยู่ร่วมชะตากรรมบนโลกนี้ ที่ต่างต้องเวียนว่ายในวัฏสงสารทั้งสิ้น ไม่มีใครหนีความป่วย ความเจ็บ ความตาย พ้นไม่ว่าจะเก่งจะดีแค่ไหน ไม่มีใครอยู่ค้ำฟ้าครับ เราน่าจะรักกันไว้ไม่ดีกว่าหรือ ส่วนตัวตนของใครจะดีจะชั่ว ใครจะถูกจะผิดอย่างไร นั่นปล่อยให้เป็นกรรมของแต่ละคน น่าจะดีกว่าไหม ศาสตร์ใครจะดีกว่ากัน อย่าไปเถียงกันเลยครับ ทำดีได้ดี ทำชั่วได้ชั่ว ปล่อยให้เป็นไปตามเวรตามกรรมของแต่ละคนเถิด มีความจำเป็นอะไรที่เราต้องไปสร้างกรรมต่อกัน หากในเมื่อเรายังไม่ได้ศึกษาศาสตร์ของกันและกันให้ดี ให้ถ่องแท้เลยว่าเป็นอย่างไร ก็อย่าพึ่งไปเบียนเบียนกันเลย (ความอัดอั้นตันใจที่เห็นหลายท่านหลายคนมักเบียนเบียนกันเพราะศาสตร์เพราะความเห็นไม่ตรงกัน และมักโดนลูกค้าถามบ่อยเรื่องศาสตร์นั้นดีไหม ยังไง.....)</p>\r\n\r\n<p>อยากให้คิดอย่างนี้ครับ ทั้งผู้ใช้ศาสตร์และผู้บริโภค(ลูกค้า) ศาสตร์แต่ละศาสตร์เปรียบก็เหมือน ทาง หรือ ถนน หรือประตูบ้าน ยกตัวอย่าง ถ้าเราจะเข้ากรุงเทพ มันก็มีเส้นทางให้เดินทางไปได้หลายทาง อาจต่างกันที่รายละเอียดปลีกย่อย เช่น ระยะทางใกล้ หรือไกล ต่างกัน และหรือ บางเส้นทางอาจจะคดเคี้ยว บางเส้นทางอาจจะมีหลุมโคลน บางเส้นทางอาจจะลาดยางมะตอย หรือ เป็นกรวด เป็นต้น แต่ไม่ว่าจะเลือกทางใดก็ใช่ว่าจะผิด หรือถูก เพราะสุดท้ายมันก็ไปถึงกรุงเทพได้ทุกทาง เป็นต้น ผมสรุปว่าไม่มีอะไรในโลกนี้ที่สมบูรณ์แบบครับ</p>\r\n\r\n<p>หรือ ถ้าคุณยังไม่เข้าใจที่ผมต้องการจะสื่อ อืม คืออย่างนี้ครับ เรื่องนี้ผมจะเปรียบการใช้ศาสตร์ตัวเลข(หลายศาสตร์) โหราศาสตร์ และศาสตร์อื่นๆ ในการแก้ไขปัญหาชะตาชีวิต ใช้ทำนายทายทักชะตาชีวิตของคุณ เปรียบก็เหมือน ..................สมมุติว่ามีเหตุไฟไหม้เกิดขึ้นที่บ้านหลังหนึ่ง แล้วเราต้องการเข้าไปช่วยคนในบ้านให้รอดและตัวเราเองก็ต้องรอดปลอดภัยและพาคนในบ้านออกมาได้อย่างปลอดภัยเช่นกัน  ศาสตร์แต่ละศาสตร์นั่นก็คือ ทางเลือกไม่ว่าจะเป็น โหราศาสตร์ เลขศาสตร์ ฮวงจุ้ย โหวงเฮ้ง ฯล เปรียบให้เข้าใจง่ายๆ มันก็เหมือนกับทางเข้าบ้านครับ มันมีหลายทาง มีหลายประตู จะเข้าประตูหน้า ประตูหลัง ประตูข้าง หรือปีนข้ามรั้ว ก็ได้เพื่อจะเข้าให้ถึงตัวบ้านและบางครั้งการที่จะพาเขารอดได้ก็ใช่ว่าจะต้องออกทางเดิมได้ตลอด บางคนตัวอ้วนจะให้ปีนข้ามรั้วก็ไม่ได้ บางทีประตูหน้ามันไกลเราก็อาจจะพาเขาออกไปประตูข้างก็ได้  ผมเปรียบแบบนี้ครับ ซึ่งอาจจะผิดก็ได้ แต่ผมขออนุญาติชี้แจง ครับ</p>\r\n\r\n<p>สรุปว่า ศาสตร์ทุกศาสตร์ล้วนมีคุณประโยชน์และดีทั้งสิ้น ในส่วนของผู้ใช้ศาสตร์ถ้าเราคิดว่าเราทำดีแล้วก็จงอย่าไปเบียนเบียนกันเลยครับ ต่างคนต่างทำหน้าที่ของตัวเองให้ดีที่สุดดีกว่า แล้วต่างก็จะมีความสุข ส่วนลูกค้าหรือผู้บริโภค ถ้าเชื่อถือศาสตร์ใด ชอบครูบาอาจารย์ท่านใด ชอบหมอดูคนไหน ก็เลือกไปเถอะครับ เมื่อเลือกแล้วก็ไม่ควรไปถามอาจารย์ฝั่งโน้นว่าทำไมอาจารย์ฝั่งนั่นเขาคิดแบบนี้แบบนั้นทำไมไม่เหมือนกัน ใครดีกว่ากัน ทำไมไม่เหมือนกัน ^^ อืม ถามบ่อยๆเข้า  ยุ่งเลยทีนี้ยังไงก็ขอฝากไว้ด้วยนะครับ ^^</p>\r\n\r\n<img class=\"ui fluid image\" src=\"https://1.bp.blogspot.com/-8YbB2qHWheE/UN6py9R7z8I/AAAAAAAAANI/1K_pQEX7M4s/s640/1c55d788a4c16f63bcca228662ee1c82bb211f3a.jpg\"/>\r\n\r\n<img class=\"ui fluid image\" src=\"https://3.bp.blogspot.com/-8KmPy4l4PHk/UN6SCUhfWlI/AAAAAAAAAMs/gLeQzKFg-AA/s640/aaaaa.png\"/>\r\n\r\n<img class=\"ui fluid image\" src=\"https://1.bp.blogspot.com/-fxwNQhakFF0/UN6ST8RMTsI/AAAAAAAAAM0/lmq14oZoEFI/s640/28-7-2555+3-12-28.png\"/>', NULL, NULL, NULL, 1, NULL, NULL),
(21, '2013-07-07 11:54:00', 'คุณนิน', NULL, 'บ้านเลขที่อันตราย 333 หมู่ 4', 'https://www.ananya.in.th/views/assets/images/home.jpg', 'ตัวอย่าง บ้านเลขที่อันตราย 333 หมู่ 4 ใครว่าบ้านเลขที่ไม่สำคัญ ดูตัวอย่างจากในข่าวเลยครับ', '<p>ตัวอย่าง บ้านเลขที่อันตราย 333 หมู่ 4 ใครว่าบ้านเลขที่ไม่สำคัญ ดูตัวอย่างจากในข่าวเลยครับ</p>\r\n\r\n\r\n<p>บ้านเลขที่ 333 หมู่ 4 (เลขของไฟเลของอารมณ์) คิดดูขนาดเจ้าพ่อที่ชอบศาสตร์ทางศิริมงคล เช่น การแก้ฮวงจุ้ยฯ ยังพลาดเพราะนึกไม่ถึงว่าตัวเลขมันจะเกี่ยวกันได้ อิทธิพลเลข 33 33 34 (เลขของเงินเลขของอารมย์เลขของอุบัติเหตุฉับพลันและเลขของไฟครับ ระวัง)</p>\r\n\r\n\r\n\r\n<p><div class=\"card\">ไฟไหม้บ้านไม้สักตากอากาศหรู “ปัญญา นิรันดร์กุล” ที่เขาใหญ่ปากช่อง เสียหายหลายสิบล้านซึ่งบ้านหลังนี้ใช้เป็นที่ถ่ายทำรายการด้วย คนเฝ้าบ้านพร้อมครอบครัวหนีตายเอาชีวิตรอด</div></p>\r\n\r\nเมื่อเวลา 01.30 น.วันนี้ (18 เม.ย.) พ.ต.ต.นพพร  ปราชญ์กระโทก  พงส.สภ.หมูสี ต.หมูสี อ.ปากช่อง จ.นครราชสีมา รับแจ้งเหตุเพลิงไหม้บ้านพักตากอากาศเจ้าของรายการทีวีชื่อดัง นายปัญญา นิรันดร์กุล เจ้าของบริษัทเวิร์คพอยท์ จำกัด เลขที่ 333 หมู่ที่ 4 บ้านกุดคล้า หมู่บ้านมูนแดนซ์ เขาใหญ่ เรสสิเดนซ์  ริมถนนสายปากช่อง-เขาใหญ่(ถนนธนะรัชต์) กม.20 ต.หมูสี ใกล้อุทยานแห่งชาติเขาใหญ่  จึงพร้อมด้วย พ.ต.อ.ธนา  เคหะเจริญ ผกก.สภ.หมูสี และประสานขอรถดับเพลิงจากเทศบาลตำบลหมูสี 2 คัน และเทศบาลเมืองปากช่องไปที่เกิดเหตุ</p>\r\n\r\n<p>พบไฟกำลังโหมลุกไหม้โครงหลังคาไม้สักบนชั้น 2 ของบ้านพักหลังใหญ่ขนาด 2 ชั้น  ปลูกในพื้นที่ 5 ไร่ มีสนามหญ้า สระน้ำขนาดเล็กส่วนพื้นที่ด้านหลังติดบ้านพักตากอากาศของผู้มีฐานะอีกหลายหลัง  เนื่องจากชั้นบนเป็นไม้สักจึงเป็นเชื้อไฟอย่างดียากต่อการดับไฟทำให้เสียหายทั้งหมด ส่วนชั้นล่างเป็นคอนกรีตจึงเสียหายเพียงเล็กน้อย  กว่าเพลิงจะสงบใช้เวลากว่า 2 ชม.คาดเสียหายนับสิบล้านบาท</p>\r\n\r\n<p>สอบสวนนายอาคม  สมโชค อายุ 39 ปี  คนเฝ้าบ้าน  ให้การหน้าซีดเซียวว่า มารับจ้างทำงานและเฝ้าบ้านให้นายปัญญา  มานานกว่า 3 ปี โดยตนพร้อมน.ส.สาลินี  พาหา อายุ 38 ปี ภรรยา พร้อมบุตรชายอีก 2 คน  นอนพักในห้องพักชั้นล่าง ชั้นบนไม่มีใครอยู่  ตั้งแต่ช่วงหัวค่ำก็นอนเปิดพัดลม มารู้สึกตัวอีกทีว่าร้อนเพราะพัดลมดับ หยุดหมุน จึงกดสวิทซ์อีกก็ไม่หมุน  จากนั้นได้ยินเสียงดังโป๊ะ อยู่ด้านนอกและมีเสียงหมาเห่า จึงออกมาดูนอกบ้าน พบไฟกำลังลุกไหม้บนชั้น  จึงรีบตะโกนเรียกภรรยาและบุตรชาย รีบออกมาจากบ้านโดยเร็ว  พร้อมโทรศัพท์แจ้งตำรวจ สภ.หมูสี ก่อนโทรศัพท์แจ้งนายจ้างให้ทราบ  เนื่องจากภายในบ้านมีของมีค่าจำนวนมากรวมทั้งใช้เป็นที่ถ่ายทำรายการต่างๆด้วย  ต้องเข้าไปตรวจสอบว่าเสียหายไปด้วยหรือไม่</p>\r\n\r\n<p>พ.ต.อ.ธนา  กล่าวว่าจะแจ้งตำรวจกองวิทยาการมาตรวจสอบสาเหตุที่แท้จริงอีกครั้งว่าจากเหตุเพลิงไหม้ดังกล่าว  หรือเกิดจากอะไร  แต่เบื้องต้นคาดไฟฟ้าลัดวงจรและห้ามไม่ให้ใครเข้าไปในที่เกิดเหตุแล้ว</p>\r\n<p>ที่มา: http://www.dailynews.co.th/thailand/22875</p>', NULL, NULL, NULL, NULL, 1, NULL);
