(22, '2012-08-13 03:44:00', 'คุณนิน', NULL, 'เบอร์สวย ไม่ใช่เบอร์ดีมีมงคล ด้วยความเป็นห่วงและเคารพครับพี่ๆน้องๆ', 'https://www.ananya.in.th/views/assets/images/mongkol.jpg', 'ด้วยความเป็นห่วงและเคารพครับพี่ๆน้องๆ ก่อนจะเปลี่ยนเบอร์โทรศัพท์ ขอให้ท่านคำนึงว่า เบอร์สวย เบอร์ดี เบอร์มงคลนั้น', '<p>ด้วยความเป็นห่วงและเคารพครับพี่ๆน้องๆ ก่อนจะเปลี่ยน<b>เบอร์โทรศัพท์</b> ขอให้ท่านคำนึงว่า <b>เบอร์สวย เบอร์ดี เบอร์มงคล</b>นั้น ต้องประกอบด้วยขั้นตอนการวิเคราะห์ห้าขั้นตอนเท่านั้น และการวิเคราะห์นั้นต้องวิเคราะห์ตามศาสตร์ของตัวเลขและหลักภูมิศาสตร์ด้วยถึงจะเรียกว่าเบอร์ดี เบอร์มงคล</p>\r\n\r\n<p>ท่านควรคำนึงว่าความหมายของตัวเลขนั้นไม่เคยเปลี่ยนแปลง แต่จะเปลี่ยนอิทธิพล เช่น ทำไมเลข 7 ถึงเป็นเลขมงคลของฝรั่งทั้งที่มันเป็นเลขร้ายของไทย ทำไมจีนถึงชอบเลข 8 ทำไมไม่ชอบเหมือนฝรั่ง หลายคนไม่ทราบว่า คนไทยที่ตั้งหลักปักฐานในประเทศไทยนั้น เลขที่เป็นมงคลนั้นคือเลข 9 ไม่ใช่เลข 8 แต่อย่างใด เลขมงคลของไทยคือเลข 9 เลข 6 เราเป็นคนไทยบ้านอยู่ประเทศไทย ต้องใช้พื้นดวงของไทยครับถึงจะถูก ถ้าไม่เชื่อก็ลองสังเกตเลขทะเบียนรถที่ลงท้ายด้วย 88 ตามหน้าหนังสือพิมพ์บ้านเรารับ มีบ่อย มันไม่ใช่เหตุบังเอิญครับ จะว่าเฮงมันก็เฮงแต่มันชีวิตมันวุ่นวายและสุดท้ายตายโหง เอาไหมครับ ทีนี้เรามาดูความหมายของเลขทั้งสิบตัวว่าตัวไหนดี ร้าย ยังไง</p>\r\n\r\n<p><b>เลข 1  ดาวบาป</b> ให้ผลในทางร้อนแรง เที่ยงตรง เร่งรีบ ไม่ยอมใคร อยู่ที่ไหนไม่นาน ตรงไปตรงมา ไม่เกรงใจใคร ได้แก่พวกมียศ มีตำแหน่ง พระราชา เชื้อพระวงค์ ข้าราชการ งานของผู้ชาย ของมีแสงสว่างสดใส การสูบฉีดโลหิตในร่างกาย ความดัน สายตา หัวใจ ไขสันหลัง ระบบเลือด ของสีแดง</p>\r\n\r\n<p><b>เลข 2 ธาตุดิน</b> เป็นดาวบุญ ให้ผลในทางดี อ่อนหวานนุ่มนวล ความไม่แน่นอน เป็นไปอย่างช้าๆ ลึกลับ ยั่วยวน มารยา มืดมน เอาอกเอาใจ ได้แก่ ราชินี ผู้นำหญิง นางพยาบาล ท่าเรือ ท่าน้ำ การบริการ ระบบน้ำในร่างกาย ต่อม ไต ตับ ของที่เป็นคู่ ตา หู จมูก มือ เท้า แขน ขา อวัยวะเพศหญิง ของสีขาว สีนวล</p>\r\n\r\n<p><b>เลข 3 เป็นธาตุลม</b> เป็นดาวบาปเคราะห์ ให้ผลในเรื่องสงคราม การต่อสู้ ได้แก่บุคคลในเครื่องแบบ ผู้คอยรับคำสั่ง นักฆ่า ทหาร ตำรวจ หน่วยกู้ภัย มือสังหาร ช่าง หมอ พยาบาล อาวุธ เครื่องมือต่างๆ ยานพาหนะ อวัยวะเพศชาย เอ็น กล้ามเนื้อ จมูก ความกล้าหาญ ความขยัน ของสีชมพู</p>\r\n\r\n<p><b>เลข 4 เป็นดาวบุญ</b> ให้ผลในการค้าขาย การเจรจาติดต่อสื่อสาร ได้แก่ผู้สื่อข่าว นักพูด พิธีกร อาหารการกิน เสื้อผ้า ผัก ผลไม้ ระบบย่อยอาหาร ลำไส้ การวางแผน สัญญา โรงพิมพ์ ที่ทำการไปรษณีย์ ต้นไม้ ใบไม้ ดอกไม้ ของสีเขียว</p>\r\n\r\n<p><b>เลข 5 ธาตุดิน</b> เป็นดาวบุญ ให้ผลในด้านการศึกษา ศาสนา ได้แก่ พระ ครู ผู้พิพากษา หมอ วัด โรงเรียน โรงพยาบาล ศาล สิ่งศักดิ์สิทธิ์ ตำรา วิชาการ เครื่องรางของคลัง วิญญาณ ประสาทสัมผัส หู ปัญญา ความคด ศีลธรรม ความซื่อสัตย์ ความรับผิดชอบ</p>\r\n\r\n<p><b>เลข 6 ธาตุน้ำ </b>เป็นดาวบุญ ให้ผลด้านการเงิน ความรัก ที่หลับที่นอน ความสนุกสนาน ความสมหวัง ความงาม ได้แก่คุณหญิงคุณนาย นักแสดง นักดนตรี นักรัก นักร้อง ช่างเสริมสวย ของหอม ของสวยงาม เครื่องเพศหญิง มดลูก ต่อมอัณฑะ ช่องท้อง หน้าท้อง</p>\r\n\r\n<p><b>เลข 7 ธาตุ ไฟ</b> เป็นดาวบาป ให้ผลด้านเกษตรกรรม กสิกรรม ความรกรุงรัง ของเหม็น สกปรก ไม่สะอาด ความเจ็บปวด ทุกข์ทรมาน ดำ มืด ต่ำ พิการ ไม่สมประกอบ รองเท้า ผ้าเช็ดตัว ยางรถยนต์ กระดูก เสา หลัก ของหนักๆ ใหญ่ๆ ที่เปลี่ยว ที่ห่างไกล</p>\r\n\r\n<p><b>เลข 8  ประมุขของเหล่าพาล</b> นักเลงทุกชนิด โมหจริต ความมัวเมา ความเสเพล ดาวแห่งการเสี่ยงโชคและโชคลาภ โหราศาสตร์ มัวเมาอบายมุข ไม่เกรงกลัวใคร ไม่รู้จักอาย ไม่เกรงใจใคร มุทะลุ ลืมสติ เห็นผิดเป็นชอบ มีเล่ห์เหลี่ยม กล้าได้กล้าเสีย ชอบของมึนเมา</p>\r\n\r\n<p><b>เลข 9  ก้าวหน้ารุ่งเรือง </b>เงินอยู่ติดตัว อายุยืน สุขภาพดี ญาณ การหยั่งรู้ ต่างประเทศ มรดก โหราศาสตร์ นักบวช สถานที่ศักดิ์สิทธิ์ คนทรงเจ้า การมีอายุยืน</p>\r\n\r\n<p><b>เลข 0  เลขมฤตยู </b>หมายถึง นักวิทยาศาสตร์ คนหัวสมัยใหม่ มีความคิดริเริ่มสร้างสรรค์อยู่เสมอ ไม่ชอบย่ำเท้าอยู่กับที่ เป็นนักปฏิวัติ ทำอะไรแปลกจากคนอื่น มีญาณพิเศษ สามารถทำนายเหตุการณ์ล่วงหน้าได้ นอกจากนี้ดาวมฤตยูยังหมายถึง สิ่งเร้นลับ และการเดินทางไปต่างประเทศ</p>\r\n\r\n<p><b>เลขที่ควรใช้ คือ 2 4 5 6 9 เท่านั้นครับ</b></p>', NULL, NULL, NULL, NULL, 1, 1),
(23, '2013-07-30 02:50:00', 'คุณนิน', NULL, 'ทะเบียนรถอันตรายกรณี เลข 11 18,81 มีพร้อมทุกอย่าง แต่เมื่อถึงวาระกรรม', 'https://4.bp.blogspot.com/-Q4PSXs9SrMY/UBb4C9KwdoI/AAAAAAAAAD0/-um6lGdnI1Q/s640/31-7-2555+4-07-11.jpg', 'จากข่าวรถคันแรก   ทะเบียน 810263(81 10 02 26 63) ผลรวมได้ 21 \r\nและทะเบียนรถคันที่สอง ทะเบียน 4118 (41 11 18)ผลรวมได้ 14 \r\nคันแรกทะเบียนไม่ดีครับ เดี๋ยวก็เจออีก ในเรื่องอุบัติเหตุ แต่เลขท้ายเขายังดีมีเลข 9 คุ้มครอง', '\r\n<img class=\"ui fluid image\" src=\"https://4.bp.blogspot.com/-Q4PSXs9SrMY/UBb4C9KwdoI/AAAAAAAAAD0/-um6lGdnI1Q/s640/31-7-2555+4-07-11.jpg\"/>\r\n\r\n<p>จากข่าวรถคันแรก   ทะเบียน <b>810263(81 10 02 26 63) ผลรวมได้ 21</b></p>\r\n<p>และทะเบียนรถคันที่สอง ทะเบียน <b>4118 (41 11 18)ผลรวมได้ 14</b></p>\r\nคันแรกทะเบียนไม่ดีครับ เดี๋ยวก็เจออีก ในเรื่องอุบัติเหตุ แต่เลขท้ายเขายังดีมีเลข 9 คุ้มครอง <b>ส่วนรถคันที่สอง สังเกตุนะครับแม้จะมีเลขดี เริ่มต้นชีวิตด้วย 41 และผลรวมยังได้ 41 หมายถึงความรุ่งเรืองความสำเร็จ</b>\r\n<p><b>ในทุกๆด้าน รุ่งเรื่องดีแท้ แต่บั้นปลายของชีวิตจะล้มเหลวล้มละลาย หรือไม่ก็เกิดอุบัติเหตุอย่างฉับพลัน จนไม่เหลืออะไรเลยแม้แต่ชีวิต นั่นเพราะมาเจอกับ เลข 11 และ 18 แถมในชื่อก็มีเลข 71 12 48 (ไปดูคำทำนายเพิ่มเติมใน http://numberniceic.blogspot.com/2011/08/blog-post_2248.html)</b></p>\r\n\r\n<p>เมื่ออ่านจากข่าวผมก็ว่าตรงนะครับ ชีวิตท่านรุ่งเรืองดีนะครับเจริญทุกด้าน ตามเลข 23,41 นั่นแหละครับ มีพร้อมทุกอย่าง แต่เมื่อถึงวาระกรรม พ่วงด้วยเลขร้ายที่ แฝงอยูในชื่อสกุล ในทะเบียนรถในเยอะขนาดนี้เลยเป็น</p>\r\n\r\n<br><b>การเปิดช่องให้เขามาทำร้ายเราได้ พรากเราไปทั้งที่ยังไม่ถึงเวลาสิ้นอายุขัย ดูจากจากตัวเลขในชื่อนะครับ</b>\r\n@@ชื่อ xxxx(711248=23) และนามสกุล (18 ) แม้ผลรวมได้ 41 แต่ก็ช่วยอะไรไม่ได้เพราะกำลังไม่พอ และเขาก็ทำงานตามหน้าที่ของเขาดีแล้ว\r\n\r\n<p>ดูไว้นะครับนี้คำตอบที่ผมอยากจะตอบหลายคนที่ถามผมว่า ถ้าชื่อไม่ดี นามสกุลไม่ดี แล้วจะเปลี่ยนชื่อให้ดีอย่างเดียวได้หรือไม่ผลจะเป็นอย่างไร แล้วจำเป็นต้องสนใจเลขเรียงในชื่อด้วยหรือไม่ มันสำคัญอย่างไร จำเป็นไหมต้องเปลี่ยนเบอร์โทร จำเป็นหรือไม่ต้องเปลี่ยนทะเบียนรถ นี้แหละครับ คือคำตอบตามมา</p>\r\n\r\n<p><b>มาดูคำตอบกันครับ</b></p>\r\n<p>สังเกต แม้ชื่อจะดีแต่แฝงร้ายอันตรายทั้งนั้น <b>คือ เลขเรียงในชื่อได้ 711248=23 นามสกุลได้ ( 18  เลขตรงกับทะเบียนรถ)</b> ดูนะครับแม้ผลรวมชื่อสกุลจะดี  คือได้  41  แต่ถ้านามสกุล ไม่ดี ก็ใช่ว่าคุณจะรอดได้ อีกทั้งทั้งตัวเลขในทะเบียนรถทั้งในชื่อ และในนามสกุล ยังมีเลขร้ายมาซ้ำเติมดวงเพิ่มความรุนแรงอีก แล้วจะเหลืออะไรละครับ  11 มาเจอ  18  ซ้ำชื่อยังได้  23  ทั้งหมด คือเลข ไฟ เลขระเบิดเลขความรุนแรง เลขอุบัติเหตุ มันเลยลงเอยอย่างที่เห็นในภาพ  ไม่น่ารุนแรงแต่ก็แรง  ซึ่งผมเองไม่ทราบว่าท่านเปลี่ยนชื่อมารึเปล่าโชคร้ายที่ไปเอาเลข  23   เอาเลขเรียงอุบัติเหตุมาตั้งชื่อโดยรู้เท่าไม่ถีงการณ์ หรือ อาจจะเป็นดวงดีพ่อแม่ตั้งให้มาแต่กำเนิดแต่หารู้ไม่ว่าแฝงพลังร้ายกาจไว้ ไม่ว่ายังก็ตาม ผมขอขอบคุณและขออนุญาติท่านในกรณีที่ผมได้เอามาเป็นเคสให้คนได้ศึกษาหาความรู้เพื่อจะได้ช่วยป้องกันตัวเอง และเป็นวิทยาทานให้กับเขาเหล่านั้นอย่าได้เดินตามรอยในสิ่งที่ไม่ดี ขอกุศลผลบุญจงเกิด ขอกุศลนั้นจงถึงแก่ท่านไม่ทางตรงก็ทางอ้อม และขอกุศลนี้จงเป็นปัจจัยให้ท่านไปสู่สุคติและก้าวข้ามไปสู่ภพภูมิที่สูงขึ้นด้วยเทอญ สาธุ สาธุ สาธุ</p>\r\n<p>สรุปแล้ว ผมขอบอกไว้ตรงนี้เลย ว่าศาสตร์ของตัวเลขที่แท้จริง ถ้าท่านรู้จริงไม่ว่าใครถ้าท่านรู้ให้ถึงแก่น  มันมีหลักอยู่แค่นี้เท่านั้น ซึ่งไม่ว่าจะเป็นวิธีการหาเบอร์โทรศัพท์ หรือ ทะเบียนรถ หรือการตั้งชื่อ-สกุล ให้ลูกให้หลาน ล้วนใช้วิธีเดียวกันดังนี้</p>\r\n\r\n<p>1. ขอให้คุณตรวจตัวเลขตัวแรก(ทะเบียนรถสำคัญ)  แต่เบอร์โทรศัพท์ข้ามไปครับ เพราะคู่แรกเหมือนกันทุกคน คือ (08) งง ไหมครับทำไมต้องดู ครับที่ให้ดูเพราะตัวเลขตัวแรกต้องน้อยกว่าตัวสุดท้ายเสมอครับเหมือนคนทำงานก็ต้องก้าวหน้าขึ้นเรื่อยๆ ไม่ใช่เริ่มต้นดีสุดท้ายหมดตัวก็แย่ ดังนั้น ที่สำคัญต้องดูตัวสุดท้าย(ทะเบียนรถ, ชื่อ)  ส่วนของโทรศัท์ให้ดูที่ คู่สุดท้าย เป็นหลักครับ เพราะหมายเลขโทรศัพท์มันก็เหมือนชีวิตคนนั้นแหละครับ มีเริ่มต้น-สิ้นสุด ยังไงถึงเริ่มต้นไม่ดีแต่สุดท้ายดีก็ถือว่าดีใช่ไหมครับ  ตัวอย่าง เบอร์โทรศัพย์  08-52373745 ลงท้ายได้ดีมาก ถือว่าเป็นเบอร์สวย ดี</p>\r\n\r\n<p>2. แยกตัวเลขออกมาที่ละตัว แล้วตรวจสอบดูว่านี้ใช่เบอร์ดีหรือไม่ โดยเปรียบเทียบกับ หลักโหราศาสตร์ว่าด้วยเลขมงคล (ศุภเคราะห์) และเลขไม่เป็นมงคล (บาปเคราะห์) ดังนี้</p>\r\n\r\n  <p>                           เลขกลุ่มมงคล ศุภเคราะห์ ที่ให้คุณ คือ  หมายเลข <b>2, 4, 5, 6, 9</b></p>\r\n  <p>                            เลขกลุ่มไม่เป็นมงคลบาปเคราะห์ ที่ให้โทษ คือหมายเลข <b>0, 1, 3, 7, 8</b></p>\r\n<p><b>สรุปว่า</b> เป็นเบอร์สวยและเบอร์ดีพอใช้ครับ เพราะมีกลุ่มเลขมงคลอยู่ถึง 5 ตัว</p>\r\n\r\n\r\n<p>3. หลังจากขั้นตอนที่ 1และ 2 จากนั้นเราก็นำมาจับคู่ตัวเลข แล้วนำมาตรวจสอบกับ กลุ่มตัวเลขที่มีความหมายระดับดีร้ายแตกต่างกัน ในส่วนนี้ท่านต้องดูดีๆนะครับ เพราะเลขบางตัว ความหมายดี แต่ก็แฝงด้วยพลังร้ายมากเช่นกัน (หาอ่านเพิ่มนะครับ) ตอนนี้จัดกลุ่มให้ได้ก่อน แล้วช่วงท้ายๆผมจะยกตัวอย่างให้ดูครับ</p>\r\n\r\n       <p>                          กลุ่มตัวเลขที่ส่งผลดีต่อชีวิต <b>ระดับดีมาก</b> คือ <b>4-14-14-24-41-45-50-51-54-55-59-95-99</b></p>\r\n\r\n      <p>                           กลุ่มตัวเลขที่ส่งผลดีต่อชีวิต <b>ระดับดี</b> คือ <b>2-6-9-36-64-65-90-100</b> (มีคามหมายแฝงที่ไม่ดี)</p>\r\n\r\n      <p>                           กลุ่มตัวเลขที่ส่งผลต่อชีวิต <b>ระดับพอใช้ คือ1-4-19-20-23-32-40-44-60-62-69-89-91-96-98</b></p>\r\n\r\n       <p>                          ตัวเลข <b>ระดับทที่ไม่ดี</b> ต่อชีวิต (หลีกให้ไกล) คือ</p>\r\n\r\n<p>3-7-8-10-11-12-13-17-18-19-21-21-23-25-26-27-28-29-31-34-35-38-43-47-48-</p>\r\n\r\n\r\n<p>49-52-53-57-61-66-67-68-71-72-74-75-76-78-79-82-83-84-85-86-87-91-92-94-97</p>\r\n\r\n\r\n<p>                           ระดับ <b>เลขอันตรายร้ายแรง<b>ต่อชีวิต อย่าเข้าใกล้ คือ <b>7-10-11-13-16-17-18-19-21-25-31-30-33-34-38-37-39-40-48-70-71-73-77-80-81-83-84-91-88-93-99</b> เป็นต้น</p>\r\n\r\n        <p>4. เป็นขั้นตอนง่ายๆครับ ถ้าตรวจครบทั้งสามขั้นตอนข้างต้นแล้ว ก็นับว่าคุณคงจะทราบแล้วว่าหมายเลขโทรศัพท์ของคุณควรนำมาใช้งานหรือไม่ เป็นมงคลแค่ไหน แต่ต้องไม่ลืมขั้นตอนสุดท้าย คือ นำเอาตัวเลขทั้งหมดมาบวกกันครับ ได้เท่าไหร่ ก็กลับไปดูข้อสองครับว่ามีอิทธิพลต่อชีวิต ในระดับ-ดีมาก-ดี-พอใช้-ไม่ดี หรือ อันตราย</p>\r\n        <p>เช่น 08-57795154  ก็นำเอามาบวกกันดังนี้  0+8+5+7+7+9+5+1+5+4 =51 (เบอร์ดีครับเป็นเบอร์มงคลมากเบอร์หนึ่ง)</p>\r\n\r\n\r\n        <p>5. เมื่อ ทำครบขั้นตอนแล้ว เราก็นำไปตรวจกับพื้นดวงครับว่าเข้ากันได้ไหม ขัดแย้งกันรึเปล่า ไม่งั้นมีงานทำอยู่ดีๆจะพานตกงานเอาง่าย หรือ วุ่นวายมากขึ้น เพราะเอาเลขอริ เอาเลขดวงไม่ดีมาซ้ำเติมดวงครับ</p>\r\n\r\n<p>เอ้า! ทีนี้เรามาทดลองทำเองดูครับเผื่อจะช่วยตัวเองได้ในเบื้องต้นไม่ต้องเปลืองเงิน ตัวอย่างนะครับ</p>\r\n\r\n        <p>สมมุติเบอร์ 08-57795154</p>\r\n\r\n        <p><b>ขั้นแรก</b>    ดูเลขตัวสุดท้าย และคู่สุดท้าย  จะได้</p>\r\n\r\n        <p>-  เลขตัวสุดท้าย คือ เลข 4 (ช่วยให้ฉลาด แตกฉาน)</p>\r\n\r\n        <p>-  เลขคู่สุดท้าย คือ 54  เป็นเลขที่มีอิทธิพลกับชีวิตในระดับดีมาก พลังมหาจักรวาล</p>\r\n\r\n\r\n        <p> <b>ขั้นที่สอง</b>   นำมาแยกออกเพื่อหากลุ่มเลขมงคลได้ดังนี้  5-9-5-5-4 สรุปมีเลขมงคลเท่ากับ  5 ตัว</p>\r\n\r\n\r\n        <p>  <b>ขั้นที่สาม</b>   นำมาจับคู่ ก็จะได้</p>\r\n\r\n        <p>- 08-57-79-51-54  มีเลขที่ดีมากอยู่ 2 คู่ ไม่ดี 3 คู่</p>\r\n\r\n        <p>- 08-85-57-77-79-95-15-51-54-   มีเลขที่ดีมากอยู่ 4 คู่ ไม่ดีอยู่ 4 อันตราย 1\r\nสรุปว่า น่าจะใช้ครับเพราะเราเจอเลขคู่ที่ดีมาก ส่วนที่ไม่ดีก็เป็นการสร้างสมดุล</p>\r\n\r\n\r\n        <p>  <b>ขั้นที่สี่ </b> นำเลขทั้งหมดมาบวกกันดังนี้</p>\r\n        <p>0+8+5+7+7+9+5+1+5+4 =51 **</p>\r\n        <p>5+1 = 6</p>\r\n\r\n\r\n        <p> <b>สรุป</b>  เบอร์นี้ดี เป็นทั้งเบอร์สวย เบอร์ดี เบอร์มงคล ครับ แต่ไม่แรงเท่าไหร่ คร่าวๆ คือจะส่งผลดีทั้งเรื่องงาน เรื่องเงิน เรื่องความรัก มีสิ่งศักดิ์สิทธ์คุ้มครอง มีผู้ใหญ่อุปถัมภ์ค้ำชู ขยัน บ้างาน เจริญรุ่งเรืองครับ ที่สำคัญต้องเป็นคนดีด้วยครับมันถึงจะส่งผลเต็มกำลังไม่มีแรงกรรมมาดึงรั้ง แต่ขณะเดียวกันก็ไม่ควรประมาทครับเพราะมีเลขอันตรายและไม่ดีอยู่ด้วยจะส่งผลเรื่องการเงินและวุ่นวายเพราะบริวาร</p>\r\n\r\n\r\n<p>หมายเหตุ : สำหรับใครจะเอาไปเผยแพร่ ขอความกรุณาให้เครดิตอ้างอิงด้วยนะครับ เพราะนี้คือศาสตร์ที่เขาไม่บอกกัน คนเล่าเรียนกันมากว่าจะแตกฉานต้องมีเงินเป็นแสนขึ้นนะครับ ถึงจะได้เคล็ดนี้มา และที่ผมนำมาเผยแพร่ก็ด้วยใจบริสุทธิ์และหวังดีจริงๆครับ ขอบคุณทุกท่าน ขอให้อ่านแล้วนำไปปรับใช้กับชีวิตให้มีความสุขและรุ่งเรืองยิ่งๆขึ้นไปครับ ด้วยความปรารถนาดี</p>', NULL, NULL, NULL, 1, 1, 1),
(24, '2014-07-25 11:30:00', 'คุณนิน', NULL, 'เลขมงคลที่ทำให้มีโชคลาภทางการเสี่ยงทางการงานการเงินความรัก', 'https://www.ananya.in.th/views/assets/images/001.jpg', 'แต่ละคนใช้เลขได้ผลไม่เหมือนกัน ต้องดูพื้นฐานดวงประกอบ ตัวเลขต้องออกมาจากวันเดือนปีเกิด เวลาเกิดจังหวัดที่เกิดเท่านั้น', '<span style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\">++<b>เลขมงคลท&#3637;&#3656;ทำให&#3657;ม&#3637;โชคลาภทางกา</b></span><b><wbr style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\"></wbr><span class=\"word_break\" style=\"background-color: white; color: #37404e; display: inline-block; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\"></span><span style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\">รเส&#3637;&#3656;ยงทางการงานการเง&#3636;นความร&#3633;ก</span><wbr style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\"></wbr><span class=\"word_break\" style=\"background-color: white; color: #37404e; display: inline-block; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\"></span></b><span style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\"><b>.</b>..ฯ เร&#3637;ยงตามลำด&#3633;บ ค&#3639;อ&nbsp;</span><br />\r\n<br style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\" />\r\n<span style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\">1. 63*45,14,</span><br />\r\n<span style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\">2. 59,36*,24,56*,95</span><br />\r\n<span style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\">3. 44*46*,41,99*,42</span><br />\r\n<span style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\">4. 64*,65*,51</span><br />\r\n<span style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\">5. 54,50</span><br />\r\n<span style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\">6. 55*,15,90</span><br />\r\n<br style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\" />\r\n<span style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\">++<b>เลขอ&#3633;นตราย****ท&#3637;&#3656;ทำให&#3657;ม&#3637;โชคล</b></span><b><wbr style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\"></wbr><span class=\"word_break\" style=\"background-color: white; color: #37404e; display: inline-block; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\"></span></b><span style=\"background-color: white; color: #37404e; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\"><b>าภทางการเส&#3637;&#3656;ยง.</b>..ฯ เร&#3637;ยงตามลำด&#3633;บ ค&#3639;อ&nbsp;</span><span class=\"text_exposed_show\" style=\"background-color: white; color: #37404e; display: inline; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\"><br /><br />1.38*,83<br />2.52*,25<br />3. 23*,32,29*,92<br />4. 66,12*,21,22,40,04,35,16,43<br />5. 57,17,18,39,67<br />6. 76,11<br /><br /><b>จงอ&#3656;านก&#3656;อนต&#3633;ดส&#3636;นใจใช&#3657;เลขมงคลหร&#3639;อเลขร&#3657;ายใดๆ</b></span><br />\r\n<span class=\"text_exposed_show\" style=\"background-color: white; color: #37404e; display: inline; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\"><br />@@ แต&#3656;ละคนใช&#3657;เลขได&#3657;ผลไม&#3656;เหม&#3639;อนก&#3633;น<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&nbsp;ต&#3657;องด&#3641;พ&#3639;&#3657;นฐานดวงประกอบ ต&#3633;วเลขต&#3657;องออกม<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>าจากว&#3633;นเด&#3639;อนป&#3637;เก&#3636;ด เวลาเก&#3636;ดจ&#3633;งห<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ว&#3633;ดท&#3637;&#3656;เก&#3636;ดเท&#3656;าน&#3633;&#3657;น<br /><br />@@ถ&#3657;าใครพ&#3639;&#3657;นดวงเก&#3636;ดเด&#3656;นเร&#3639;&#3656;องโ<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ชคลาภ..ถ&#3657;าสามารถเล&#3639;อกใช&#3657;เลขได&#3657;<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ด&#3637;ถ&#3641;กโฉลกดวงไม&#3656;ข&#3633;ดลาภ ร&#3633;บรองเพ&#3636;&#3656;มความเฮงให&#3657;ท&#3656;านได&#3657;แน<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3656;นอนจากท&#3637;&#3656;เฮงย&#3640;แล&#3657;ว<br /><br />@@ ถ&#3657;าใครพ&#3639;&#3657;นดวงเก&#3636;ดไม&#3656;ม&#3637;โชคลาภ..<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>.แต&#3656;ถ&#3657;าใช&#3657;เลขท&#3637;&#3656;ช&#3656;วยเร&#3639;&#3656;องโชคลาภได&#3657;แถมถ&#3641;กก&#3633;บโฉลกดวงไม&#3656;ข&#3633;ดลาภ<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&nbsp;ผลค&#3639;อ จากท&#3637;&#3656;ไม&#3656;เคยม&#3637;โชคก&#3655;จะม&#3637;...ท&#3637;&#3656;ม<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3637;อย&#3641;&#3656;แล&#3657;วบ&#3657;างก&#3655;จะบ&#3656;อยข&#3638;&#3657;นแต&#3656;ไม<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3656;เยอะนะคะถ&#3657;าพ&#3639;&#3657;นดวงไม&#3656;ม&#3637;(ถ&#3657;าเล<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3639;อกใช&#3657;เลขด&#3637;แม&#3657;ไม&#3656;ท&#3637;ดวงโชคลาภแต<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3656;ค&#3640;ณจะได&#3657;เร&#3639;&#3656;องอ&#3639;&#3656;นทดแทน)</span><br />\r\n<br />\r\n<div class=\"separator\" style=\"clear: both; text-align: center;\">\r\n<a href=\"//2.bp.blogspot.com/-PZMnlMUb620/U9NKZ2WJ39I/AAAAAAAAAmg/QYF296wwCf8/s1600/001.jpg\" imageanchor=\"1\" style=\"margin-left: 1em; margin-right: 1em;\"><img border=\"0\" height=\"320\" src=\"//2.bp.blogspot.com/-PZMnlMUb620/U9NKZ2WJ39I/AAAAAAAAAmg/QYF296wwCf8/s1600/001.jpg\" width=\"320\"></a></div>\r\n<wbr></wbr><br />\r\n<br />\r\n**หมายเหต&#3640;** สำหร&#3633;บใครท&#3637;&#3656;อยากม&#3637;โชคทางการเส&#3637;<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3656;ยงแต&#3656;เล&#3639;อกใช&#3657;เลขอ&#3633;นตราย จงพ&#3638;งระว&#3633;ง จร&#3636;งอย&#3641;&#3656;ม&#3633;นกระต&#3640;&#3657;นโชคลาภให&#3657;ค&#3640;ณ<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ได&#3657; แต&#3656;...จงระว&#3633;งและไตร&#3656;ตรองให&#3657;ด&#3637;เ<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>พราะม&#3633;นม&#3637;ผลร&#3657;ายท&#3637;&#3656;ค&#3640;ณต&#3657;องยอมร&#3633;<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>บม&#3633;นให&#3657;ได&#3657;และก&#3655;ร&#3657;ายแรงท&#3637;&#3656;เด&#3637;ยว<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ในเลขบางต&#3633;วถ&#3657;ายอมร&#3633;บได&#3657;ก&#3655;ล&#3640;ยเล<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ย<br />\r\n<br />\r\n=== ข&#3657;อม&#3641;ลน&#3637;&#3657;ม&#3637;ท&#3633;&#3657;งค&#3640;ณและโทษ จงพ&#3636;จารณาด&#3657;วยสต&#3636;และป&#3633;ญญา กร&#3640;ณาอ&#3656;านให&#3657;เข&#3657;าใจ และจงเล&#3639;อกใช&#3657;อย&#3656;างระม&#3633;ดระว&#3633;ง ===<br />\r\n<br />\r\nBy น&#3636;น&#3636;น<br />\r\nโดย www.numberniceic.com<br />\r\n<span class=\"text_exposed_show\" style=\"background-color: white; color: #37404e; display: inline; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\"><br /></span>\r\n<br />\r\n<span style=\"color: #37404e; font-family: Helvetica, Arial, lucida grande, tahoma, verdana, arial, sans-serif;\"><span style=\"background-color: #cccccc; line-height: 20px;\">----------------------------------------------------------------------------------------------------------------------------------</span></span><br />\r\n<span class=\"text_exposed_show\" style=\"background-color: white; color: #37404e; display: inline; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\"><br /></span>\r\n<span class=\"text_exposed_show\" style=\"background-color: #eeeeee; display: inline; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\"><b><span style=\"color: blue;\">หล&#3633;งจากโพสบทความด&#3657;านบนใน Facebook ได&#3657; 1 ว&#3633;นเ ผลค&#3639;อทำให&#3657;เราต&#3657;องตอบคำถาม</span></b></span><br />\r\n<span class=\"text_exposed_show\" style=\"background-color: white; color: #37404e; display: inline; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\"><br /></span>\r\n<span class=\"text_exposed_show\" style=\"background-color: white; color: #37404e; display: inline; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\">ตอบคำถามท&#3637;&#3656;ม&#3637;หลายคนใน Facebook ส&#3656;ง inbox มาถามเก&#3637;&#3656;ยวก&#3633;บเลขมงคลและเลขร&#3657;า<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ยท&#3637;&#3656;ให&#3657;ผลทางด&#3657;านโชคลาภ...จากกา<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>รเส&#3637;&#3656;ยงก&#3633;บเราว&#3656;า</span><br />\r\n<span class=\"text_exposed_show\" style=\"color: #37404e; display: inline; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 16px; line-height: 20px;\"><br /><span style=\"background-color: #f3f3f3;\">1.ทำไมเลขท&#3637;&#3656;เสร&#3636;มโชคลาภของเราท<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3637;&#3656;ให&#3657;เม&#3639;&#3656;อวานจ&#3638;งไม&#3656;เหม&#3639;อนอาจาร<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ย&#3660;ท&#3656;านอ&#3639;&#3656;น ?....</span><br /><br /><span style=\"background-color: #f3f3f3;\">2.ทำไมไม&#3656;เหม&#3639;อนก&#3633;บท&#3637;&#3656;คนเล&#3656;นเลข<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ส&#3656;วนใหญ&#3656;เขาขายเขาเช&#3639;&#3656;อก&#3633;น (7,8,9)?.....</span><br /><br /><span style=\"background-color: #f3f3f3;\">3.ทำไมท&#3637;&#3656;อ&#3639;&#3656;นใช&#3657;แค&#3656;\"ว&#3633;นเก&#3636;ด\"ไม<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3656;ต&#3657;องใช&#3657;\"ว&#3633;นเด&#3639;อนป&#3637;เก&#3636;ด เวลาเก&#3636;ด จ&#3633;งหว&#3633;ดท&#3637;&#3656;เก&#3636;ด\"เพ&#3639;&#3656;อเช&#3655;คเลขโฉล<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>กดวง?....</span><br /><br /><span style=\"background-color: white;\">==ตอบข&#3657;อ 1 และ 2 ==เพราะเราไม&#3656;เหม&#3639;อนใคร.......</span><br /><span style=\"background-color: white;\">เพรา</span><span class=\"text_exposed_show\" style=\"background-color: white; display: inline;\">ะส&#3636;&#3656;งท&#3637;&#3656;เราบอกล&#3657;วนมาจากประสบกา<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>รณ&#3660;การทำงานก&#3633;บล&#3641;กค&#3657;าของเรา มาจากคร&#3641;บาอาจารย&#3660;สอนส&#3633;&#3656;งโดยตรง<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&nbsp;ซ&#3638;&#3656;งท&#3633;&#3657;งหมดผ&#3656;านการพ&#3636;ส&#3641;จน&#3660;แล&#3657;วด<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3657;วยต&#3633;วเราเอง ด&#3657;วยคนรอบข&#3657;างของเรา<br />พ&#3636;ส&#3641;จน&#3660;แล&#3657;วจากประว&#3633;ต&#3636;การใช&#3657;เลขมงคล<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ของล&#3641;กค&#3657;าของเรา ท&#3633;&#3657;งเลขด&#3637;ม&#3637;มงคลและเลขร&#3657;าย<br />......ความร&#3641;&#3657;ท&#3637;&#3656;เราม&#3637;และถ&#3656;ายทอ<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ดบอกท&#3656;านไปเราไม&#3656;ได&#3657;ท&#3656;องจำมาจาก<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ตำราหร&#3639;อบทความของผ&#3641;&#3657;ใดท&#3637;&#3656;เช&#3639;&#3656;อ<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ตามก&#3633;นมาโดยไม&#3656;ผ&#3656;านการพ&#3636;ส&#3641;จน&#3660;</span></span><br />\r\n<div class=\"separator\" style=\"clear: both; text-align: center;\">\r\n<a href=\"//3.bp.blogspot.com/-609OfHUvdU8/U9NJ238c7aI/AAAAAAAAAmc/YF40J78lqcE/s1600/1304301424-15370.jpg\" imageanchor=\"1\" style=\"margin-left: 1em; margin-right: 1em;\"><img border=\"0\" height=\"260\" src=\"//3.bp.blogspot.com/-609OfHUvdU8/U9NJ238c7aI/AAAAAAAAAmc/YF40J78lqcE/s1600/1304301424-15370.jpg\" width=\"320\"></a></div>\r\n<br />\r\n......<b>เราไม&#3656;ได&#3657;เน&#3657;นผลทางธ&#3640;รก&#3636;จ<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>เป&#3655;นหล&#3633;ก ไม&#3656;ได&#3657;ให&#3657;ความสำค&#3633;ญก&#3633;บเง&#3636;นเป&#3655;นท<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3637;&#3656;หน&#3638;&#3656;ง</b> แต&#3656;<b>เราให&#3657;ความสำค&#3633;ญก&#3633;บช&#3637;ว&#3636;ตของล<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3641;กค&#3657;าเราเป&#3655;นท&#3637;&#3656;หน&#3638;&#3656;ง</b>...ส&#3633;งเกต&#3640;<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ได&#3657;คะว&#3656;าเราจะเน&#3657;นเฉพาะ<b>เลขมงคลจ</b><wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ร&#3636;งๆ ไม&#3656;ม&#3637;เลขสวย เร&#3637;ยงตอง เลขโฟร&#3660; เลขไม&#3656;ด&#3637;หาความเป&#3655;นมงคลไม&#3656;ได&#3657;เร<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>าไม&#3656;เคยขายไม&#3656;เคยแนะนำให&#3657;ซ&#3639;&#3657;อให<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3657;หามาใช&#3657;<br />\r\n<br />\r\n==ตอบข&#3657;อ 3 == ลองค&#3636;ดตามนะคะ เป&#3655;นไปได&#3657;หร&#3639;อ ท&#3637;&#3656;คนเก&#3636;ดว&#3633;นเด&#3637;ยวก&#3633;นเช&#3656;น เก&#3636;ด \"ว&#3633;นอาท&#3636;ตย&#3660;\" แล&#3657;วจะใช&#3657;เลขต&#3633;วเด&#3637;ยวก&#3633;นได&#3657;ผลเห<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ม&#3639;อนก&#3633;น ด&#3637;เหม&#3639;อนก&#3633;น เป&#3655;นไปได&#3657;หร&#3639;อ?......<br />\r\nมองถ&#3638;งความเป&#3655;นจร&#3636;งนะคะทำไมคนท&#3637;<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3656;เก&#3636;ดว&#3633;นเด&#3637;ยวก&#3633;น แต&#3656;กล&#3633;บม&#3637;หน&#3657;าตา ม&#3637;อาช&#3637;พหน&#3657;าท&#3637;&#3656;การงาน การเง&#3636;น ความร&#3633;ก ความส&#3640;ข แม&#3657;ฐานะครอบคร&#3633;วก&#3655;ย&#3633;งด&#3637;ย&#3633;งได&#3657;ไม<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3656;เท&#3656;าก&#3633;น ม&#3637;ว&#3636;ถ&#3637;ช&#3637;ว&#3636;ตแตกต&#3656;างก&#3633;น...น&#3633;&#3656;นเพ<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>ราะอย&#3656;าล&#3639;มว&#3656;าแม&#3657;ค&#3640;ณจะเก&#3636;ดว&#3633;นเด<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3637;ยวก&#3633;นแต&#3656;...เก&#3636;ดต&#3656;างว&#3633;นท&#3637;&#3656;...ต<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3656;างเด&#3639;อนเก&#3636;ด...ต&#3656;างป&#3637;เก&#3636;ด ต&#3656;างเวลาเก&#3636;ด...ต&#3656;างสถานท&#3637;&#3656;เก&#3636;ด<br />\r\n.....ด&#3633;งน&#3633;&#3657;นเป&#3655;นไปไม&#3656;ได&#3657;เลยคะท<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3637;&#3656;คนท&#3640;กคนจะใช&#3657;เลขต&#3633;วเด&#3637;ยวก&#3633;นแล<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>&#3657;วได&#3657;ผลด&#3637;เหม&#3639;อนก&#3633;น เลขด&#3637;ก&#3633;บอ&#3637;กคนใช&#3656;ว&#3656;าจะด&#3637;ก&#3633;บท&#3640;กค<wbr></wbr><span class=\"word_break\" style=\"display: inline-block;\"></span>นนะคะ ต&#3657;องระว&#3633;ง<br />\r\n<br />', NULL, NULL, NULL, 1, 1, 1),
(25, '2012-03-10 12:41:00', 'คุณนิน', NULL, 'ทะเบียนรถมรณะ \"ศข 111\" ซิ่ง\'ลัมโบกินี\'ชนที่กั้นทางไฟลุกท่วม', 'https://www.ananya.in.th/views/assets/images/carfire.jpg', 'รถหรูคันนี้\"ทะเบียน ศข 111\"  ซึ่งว่ากันว่าในโลกนี้มีเพียง 20 คันและมีมูลค่าสูงถึง 30 กว่าล้านบาท รถสวย รถหรู รถแพง แต่มีความเชื่อที่ผิดๆ บางครั้งมันก็นำ', '<div>\r\n    <b>รถหร&#3641;ค&#3633;นน&#3637;&#3657;\"ทะเบ&#3637;ยน ศข 111\"&nbsp;</b>\r\n    ซ&#3638;&#3656;งว&#3656;าก&#3633;นว&#3656;าในโลกน&#3637;&#3657;ม&#3637;เพ&#3637;ยง 20 ค&#3633;นและม&#3637;ม&#3641;ลค&#3656;าส&#3641;งถ&#3638;ง 30 กว&#3656;าล&#3657;านบาท\r\n    รถสวย รถหร&#3641; รถแพง แต&#3656;ม&#3637;ความเช&#3639;&#3656;อท&#3637;&#3656;ผ&#3636;ดๆ\r\n    บางคร&#3633;&#3657;งม&#3633;นก&#3655;นำความซวยมาให&#3657;เราได&#3657; จากทะเบ&#3637;ยน ศข111 จะได&#3657;=72111=12=3 และม&#3637;บ&#3657;านเลขท&#3637;&#3656;อ&#3633;นตรายเลขท&#3637;&#3656; 21/7 (10,21,17)&nbsp; น&#3633;บว&#3656;าโชคด&#3637;มากท&#3637;&#3656;รอดมาได&#3657; แม&#3657;รถม&#3633;นจะเก&#3639;อบไม&#3656;เหล&#3639;อซาก\r\n    แต&#3656;ถ&#3657;าคนข&#3633;บย&#3633;งม&#3637;ลมหายใจอย&#3641;&#3656; ย&#3633;งม&#3637;แรง เราม&#3637;เง&#3636;นเราก&#3655;ซ&#3639;&#3657;อใหม&#3656;ได&#3657;\r\n    รวยๆแบบน&#3637;&#3657;น&#3656;าจะม&#3637;ประก&#3633;นช&#3633;&#3657;นหน&#3638;&#3656;งอย&#3641;&#3656;แล&#3657;ว\r\n    ถ&#3639;อว&#3656;าค&#3640;ณพระย&#3633;งค&#3640;&#3657;มครองและให&#3657;โอกาส เม&#3639;&#3656;อม&#3637;โอกาสจงร&#3637;บเปล&#3637;&#3656;ยนแปลงนะคะ<br />\r\n    <br />\r\n<img class=\"ui fluid image\" src=\"//2.bp.blogspot.com/-DBaxUiFthFI/UMWejp0N3SI/AAAAAAAAAKA/e10YzUAACog/s320/view_resizing_images.php.jpg\" width=\"320\">\r\n    \r\n    <p>แต&#3656;เม&#3639;&#3656;อมาค&#3636;ดอ&#3637;กท&#3637;ก&#3655;คงยากท&#3637;&#3656;เขาจะเปล&#3637;&#3656;ยน\r\n    เพราะจากสถ&#3636;ต&#3636;ส&#3656;วนใหญ&#3656;คนรวยๆม&#3633;กชอบเลขเร&#3637;ยงเลขตองเลขมรณะ ท&#3633;&#3657;ง 1111 2222\r\n    3333 7777 8888 1188 4444 5555 9999 9955&nbsp; เป&#3655;นต&#3657;น\r\n    และเช&#3639;&#3656;อว&#3656;าม&#3633;นด&#3637;ม&#3633;นค&#3641;&#3656;ควรม&#3633;นค&#3640;&#3657;มค&#3656;าแล&#3657;วสำหร&#3633;บเง&#3636;นของเขาท&#3637;&#3656;จ&#3656;ายออกไป\r\n    หร&#3639;อว&#3656;าม&#3633;นจะเป&#3655;นล&#3636;ข&#3636;ตสววรค&#3660;เพ&#3639;&#3656;อสร&#3657;างความสมด&#3640;ลให&#3657;โลก\r\n    บางคร&#3633;&#3657;งเราจ&#3638;งเห&#3655;นคนรวยๆต&#3657;องเซ&#3656;นส&#3633;งเวยให&#3657;ก&#3633;บส&#3636;&#3656;งท&#3637;&#3656;เขาค&#3636;ดว&#3656;าด&#3637;และเขาชอบ\r\n    เขาสะสม แต&#3656;คนน&#3637;&#3657;น&#3633;บว&#3656;าโชคด&#3637;มากเพราะเขารอดมาได&#3657;\r\n    แม&#3657;สภาพรถแทบจะย&#3633;บเย&#3636;นไม&#3656;เหล&#3639;อซาก น&#3633;&#3656;นแหละ ค&#3639;ออ&#3636;ทธ&#3636;พลของเลข\r\n    11(เลขศาสตร&#3660;พล&#3633;งเงาเลขเร&#3637;ยง ม&#3633;นก&#3655;ค&#3639;อ\r\n    ศาสตร&#3660;ท&#3637;&#3656;แฝงด&#3657;วยพล&#3633;งฮวงจ&#3640;&#3657;ยแฝงด&#3657;วยการจ&#3633;ดวางท&#3637;&#3656;ลงต&#3633;วส&#3656;งเสร&#3636;มก&#3633;น\r\n    อะไรท&#3637;&#3656;มากเก&#3636;นไป น&#3657;อยเก&#3636;นไป ก&#3655;ไม&#3656;ใช&#3656;ว&#3656;าด&#3637;\r\n    ท&#3633;&#3657;งน&#3637;&#3657;เราต&#3657;องด&#3641;พ&#3639;&#3657;นดวงเขาประกอบด&#3657;วย )<br />\r\n    <br />\r\n    ถ&#3657;าถามว&#3656;าแล&#3657;วคนข&#3633;บเขารอดมาได&#3657;อย&#3656;างไร รอดได&#3657;คะ\r\n    เพราะแม&#3657;เด&#3655;กคนน&#3637;&#3657;จะม&#3637;พล&#3633;งเลขศาสตร&#3660;ไม&#3656;ด&#3637;\r\n    แต&#3656;เขาม&#3637;พ&#3639;&#3657;นดวงด&#3637;แน&#3656;นอนเพราะเก&#3636;ดในตระก&#3641;ลด&#3637;\r\n    และส&#3633;งเกต&#3640;เลขในช&#3639;&#3656;อสก&#3640;ลเขาแล&#3657;วม&#3633;นก&#3655;ด&#3637;มากแม&#3657;จะไม&#3656;ด&#3637;ท&#3633;&#3657;งหมด เพราะ เขาม&#3637;ช&#3639;&#3656;อก&#3633;บนามสก&#3640;ล ได&#3657;เลขรวม 34 และ 30 (เลขอ&#3640;บ&#3633;ต&#3636;เหต&#3640; เลขความซวย...)<br />\r\n    <br />\r\n    แต&#3656;จำก&#3633;นได&#3657;ไหมคะ ท&#3637;&#3656;เราเคยบอกว&#3656;า ส&#3636;&#3656;งท&#3637;&#3656;ม&#3637;พล&#3633;งมากท&#3637;&#3656;ส&#3640;ด\r\n    ค&#3639;อเลขพล&#3633;งเงาก&#3633;บเลขเร&#3637;ยง ด&#3633;งน&#3633;&#3657;นในเคสน&#3637;&#3657; ถ&#3657;าเราเข&#3657;าไปด&#3641;ท&#3637;&#3656;\r\n    \"เลขเร&#3637;ยงของช&#3639;&#3656;อก&#3633;บสก&#3640;ลเขา\"จะพบว&#3656;าเลขเร&#3637;ยงด&#3637;มากโดยเฉพาะนามสก&#3640;ล\r\n    เพราะม&#3637;เลขพล&#3633;งส&#3656;งเสร&#3636;มและค&#3640;&#3657;มครอง(45,9)อย&#3641;&#3656;หลายต&#3633;ว\r\n    และเม&#3639;&#3656;อเข&#3657;าไปด&#3641;พล&#3633;งเงาก&#3655;ไม&#3656;ใช&#3656;ว&#3656;าเลยร&#3657;ายเพราะได&#3657; 35 และ 104(5)&nbsp;\r\n    คะและน&#3633;&#3656;นค&#3639;อ คำตอบว&#3656;าทำไมจ&#3638;งรอดมาได&#3657; แต&#3656;ในทางกล&#3633;บก&#3633;นถ&#3657;าสมม&#3640;ตเด&#3655;กคนน&#3637;&#3657;\r\n    ม&#3637;เลขในช&#3639;&#3656;อสก&#3640;ล โดยเฉพาะในเลขเร&#3637;ยงในพล&#3633;งเงาแล&#3657;ว ม&#3637;เลข 37 33 11 73 48 84\r\n    88 77 17 18 16 61 71 81 21 12 13 31 34 66 19 92 29 28 82....ฯ\r\n    อย&#3641;&#3656;ร&#3633;บรองว&#3656;าไม&#3656;รอดแน&#3656;นอน<br />\r\n    <br />\r\n    <span class=\"userContent\"><span class=\"text_exposed_show\"><u><b>ฝากให&#3657;ค&#3636;ดเก&#3637;&#3656;ยวก&#3633;บศาสตร&#3660;ต&#3633;วเลขในเบอร&#3660;โทร ในทะเบ&#3637;ยนรถ ในช&#3639;&#3656;อส&#3640;กล ในบ&#3657;านเลขท&#3637;&#3656;</b></u></span></span><br />\r\n    <br />\r\n    เวร\r\n    กรรมม&#3637;จร&#3636;ง เวรกรรมแก&#3657;ไม&#3656;ได&#3657;แก&#3657;ไม&#3656;ตก แต&#3656;--หน&#3637;ได&#3657;\r\n    พระพ&#3640;ทธศาสนาไม&#3656;ได&#3657;บอกให&#3657;ยอมจำนน แต&#3656;ให&#3657;ร&#3641;&#3657;เท&#3656;าท&#3633;น\r\n    และหม&#3633;&#3656;นสร&#3657;างกรรมด&#3637;เพ&#3639;&#3656;อช&#3656;วยให&#3657;เราหน&#3637;กรรมได&#3657;ด&#3657;วยแรงบ&#3640;ญ หร&#3639;อ\r\n    ด&#3657;วยการเปล&#3637;&#3656;ยนแปลงการกระทำ<br />\r\n    <br />\r\n    สำหร&#3633;บศาสตร&#3660;ต&#3633;วเลขของเรา\r\n    เขาก&#3655;ให&#3657;เราหน&#3637;กรรมด&#3657;วยการเปล&#3637;&#3656;ยนรห&#3633;สกรรมรห&#3633;สช&#3637;ว&#3636;ต(หน&#3637;ช&#3633;&#3656;วคราวเพ&#3639;&#3656;อถ&#3656;วง\r\n    เวลาให&#3657;เราได&#3657;สร&#3657;างบ&#3640;ญพ&#3638;&#3656;งศาสนาให&#3657;มาหน&#3640;นนำให&#3657;ม&#3637;พล&#3633;งบ&#3640;ญมากกว&#3656;ากรรม และเปล&#3637;&#3656;ยนเอารห&#3633;สบ&#3640;ญท&#3637;&#3656;เราเคยทำไว&#3657;ใน\r\n    อด&#3637;ตชาต&#3636;มาใช&#3657;มาเสร&#3636;มดวง เช&#3639;&#3656;อไม&#3656;เช&#3639;&#3656;อไม&#3656;เป&#3655;นไร ม&#3633;นพ&#3636;ส&#3641;จน&#3660;ได&#3657; ลองด&#3641;&nbsp; )</div>\r\n<div>\r\n    <br />\r\n    และน&#3637;&#3657; ค&#3639;อ อ&#3637;กหน&#3638;&#3656;งเคส ท&#3637;&#3656;จะบอกให&#3657;ท&#3640;กคนได&#3657;ทราบว&#3656;าต&#3633;วเลข\r\n    เขาม&#3637;พล&#3633;งจร&#3636;งๆ โดยเฉพาะเลข 11 เพราะม&#3633;น ค&#3639;อเลขของไฟ ม&#3633;นค&#3639;อ  ไฟมรณะ\r\n    เลขของระเบ&#3636;ด เลขของอ&#3640;บ&#3633;ต&#3636;เหต&#3640; ล&#3657;มละลาย ล&#3657;มเหลว  เลขท&#3637;&#3656;ทำให&#3657;คนท&#3637;&#3656;ใช&#3657;\r\n    ประสบความสำเร&#3655;จ ร&#3640;&#3656;งเร&#3639;องร&#3640;&#3656;งโรจน&#3660;ในช&#3656;วงต&#3657;นของช&#3637;ว&#3636;ต\r\n    แต&#3656;บ&#3633;&#3657;นปลายม&#3633;กส&#3641;ญส&#3636;&#3657;นจนแทบไม&#3656;เหล&#3639;ออะไรแม&#3657;กระท&#3633;&#3656;งช&#3637;ว&#3636;ต\r\n    หากตอนน&#3637;&#3657;ใครม&#3637;เลขน&#3637;&#3657;อย&#3641;&#3656; ขอจงระว&#3633;งและร&#3637;บเปล&#3637;&#3656;ยนแปลงก&#3656;อนท&#3637;&#3656;จะสายเก&#3636;นไป\r\n    และหากใครม&#3637;เลข 11 อย&#3641;&#3656;รอบต&#3633;ว แถมย&#3633;งม&#3637;เลขมรณะอ&#3639;&#3656;นๆอย&#3641;&#3656;ด&#3657;วย\r\n    อ&#3637;กพ&#3639;&#3657;นดวงย&#3633;งม&#3637;ดวงอ&#3640;บ&#3633;ต&#3636;เหต&#3640;ล&#3657;มละลายด&#3657;วยแล&#3657;วจงร&#3637;บแก&#3657;ไขท&#3633;นท&#3637;ก&#3656;อนท&#3637;&#3656;จะ\r\n    แก&#3657;ไขอะไรไม&#3656;ได&#3657;แล&#3657;ว อย&#3656;าล&#3657;อเล&#3656;นนะคะ เพราะถ&#3657;าค&#3640;ณล&#3657;อเล&#3656;นก&#3633;บม&#3633;น\r\n    ม&#3633;นก&#3655;จะเล&#3656;นก&#3633;บค&#3640;ณ ต&#3633;วเลขไม&#3656;ว&#3656;าด&#3637;หร&#3639;อร&#3657;าย\r\n    เม&#3639;&#3656;อถ&#3638;งเวลาเขาจะทำหน&#3657;าท&#3637;&#3656;ของเขาแน&#3656;นอน จงอย&#3656;าประมาท<br />\r\n    <br />\r\n    <span class=\"fbUnderline\">&nbsp;\"ถ&#3657;าเราย&#3633;งม&#3637;ลมหายใจอย&#3641;&#3656;\r\nเง&#3636;นเราย&#3656;อมม&#3637;ค&#3656;าและใช&#3657;ประโยชน&#3660;จากม&#3633;นได&#3657;  หามาเพ&#3636;&#3656;มเต&#3636;มได&#3657;\r\nหากถ&#3657;าไร&#3657;ซ&#3638;&#3656;งลมหายใจแล&#3657;ว เง&#3636;นเราน&#3633;&#3657;นก&#3655;จ&#3633;กม&#3637;ค&#3656;าก&#3633;บคนอ&#3639;&#3656;น\r\nและคนอ&#3639;&#3656;นจะเป&#3655;นคนใช&#3657;ประโยชน&#3660;จากม&#3633;น และเราคงหามาเพ&#3636;&#3656;มเต&#3636;มไม&#3656;ได&#3657;แล&#3657;ว\"</span><br />\r\n    <br />\r\n    <br />\r\n    <b>เน&#3639;&#3657;อข&#3656;าว ซ&#3636;&#3656;ง\'ล&#3633;มโบก&#3636;น&#3637;\'ชนท&#3637;&#3656;ก&#3633;&#3657;นทางไฟล&#3640;กท&#3656;วม</b><br />\r\n    <b> หน&#3640;&#3656;มว&#3633;ย 21 ซ&#3636;&#3656;งล&#3633;มโบก&#3636;น&#3637; แฉลบชนขอบก&#3633;&#3657;นทางด&#3656;วนย&#3656;านคลองหลวง\r\n        ปท&#3640;มธาน&#3637;  ก&#3656;อนตกข&#3657;างทางไฟล&#3640;กท&#3656;วม รถสปอร&#3660;ตหร&#3641;ไหม&#3657;ท&#3633;&#3657;งค&#3633;น\r\n        เจ&#3657;าของรอดหว&#3640;ดหว&#3636;ด  เช&#3639;&#3656;อสาเหต&#3640;จากทรายบนถนน </b><br />\r\n    &nbsp;&nbsp;&nbsp;&nbsp; เก&#3636;ดอ&#3640;บ&#3633;ต&#3636;เหต&#3640;รถสปอร&#3660;ตหร&#3641;ซ&#3636;&#3656;งไปเท&#3637;&#3656;ยวเขาใหญ&#3656;\r\n    แต&#3656;เก&#3636;ดอ&#3640;บ&#3633;ต&#3636;เหต&#3640;แฉลบชนขอบก&#3633;&#3657;นทางด&#3656;วนก&#3656;อนตกข&#3657;างทางไฟล&#3640;กไหม&#3657;เส&#3637;ยหายท&#3633;&#3657;ง\r\n    ค&#3633;น เหต&#3640;เก&#3636;ดเม&#3639;&#3656;อเวลา 20.10 น. ว&#3633;นท&#3637;&#3656; 8 ธ&#3633;นวาคม พ.ต.ท.เชาวล&#3636;ต\r\n    แสงพงษ&#3660;พ&#3636;ทยา พน&#3633;กงานสอบสวน สภ.คลองหลวง จ.ปท&#3640;มธาน&#3637;\r\n    ร&#3633;บแจ&#3657;งม&#3637;อ&#3640;บ&#3633;ต&#3636;เหต&#3640;รถยนต&#3660;เส&#3637;ยหล&#3633;กพ&#3640;&#3656;งชนขอบก&#3633;&#3657;นทางด&#3656;วนและแฉลบพ&#3640;&#3656;งลงข&#3657;าง\r\n    ทางก&#3656;อนจะเก&#3636;ดไฟล&#3640;กไหม&#3657; บร&#3636;เวณถนนพหลโยธ&#3636;นขาออก ช&#3656;วงก&#3656;อนถ&#3638;งป&#3633;&#3658;มน&#3657;ำม&#3633;นเชลล&#3660;\r\n    ซอยค&#3640;ณพระ หล&#3633;ก กม.ท&#3637;&#3656; 35+500 หม&#3641;&#3656; 6 ต.คลองหน&#3638;&#3656;ง อ.คลองหลวง\r\n    หล&#3633;งร&#3633;บแจ&#3657;งจ&#3638;งประสานงานหน&#3656;วยบรรเทาสาธารณภ&#3633;ยเทศบาลเม&#3639;องคลองหลวง\r\n    นำรถด&#3633;บเพล&#3636;งจำนวน 2 ค&#3633;น พร&#3657;อมเจ&#3657;าหน&#3657;าท&#3637;&#3656;จำนวนหน&#3638;&#3656;งเด&#3636;นทางไปตรวจสอบ<br />\r\n    &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; เจ&#3657;าหน&#3657;าท&#3637;&#3656;ตรวจท&#3637;&#3656;เก&#3636;ดเหต&#3640; พบรถยนต&#3660;  ย&#3637;&#3656;ห&#3657;อล&#3633;มโบก&#3636;น&#3637;ไม&#3656;ทราบส&#3637;\r\n    ทะเบ&#3637;ยน ศข 111 กร&#3640;งเทพมหานคร  หน&#3657;ารถท&#3636;&#3656;มลงไปในพงหญ&#3657;าข&#3657;างทาง\r\n    ช&#3656;องทางค&#3641;&#3656;ขนาน  และม&#3637;ไฟล&#3640;กไหม&#3657;ต&#3633;วรถอย&#3656;างร&#3640;นแรง\r\n    เจ&#3657;าหน&#3657;าท&#3637;&#3656;หน&#3656;วยบรรเทาสาธารณภ&#3633;ยเทศบาลเม&#3639;องคลองหลวง\r\n    ต&#3657;องเร&#3656;งฉ&#3637;ดน&#3657;ำสก&#3633;ดเพล&#3636;งไหม&#3657; แต&#3656;ไม&#3656;สามารถจะด&#3633;บได&#3657;ในเวลาอ&#3633;นรวดเร&#3655;ว\r\n    ทำให&#3657;รถถ&#3641;กเพล&#3636;งล&#3640;กไหม&#3657;เส&#3637;ยหายท&#3633;&#3657;งค&#3633;น คนข&#3633;บอาย&#3640; 21 บ&#3657;านเลขท&#3637;&#3656; 21/ 7\r\n    (ถ&#3657;าช&#3639;&#3656;อไม&#3656;ช&#3656;วยสงส&#3633;ยจะไม&#3656;รอด)<br />\r\n    <br />\r\n    อ&#3657;างอ&#3636;ง จาก www.khaosod.co.th/view_news.php?newsid=TUROd01ERXdNekE1TVRJMU5RPT0=&amp;sectionid=TURNd01RPT0=&amp;day=TWpBeE1pMHhNaTB3T1E9PQ==<br />\r\n    <br />\r\n    <u><b>เคสต&#3633;วอย&#3656;างให&#3657;ศ&#3638;กษา</b></u><br />\r\n    เพ&#3639;&#3656;อบอกว&#3656;าท&#3640;กต&#3633;วเลขสำค&#3633;ญ ทะเบ&#3637;ยนรถสำค&#3633;ญ ช&#3639;&#3656;อสก&#3640;ลสำค&#3633;ญ และใครบอกว&#3656;าบ&#3657;านเลขท&#3637;&#3656;ไม&#3656;ม&#3637;ผลเราเอาต&#3633;วอย&#3656;างมาให&#3657;ด&#3641;แล&#3657;ว เส&#3637;ยดายท&#3637;&#3656;ไม&#3656;ม&#3637;เบอร&#3660;โทรให&#3657;ด&#3641;ด&#3657;วยจะได&#3657;ไม&#3656;กล&#3656;าวอ&#3657;างก&#3633;นลอยๆ<u><b><br /></b></u><br />\r\n    <br />\r\n    <b>- </b>www.thairath.co.th/content/region/292509<br />\r\n    ทะเบ&#3637;ยนรถก&#3655;อ&#3633;นตราย <b>ทะเบ&#3637;ยน กจ 9999</b> ส&#3640;พรรณบ&#3640;ร&#3637; ชนเสยท&#3657;ายรถส&#3636;บล&#3657;อ อ&#3637;ซ&#3641;ซ&#3640; ส&#3637;ฟ&#3657;า <b>ทะเบ&#3637;ยน 82-1217</b> บ&#3657;านเลขท&#3637;&#3656;ก&#3655;อ&#3633;นตราย <b>อย&#3641;&#3656;บ&#3657;านเลขท&#3637;&#3656; 111/1 หม&#3641;&#3656; 10 ต.มะขามล&#3657;ม</b>ช&#3639;&#3656;อก&#3655;ไม&#3656;ใช&#3656;ว&#3656;าด&#3637; ร&#3633;บรองว&#3656;าเบอร&#3660;โทรท&#3637;&#3656;ใช&#3657;ก&#3655;ต&#3657;องอ&#3633;นตรายไม&#3656;แพ&#3657;ก&#3633;น<br />\r\n    <br />\r\n    &nbsp;-http://news.tlcthai.com/news/34562.html <b>&nbsp;</b><br />\r\n    <b>ทะเบ&#3637;ยนรถ <span style=\"color: blue;\">ธม-4278 </span></b><span style=\"color: blue;\">ทะเบ&#3637;ยน</span>ก&#3655;ไม&#3656;ด&#3637; ช&#3639;&#3656;อสก&#3640;ลเลขเร&#3637;ยงพล&#3633;งเงาย&#3633;งไม&#3656;ด&#3637; แล&#3657;วจะเหล&#3639;ออะไร<br />\r\n    <br />\r\n    - www.chonburinews.com/Q1/thememenu.php?id=17276&nbsp; <span class=\"style17\">&nbsp;</span></div>\r\n<div>\r\n    <b><span class=\"style17\">ทะเบ&#3637;ยนมฉ-9687</span></b>รอดเพราะม&#3637;พล&#3633;งเงาช&#3639;&#3656;อด&#3637;ช&#3656;วยไว&#3657; เพราะได&#3657;เลข 95 อ&#3637;กท&#3633;&#3657;งผลรวมช&#3639;&#3656;อสก&#3640;ลย&#3633;งได&#3657;เลข 45 จ&#3638;งย&#3633;งคมม&#3637;ลมหายใจอย&#3641;&#3656; <br />\r\n    <br />\r\n    -www.bloggang.com/viewdiary.php?id=vinitsiri&amp;month=05-2012&amp;date=08&amp;group=188&amp;gblog=117&nbsp; <b>ทะเบ&#3637;ยนรถฐล 9525 </b>ไม&#3656;ด&#3637; แต&#3656;บ&#3657;านเลขท&#3637;&#3656;ด&#3637; 59 เลขเร&#3637;ยงในช&#3639;&#3656;อสก&#3640;ลด&#3637; จ&#3638;งรอดมาได&#3657; แต&#3656;จากการด&#3641;คร&#3656;าวๆในช&#3639;&#3656;อสก&#3640;ลม&#3637;เลขร&#3657;ายเยอะมากท&#3633;&#3657;ง 33 83 39 72 188 ร&#3633;บรองว&#3656;าคนน&#3637;&#3657;ย&#3633;งไงก&#3655;จะเจออ&#3637;กซ&#3638;&#3656;งจะเป&#3655;นอ&#3640;บ&#3633;ต&#3636;เหต&#3640; และหน&#3633;กด&#3657;วย <br />', NULL, NULL, NULL, 1, 1, NULL);
