INSERT INTO `numbers` (`pairnumberid`, `pairnumber`, `pairtype`, `pairpoint`, `miracledesc`, `miracledetail`, `detail_vip`) VALUES
(1, '00', 'R10', -30, 'หมายเลข 00 ดาวอาทิตย์ดาวพลังความเชื่อมั่น ', 'เป็นเลขแห่งผู้นำ ได้รับอิทธิพลจากดาวอาทิตย์ เป็นเลขแห่งความเชื่อมั่นในตัวเองสูง มีไหวพริบปฏิภาณดีเยี่ยม สติปัญญาว่องไวใจนักเลง กล้าหาญ มีความทะเยอทะยานที่จะเป็นใหญ่เป็นโต กล้าเสี่ยง ชอบออกหน้า ถือความคิดอ่านตนเป็นใหญ่ เป็นผู้นำคน ชอบเด่นชอบดัง เป็นที่เคารพนับถือคนทั่วไป ใจคอเด็ดเดี่ยว คิดการเช่นไรมักจะรีบทำเดี๋ยวนั้น มั่นคงมีการตัดสินใจได้รวดเร็ว ไม่โลเล ชีวิตมักจะมีการเดินทางไม่เกรงกลัวต่ออุปสรรคต่างๆ เป็นเลขของเจ้าชะตะตาที่มีความแข็งแรงมีพลังร้อนแรงไม่มีขีดจำกัดอยู่ ชีวิตประสบความสำเร็จดี มีชื่อเสียง มีสมบัติทรัพย์ มีความสุข ดีได้ด้วยปัญญาความสามารถของ ทำงานด้านรับราชการ ทหาร ตำรวจ เป็นเจ้าคนนายคน ดีนักแล', 'เป็นสาเหตุให้เกิดการเปลี่ยนแปลงกะทันหัน มักมีเหตุการณ์เกิดขึ้น แบบไม่คาดฝันโดยไม่รู้ตัว \r\n\r\nข้อดี คนที่มีรหัส 0 จะเป็นคนที่ชอบแสวงหาความรู้แปลกๆ ใหม่ๆ อยู่เสมอ ไม่ชอบหยุดนิ่งอยู่กับที่ ชอบงานที่เสี่ยงอันตราย ชอบค้นคว้า ชอบสำรวจ ชอบติดต่อพบปะกับคนต่างชาติ หากใช้ชีวิตอยู่ต่างแดนจะประสบความสำเร็จมากกว่าอยู่ในประเทศไทย เพราะ  เลข 0 ยังหมายถึง ต่างประเทศ,วิญญาณ,โหราศาสตร์ แต่ถ้ามี 00 ต้องระวังให้มาก โดยเฉพาะถ้า X จาก X00X เป็นเลขบาปเคราะห์ เพราะ 0 มีข้อเสีย คือ\r\n\r\nข้อเสีย บุคคลที่ได้เลข 00 หรือ ถ้าสะสมเลข 0 อยู่ในชีวิตเยอะ มักจะเกิดอุบัติเหตุร้ายแรง หรือ เจ็บป่วยกะทันหัน ป่วยด้วยโรคร้ายที่รักษาไม่หาย หรือเป็นโรคร้ายเรื้อรัง โรคกรรม โรคมะเร็ง ชีวิตมักไม่ราบรื่น แถมถ้ามีเลขร้ายเกาะเยอะจะทำให้ชีวิตลุ่มๆดอนๆ\r\n\r\nข้อดี คนที่มีรหัส 0 จะเป็นคนที่ชอบแสวงหาความรู้แปลกๆ ใหม่ๆ อยู่เสมอ ไม่ชอบหยุดนิ่งอยู่กับที่ ชอบงานที่เสี่ยงอันตราย ชอบค้นคว้า ชอบสำรวจ ชอบติดต่อพบปะกับคนต่างชาติ หากใช้ชีวิตอยู่ต่างแดนจะประสบความสำเร็จมากกว่าอยู่ในประเทศไทย เพราะ  เลข 0 ยังหมายถึง ต่างประเทศ,วิญญาณ,โหราศาสตร์ แต่ถ้ามี 00 ต้องระวังให้มาก โดยเฉพาะถ้า X จาก X00X เป็นเลขบาปเคราะห์ เพราะ 0 มีข้อเสีย คือ\r\n\r\nข้อเสีย บุคคลที่ได้เลข 00 หรือ ถ้าสะสมเลข 0 อยู่ในชีวิตเยอะ มักจะเกิดอุบัติเหตุร้ายแรง หรือ เจ็บป่วยกะทันหัน ป่วยด้วยโรคร้ายที่รักษาไม่หาย หรือเป็นโรคร้ายเรื้อรัง โรคกรรม โรคมะเร็ง ชีวิตมักไม่ราบรื่น แถมถ้ามีเลขร้ายเกาะเยอะจะทำให้ชีวิตลุ่มๆดอนๆ\r\n'),
(2, '01', 'R10', -10, 'หมายเลข 01 ดาวอาทิตย์ดาวพลังความเชื่อมั่น ', 'เป็นเลขแห่งผู้นำ ได้รับอิทธิพลจากดาวอาทิตย์ เป็นเลขแห่งความเชื่อมั่นในตัวเองสูง มีไหวพริบปฏิภาณดีเยี่ยม สติปัญญาว่องไวใจนักเลง กล้าหาญ มีความทะเยอทะยานที่จะเป็นใหญ่เป็นโต กล้าเสี่ยง ชอบออกหน้า ถือความคิดอ่านตนเป็นใหญ่ เป็นผู้นำคน ชอบเด่นชอบดัง เป็นที่เคารพนับถือคนทั่วไป ใจคอเด็ดเดี่ยว คิดการเช่นไรมักจะรีบทำเดี๋ยวนั้น มั่นคงมีการตัดสินใจได้รวดเร็ว ไม่โลเล ชีวิตมักจะมีการเดินทางไม่เกรงกลัวต่ออุปสรรคต่างๆ เป็นเลขของเจ้าชะตะตาที่มีความแข็งแรงมีพลังร้อนแรงไม่มีขีดจำกัดอยู่ ชีวิตประสบความสำเร็จดี มีชื่อเสียง มีสมบัติทรัพย์ มีความสุข ดีได้ด้วยปัญญาความสามารถของ ทำงานด้านรับราชการ ทหาร ตำรวจ เป็นเจ้าคนนายคน ดีนักแล', 'ข้อเสีย คือ เป็นคนมั่นใจในตัวเองสูง เอาแต่ใจตัวเอง หยิ่ง ไม่ชอบอยู่ใต้บังคับบัญชาใคร กล้าได้กล้าเสีย ทำให้มีปัญหาในการทำงานและครอบครัว เลข 01 10 (รวมถึงเลขทุกคู่ที่บวกกันแล้วได้ 10 ) เป็นเลขของความพลัดพราก ครอบครัวไม่อบอุ่น ไม่เข้าใจกัน ไม่มีเวลาให้กัน มักต้องพลัดพรากจากกันพ่อไปทาง แม่ไปทาง ลูกไปทาง  ถ้าดวงแข็งก็จากเป็นแค่เลิกราหย่าร้าง ถ้าดวงอ่อนก็จากตาย ถ้าโชคดีดวงแข็งและอดทนได้อยู่ด้วยกันก็มักไม่ลงรอยกัน ไม่มีเวลาให้กัน อาจมีปากเสียงกันบ่อย ทะเลาะกันบ่อย ขัดแย้งกันไม่เข้าใจกัน มีมือที่สาม มีเรื่องพ่อแม่ญาติพี่น้องของอีกฝ่ายมารบกวน ชีวิตมักมีอุปสรรค และมักมีคดีความทุกคน มีคนปองร้าย บริวารมักให้โทษ เป็นคนอาภัพ ศัตรูรอบด้าน บริวารมักจะแข็งข้อ ก่อเหตุให้เดือดร้อนและกระทบกระเทือนใจมาให้ มักมีปัญหายุ่งยากภายในครอบครัวเสมอ ต้องมีภาระต้องรับผิดชอบ ต้องแบกภาระอันใหญ่หลวง\r\n\r\nชีวิตมักจะมีเรื่องระทมขมขื่นแอบแฝงอยู่ในใจ แม้มีเพื่อนมีบริวารมากแต่กลับเหงาและรู้สึกโดดเดี่ยว สุดท้ายจะมีโรคภัยไข้เจ็บเบียดเบียนอย่างเรื้อรัง โดยเฉพาะตา สมอง โรคความดันและหัวใจทุกรูปแบบ ใครที่ใช้เลขนี้จักเป็นคนที่คิดการสิ่งใด หรือทำสิ่งใดๆอยากทำให้ได้ดีที่สุดแต่บางครั้งก็ไม่สำเร็จ จนหักโค่นล้มลงได้ จึงทำให้ต้องแบกรับภาระหนี้สินมากมายในช่วงชีวิตหนึ่ง \r\n\r\nข้อดี ชอบของแปลกใหม่ไม่ซ้ำใคร มักจะเป็นผู้นำในการคิดค้นสิ่งใหม่ๆ โดยหวังจะให้มีสิ่งนั้นเกิดขึ้นเพื่อเป็นประโยชน์ต่อผู้อื่น มีความทันสมัย ชอบการเดินทาง ชอบท่องเที่ยว บุคคลหมายเลขนี้บทจะรุ่งโรจน์ มีลาภ ยศ สรรเสริญ ก็จะได้มาอย่างมากมาย บทดวงตก ลาภยศก็สามารถสูญสิ้นได้ในพริบตา ชีวิตจะประสบความสำเร็จหรือล้มเหลวขึ้นอยู่กับการกระทำ และการตัดสินใจของตนเองเป็นหลัก คนเลขนี้มักตกต่ำลงในบั้นปลายระวังจะลำบาก'),
(3, '02', 'R5', -25, 'หมายเลข 02 ดาวจันทร์ดาวพลังแห่งจินตนาการ ', 'มักเป็นคนมีจินตนาการสูง จิตใจอ่อนไหว มองโลกในแง่ดี บางครั้งคิดมาก คิดเล็กคิดน้อย ขี้น้อยใจ ช่างคิด ช่างฝัน ชอบศิลปะ ชอบของละเอียดอ่อน มีอารมณ์ศิลปิน ไวต่อความรู้สึกสูง เปลี่ยนแปลงอารมณ์ง่าย ด้วยเหตุนี้จึงเชื่อใจคนอื่นได้ง่าย ชอบชีวิตอิสระ ใครอยู่ใกล้แล้วจะมีความสุข เป็นคนอ่อนไหวแต่ถึงอย่างไรก็ตามเมื่อมีเหตุการณ์ไม่คาดคิด จะควบคุมสติได้ดี มีความกล้าหาญ เข็มแข็ง หลิกผันสถานการณ์ได้ดี ทำงานเป็นอาร์ตทิส ศิลปิน ดีไซด์เนอร์ นักออกแบบ สถาปนิก ครีเอทีฟ อาร์ตไดเร็คเตอร์ ฝ่ายศิลป์ทั้งหลาย นักออกแบบ ผู้ที่ต้องใช้ศาสตร์และศิลปะมาประกอบอาชีพจะรุ่งเรือง ติดที่เป็นคนดื้อรั้นแบบดื้อเงียบ ช่างฝันและขี้อาย เจ้าระเบียบ ขี้จุกจิก ต้องลดความดื้อและความอายลงบ้างจะดี', 'ด้านเสีย มักเป็นคนที่มีพฤติกรรมเพ้อฝัน ไม่ไว้ใจผู้อื่น อ่อนไหวง่าย รวนเร ดื้อ จุกจิก มีความทะเยอทะยานสูง เป็นคนที่คิดฝันไกล และมักฝันถึงโครงการใหญ่ๆ ชอบทำอะไรใหญ่เกินตัว กลายเป็นคนที่มีความกระตือรือร้นอย่างรุนแรง ชอบวิธีการใหม่ โดยไม่ชอบย่ำเท้าอยู่กับที่ กล้าลองกล้าเสี่ยง จนบางครั้งทำให้เกิดความผิดพลาดและคิดหลงผิดจนล้มเหลวลงได้ คนเลขนี้จะประสบความสำเร็จได้ต้องอาศัยคนรอบข้างหรือลูกน้องบริวารช่วย หากทำเองคนเดียวมักสำเร็จยากหรือไม่สำเร็จเลย ต้นดีพอสมควร แต่บั้นปลายชีวิตเหมือนผู้ดีตกยาก ทั้งหญิงและชายที่ใช้หมายเลขนี้ ต้องระวังเรื่องสุขภาพและคู่ครอง เทวดามักไม่สื่อรัก มักไม่ได้แต่งงาน หรือแต่งงานช้า หรือแต่งแล้วต้องเลิกรากัน ชีวิตมักจะมีปัญหาเรื่องคู่ ถูกกดดันจนทำให้ต้องเป็นคนไร้คู่ มักมีกิ๊กมีชู้ เป็นเมียน้อย มีเมียน้อย กินน้ำใต้ศอกผู้อื่น มักมีปัญหาที่หน้าอกช่วงอก มดลูก ซีสต์ เนื้องอก มะเร็ง มีปัญหาที่อวัยวะเพศชายก็เช่นกัน ให้ระวังต่อมลูกหมาก\r\n\r\nด้านดี มีเสน่ห์ ประสบความสำเร็จในเงินงานพอสมควร แค่ความรักมักมีปัญหาไม่โดดเด่นเหมือนงาน  ลางสังหรณ์แม่น ชอบปฏิรูปการเปลี่ยนแปลง ไม่ชอบอยู่นิ่งอยู่กับที่ มีความทะเยอทะยาน กระตือรือร้น มุ่งมั่นสูง กล้าเสี่ยงกล้าลอง กล้าคิดกล้าทำ รู้จักวางแผนรอบคอบ รักความก้าวหน้า ทะเยอทะยาน รักความสำเร็จ คาดหวังกับตัวเองเรื่องชีวิตสูงมาก มีจินตนาการกว้างไกล เป็นคนที่ทำงานประณีต เป็นคนทันสมัย ชอบไขว่คว้าหาแต่สิ่งที่สูงที่สุดเอื้อมจนกลายเป็นเรื่องละเมิดสิทธิของผู้อื่นได้ \r\n'),
(4, '03', 'R10', -50, 'หมายเลข 03 ดาวอังคารดาวพลังแห่งความกล้าหาญชาญชัย', 'มักเป็นคนมีจินตนาการสูง จิตใจอ่อนไหว มองโลกในแง่ดี บางครั้งคิดมาก คิดเล็กคิดน้อย ขี้น้อยใจ ช่างคิด ช่างฝัน ชอบศิลปะ ชอบของละเอียดอ่อน มีอารมณ์ศิลปิน ไวต่อความรู้สึกสูง เปลี่ยนแปลงอารมณ์ง่าย ด้วยเหตุนี้จึงเชื่อใจคนอื่นได้ง่าย ชอบชีวิตอิสระ ใครอยู่ใกล้แล้วจะมีความสุข เป็นคนอ่อนไหวแต่ถึงอย่างไรก็ตามเมื่อมีเหตุการณ์ไม่คาดคิด จะควบคุมสติได้ดี มีความกล้าหาญ เข็มแข็ง หลิกผันสถานการณ์ได้ดี ทำงานเป็นอาร์ตทิส ศิลปิน ดีไซด์เนอร์ นักออกแบบ สถาปนิก ครีเอทีฟ อาร์ตไดเร็คเตอร์ ฝ่ายศิลป์ทั้งหลาย นักออกแบบ ผู้ที่ต้องใช้ศาสตร์และศิลปะมาประกอบอาชีพจะรุ่งเรือง ติดที่เป็นคนดื้อรั้นแบบดื้อเงียบ ช่างฝันและขี้อาย เจ้าระเบียบ ขี้จุกจิก ต้องลดความดื้อและความอายลงบ้างจะดี', 'ด้านดี เป็นผู้ที่มีความกล้าหาญ มีความขยันขันแข็ง หัวคิดทันสมัย เป็นคนเก่ง เลขนี้สามารถส่งผลให้ชีวิตรุ่งโรจน์ได้อย่างผาดโผน ประสบความสำเร็จมีทุกสิ่งทุกอย่างทั้งเงินงานความรัก แต่…..\r\n\r\nด้านเสีย ขณะเดียวกันความรุ่งโรจน์ก็อาจล้มครืนลงมาได้อย่างฉับพลัน เหมือนวิมานทลาย  ชีวิตหาความสมดุลได้ยากเพราะชีวิตมักจะเปลี่ยนแปลงอย่างรวดเร็ว เช่น ธุรกิจการค้ากำลังเจริญรุ่งเรือง แต่ก็จะเกิดมีอุปสรรคมาปิดกั้นอย่างปัจจุบันทันด่วน หรือธุรกิจการงานกำลังประสบความสำเร็จแต่เจ้าของถูกจับหรือก็มีอันเป็นไป ได้แต่งงานได้เลื่อนตำแหน่งแต่ป่วยเจ็บประสบอุบัติเหตุ เป็นต้น จึงต้องระวังไม่ควรที่จะประมาท เพราะดาวคู่นี้เป็นดาวคู่ร้อนคู่อุบัติเหตุเมื่อมาอยู่ร่วมกัน จึงต้องระมัดระวังเรื่องอุบัติเหตุหรือเรื่อร้ายๆกะทันหันและมีเหตุร้ายแรงอย่างฉับพลัน เช่น การป่วย การบาดเจ็บ การผ่าตัดบ่อยๆ ให้ระวังเรื่องอุบัติเหตุและการผ่าตัดให้มาก ระวังรถคว่ำ ภัยจากอาวุธ เขี้ยวขอ ถูกคนลอบทำร้าย จนทำให้สูญเสียชีวิตได้ ให้ระวังการทะเลาะวิวาท ถูกจับ มีคดี การเจ็บป่วยจากโรคประสาท โรคผิวหนัง และระวังการถูกแย่งชิงตำแหน่งหน้าที่การงานความรักด้วย และคนเลขนี้มักมีเรื่องอื้อฉาวเกี่ยวกับการครองชีวิตคู่ การทะเลาะวิวาทในครอบครัว ชีวิตสมรสไม่แน่นอน ไม่ได้แต่งงาน หรือแต่งไม่น้อยกว่าหนึ่งครั้ง \r\n\r\nชีวิตมักจะหักกลาง มักมีปัญหาและอุปสรรคมากมาย มักล้มเหลวในหน้าที่การงาน มักถูกทรยศหักหลัง ถูกคดโกงไม่ซื่อสัตย์ กลายเป็นคนอมทุกข์ มักมีเรื่องสะเทือนใจอย่างรุนแรงในชีวิต ถูกเพื่อนฝูงญาติมิตร เกลียดชัง ดูถูกเหยียดหยาม จิตใจมักได้รับความเจ็บซ้ำหรือ เจ็บปวดอย่างรุนแรงอยู่เสมอๆ ใครที่ใช้เลขนี้ชีวิตมักจะพบกับจุดแตกหักได้อย่างไม่คาดฝัน มีความไม่แน่นอนในชีวิตสูง บางครั้งจะได้อยู่แล้วกลับไม่ได้ ชีวิตต้นร้ายปลายดี แต่กว่าจะผ่านวัยต้นของชีวิตไปได้ อาจจะไม่มีชีวิตอยู่ก็ได้ '),
(5, '04', 'D5', 25, 'หมายเลข 04 ดาวพุธพลังแห่งดาวสติปัญญา ', 'เป็นคนเฉลียวฉลาด ว่องไว ทันเกมคนอื่นๆ ใครก็หลอกไม่ได้ เอาตัวรอดได้ดีมาก ชีวิตประสบความสำเร็จดี รู้จักวางตัว ทันคนชอบติดต่อคบหาสมาคม ทำงานด้านการติดต่อสื่อสาร เป็นฝ่ายบริหารงานลูกค้า การตลาด ประชาสัมพันธ์ เซลขายของต่างๆ อาจารย์ งานที่ต้องติดต่อกับคนมากๆ มนุษย์สัมพันธ์เป็นเลิศ ใครๆก็ชอบอยู่ใกล้ ชอบเข้ามาคบค้าสมาคมด้วย มีความคล่องตัวสูง ติดตรงที่จะเหนื่อยกับการเดินทางเสมอ เหนื่อยกับการติดต่อสื่อสาร บางครั้งจิตใจสับสนบอกความต้องการของตัวเองไม่ถูก', 'ด้านดี ผู้ที่ใช้เลขนี้ คือ ฉลาดทันคน ปราดเปรียว วางตัวดี เอาตัวรอดเก่ง ชีวิตประสบความสำเร็จดี ดีเรื่องการเงิน เก็บเงินเก่ง บริหารเงินดี ชีวิตมีความสุขสบาย ฐานะร่ำรวยดี เจ้าบทบาท เป็นคนใฝ่รู้ชอบค้นคว้าหาความรู้ ชอบสนุกสนาน ชอบเดินทางท่องเที่ยว ชอบสิ่งใหม่ๆ และแปลกๆ ไม่ชอบอยู่ติดที่ จะได้รับการส่งเสริมหนุนนำ ให้ได้รับความสำเร็จมีความโดดเด่น ตรึงตาตรึงใจของคนทั้งหลาย เป็นคนที่พูดเก่ง บางครั้งพูดจาจนหาสาระไม่ได้ เป็นบุคคลที่ชอบคิดฝัน จินตนาการกว้างไกล ชอบสร้างวิมานในอากาศ รักอิสระ มักอยู่ไม่ติดบ้าน ชอบทำอะไรแหวกแนว \r\n\r\nด้านเสีย คือ สับสนตัวเอง เหนื่อยกับชีวิตการงานและสังคม เป็นคนเปลี่ยนใจง่าย อ่อนไหว เชื่อคนง่ายและยึดถืออย่างจริงจัง ระวังอุบัติเหตุ อาภัพรัก มักโสด  (ความรุนแรงมากน้อยต้องดูเลขอื่นประกอบ)'),
(6, '05', 'D8', 25, 'หมายเลข 05 ดาวพลังแห่งปัญญาปัญญาทางธรรมะ ', 'ปัญญาทางด้านคุณธรรม ด้วยปัญญาที่มีอยู่จะทำให้ชีวิตประสบความสำเร็จ ประกอบการทำงานใดๆจะราบรื่นรุ่งเรือง มีจริยธรรมดี มีความยุติธรรม ไม่ทำร้าย เอาเปรียบใคร ชอบสิ่งเร้นลับ ไสยศาสตร์ สิ่งศักดิ์สิทธิ์ สิ่งเหนือธรรมชาติ พิสูจน์ไม่ได้ด้วยวิทยาศาสตร์ เป็นคนมีความสุขุมเยือกเย็น เป็นคนมองโลกในแง่ดี ให้ความสำคัญกับศาสนาทำงานด้านอาจารย์ นักปกครอง งานที่ต้องอาศัยความสุขุมรอบคอบดี ถ้าเป็นพระจะชอบพิธีกรรมทางศาสนาต่างๆ ติดที่เป็นคนโกรธง่าย เชื่อมั่นในตัวเองค่อนข้างสูงทำให้ขาดเสน่ห์ไปได้', 'ด้านดี ผู้ที่ได้หมายเลขนี้ ดวงดีมาก เลขนี้จะนำพาไปสู่ความสำเร็จได้อย่างดี ผู้คนมักนิยมรักใคร่นับถือ โดยเฉพาะเรื่องสติปัญญา ว่องไว มีความสามารถ เป็นคนมีญาณพิเศษ มีบุญ มีความจำแม่นยำ มีความสุขุม เป็นคนรักความยุติธรรม ชอบไขว่คว้าหาความก้าวหน้าให้กับชีวิต ชอบการแสวงหาสนใจธรรมะ ชอบเดินทางต่างถิ่นต่างประเทศ สนใจในภาษาต่างประเทศ ชีวิตต้องเกี่ยวข้องกับต่างประเทศหรือคนต่างชาติต่างภาษาในหลายรูปแบบ ไม่ทำงานกับคนต่างชาติก็ทำงานหรือเรียนต่อต่างประเทศ ดีเด่นทางทำงานต่างประเทศ มักจะได้ไปใช้ชีวิตยังต่างประเทศ หรือคบหากับคนต่างชาติต่างภาษา คนเลขนี้ชีวิตต้องพบปะกับคนแปลกหน้าตลอดถึงจะดี เป็นคนที่ชอบเรียนรู้ศาสตร์เชิงปรัชญา หรือสิ่งลี้ลับ \r\n\r\nด้านเสีย ระวังจะหลงศาสนา สนใจธรรมะมากกว่าทางโลก แม้เลข 50 05 จะเป็นเลขดี แต่ห้ามมีเยอะ เพราะถ้ามีเยอะหรือไปจับคู่กับเลขร้ายๆจนเขาแสดงผลเต็มที่ให้ระวังจะป่วยเกี่ยวกับตับ ถุงน้ำดี ไมเกรน กระเพาะ และ ซีส เนื้อ งอก มะเร็ง \r\n'),
(7, '06', 'R5', -10, 'หมายเลข 06 ดาวแห่งศิลปะวิทยาการ', 'มีเสน่ห์ รักสวยรักงาม มีจินตนาการความฝัน ชอบศิลปะ ชื่นชมในงานศิลปะต่างๆ ทำอะไรก็จะคำนึงภาพลักษณ์ตนเองเป็นอย่างแรก มีรสนิยมดีชอบศิลปะ และดนตรี สนุกบันเทิง เป็นคนที่ชอบความรักสบายอย่างมาก มีโลกส่วนตัว เจ้าสำราญเสมอ ไม่ชอบเอาเปรียบเบียดเบียนใคร ชื่อนี้ดีมากจะส่งเสริมเงินทองไหลมาเทมา มีเสน่ห์ ชื่อเสียง มีความสำเร็จที่งดงาม ทำงานด้านช่างแต่งหน้า ศิลปิน สไตล์ริส นักประชาสัมพันธ์ ฝ่ายศิลป์ต่างๆ จะดี', 'ด้านดี คือ เป็นคนที่มีเสน่ห์ รักสวยรักงาม มีแรงดึงดูดให้คนรักใคร่ชอบพอ มักมีความโชคดีในเรื่องงานและเงินทอง มองโลกในแง่ดี มีอารมณ์ประณีตละเอียดละมัย มีความสุขุมรอบคอบ จิตใจดี มองโลกในแง่ดี ไม่ชอบเอาเปรียบเบียดเบียนใคร ชอบในสถานที่โอ่อ่าหรูหราดูดี ชะตาชีวิตโดยทั่วไปถือว่าดี ไม่ต้องต่อสู้ฟันฝ่าอุปสรรคมากนัก มีความเป็นอยู่สุขสบาย แม้จะดีแต่ไม่ควรมีมากกว่า 1 คู่ แม้จะดีแต่ควรระวังส่วนร้ายให้มากๆถ้ามีเยอะถ้าใช้นานระวังจะเป็นป่วยเป็นโรคและจะกลายเป็นขี้เกียจ เฉื่อยชา รักสบายติดหรูฟุ่มเฟือยใช้เงินเก่ง\r\n\r\nด้านเสีย คือ งมงาย หลงผิด เพ้อฝันชอบจินตนาการ ใช้เงินเก่ง หรือ มักมีเหตุให้เสียเงินเสียทรัพย์ ระวังถูกหลอกถูกโกงอย่างไม่คาดฝัน ชอบคิดแต่ไม่ลงมือทำ หรือทำแต่ช้าทำไม่จริงจัง หญิงใช้ดี แต่อย่าประมาท ชายใช้ระวังจะเป็นผิดเพศ หญิงชายใช้ถ้ามีมีเยอะและอยู่ในส่วนสำคัญที่แสดงผลแรง ระวังจะมีกิ๊กมีชู้ ระวังโรคภายในช่องท้อง โรคที่เกี่ยวกับ ไต กระเพาะปัสสาวะ อวัยวะเพศ ติดเชื้อ.. ซีสเนื้องอก โรคมะเร็ง \r\n\r\n \r\n'),
(8, '07', 'R10', -60, 'หมายเลข 07 ดาวเสาร์ดาวพลังแห่งทุกข์โศก', 'โรคภัยไข้เจ็บ ป่วยง่าย เป็นหวัดบ่อย ปวดหัวตัวร้อยเสมอ ทำอะไรก็ติดขัดไปหมด มีการสูญเสียเสมอ ไม่เป็นที่ มักเดือดร้อนเป็นประจำ ไม่สมหวังเรื่องความรัก และครอบครัว ต้องแยกกันอยู่ไม่ค่อยได้อยู่พร้อมหน้าพร้อมตา แต่มีดีเรื่อง มีสติปัญญาและความอดทนเป็นเลิศ ใช้ภาษาการติดต่อสื่อสารเก่งประคับประคองตัวแต่เป็นแบบลุ่มๆดอนๆไม่มั่นคง การตั้งชื่อให้หลีกเลี่ยงเลข 7 ไว้ได้เลยเพราะถือว่าเป็นดาวบาปเคราะห์ จะมีผลทางลบมากกว่าทางบวกจะนำความยุ่งยากให้แก่ชีวิต มีความไม่มั่นคงในชีวิต', 'ด้านเสีย 70 07 ผู้ที่ได้หมายเลขนี้ มักมีภัยอุบัติเหตุจ้อง มักเจ็บป่วย มีโรคร้าย หรือมีโรคประจำตัวเรื้อรัง เช่น กระเพาะ ภูมิแพ้ มะเร็ง หรือ มีปัญหาที่เอ็น ข้อต่อ กระดูก หลัง คอ หัว ระบบประสาท เส้นประสาท สมอง กระดูกแตกร้าว เอ็นพลิกเอ็นขาด เป็นต้น คนเลขนี้ใช้ไปนานๆชีวิตมักมีอุปสรรคปัญหารุมเร้า มีคนไม่ชอบหน้าและปองร้าย อาภัพโดดเดี่ยว ชีวิตมีความกดดันสูงมากจนอาจถึงขั้นทำร้ายตนเอง ฆ่าตัวตาย โดนฆ่าตาย หรือทำร้ายผู้อื่นได้ คนเลขนี้มักมีเรื่องให้เครียด คิดมาก ฟุ้งซ่าน เก็บกด กดดัน ทุกข์ เศร้า อมทุกข์ อาภัพรัก มักมีอุบัติเหตุ โดนเอาเปรียบ โดนรังแกโดนทำร้าย มีคดีความ ทะเลาะ ถูกคุมขัง ติดคุกติดตะราง ถูกปล้นจี้ และภัยธรรมชาติอันร้ายแรง ใครที่มีเลขนี้ใช้เลขนี้นานๆ จะมีอำนาจเร้นลับมีอำนาจมืดครอบงำให้คิดผิดตัดสินใจผิด และทำให้เป็นคนเห็นแก่ตัว ใจร้ายใจดำ อาฆาตจองเวร ใช้อารมณ์มากกว่าเหตุผล มักเป็นโรคเครียด หรือเป็นโรคจิตเป็นโรคประสาทอ่อนๆ\r\n\r\nเลขนี้เป็นเลขที่อันตราย แรงกรรมรุนแรง ผู้ได้เลขนี้ถ้ารักตัวเองควรเปลี่ยนออก แต่ถ้าเปลี่ยนไม่ได้ ต้องพยายามควบคุมอารมณ์ให้ได้ ต้องมีสติ ต้องมีสติสมาธิ ต้องทำบูญบ่อยๆเพราะแรงกรรมและความคิดชั่ววูบ อาจก่อให้เกิดปัญหาร้ายแรงอย่างคาดไม่ถึง จนทำให้ทุกข์และเกิดความสูญเสียทั้งชื่อเสียง เงิน งาน แม้แต่ชีวิตของตนเอง\r\n'),
(9, '08', 'R5', -10, 'หมายเลข 08 ดาวราหูพลังแห่งความลุ่มหลงมัวเมา ', 'โมโหง่าย ถูกครอบงำทางเสื่อมได้ง่าย การงานความรักมีแต่อุปสรรค โดนคนใส่ร้ายก็บ่อย ศัตรูมาก คนไม่ชอบหน้าเยอะ และจะถูกชักจูงได้ง่าย ไปในทางอบายมุข พนันบอล เล่นมวย เที่ยวกลางคืนบ่อยๆจนเสียงานเสียการ มีความทุกข์ในใจสูง ถ้าจะเป็นใหญ่เป็นโตได้แต่ต้องลำบากฝ่าฟันมากกว่าจะสำเร็จ', 'ด้านดี คือ ความมั่งคั่งร่ำรวย ด้านดีภายนอกเป็นนักต่อสู้ชีวิตคนหนึ่ง มีความอดทน อีกทั้งเป็นคนใจกว้าง ให้อะไรใครไม่เคยเสียดาย ชอบเข้าสังคม เป็นคนที่ชอบคบเพื่อน  มีเพื่อนมาก รักพวกพ้อง คบกับใครได้ทุกคน ใจกล้า กล้าได้กล้าเสีย \r\n\r\nด้านเสีย มักเหน็ดเหนื่อยเดือดร้อนวุ่นวายกับงานและบริวาร จะเป็นคนเจ้าอารมณ์ มุทะลุ พูดจาเผ็ดร้อน ขวานผ่าซากออกนักเลง แต่ไม่นานก็หาย จึงมีศัตรูเยอะ ลุ่มหลงมัวเมา ขาดสติ หลงตัวหลงตน เมารัก เมาเหล้า การพนัน ชอบอบายมุข สิ่งผิดกฎหมาย เจ้าโทสะ ชีวิตมักถูกใส่ร้ายป้ายสี ชีวิตมักจะผิดพลาดอยู่เสมอ เลขนี้ถ้าใครสะสมไว้มากๆ มักจะมีชู้มีกิ๊ก ทำผิดกฎหมายและศีลธรรม มีคดีความ โดนหลอกโดนโกง หมดตัว ล้มละลาย มักตัดสินใจผิดพลาด เจ็บตัวเจ็บป่วยด้วยโรคร้าย โรคมะเร็ง โรคกรรม หรือประสบอุบัติเหตุรุนแรงกะทันหัน ความหมายคล้ายๆกับเลข 80 88 แต่มีความรุนแรงน้อยกว่า ถ้าเลือกได้ ถ้าถูกโฉลกจึงอนุญาตให้ใช้ได้เพียงคู่เดียว\r\n'),
(10, '09', 'D10', 30, 'หมายเลข 09 พลังดาวเกตุพลังแห่งความลึกลับ ', 'เลขนี้เป็นมงคลมาก เพราะได้พลังจากสิ่งที่มองไม่เห็นมาช่วยดูแลคุ้มครอง ช่วยทำให้กิจการงานใดๆประสบผลสำเร็จ บางครั้งมีอุบัติเหตุก็ทำให้รอดพ้นอย่างไม่น่าเชื่อ มีอายุยืนมั่นคง มีความคิดรวดเร็วว่องไว มีลางสังหรณ์ที่แม่นยำ เลื่อมใส ศรัทธา สนใจในศาสนาเร้นลับสนใจของเก่าแก่ เลขนี้ทำให้อยู่สบาย เรื่องราวชีวิตราบรื่นได้โชคลาภแบบไม่คาดฝัน เพราะมีสิ่งพลังเร้นลับช่วยอยู่ ชอบสะสมของเก่า ของโบราณต่างๆ ถ้าสวดมนตร์บ่อยๆและแผ่เมตตาบารมี พลังสวดมนตร์บำบัดจะช่วยให้พลังของสิ่งที่มองไม่เห็นช่วยคุณได้มากขึ้นไปอีก การทำงานเป็นนักค้าของเก่า นักโบราณคดี โหราจารย์ ผู้ที่ต้องยุ่งเกี่ยวกับเรื่องเร้นลับหรือของเก่าของขลังจะดี', 'ด้านดี ผู้ที่ได้หมายเลขนี้ จะมีสิ่งศักดิ์สิทธิ์คอยให้ความช่วยเหลืออยู่ตลอดเวลาทั้งเทพเทวา และผีวิญญาณ ชะตาชีวิตราบรื่นดี หยิบจับอะไร มักจะประสบความสำเร็จลุล่วงได้เป็นอย่างดี มีผู้หลักผู้ใหญ่ให้การสนับสนุน ส่งเสริมให้ประสบความสำเร็จ ในหน้าที่การงาน มีความเป็นอยู่ที่สุขสบาย ชีวิตมีอุปสรรคน้อย มักลำบากไม่นาน เพราะมีสิ่งศักดิ์สิทธิ์คอยคุ้มครอง ส่งเสริมหนุนนำชีวิต ให้มีความสุข ความเจริญ และร่ำรวยมั่นคงพอสมควร\r\n\r\nด้านเสีย ถ้าเป็นคนดีจะดี ถ้าเป็นคนไม่ดีผีและเทพเทวาจะให้โทษ เลขนี้จะทำให้คนที่ใช้ชีวิตประสบความสำเร็จดี แต่เหมือนยังดีไม่สุด ต้องระวังอย่านำไปใช้กับเลขร้ายๆ เช่น ทะเบียนรถ 9037 ถ้าเจอแบบนี้จะประสบอุบัติเหตุได้ง่าย เพราะเลข 90 เป็นเหมือนประตูเปิดไปหาทั้งนรกสวรรค์ ถ้ามีกรรมเก่าแรงต้องระวังเพราะเลขนี้ถ้าจับคู่กับเลขดีจะยิ่งดี เลขดีจะช่วยลดพลังของดาวมฤตยูได้ แต่ถ้านำไปใช้คู่กับคู่เลขร้าย ความร้ายก็จะเพิ่มทวีเช่นกัน'),
(11, '10', 'R10', -30, 'หมายเลข 10 พลังแห่งอุปสรรค ', 'เป็นคนจริงจังซีเรียสทุกเรื่อง เชื่อมั่นในตัวเองสูง ไม่ชอบอยู่ใต้บังคับใคร เป็นคนแข็งกร้าว ชอบเป็นผู้นำ ยอมหักไม่ยอมงอ ทำอะไรมีอุปสรรคศัตรูมาก ไม่ค่อยประนีประนอม แต่กล้าตัดสินใจ กล้าได้กล้าเสีย ในชีวิตมักจะมีอุปสรรค คิดจะทำอะไรมักจะเจอคู่แข่ง มีคนปองร้าย บริวารมักจะให้โทษ ทำให้ชีวิตมักอาภัพ มีศัตรูรอบด้าน คนในครอบครัวไม่เชื่อฟัง ต้องทุกข์ใจเพราะคนในครอบครัว ต้องแบกภาระอันหนักอึ้งเพียงลำพัง และยังจะมีโรคภัยไข้เจ็บได้ง่ายป่วยบ่อย ไม่สบายบ่อย สุขภาพอ่อนแอ ผลรวมเบอร์ทุกตัวที่ได้เลขนี้ ควรเปลี่ยนครับ เป็นเลขพลัดพราก เป็นเชขของความโดดเดี่ยวอ้างว้าง เหงา ครอบครัวไม่อบอุ่น บั้นปลายต้องอยู่คนเดียว ไร้ญาติขาดมิตร แม้จะมีก็เหมือนไม่มี  ชีวิตมักจะมีเรื่องระทมขมขื่นแอบแฝงอยู่  ระวังโรคหัวใจ ระวังจะมีภาระหนี้สินมีหนี้ท่วมหัว มีศัตรูคอยกลั่นแกล้ง ชีวิตเหมือนต้องเริ่มนับหนึ่งใหม่เสมอ ชีวิตก็มีประสบความสำเร็จอยู่บ้าง คือสำเร็จอย่างแหวกแนวไม่เหมือนใคร แต่ถ้าเวลาดวงตกก็จะสูญสิ้นในพริบตา', 'ข้อเสีย คือ เป็นคนมั่นใจในตัวเองสูง เอาแต่ใจตัวเอง หยิ่ง ไม่ชอบอยู่ใต้บังคับบัญชาใคร กล้าได้กล้าเสีย ทำให้มีปัญหาในครอบครัว เลข 01 10 (รวมถึงเลขทุกคู่ที่บวกกันแล้วได้ 10 ) เป็นเลขของความพลัดพราก ครอบครัวไม่อบอุ่น ไม่เข้าใจกัน ไม่มีเวลาให้กัน มักต้องพลัดพรากจากกันพ่อไปทาง แม่ไปทาง ลูกไปทาง  ถ้าดวงแข็งก็จากเป็น ถ้าดวงอ่อนก็จากตาย ถ้าโชคดีได้อยู่ด้วยกันก็มักไม่ลงรอยกัน อาจมีปากเสียงกันบ่อย ทะเลาะกันบ่อย ขัดแย้งกันไม่เข้าใจกัน เลิกราหย่าร้าง มีมือที่สาม\r\n\r\nชีวิตมักมีอุปสรรค และมักมีคดีความทุกคน จับงานอะไรมักจะเจอคู่แข่ง มีคนปองร้าย บริวารมักให้โทษ เป็นคนอาภัพ ศัตรูรอบด้าน บริวารมักจะแข็งข้อ ก่อเหตุให้เดือดร้อนและกระทบกระเทือนใจมาให้ มักมีปัญหายุ่งยากภายในครอบครัวมีภาระต้องรับผิดชอบต่อหน้าที่การงาน ต้องแบกภาระอันใหญ่หลวงชีวิตมักจะมีเรื่องระทมขมขื่นแอบแฝงอยู่ มีโรคภัยไข้เจ็บเบียดเบียนอย่างเรื้อรัง โดยเฉพาะโรคตาโรคความดันและหัวใจทุกรูปแบบ ใครที่ใช้เลขนี้จักเป็นคนที่คิดการสิ่งใด หรือทำสิ่งใดๆอยากทำให้ได้ดี ที่สุดแต่บางครั้งไปไม่รอด อาจหักโค่นล้มลงได้ จึงทำให้ต้องแบกรับภาระหนี้สินเกิด มีศัตรูคอยปองร้ายกลั่นแกล้ง มีความยุ่งยาก ความวุ่นวายไว้เสมอ ชีวิตต้องระวังอุบัติเหตุ หรือโรคภัยไข้เจ็บ ที่คอยเบียดเบียน\r\n\r\nข้อดี ชอบของแปลกใหม่ไม่ซ้ำใคร มักจะเป็นผู้นำในการคิดค้นสิ่งใหม่ๆ โดยหวังจะให้มีสิ่งนั้นเกิดขึ้นเพื่อเป็นประโยชน์ต่อผู้อื่น มีความทันสมัย ชอบการเดินทาง ชอบท่องเที่ยว บุคคลหมายเลขนี้บทจะรุ่งโรจน์ มีลาภ ยศ สรรเสริญ ก็จะได้มาอย่างมากมาย บทดวงตก ลาภยศก็สามารถสูญสิ้นได้ในพริบตา ชีวิตจะประสบความสำเร็จหรือล้มเหลวขึ้นอยู่กับการกระทำ และการตัดสินใจของตนเองเป็นหลัก \r\n'),
(12, '11', 'R10', -60, 'หมายเลข 11 พลังแห่งความขัดแย้งในตัวเอง', 'เป็นคนเข้าใจยาก มีบุคลิกสองอย่างขัดแย้งกัน การแสดงออกภายนอกอ่อนไหว เรียบร้อย เป็นระเบียบ แต่ภายในหัวแข็ง ดื้อไม่ยอมใคร เป็นคนอาฆาตพยาบาท มักจะซ่อนบุคลิก ลักษณะอันแท้จริงไว้ภายในซึ่งทำให้คนอื่นอ่านยาก มักจะอำพรางส่วนลึกของจิตใจไม่ให้ใครเห็นใครรู้จนยากที่ใครจะทายใจได่ง่ายๆ มักจะเป็นคนหลงตัวเอง ทำอะไรคือชอบเอาตัวเองเป็นหลักไม่ชอบอะไรจะไม่โต้แย้งแต่จะเก็บและจำไว้ เป็นคนจู้จี้ขี้บ่น เป็นคนที่จัดว่าดื้อรั้นอย่างมาก จึงมักจะถูกพวกมากลากไป ชีวิตต้องต่อสู้ดิ้นรนฟันฝ่าอุปสรรคด้วยแข้งตัวเองตลอด จะเดือดร้อนเพราะเพื่อนพ้อง และความเชื่อมั่นใจตัวเองเสมอๆ เป็นคนที่มีความทะเยอทะยานสูงมาก ชอบการก้าวกระโดด ใฝ่ฝันต่อความก้าวหน้าอย่างเร่าร้อนรุนแรง มักจะตัดสินจออกมาในลักษณะเด็ดเดี่ยวแข็งกร้าว กล้าที่จะตัดสินใจ ต่อเหตุการณ์ร้ายแรงเด็ดขาดโดยไม่มีคาดฝันมาก่อน มักจะโดนหลอกได้ง่าย', 'ด้านดี ผู้ที่ตกอยู่ใต้อิทธิพลของหมายเลข 11 ดี รุ่งเรือง ร่ำรวยในตอนต้น \r\n\r\nด้านเสีย ตกต่ำ เจ็บ ตายในบั้นปลาย เลขนี้มักพบบ่อยในคนที่มีดวงล้มละลาย หมดตัว มักโดนปองร้าย มีอุบัติเหตุ มีคดีความ เลขนี้ถ้าใครมีเยอะแถมมีเลขร้ายแรงร่วมด้วย มักจะประสบอุบัติเหตุรุนแรง โดนยิง โดนไฟ โดนระเบิด คนเลขนี้มักจะอ่อนนอกแข็งใน การแสดงออกภายนอกดูเป็นคนนุ่มนวล แต่กลับเป็นคนซ่อนบุคลิกอันแท้จริงไว้ เป็นคนรักความก้าวหน้าในชีวิต วิถีชีวิตต้องดิ้นรนต่อสู้ ไม่ค่อยมีเวลาหยุดนิ่งเฉย มักจะทำอะไรได้ดีในตอนต้น แต่สุดท้ายมักจะล้มเหลวในที่สุด ชีวิตมักมีอันตราย เข้ามาแอบแฝงอยู่บ่อยๆ ให้ระวังการถูกทรยศหักหลังจากผู้อื่นและเพศตรงข้าม มักจะถูกเพื่อนฝูงและเพศตรงข้ามทรยศหักหลังอยู่บ่อยๆ ทำคุณกับใครไม่ค่อยขึ้นหาคนจริงใจด้วยยาก ค่อนข้างอ่อนไหวได้ง่าย มักจะต้องเดินทางบ่อยๆ เปลี่ยนแปลงโยกย้ายหลายครั้ง หรือบ่อยมาก ในชีวิตมักจะไปได้ดี ในถิ่นที่ไม่ใช่บ้านเกิดของตน มีความเชื่อมั่นในตนเองสูงมาก อวดดี มักจะเป็นคนหลงตัวเองเป็นหลักชอบอวดอ้าง  ทำอะไรชอบเข้าข้างตัวเอง  มักถือพวกพ้องเป็นใหญ่ ดื้อรั้น อย่างหนัก ถ้าลองปักใจอะไรแล้วยากที่ใครจะเปลี่ยนใจได้ง่าย ๆ  ในบางครั้งก็อ่อนไหวง่ายจิตใจรวนเร จึงมักถูกคนหมู่มากลากไป เป็นคนที่ต้องต่อสู้กับอุปสรรคอันใหญ่หลวงในชีวิต จะลงมือทำอะไรมักจะมีมือคนทำให้ป่วยทำให้เรื่องยุ่ง มีปัญหาอยู่บ่อยๆ คนที่ใช้เลขนี้อย่าไว้ใจใครเด็ดขาด อย่าไปคาดหวังให้คนอื่นรักเราช่วยเหลือเราในยามทุกข์เพราะไม่มี และจงอย่าแข็งกร้าวกับความสัมพันธ์ไม่ว่ากับเพื่อน แฟน หรือคนในครอบครัว เพราะจะมีแต่วุ่นวายไร้สุข ทุกข์ยิ่งกว่าเก่า \r\n'),
(13, '12', 'R10', -50, 'หมายเลข 12 พลังแห่ง2บุคลิกในคนเดียว ', 'เป็นคนที่มีอารมณ์ขัดแย้งกันในตัวเอง เป็นคนมี 2 บุคลิกคือ บางครั้งดื้อรั้น มุทะลุดุดัน บางครั้งก่อนโยน ว่าง่ายเชื่อฟัง เวลาที่อยากเอาชนะใครจะต้องเอาชนะให้ได้ไม่ยอมคน ชอบการเอาชนะไม่ยอมสยบใครง่ายๆ การที่ไม่ยอมและแข็งๆแบบนี้ก่อให้เกิดอุบัติเหตุต่อชีวิตได้ง่าย จะมีโรคภัยไข้เจ็บเรื้อรัง ทำการสิ่งใดมักจะมีอุปสรรค ความใจร้อนทำให้เกิดอุบัติเหตุเสมอ และเป็นการก่อศัตรูเพิ่มอีกด้วย ชอบใจอ่อนระวังจะโดนหลอกได้ง่าย เรื่องความรักทุ่มเทสุดตัว แต่ถ้าอกหักล่ะ ไม่เป็นอันทำอะไรเลย และมีโอกาสถูกคนปองร้ายได้', 'ด้านดี พลังของราหู คนที่มีเลขนี้ตั้งแต่กำเนิด มักมีเสน่ห์ ดูดี โดดเด่น มีชื่อเสียง มั่งคั่งร่ำรวย \r\n\r\nด้านเสีย แต่ถ้าไม่ระวัง และมีเยอะเกินไป อีกทั้งมีเลขร้ายอื่นๆมาร่วมด้วย จะมีคดีความ มีเรื่องมีราว ป่วย มีอุบัติเหตุ เพราะคนเลขนี้หยิ่ง,ลุ่มหลงมัวเมา หูเบาเชื่อใจคนง่าย ถูกยุยงได้ง่าย ,เจ็บไม่จำ มีอารมณ์ขัดแย้งในตัวเอง และมีอาการหยิ่งถือดี มีโทสะจริต ชอบการเอาชนะไม่ยอมสยบใครง่าย ๆ มักจะไม่ได้รับความจริงใจ จากเพศตรงข้ามและเพื่อนฝูง เป็นคนดื้อรั้น และเชื่อมั่นในตนเองสูง ชีวิตมักผิดพลาด ชีวิตมักมีมุมหักเหหรือมีเหตุให้ล้มเหลวเกิดขึ้นกับตนเองได้อย่างที่ไม่ทันตั้งตัว เพราะหากตั้งใจทำอะไร หรือจะช่วยเหลือใครแล้วละก็ใครจะห้ามปราม หรือให้เหตุผลทัดทานอย่างไรก็ไม่ฟัง ถ้าหลงใครแล้วมักจะหลงอย่างไม่ลืมหูลืมตา ทุ่มทุกอย่างแม้กระทั่งชีวิตของตัวเองเพื่อคนอื่น มักแบกรับภาระของคนอื่นไว้ ทำเพื่อนคนอื่นมากกว่าตัวเอง มักถูกนินทาหรือถูกใส่ร้ายอยู่เนืองๆ คนที่มีเลขนี้ตามมักมีโรคประจำตัวที่รักษาหายยาก โรคภัยไข้เจ็บเบียดเบียนอย่างเรื้อรัง มักเป็นโรคร้าย โรคกรรมโรคมะเร็ง ชีวิตเกิดอุบัติเหตุได้ง่าย ติดเหล้าติดยา บางครั้งติดการพนัน หรือหลงเชื่อการทรงเจ้า เข้าผี เชื่ออย่างผิดๆ คิดว่าตนเองเป็นผู้มีญาณหยั่งรู้ วิเศษกว่าคนอื่น คนเลข 12 ชีวิตสมรสไม่แน่นอนถ้ายังไม่มีแฟนใช้จะถึงขั้นไม่ได้แต่งงาน ถ้าแต่งงานแล้วตัวเลขจะทำให้ต้องแต่งงานไม่น้อยกว่า 1 ครั้ง คนเลข 12 มักมีคนไม่จริงใจหวังเงินหวังผลประโยชน์รายล้อมอยู่รอบด้าน บางครั้งรู้ว่าขาหลอกแต่เต็มใจให้หลอก ก็เพราะเป็นคนใจอ่อนนั่นเอง เลข 12,21, ถ้าตามใครแล้วรวยทุกคน มีเงินทุกคนแต่ชีวิตมักจะขึ้นๆลงๆและจบไม่สวยในตอนจบ\r\n'),
(14, '13', 'R10', -80, 'หมายเลข 13 แห่งการเปลี่ยนแปลงทั้งดีและร้าย ', 'สามารถทำให้เกิดอิทธิพลได้ทั้งเรื่องดีและเรื่องร้ายเกิดขึ้นได้อย่างฉับพลัน จะมีการเปลี่ยนแปลงอย่างรวดเร็วทั้งดีและร้าย มีโอกาสได้ลาภลอยแต่ก็ต้องถูกหมดสิ้นไปอย่างรวดเร็ว ไม่คงทน จะมีอุบัติเหตุที่หนักๆในช่วงหนึ่งของชีวิต บางครั้งลาภที่ได้ก็เป็นแบบทุกข์ลาภได้มาแต่ต้องทุกข์ใจด้วย จะมีโอกาสเกิดการพลัดพรากจากครอบครัว ความรักไม่ราบรื่นทะเลาะกันบ่อยหรือยากที่จะได้พบรัก มีความทุกข์ในใจที่บอกใครไม่ได้เสมอ เดินทางบ่อย อยู่กับที่ไม่เป็น', 'ด้านดี คือมักจะส่งผลดีอย่างรวดเร็ว (มีอิทธิพลจากกำลังดาวมหาอุจน์ 13) ทำให้มีโชคมีอำนาจหน้าที่การงานสูงอย่างไม่คาดคิดมาก่อนแต่…………………………………………………….\r\n\r\nด้านเสีย……..แต่ในขณะเดียวกันก็จะตกต่ำล้มเหลวลงอย่างรวดเร็ว มีเหตุร้ายเกิดขึ้นอย่างไม่คาดฝันเช่นกัน เพราะเลข 1,3 เป็นดาวคู่ศัตรูกัน เมื่อมาอยู่ร่วมกัน  จะให้ทั้งคุณและโทษอย่างรวดเร็ว มักมีการเปลี่ยนแปลงอย่างรวดเร็ว  จึงทำให้เกิดทั้งเรื่องดี เรื่องร้ายได้อย่างฉับพลัน  ชีวิตที่ต้องวิ่งเต้นต่อสู้ หรือแข่งขันอยู่ตลอดเวลา เป็นคนที่รับผิดชอบต่อหน้าที่การงานดี แต่ชีวิตมักหักกลางคัน ซึ่งเกิดจากบุคคลที่ใกล้ชิดหรือผู้ที่ตนไว้วางใจ ชีวิตมักจะมีลูกน้องหรือมีผู้สนับสนุนเป็นอันดี ในช่วงเริ่มต้นทำงานแต่พอเริ่มจะดีก้าวหน้าขึ้น มักถูกหักหลัง หรือขาดความสามัคคีกัน จนเป็นเหตุให้สิ่งที่กำลังดำเนินอยู่ มีอันต้องล้มลง และผู้ที่ใช้หมายเลข 13 ต้องระวังเรื่องชู้สาว การหย่าร้าง ครอบครัวแตกแยก การทรยศหักหลัง อุบัติเหตุรุนแรง หากมีบริวารลูกน้อง ก็ต้องระวังเขาจะโกงเงิน จะแทงข้างหลัง ชีวิตตอนต้นดีบั้นปลายร้าย \r\n\r\nใครมีเลข 13 จงระวังให้หนักเพราะเป็นดาวอุบัติเหตุที่รวดเร็วและรุนแรง  ต้องระวังอุบัติเหตุทุกรูปแบบ  ผ่าตัด ช่องท้อง รถคว่ำ ถูกอาวุธ ถูกคนลอบทำร้าย  ครอบครัวมีปัญหาแตกร้าว ชีวิตคู่ไม่ปกติสุข  ผู้ใหญ่ให้โทษ สายตามีปัญหา ผู้ใหญ่กดดัน  คนเลข 13 มักจะมีความคิดความเห็นแปลกไม่เหมือนคนอื่น ดื้อรั้น บางครั้งชอบทำอะไรแปลกแหวกแนวไม่เหมือนใคร  ไม่ชอบให้ใครมาท้าทาย ไม่ชอบเดินตามรอยเท้าใคร กล้าแบบไม่กลัวใคร เป็นคนตัดสินใจผิดพลาดทั้ง ๆ ที่รู้ จึงมักส่งผลให้เกิดศัตรู มีอันตรายและล้าเหลวในบั้นปลาย เลข 13 จะได้มาซึ่งอำนาจ  แต่หากใช้ อำนาจไปในทางที่ผิด มีความเห็นแก่ตัว  เอารัดเอาเปรียบแล้ว  ไม่มีศีลธรรม  จะมีอุปสรรค มาขวางกั้นอยู่ตลอดเวลา หาความสมดุลให้กับชีวิตไม่ได้เลย ชีวิตขึ้น ๆ ลงๆ หาความแน่นอนไม่ได้เลย\r\n'),
(15, '14', 'D10', 65, 'หมายเลข 14 พลังสติปัญญาไหวพริบและมงคล ', 'เป็นเลขดีมาก มักจะส่งเสริมให้ชีวิตมีความรุ่งโรจน์รุ่งเรือง มีความรู้สติปัญญาเหนือคนอื่นๆ รู้เท่าทัน ไม่โดนคดโกงหลอกง่าย ทำงานประสบความสำเร็จ มีโอกาสก้าวหน้าได้อย่างรวดเร็วทางด้านหน้าที่การงาน เป็นคนสมองเฉียบแหลมว่องไว กล้าคิดกล้าทำหล้าตัดสินใจ มีชื่อเสียงกว้างไกล เป็นคนที่ยึดถือความถูกต้อง ชอบความยุติธรรม ซื่อสัตย์ ความรักก็ราบรื่นได้แฟนคู่ครองที่ดี ลูกหลานครอบครัวสบาย มีความเข้มแข็ง อดทน ต่อสู้อุปสรรคไม่ย่อท้อ จะติดอยู่บ้างตรงที่ ใจร้อน บางครั้งปากไวพูดไม่ระวังทำให้คนอื่นๆเสียใจได้ อาชีพ ทนายความ ผู้พิพากษา ฝ่ายจัดซื้อ บัญชี ตำแหน่งสูงๆในบริษัท ในสายงานจะดี', 'ด้านดี จะส่งเสริมให้ชีวิตเจริญก้าวหน้ารุ่งเรืองพบกับความรุ่งโรจน์อย่างมั่นคง ชีวิตประสบความสำเร็จอย่างดีเยี่ยม มีเกียรติ เป็นที่ยอมรับนับถือในสังคม ผู้ใหญ่มักจะให้ความเมตตาให้การอุปถัมภ์  มีสิ่งศักดิ์สิทธ์ให้ความคุ้มครอง มีลางสังหรณ์ที่แม่นยำมาก มักเป็นผู้ที่มีความคิดริเริ่มอยู่ตลอดเวลา มักมีสมองเฉียบแหลมว่องไว เป็นคนชอบศึกษาค้นคว้า มีความจำดี และจดจำสิ่งต่าง ๆ ได้อย่างแม่นยำ  มีสติปัญญามีปฏิภาณไหวพริบดี แก้ไขปัญหาเก่ง รักความยุติธรรม รักความถูกต้อง มีมนุษย์สัมพันธ์ดี จะนำพาไปสู่ความสำเร็จที่ยิ่งใหญ่ ชอบหาความก้าวหน้าให้กับชีวิต เป็นคนมีความคิดสุขุมลุ่มลึก มีความยุติธรรมเป็นหลักประจำใจ ถ้าเป็นเด็กจะเรียนเก่ง เป็นคนที่มีความทะเยอทะยานดี  บุคคลหมายเลข 14 ต้องทำงานที่ต้องมีการเคลื่อนไหวตลอดเวลา และต้องเดินทางท่องเที่ยว หรือ ติดต่อกับผู้คนจำนวนมาก เช่น การขาย ฝ่ายการตลาด ฝ่ายประชาสัมพันธ์ หรืองานที่ต้องติดต่อกับคนต่างประเทศ เลขนี้มักจะชักนำให้ได้คบหากับคนต่างถิ่น คนต่างชาติต่างภาษา งานลักษณะนี้จะนำความโชคดีมาให้ นอกจากนี้การติดต่อสื่อสารใด ๆ ที่เกี่ยวกับสาธารณะชน เช่น   สื่อสิ่งพิมพ์ นักเขียน นักข่าว  นักประชาสัมพันธ์ สื่อมวลชนทุกแขนง จะมี ความเกี่ยวพันธ์กับบุคคลหมายเลข 14\r\n \r\nด้านเสีย ของเลข  14 คือ ถ้ามีมากจะทำให้เป็นคนเจ้าระเบียบ พูดมาก บางครั้งพูดมากจนกลายเป็นคนจู้จี้ขี้บ่น ชอบแก้ปัญหาให้ผู้อื่น จนบางครั้งทำให้ตนเองต้องเดือดร้อน และไม่มีใครเห็นความดีของตน เหมือนปิดทองหลังพระ  การเชื่อหรือคล้อยตามคำพูดคนอื่นและการเชื่อมั่นตนเองมากเกินไป  จะนำตัวเองเข้าสู่ความเสี่ยงทั้งปวง\r\n'),
(16, '15', 'D10', 70, 'หมายเลข 15 พลังแห่งเสน่ห์ ', 'เป็นเลขดีมาก มักจะเป็นคนมีเสน่ห์ มีอารมณ์ดี น่าดึงดูดใจเพศตรงข้าม มีมนุษย์สัมพันธ์ดี มีเพื่อนมาก เป็นดาวการเงิน(แต่น้อยกว่าเลข 24) และเป็นดาวแห่งเสน่ห์เจ้าชู้เมตตามหานิยม ถ้าใครมีพื้นดวงเกิดเจ้าชู้ควรหลีกเลี่ยง เพราะถ้าไม่ระวังอาจจะมีโอกาสมีคนรักหลายๆคนได้ เพราะความอัธยาศัยดีของคุณจะทำให้คนรักคนหลง และเลขนี้ยังมีข้อดี คือ มีผู้หลักผู้ใหญ่ให้การสนับสนุนเสมอ คุณมีดีที่คำพูด วาจาเป็นเลิศ มีความน่าเชื่อถือ เข้ากับคนได้ทุกระดับ อ่านใจคนเก่ง มักจะได้รับของตอบแทน จากผู้อื่นเสมอๆ มีลาภเพราะปาก มีสติปัญหาดี รู้จักพลิกแพลงเรื่องต่างๆด้วยคำพูด แก้ผิดเป็นถูกได้อย่างไม่น่าเชื่อ ในช่วงที่มีอายุมากจะมีความสุขเพราะลูกหลานเงินทอง ชีวิตรุ่งเรืองดี ทำงานด้านที่ต้องใช้คำพูดทนายความ นักจัดรายการวิทยุ วิทยากร ฝ่ายฝึกอบรม นักธุรกิจ ฝ่ายบริหารงานลูกค้า การตลาด ถ้าใครใช้เลขนี้รือมีเลขในเบอร์ในชื่อเยอะระวังอย่าไปแช่งไปด่าใครเพราะส่วนใหญ่คนเลขนี้ถ้าธรรมะธรรมโมจะมีวาจาศักดิ์สิทธิ์ดีแท้', 'ด้านดี เป็นคนที่มีเสน่ห์ ยั่วยวน มีอำนาจดึงดูดเฉพาะตัวที่รุนแรง เสน่ห์แรง วาจาเป็นเลิศ คารมดี ดึงดูดเร้าใจผู้อื่นได้ดี ดึงดูดให้บุคคลเข้ามาหาได้อย่างประหลาด ส่งผลให้มีแต่คนอยากชิดใกล้ และมักจะโชคดีได้รับของกำนัลความรัก ความเสน่หาจากผู้อื่นอยู่เสมอ เลข 15 ใครได้ใช้มักจะโชคดีมาก เป็นคนที่ ผู้อื่นให้ความรักความเมตตาอยู่เสมอ มีผู้ใหญ่คอยให้ความช่วยเหลือสนับสนุนอยู่ตลอดเวลา เป็นผู้ที่แสวงหาความรู้ไปในทุกๆด้าน มีนิสัยชอบเอื้อเฟื้อ เผื่อแผ่คนอื่นอยู่เสมอ มองโลกในแง่ดี รักสวยรักงาม อารมณ์ดี จิตใจดี เข้ากับคนได้ง่ายเข้าได้ทุกระดับ อ่านใจคนเก่ง มักได้รับของตอบแทนทั้งสิ่งของและการเงินจากบุคคลอื่นอยู่เสมอ เป็นคนที่โชคดีเกี่ยวกับเรื่องเงินทอง สามารถหาเงินมาได้โดยง่ายเป็นตัวเลขที่ดี มีเพื่อนมาก มีคนรักมากมาย มีศิลปะในการพูด ทำให้คนรักใคร่เกื้อหนุน ดวงชะตามีเกียรติยศชื่อเสียง มีโชคลาภ ใครมีหมายเลข 15 จะได้รับพรประเสริฐและสามารถนำความผาสุกมาสู่คน  แต่มีเงื่อนไขว่าจะต้องไม่ใช้อำนาจลึกลับ  และการได้รับพรนี้ไปทางที่ผิด\r\n\r\nด้านเสีย บางครั้งเป็นคนใจดีมากเกินไป หูเบาเชื่อใจคนง่าย จิตใจเปลี่ยนแปลงง่าย การดำเนินชีวิตต้องระวังการถูกหลอก โดยเฉพาะการถูกหลอกจากเพื่อนฝูง เช่น ถูกหลอกในเรื่องของการเงิน และความรัก เลข 15 51 ถ้ามีควรประกบด้วย 45,59,36,41,14 จะช่วยแก้ข้อเสียนี้ได้\r\n\r\n'),
(17, '16', 'R10', -50, 'หมายเลข 16 พลังชีวิตที่ต้องฝ่าฟัน ', 'ชะตาชีวิตจะส่งเสริมให้ชีวิตพบกับความสำเร็จอย่างผาดโผน มีชื่อเสียง มีอำนาจแบบชนิดคาดไม่ถึง จะได้ลาภหรือตำแหน่งใหญ่โต มีอำนาจ มีลูกน้องมาก ด้วยตำแหน่งที่ได้มาที่มักจะไปขัดแข้งขัดขาผู้อื่นเสมอ และมักจะมีคนไม่ชอบมาก จึงอาจจะโดนเลื่อยขาเก้าอี้ได้โดยง่ายเป็นคนที่มีความร้อนรุ่มในใจเสมอ มีอุปสรรคเยอะ จะทำอะไรสำเร็จต้องเหนื่อยอย่างมากก่อนจึงจะสำเร็จ', 'ด้านดี เลขนี้เป็นเลขรวย คนที่มีมักรวย เป็นเศรษฐี หรือ เกิดเป็นลูกคนรวย เก่งในการวางแผนการทำงาน แม้จะมีวาสนาสูง เกิดเป็นลูกเศรษฐี ลูกคนรวย \r\n\r\nด้านเสีย แต่….ชีวิตก็ต้องมีอุปสรรคและความโชคร้ายนานา มีศัตรูมาก มีคนเกลียดชัง มักจะแพ้ภัยจากศัตรู  ชีวิตมักจะประสบกับโชคร้ายมากกว่าความสำเร็จ เป็นตัวเลขที่มีสิ่งศักดิ์สิทธ์คอยให้ความคุ้มครองแต่จะคุ้มครอง ก็ต่อเมื่อต้องเจ็บตัวก่อน แล้วจึงจะช่วย ตัวอย่างเช่น การเกิดอุบัติเหตุ รถชนกันจนพังยับ ท่านสลบไป 7 วัน 7 คืนแล้วฟื้น ใครใช้เลข 16 ท่านจะเจอเหตุการณ์หวาดเสียวตลอดชีวิต เช่น ท่านขับรถเข้ากรุงเทพฯ อยู่ๆ ก็มีรถจากเลนส์ขาออกจากกรุงเทพ ลอยมาหาท่าน สร้างความเสียหายให้กับท่าน แต่ท่านก็ไม่ได้รับบาดเจ็บ หมายเลขนี้ไม่เหมาะสมกับสุภาพสตรี เป็นอย่างยิ่ง จะทำให้ผิดหวังในความรักทุกรูปแบบ ชีวิตรักไม่สมบรูณ์แบบ ขึ้นคาน เป็นเมียน้อย* กินน้ำใต้ศอกคนอื่น มีกิ๊กมีชู้ รักสามเศร้า รักต่างวัย แต่งงานช้า ไม่ได้แต่งงาน  แต่งแล้วต้องเลิก  ได้พ่อหม้ายเป็นสามี หรือเป็นหม้ายก่อนวัยอันควร มีลูกยาก* เลข 16 ตัวเลขของ คดีความ* ความทุกข์ อุปสรรค ปัญหา อับโชค โรคภัยไข้เจ็บ ต้องต่อสู้ชีวิตด้วยความลำบาก ต้องฟันฝ่าอุปสรรคนานับประการ บุคคลหมายเลข 16 หากมีความสำเร็จของชีวิตที่ยิ่งใหญ่ ต้องระวังจะพบจุดจบอย่างไม่คาดคิด  ถูกคนปองร้าย ถูกอำนาจมืดคุกคาม จะตกต่ำในบั้นปลายของชีวิต ให้ระวังชะตากรรมร้ายที่รออยู่เบื้องหน้า จะมีอันตรายจากคน หรือ จากอุบัติเหตุและความล้มเหลวอย่างปัจจุบันทันด่วน ให้เชื่อลางสังหรณ์ ที่มักจะปรากฏเตือนอันตรายล่วงหน้า เพราะมีส่วนที่จะเป็นจริงมาก อย่าคิดว่าเป็นสิ่งไร้สาระ ถ้าคิดเช่นนั้นจะต้องเสียใจกับ ความผิดพลาดที่เกิดขึ้น\r\n\r\n'),
(18, '17', 'R7', -45, 'หมายเลข 17 พลังแห่งความไม่แน่นอน ', 'ชะตาชีวิตเป็นผู้มีปัญญาดี มีโอกาสมีความสำเร็จสูง แต่ก็ต้องเรียกว่าเหนื่อยมากๆกว่าจะสำเร็จหรือลองผิดลองถูกกันหลายครั้ง เป็นคนเข้าใจอะไรได้ง่าย สามารถหยั่งรู้เหตุการณ์ล่วงหน้าได้อย่างรวดเร็ว ช่วงที่ชีวิตประสบความสำเร็จอาจจะพบกับอุปสรรคหรือสิ่งที่ขัดขวางผลสำเร็จ มักจะถูกผู้ใหญ่กดดันและให้โทษเสมอๆ ทำให้ชีวิตขึ้นๆลงๆ ไม่แน่นอน เมื่อครั้งรับตำแหน่งใหญ่โตจะโดนทำให้ตกจากตำแหน่งได้ หรือไม่ก็มักจะถูกแย่งตำแหน่ง หน้าที่การงานมักจะไม่ยั่งยืนถาวร เมื่อจะก้าวหน้ามักมีอุปสรรคเสมอ', 'ด้านดี มักจะมีสติปัญญาแตกฉาน เข้าใจอะไรได้ง่าย สามารถหยั่งรู้เหตุการณ์ล่วงหน้าได้อย่างรวดเร็ว  มีตำแหน่งหน้าที่การงานสูง\r\n\r\nด้านเสีย เลขของคดีความ เลขอกหัก อุบัติเหตุ เลขของอุปสรรค กว่าจะมีชื่อเสียง หรือเกียรติยศ ท่านก็ต้องผ่านอุปสรรคอันยุ่งยากมากมาย มักถูกกลั่นแกล้งอยู่เสมอ ถูกเอารัดเอาเปรียบถูกเบียดเบียนเอาความดีความชอบอยู่ตลอดเวลา ชีวิตมีความกดดันสูงและต้องวางแผนอย่างรอบคอบ จึงจะประสบความสำเร็จได้ แต่ความสำเร็จนั้นก็ไม่ยืนยาว พร้อมที่จะล้มเหลวได้ตลอดเวลา  มักจะถูกผู้ใหญ่กดดัน ผู้ใหญ่มักจะให้โทษ  ชีวิตผันผวนขึ้นๆลงๆไม่แน่นอน บุคคลที่อยู่ในตำแหน่งหน้าที่การงานสูงหากต้องระวังจะตกจากตำแหน่งได้ง่าย มักถูกจำกัดอำนาจ มักโดนแทงข้างหลังหรือถูกคุกคาม หรือไม่ก็ถูกแย่งตำแหน่ง  หน้าที่การงาน 17 หมายเลขนี้ไม่เหมาะกับบุรุษและสตรี  ถ้าชายใช้ ชีวิตรักชีวิตสมรถจะไม่สมหวัง ถึงต้องมีเหตุเลิกราหย่าร้างเป็นหม้ายก่อนวัยอันควร  มีเมียน้อย  ได้ภรรยาเป็นแม่หม้าย  หมายเลข 17 ยิ่งไม่เหมาะกับสุภาพสตรี   เพราะมักมีปัญหาเรื่องคู่ ทุกข์เพราะคู่ครอง  มักอาภัพคู่  เช่น  แต่งงานช้า  ไม่ได้แต่ง  แต่งก็ต้องเลิก  ได้พ่อหม้ายเป็นสามี  กินน้ำใต้ศอกคนอื่น  และจะเป็นหม้ายก่อนวัยอันควรมักจะประสบกับเรื่องผิดหวังชอกช้ำในเรื่องความรักเสมอ  คนเลข 17 เป็นคนหูเบาเชื่อคนง่าย  ค่อนข้างจะดื้อรั้นเอาแต่ใจตัวเอง ระวังโรคไมเกรน โรคตับอักเสบ คนเลข 17 เมื่อยามรุ่งโรจน์ก็อย่างเหลิง  เมื่อถึงคราวตกต่ำก็อย่าเสียใจจนเกินเหตุ ทำใจให้สงบถือว่าเป็นกฎแห่งกรรม มันคือความไม่เที่ยงของสรรพสิ่งในโลก  \r\n'),
(19, '18', 'R10', -50, 'หมายเลข 18 พลังชีวิตแห่งการเปลี่ยนแปลง', 'พลังจะส่งผลให้ไม่มีความมั่นคงในชีวิตช่วงเวลาที่เจริญมักจะมีเหตุปัจจัยให้ล่วงลงหนักๆ มีการโยกย้ายอยู่บ่อยๆ ชีวิตที่รุ่งโรจน์รุ่งเรือง มักตกต่ำลง ชีวิตมักจะพบกับสิ่งไม่คาดคิดอยู่เสมอ การจะกระทำสิ่งใดมักมีอำนาจมืดพลังร้ายบทบังแฝงอยู่ ควรจะทำอะไรอย่างรอบคอบ ความสำเร็จจะมีเป็นช่วงๆสลับกับการตกต่ำ ชีวิตครอบครัวมักแตกร้าวการทะเลาะวิวาท ครอบครัวไม่อบอุ่น มีเรื่องวุ่นวายใจเสมอ มีแต่ความผิดหวัง ดวงความรักแย่มากๆครับ ชะตาจะขึ้นสุดลงสุด ไม่แน่นอน', 'เลข 18 เป็นเลขใกล้เคียงกับหมายเลข 17 ผู้ที่ได้หมายเลขนี้มักมีชีวิตที่รุ่งโรจน์ ร่ำรวย แต่สุดท้ายก็อาจตกต่ำลงได้ ชีวิตไม่แน่นอน ขึ้นๆลง ระวังเรื่องอบายมุขทั้งปวง คนเลขนี้ มักอยู่ไม่ติดที่ มีการเดินทางบ่อย หรือ โยกย้ายเปลี่ยนแปลงบ่อยๆ ทั้งที่อยู่อาศัย และตำแหน่งหน้าที่การงาน จึงไม่เหมาะกับอาชีพที่ต้องทำงานอยู่กับที่ ถ้าอยากแก้เคล็ดควรหางานที่ต้องเดินทางจะเหมาะกว่า ใครใช้เลขนี้ ชีวิตต้องพยายามควบคุมสภาวะจิตใจ อารมณ์ให้ได้ ต้องรอบคอบ เพราะมักจะถูกกดดันและถูกคุกคามจากผู้มีอำนาจเหนือกว่า และผู้มีอำนาจที่ไม่เป็นธรรม ถูกศัตรูปองร้าย เพราะชีวิตมักจะพบกับสิ่งที่ไม่คาดคิดเสมอ(ทางร้าย)\r\n\r\nหมายเลขนี้ไม่เหมาะกับสตรี เพราะจะทำให้ขมขื่นกับความรัก ปัญหามักเกิดจากสามี เช่น ได้สามีที่ชอบเล่นการพนัน กิจการสามีไม่ก้าวหน้า หรือเรียกว่าเจ๊ง ขาดทุนล้มละลายนั่นเอง หรือ มักแต่งงานช้า ไม่ได้แต่ง  แต่งก็ต้องเลิกได้   พ่อหม้ายเป็นสามี  กินน้ำใต้ศอกคนอื่น  เป็นหม้ายก่อนวัยอันควร  ถ้าชายใช้เลข 18 มักจะติดการพนันติดอบายมุข การงานไม่ก้าวหน้า มักขาดทุน ล้มละลาย ชีวิตครอบครัวแตกร้าว จะมีแม่หม้ายเข้ามาพัวพันในชีวิต  จะพบกับความขมขื่นในเรื่องความรักผิดหวังต้องพลัดพรากจากกันเสมอ  เลข 18 ใครใช้ชีวิตครอบครัวมีปัญหาแตกร้าว  การทะเลาะวิวาททำให้ชีวิตต้องตกพุ่มหม้ายหรือไร้คู่  ต้องระวังการถูกหลอกลวงจากผู้อื่นทำอะไรจึงต้องละเอียดรอบคอบไว้ เพราะเลขนี้เป็นเลขที่เกี่ยวกับการทะเลาะอย่างรุนแรง ประสบปัญหาในครอบครัวไม่เว้นแม้แต่กับวงศาคณาญาติ ระวังการทรยศหักหลังการถูกหลอกลวงจากคนที่เป็นเพื่อนมิตรและศัตรูในร่างเดียวกัน บุคคลเลข 18 ไม่เหมาะกับการทำงานเสี่ยง ถ้าเลี่ยงได้ควรจะหลีกเลี่ยงเพราะเสี่ยงต่ออันตราย อุบัติเหตุและความตาย และอันตรายจากหลาย ๆ สิ่ง เช่น พายุ อันตรายจากน้ำ ไฟและระเบิด ชีวิตของคนที่มีเลข 18 เป็นคนต้องคำสาป เพราะเป็นคนขอไว้เองว่า ขอให้ชาติใหม่นี้ ขอให้ตัวเองมีความทุกข์ มีอุปสรรค ทั้งนี้เพื่อเป็นการฝึกตน เพื่อทดสอบความอดทน ทดสอบความแข็งแกร่งของจิตใจ คำขอก็เป็นจริง จึงทำให้ต้องได้รับทุกข์ทรมานแบบ ให้ระวังโรคผิวหนัง  \r\n'),
(20, '19', 'R5', -10, 'หมายเลข 19 พลังแห่งความสำเร็จจากผู้อุปถัมภ์ ', 'เป็นเลขดีมาก เหมาะสำหรับผู้ชาย (สำหรับเลขทะเบียนผู้หญิงใช้ได้) ชอบศึกษาหาความรู้ ชีวิตมักประสบความสำเร็จจากผู้อื่นที่ใหญ่กว่า มีสติปัญญาดี ฉลาดหลักแหลม ได้รับความอุปการะจากผู้ใหญ่ จะได้รับเกียรติอย่างสูงในสังคม จะได้ตำแหน่งใหญ่โตในหน้าที่การงาน และมีความเชี่ยวชาญพิเศษทางการศึกษา ไม่อับจนมีคนช่วยเหลือ ส่งผลดีให้กับอนาคตพบกับความสำเร็จที่ยิ่งใหญ่ เลขนี้ดีกับผู้ชาย แต่เลข 19 นี้ไม่เหมาะกับผู้หญิง จะทำให้ตกพุ่มหม้ายกำพร้าพ่อก่อนแม่ บางครั้งส่งผลให้สามีตกจากตำแหน่ง หรือถูกแย่งงาน ชีวิตมักมีปัญหาเรื่องคู่ มักจะเป็นภรรยาน้อยของผู้อื่นหาตัวจริงไม่ได้ ถึงแม้จะประสบความสำเร็จในด้านอื่นๆก็ตาม ผู้ชายดีแต่ผู้หญิงควรเปลี่ยนครับ งานที่ดีจะเกี่ยวข้องกับการศึกษา ครู อาจารย์ นักวิชาการ งานที่ต้องใช้ความรู้ความสามารถมากๆ นักธุรกิจ นักวางแผนงาน โครงการต่างๆ', 'ด้านดี ดวงค่อนข้างดี แต่ชีวิตมักวุ่นวายสับสน อยู่ตลอดเวลา แต่ถ้าท่านสามารถบริหารชีวิตของท่านได้ดี ชีวิตจะมีความสุข สำเร็จและดีเด่นทางด้านการศึกษาและมีหน้าที่การงานสูงส่ง ชีวิตจะประสบความสำเร็จดีเยี่ยม มักได้รับการอุปการะจากผู้ใหญ่ หรือผู้มีอำนาจจะให้ความคุ้มครองช่วยเหลือตลอด นับเป็นเลขนำโชคเลขหนึ่ง ไม่มีวันอับจนและตกอับ แต่ถ้าบริหารชีวิตไม่เป็น \r\n\r\nด้านเสีย ท่านก็จะล้มเหลวติดพันไปทุกอย่างเพราะไม่มีเวลาให้ครอบครัว มักจะมีปัญหามือที่สาม ทะเลาะเบาะแว้ง ขาดความอบอุ่นในครอบครัว มีคดีความ หมายเลขนี้ไม่ดีต่อทั้งหญิงและชาย แต่ดีต่อชายมากกว่าหญิง ไม่เหมาะสำหรับผู้หญิง เพราะเป็นหญิงจะถูกกลั่นแกล้งจากคนรอบข้าง จะทำให้กำพร้าได้ เป็นหม้าย ผัวตายเมียทิ้ง ถึงเขาไม่ทิ้งเราเราก็ทิ้งเขา คล้ายเลข 17,18 อาภัพรัก ชีวิตรักมักผิดหวัง  บางครั้งสามารถส่งผลทำให้สามีตกจากตำแหน่งหรือถูกแย่งงาน ตำแหน่งหน้าที่การงานของสามีไม่ยั่งยืน  ชีวิตมักจะมีปัญหาเรื่องคู่ เช่น แต่งงานช้า ไม่ได้แต่ง แต่งแล้วต้องเลิก ได้พ่อหม้ายเป็นสามี กินน้ำใต้ศอก เป็นเมียน้อยผู้อื่น  เป็นหม้ายก่อนวัยอันควร หากเป็นชายจะมีความรุ่งโรจน์มาก แต่จะมีปัญหาครอบครัว และเจ็บป่วยในบั้นปลาย  ใครที่ใช้เลขนี้ มักเลื่อมใสในศาสตร์เร้นลับอยู่เป็นทุน แต่ก็ชอบศึกษาหาความรู้หลายๆแขนง ระวังเป็นโรคเกี่ยวกับหัวใจ  ระวังเจ็บป่วย คดีความ ภาระหนี้สิน เกิดความไม่เข้าใจไม่ลงรอยในครอบครัว เกิดความพลัดพรากไม่ต้องจากเป็นก็จากตาย\r\n'),
(21, '20', 'R7', -45, 'หมายเลข 20 พลังแห่งความสำเร็จที่ต้องอาศัยผู้อื่นช่วยหนุนนำ ', 'เป็นคนมักมีความมุ่งมั่นสูง รู้จักวางแผนรอบคอบ รักความก้าวหน้า ทะเยอทะยาน รักความสำเร็จ คาดหวังกับตัวเองเรื่องชีวิตสูงมาก มีจินตนาการกว้างไกล การจะสำเร็จต้องอาศัยผู้อื่น เพื่อนร่วมงาน ลูกน้อง มาช่วยประกอบกันจึงจะสำเร็จ เปลี่ยนแปลงไม่ชอบหยุดนิ่งอยู่กับที่ มีความทะเยอทะยาน เป็นคนมีความกระตือรือร้นอย่างรุนแรง กล้าเสี่ยงกล้าลอง เชื่อว่าสิ่งที่ตัวเองจะทำจะต้องสำเร็จ ควรจะทำบุญเสริมบารมีบ่อยๆจึงจะช่วยเสริมบารมีได้ เป็นคนลางสังหรณ์แม่นยำมาก กล้าคิดกล้าทำ แต่เรื่องความรักอาจจะไม่โดดเด่นเท่าเรื่องการงาน งานที่ดีเหมาะสมกับข้าราชการ พนักงานบริษัทที่ต้องอาศัยการไต่เต้าขึ้นไป หรืองานที่ต้องช่วยกันเป็นทีมโดยคุณเป็นคนคุมจึงจะสำเร็จ ผู้ใหญ่จะให้ การสนับสนุนได้ดีมาก', 'ด้านเสีย มักเป็นคนที่มีพฤติกรรมเพ้อฝัน ไม่ไว้ใจผู้อื่น อ่อนไหวง่าย รวนเร มีความทะเยอทะยานสูง เป็นคนที่คิดฝันไกล และมักฝันถึงโครงการใหญ่ๆ ชอบทำอะไรใหญ่เกินตัว กลายเป็นคนที่มีความกระตือรือร้นอย่างรุนแรง ชอบวิธีการใหม่ โดยไม่ชอบย่ำเท้าอยู่กับที่ กล้าลองกล้าเสี่ยง จนบางครั้งทำให้เกิดความผิดพลาดและคิดหลงผิดจนล้มเหลวลงได้ คนเลขนี้จะประสบความสำเร็จได้ต้องอาศัยคนรอบข้างหรือลูกน้องบริวารช่วย หากทำเองคนเดียวมักสำเร็จยากหรือไม่สำเร็จเลย ต้นดีพอสมควร แต่บั้นปลายชีวิตเหมือนผู้ดีตกยาก ทั้งหญิงและชายที่ใช้หมายเลขนี้ ต้องระวังเรื่องสุขภาพและคู่ครอง เทวดามักไม่สื่อรัก มักไม่ได้แต่งงาน หรือแต่งงานช้า หรือแต่งแล้วต้องเลิกรากัน ชีวิตมักจะมีปัญหาเรื่องคู่ ถูกกดดันจนทำให้ต้องเป็นคนไร้คู่ มักมีกิ๊กมีชู้ เป็นเมียน้อย มีเมียน้อย กินน้ำใต้ศอกผู้อื่น มักมีปัญหาที่หน้าอกช่วงอก มดลูก ซีสต์ เนื้องอก มะเร็ง มีปัญหาที่อวัยวะเพศชายก็เช่นกัน ให้ระวังต่อมลูกหมาก\r\n\r\nด้านดี มีเสน่ห์ ประสบความสำเร็จในเงินงานพอสมควร แค่ความรักมักมีปัญหาไม่โดดเด่นเหมือนงาน  ลางสังหรณ์แม่น ชอบปฏิรูปการเปลี่ยนแปลง ไม่ชอบอยู่นิ่งอยู่กับที่ มีความทะเยอทะยาน กระตือรือร้น มุ่งมั่นสูง กล้าเสี่ยงกล้าลอง กล้าคิดกล้าทำ รู้จักวางแผนรอบคอบ รักความก้าวหน้า ทะเยอทะยาน รักความสำเร็จ คาดหวังกับตัวเองเรื่องชีวิตสูงมาก มีจินตนาการกว้างไกล เป็นคนที่ทำงานประณีต เป็นคนทันสมัย ชอบไขว่คว้าหาแต่สิ่งที่สูงที่สุดเอื้อมจนกลายเป็นเรื่องละเมิดสิทธิของผู้อื่นได้ '),
(22, '21', 'R10', -60, 'หมายเลข 21 พลังแห่งการพลิกผัน', 'เป็นที่รู้จักของสังคมเข้าสังคม มักจะเป็นคนเด่น มีคนยกย่องให้เกียรติ มีคนเคารพยกย่อง นับถือ ดูดีภูมิฐานตลอดเวลา เป็นบุคคลสองลักษณะในตนเองคือ การแสดงออกภายนอก มักจะดูอ่อนแอ แต่จริงๆแล้วสภาพภายในเป็นคนกล้าแข็ง ทะเยอทะยาน ค้นหาความสำเร็จ เป็นคนเด็ดเดี่ยวกล้าตัดสินใจ มักจะมีสิ่งไม่คาดคิดเกิดแบบเฉียบพลันบ่อยๆเช่น การงานที่กำลังรุ่งเรืองต้องมามีเรื่องล้มไม่รู้ตัว อนาคตมัวหมอง อะไรที่เหมือนจะดีกลับต้องพลาดไปกลายเป็นร้าย ชีวิตเหนื่อยอยู่ ต้องดูแลผู้อื่นจนไม่ได้สนใจตัวเอง', 'ด้านดี คือ รวย เป็นคนมีเสน่ห์ ดูดี โดดเด่นมีคนยกย่องให้เกียรติ เข้าสังคมได้ดี คนเลขนี้จะส่งเสริมให้เกิดความรุ่งโรจน์หรือประสบความสำเร็จได้อย่างรวดเร็ว\r\nด้านเสีย เป็นคนสองบุคลิก คือ เป็นผู้นำคน เด็ดเดี่ยวกล้าตัดสินใจ เข็มแข็ง หยิ่ง ถือตัว เอาแต่ใจตนเอง บางครั้งก็อ่อนแออ่อนหวาน นิ่มนวล อ่อนไหวง่าย เลข 21 มีความหมายเช่นกันกับเลข 12 แต่เลข 21 มีพลังร้ายกว่าแรงกว่า เช่น อุบัติเหตุแรงกว่า พลังของความลุ่มหลงมัวเมาแรงกว่า พลังของการถูกทำร้าย ปองร้ายเบียดเบียนแรงกว่า พลังของคดีความ การทะเลาะวิวาทแรงกว่า เลข 21 ใครใช้ใจจะสู้ไม่ท้อถอยต่อปัญหา ระวังชีวิตสามารถหักโค่นกลางคันได้ซึ่งจะเปลี่ยนวิถีชีวิตไปในทิศทางทางตรงกันข้ามได้เลย คนเลขนี้อนาคตไม่แน่นอน อาจจะตกต่ำ หรือตกจากตำแหน่งหน้าที่การงานได้ ชีวิตมักจะมีทุกข์ผิดหวัง ชีวิตไม่ราบเรียบ ชีวิตสมรสไม่แน่นอน คนเลขนี้จะส่งเสริมให้เกิดความรุ่งโรจน์หรือประสบความสำเร็จได้อย่างรวดเร็ว แต่ก็อาจจะล้มเหลวได้อย่างฉับพลัน ให้ระมัดระวังโรคภัยไข้เจ็บ   มะเร็ง  ปวดหัว ไมเกรน วิญญาณ คนพาล ศัตรูปองร้าย การคดโกงกัน ทำร้ายกัน ตัวอย่างของคนที่ถูกเลข 21 ครอบงำ คือ เสกโลโซ\r\n'),
(23, '22', 'R7', -35, 'หมายเลข 22 พลังแห่งการเพ้อฝัน', 'เป็นคนเพ้อฝันมีอารมณ์อ่อนไหว เป็นคนละเอียดอ่อน เพ่อฝัน ทำอะไรไม่ประสบความสำเร็จเป็นชิ้นเป็นอัน ถูกผู้อื่นหลอกลวงได้โดยง่าย ทำให้การงานสิ่งใดไม่ประสบผลสำเร็จ มักเป็นคนชั่งคิดชั่งฝันมากกว่าเป็นนักปฏิบัติ เปลี่ยนใจง่าย แน่นอนไม่ค่อยได้ ทำให้ถูกหลอกลวง อยู่เสมอ ชอบสร้างวิมานในอากาศ เป็นคนหัวแข็ง ไม่รับฟังผู้อื่น ทำอะไรไม่เป็นหลักเป็นฐาน หลงละเมอเพ้อพกแต่สิ่งผิดๆ บางครั้งงมงายอย่างมาก ทำอะไรธุรกิจฝืดเคืองเพราะคิดแต่ไม่ทำจะโดนผู้อื่นตัดหน้าได้ เป็นคนเก็บกด ทุกข์ใจได้ง่าย ชอบเรื่องราวเร้นลับ ไสยศาสตร์มากกว่าทางพระทางเจ้า เชื่อแบบไม่มีเหตุผล', 'ด้านเสีย ทำอะไรมักล้มเหลวและไม่ประสบความสำเร็จ ชอบคิดชอบพูดมากกว่าทำ ชอบดูแลผู้อื่น จนลืมดูแลตัวเอง เป็นคนที่ไม่ชอบอยู่กับที่นานๆ อยู่ไม่ติดบ้าน ชอบทำอะไรแปลกแหวกแนว เพราะอยากจะเด่นดัง เจ้าชู้ เป็นคนเพ้อฝันมีอารมณ์อ่อนไหว หูเบาเชื่อใจคนง่าย สภาพจิตใจรวนเร เปลี่ยนใจง่าย  หาความแน่นอนไม่ได้ ชีวิตขึ้นๆลงๆ สิ่งที่คิดหวังไว้มักไม่ได้ดังหวัง สิ่งทีไม่หวังมักจะได้ เป็นนักคิดนักฝันลมๆแล้งๆ บางเรื่องเป็นไปได้ยากในความเป็นจริง จึงจะทำให้ถูกหลอกลวง รวมทั้งหลอกผู้อื่นและหลอกตัวเองด้วย คนเลขนี้ถ้าลองปักใจเชื่อสิ่งใดแล้วจะดื้อรั้น ดื้อเงียบ หัวแข็ง ใครแนะนำสิ่งที่ดีกว่า จะฟัง แต่ไม่ทำตามกลับยิ่งปล่อยตัวปล่อยใจให้ถลำลึกลงไปอีก \r\n\r\nหลายครั้งจึงผิดพลาดล้มเหลวมีหนี้สินมีเรื่องร้ายเกิด เป็นคนที่ยอมตัดสินใจผิดพลาดทั้งๆที่รู้ ไม่ชอบให้ใครท้าทาย จึงขัดแย้งกับคนอื่นได้ง่าย ไม่ชอบเดินตามรอยเท้าใคร แต่เป็นคนคบคนง่าย มีเพื่อนฝูงเยอะ มีลางสังหรณ์ดี เกิดมาเพื่อใช้ชีวิตอย่างแท้จริง บุคคลเลข 22 ควรระวังเรื่องศาสตร์เร้นลับ มักจะเชื่ออย่างไม่ลืมหูลืมตา บางคนอาจกลายเป็นร่างทรงไปก็มี บางคนเข้าใจผิดคิดว่าตัวเองมีญาณไปก็มี (ถ้ามีส่วนประกอบเป็นเลขเสียต้องระวังให้มาก) คนเลขนี้แม้การเงินดี แต่ถ้าเลขแสดงผลเต็มที่เมื่อไหร่ระวังจะโดนหลอก ธุรกิจจะฝืดเคือง เก็บกด ทุกข์ใจง่าย ระวังมีอุบัติเหตุที่มีน้ำมาเกี่ยวข้อง เช่น ตกน้ำ จมน้ำ ลื่น รถคว่ำรถชนตอนฝนตก รถตกน้ำ ระวังโรคที่เกี่ยวกับช่องท้อง กระเพาะ ลำไส้ อวัยวะเพศ ซีส เต้านม ริดสีดวงทวาร เลือดไม่ดี น้ำเหลืองเสีย \r\n\r\nด้านดี หมายเลขนี้  การเงินดี  เป็นคนมีเสน่ห์โดดเด่นมีคนยกย่องให้เกียรติ ชอบช่วยเหลือสังคม  ชอบเป็นนักสังคมสงเคราะห์ \r\n'),
(24, '23', 'D5', 20, 'หมายเลข 23 พลังเสน่ห์เมตตามหานิยม ', 'เป็นเลขดี เหมาะกับผู้หญิง เป็นคนเข้มแข็ง อดทน ต่อสู้อุปสรรคต่างๆเพื่อให้สำเร็จ ชอบเอาชนะคนอื่นไม่ยอมคน เป็นเลขดีด้านชู้สาว ในด้านความรัก มักเป็นคนเจ้าชู้ถือความรักเป็นใหญ่ เป็นคนสนใจเรื่องการศึกษาหาความรู้ ชอบช่วยเหลือผู้อื่น เป็นคนโกรธง่าย หงุดหงิดง่าย เป็นคนที่โชคดีอย่างมากในเรื่องความรักเพศตรงข้าม มีเสน่ห์ใครๆก็หลง อาจจะเสียการงานเพราะผู้หญิง จะทำให้ชีวิตตกต่ำ หรือคู่ครองมักจะมีมลทิน เป็นคนใจร้อยต้องลดๆลงบ้าง ถ้าทำงานเกี่ยวข้องกับเพศตรงข้าม หรืองานที่ต้องอาศัยประโยชน์จากเพศตรงข้ามจะดี เบอร์นี้สุภาพสตรีก็จะดีแต่บุรุษอาจจะไม่ดีเท่ามีทั้งดีและร้าย จะเปลี่ยนเพื่อความสบายใจก็ได้', 'ด้านดี หญิงชายใช้มักจะมีเสน่ห์ต่อเพศตรงข้ามให้รักให้หลง จะมีเสน่ห์ต้องตาต้องใจของผู้อื่น มีผู้ใหญ่ที่มีอิทธิพลคอยให้ความช่วยเหลือสนับสนุน เป็นคนที่รักความยุติธรรมและความถูก ต้องชอบแสวงหาความรู้ จิตใจดี เลขนี้จะทำให้ชีวิตประสบความสำเร็จได้เป็นอย่างดี ถ้าไม่มีมากกว่า 1 คู่ และไม่ได้มีเลขร้ายคู่อื่นๆซ้ำเติมดวงชะตา\r\n\r\nด้านเสีย เจ้าตัวจะเป็นคนเจ้าอารมณ์ หงุดหงิดง่าย  เอาแต่ใจตัวเอง ชอบเอาชนะ ถือความรักความหลงเป็นใหญ่ บางครั้งต้องระวังเรื่องศีลธรรม ชายใช้มักเป็นคนขาดรักขาดความอบอุ่น ครอบครัวแตกแยก มีปม เป็นคนเจ้าชู้ มากคู่หลายเมีย จะมีปัญหาเรื่องชู้สาว มีเรื่องอื้อฉาวเสียหายเกี่ยวกับเรื่องความรัก หรือคนที่เข้ามาพัวพันไม่ใช่คนโสด และเพศตรงข้ามมักทำให้เสื่อมเสียชื่อเสียงเงินทอง ผู้หญิงจะทำให้ชีวิตตกต่ำ หรือคู่ครองจะมีมลทิน และทำร้ายเอาภายหลัง ทำให้ตกจากตำแหน่ง หรือเสีย ทรัพย์ เสียเงิน เสียชื่อ มีศัตรูแอบทำร้ายอยู่เบื้องหลัง \r\n\r\nบุคคลหมายเลข  23 มักเป็นคนมีอารมณ์ขัดแย้งในตัวเอง ท่าทีภายนอกเป็นคนนุ่มนวลอบอุ่นอ่อนโยน แต่ภายในเป็นคนมีอารมณ์แข็งกร้าว มีโทสะจริตครอบงำ ไม่ยอมแพ้คน ชอบเอาชนะผู้อื่นเสมอ คือเป็นคนไม่ยอมให้ใครกดหัวง่ายๆ ระวังทะเลาะ อุบัติเหตุ และมีความเจ็บป่วยจากช่วงล่าง โรคข้อ กระดูก เอ็น อวัยวะเพศ เบาหวาน น้ำเหลืองเสีย ต้องมีการผ่าตัด \r\n'),
(25, '24', 'D10', 80, 'หมายเลข 24 พลังแห่งมหามงคลความสำเร็จ', 'เป็นเลขดีมาก เป็นดาวการเงิน เสริมส่งในเรื่องการงานการเงินให้ไหลคล่องเงินหาง่ายหาเงินเก่ง มีเสน่ห์รุนแรง ดึงดูด ทำให้เป็นคนมีมิตรมาก มีเพื่อนมาก และเพื่อนฝูงมักจะให้การอุปถัมภ์ค้ำชูและสนับสนุนเป็นอย่างดี เป็นค่าพลังที่สมบูรณ์มาก มีไหวพริบดี ฉลาด ไม่ถือตัว เข้าถึงง่าย ใครมาขอความช่วยเหลือไม่เคยปฏิเสธ แต่เป็นคนรอบคอบ รู้จักวางแผน ชีวิตประสบความสำเร็จดีมากเหมาะกับดารานักแสดง นักการเมือง โดยเฉพาะพ่อค้าแม่ค้า หรือ นักธุรกิจ เจ้าของกิจการควรใช้ เพราะจะเสริมด้านวาจา เสริมเสน่ห์ดึงคนรักคนอุปถัมถ์ ดึงเงินดึงลูกค้าได้ดี และที่สำคัญที่ควรรู้คือเลขนี้ยังช่วยปรับในคนที่มีอารมณ์ร้อนหงุดหงิดขี้โมโหให้เป็นคนเป็นคนมีกิริยามารยาท นุ่มนวล พูดดีพูดเพราะใจเย็นได้มากขึ้น และจะทำให้เป็นที่รักของคนทั่วไป แถมยังช่วยเสริมในด้านสติปัญญาให้มีความฉลาดว่องไวแตกฉาน เป็นคนหยั่งรู้การณ์ไกล เข้าใจสิ่งแวดล้อมรอบตัวได้อย่างเอาใจเขามาใส่ใจเราได้ดี งานที่ให้ผลดีจะเกี่ยวข้องกับศิลปะ การค้าขาย การเจรจาต่อรอง ต่างๆ แต่ถ้าทางศิลปะจะดีมากๆแต่โดยรวมส่งผลได้เกือบทุกอาชีพเลย ควรทำบุญเสริมบารมีเสมอเพื่อให้ความราบรื่นมีอย่างต่อเนื่องเพราะเลขนี้บางคนมักจะหลงและโลภเพราะอยากได้ก้จะได้และมักได้มาโดยง่ายถ้าไม่ระวังไม่เสริมดวงเขาจะทำโทษเอา', 'ด้านดี เป็นดาวการเงิน เสริมส่งในเรื่องการงานการเงินให้ไหลคล่อง เงินหาง่ายหาเงินเก่ง มีเสน่ห์รุนแรง ดึงดูด ทำให้เป็นคนมีมิตรมาก มั่งมีศรีสุข สมบูรณ์พูนผล ชีวิตไม่ยุ่งยาก มีความรักที่ดี เป็นคนฉลาดมีปฏิภาณไหวพริบ ไม่ถือตัว เป็นคนดีมีเมตตา เอื้อเฟื้อช่วยเหลือผู้อื่น ผู้ใหญ๋และเพื่อนฝูงมักจะให้การอุปถัมภ์ค้ำชูเป็นอย่างดี กิริยามารยาทนุ่มนวลเป็นที่รักของคนทั่วไป เป็นคนมีสติปัญญาว่องไวแตกฉาน  เป็นคนมองการณ์ไกล เข้าใจสิ่งแวดล้อมรอบตัวได้อย่างรวดเร็วโดยไม่ต้องไต่ถาม เป็นคนละเอียดอ่อนไม่ฉาบฉวย เข้าถึงอารมณ์ศิลป์ โรแมนติก ใจดี ใจบุญ ใจเย็น ไม่ชอบการแสดงอำนาจ มักจะมีโชคลาภ เงินทองไหลเข้าหาได้ง่าย เงินทองไม่ขาดมือ และมีรายได้หลายทาง (เลขนี้เป็นเลขนึงที่ใช้ปรับคนใจร้อนใจร้ายปากร้ายถ้าเขาใช้ได้ถูกโฉลก)\r\n\r\nหากใครเป็นศิลปิน และตกอยู่ภายใต้อิทธิพลเลข 24 มักจะเป็นศิลปินเอกมีชื่อเสียงโด่งดัง สามารถแสดงอารมณ์ความรู้สึกได้อย่างดีเยี่ยม (ตีบทแตก) เลข 24 ยังเหมาะกับพ่อค้าแม่ขาย เพราะมีความชำนาญงานปฏิภาณเฉียบแหลม เข้าใจงานอย่างลึกซึ้ง เข้ากับใครได้ง่าย พูดดี พูดเก่งพูดเพราะอ่อนหวาน บุคคลหมายเลข 24 จะทำให้ได้รับการช่วยเหลือจากผู้มีอำนาจอิทธิพล และบ่งบอกว่าจะต้องรู้จักเกี่ยวพันกับคนในสังคมชั้นสูงที่มีหน้าที่การงานใหญ่โต หมายเลขนี้ช่วยเพิ่มพูนความสำเร็จทางการเงินการงานได้เป็นอย่างดี และจะได้รับความสุขในด้านความรักด้วย\r\n\r\nด้านเสีย เป็นเลขดีมาก แต่อย่ามีเยอะมากเกินไป เพราะจะสุขนิยม เฉื่อย หลงตัวเอง ใช้เงินเก่ง ใจเย็นเกินไป ควรต้องปรับสมดุลด้วย 41,14,15,45,59,95,36,63\r\n\r\nหมายเลข 24 ถ้าใครได้มาตั้งแต่กำเนิดเกิดมาเอง โดยไม่ได้เปลี่ยนแปลง มักเป็นผู้ที่เกิดมามีบุญวาสนา หรือกินบุญเก่านั้นเอง จะเป็นคนที่มีสติปัญญาดี เป็นนักพูดชั้นดี มีเพื่อนฝูงดีๆมาก มีบริวารคอยให้ความช่วยเหลือสนับสนุน เป็นคนที่มีเสน่ห์ดึงดูดใจ ให้คนอื่นรักชอบ เป็นคนน่ารัก มีโชคดีเกี่ยวกับความรักและเงินทอง เงินทองหามาได้โดยง่าย ชีวิตสุขสบายมาก จนบางครั้งถึงกับหลงตัวเองว่า ทำไมเกิดมาชีวิตนี้จึงดีไปเสียหมดทุกอย่าง แต่....ระวังสุดท้ายแล้วถ้าเขาเกิดมาดี แต่กลับไม่ทำความดีไม่สร้างบุญเพิ่มในชาตินี้ แถมไปรับเอาเลขร้ายๆเข้ามาในชีวิตโดยไม่รู้ตัว เมื่อบุญหมด บั้นปลายชีวิตจะตกต่ำลงในทุกๆเรื่องไม่ว่าจะเป็นทรัพย์สินเงินทองหรือความรักก็ตาม \r\n');
INSERT INTO `numbers` (`pairnumberid`, `pairnumber`, `pairtype`, `pairpoint`, `miracledesc`, `miracledetail`, `detail_vip`) VALUES
(26, '25', 'R7', -25, 'หมายเลข 25 พลังร้ายและพลังดี', 'การจะสำเร็จต้องผ่านอุปสรรคและการต่อสู้อย่างเหน็ดเหนื่อยก่อน จะต้องพบเจอกับทั้งเรื่องร้ายและดี จุดหมายสำเร็จแต่ก่อนที่จะสำเร็จต้องอาศัยความขยันหมั่นเพียรมากกว่าคนอื่นๆ และฟันฝ่าอุปสรรคต่างๆ ด้วยลำแข้งของตัวเองจึงจะบรรลุความสำเร็จดั่งต้องการ มีคนให้ความช่วยเหลือ มีความสำเร็จคอยอยู่อย่างแน่นอน จะได้คู่ดี เด่น มีหลักฐาน ความรู้ คู่ครองดี เก่งรอบด้าน คู้ครองจะช่วยเหลือกิจการงานใดๆได้เป็นอย่างดี แต่ระวังศัตรูไว้ให้มากเพราะค่านี้เลขศัตรูแรงมาก ระวังเรื่องกระทบกระทั่งเรื่องวาจา เลขนี้เกือบดีแต่มีอุปสรรคมากกว่าจะสำเร็จ', 'ด้านดี หมายเลข 25 มักเป็นคนปราดเปรื่อง ชอบแสวงหาความรู้ ความรัก และความยุติธรรม ชีวิตประสบความสำเร็จปานกลาง มักมีแนวคิดและอุดมการณ์ ที่ขัดแย้งกับผู้ใหญ่ แต่มักไม่แสดงออกและเก็บไว้ในใจ ทำให้เกิดอาการอึดอัด จนสุดท้ายก็มีปัญหากันในที่สุด ในด้านความสำเร็จของชีวิต ดูผิวเผินก็น่าจะประสบความสำเร็จได้เป็นอย่างดี แต่จะต้องใช้ความรู้ ความสามารถของตัวเองเป็นอย่างมาก ต้องต่อสู้ชีวิตอย่างเหน็ดเหนื่อย ต้องทนลำบากกว่าจะประสบความสำเร็จได้ เพราะเลข  2+5 เป็นเลข 7 ซึ่งหมายถึงดาวเสาร์ ชีวิตต้องอยู่กับปัญหาอุปสรรคตลอด มองเผินๆ เป็นเลขดี แต่เลขคู่นี้กว่าจะสำเร็จต้องผ่านอุปสรรคและการต่อสู้ ต้องเหนื่อยก่อน ต้องอาศัยความขยันหมั่นเพียรและฟันฝ่าอุปสรรคต่าง ๆ ด้วยลำแข้งของตนเอง จึงจะบรรลุความสำเร็จตามต้องการได้ กว่าจะผ่านพ้นไปได้ ต้องใช้ความพยายามและอดทนสูง \r\n\r\nด้านเสีย ชีวิตมักพบกับภาวะคับขันลำเค็ญอย่างสุดขีด  ถูกศัตรูปองร้าย ถูกกลั่นแกล้ง ถูกอำนาจมืดคุกคาม ถูกปล้น ถูกจี้ ถูกทำร้ายโดยไม่ได้ตั้งใจ ชีวิตจะพบกับความผันผวนอย่างรุนแรง  อาจถูกปองร้ายจนถึงแก่ชีวิต อันเนื่องจากการแก้ไขปัญหาในหน้าที่การงานทุกกรณี ปัญหาครอบครัวก็จะเกิดจุดแตกหัก  มักได้รับทุกข์จากกรรมเก่าที่มองไม่เห็น (ตามตัวเลขชีวิตของบุคคลเลข 25 เหนื่อยใจกาย) ชีวิตต้องประสบกับการเปลี่ยนแปลง ทำให้ชีวิตขึ้น ๆ ลง ๆ หาความแน่นอนไม่ได้ ชายใช้มักจะได้คู่ครองที่ดี มักมีสตรีหรือเพศตรงข้ามอุปถัมภ์  หญิงใช้จะต้องอุปถัมภ์ผู้ชาย เสียให้เขามากกว่าได้จากเขา\r\n'),
(27, '26', 'R5', -20, 'หมายเลข 26 พลังเสน่ห์และลุ่มหลง', 'อาชีพการงานไม่มั่นคง เป็นเลขที่ไม่ดี เป็นหลักฐานเก็บเงินทองไม่อยู่ เป็นคนเพ้อฟัน มองโลกในแง่ดี ไว้ใจคนง่าย อาจจะถูกหลอกให้เสียทรัพย์ ต้องระวังเพศตรงข้ามเพราะจะทำให้เสียชื่อเสียงด้วยเรื่องทางเพศ การทำการสิ่งใดจะสำเร็จแต่มักจะมีผู้กลั่นแกล้งสำเร็จได้ไม่นานต้องล้มลง ระวังการคบค้าสมาคมกับใคร ต้องใส่ใจในการคบหา เพราะจะนำพาความพินาศความล้มเหลวในชีวิต มักจะเกิดจากการแนะนำผิดๆ จากเพื่อนฝูง และหุ้นส่วน', 'ด้านดี หมายเลข 26 มีเสน่ห์มาก มองโลกในแง่ดี มีความสามารถ มีความอดทนพยายาม ชีวิตจึงประสบความสำเร็จดี มีชื่อเสียงเงินทอง มีหน้าที่การงานดีในอาชีพและสังคมที่อยู่ และผู้ใหญ่และเพศตรงข้ามมักให้โอกาสให้การสนับสนุนอุปถัมภ์ แต่เลขนี้ห้ามมีห้ามใช้มากกว่า 1 คู่ เพราะ\r\n\r\nด้านเสีย คือ เมื่อคนเรามีชื่อเสียงเงินทอง ก็มักอ่อนไหวตามสิ่งแวดล้อมที่มายั่วยวน จนเป็นคนฟุ้งเฟ้อ และหลงระเริงในเงินทองและกิเลสตัณหา ระวังจะมีปัญหาเรื่องรักสามเศร้า มีคนเข้ามาเพื่อหวังผล ทางแก้ คือ ควรระวัง เรื่องการคบเพื่อนคบมิตร..เพราะเขามักไม่ชอบหน้า อิจฉาริษยาคุณ เมื่ออยู่ซึ่งหน้าก็พูดดี อยู่ลับหลังก็อีกอย่าง คุณเป็นคนทำดีกับใครไม่ขึ้น ห้ามร่วมหุ้นกับใครอื่นเพราะจะถูกเอาเปรียบถูกโกงหรือมีปัญหาเกิด ถ้าจะทำธุรกิจควรทำคนเดียว และในชีวิตต้องใส่ใจในการคบหามิตรบริวารให้มากๆ เพราะที่ไหนมีเงิน...ความโลภความไม่ซื่อความหลอกลวงย่อมเกิด จึงต้องระวังอย่าไว้ใจใครเพราะเขาอาจนำพาความพินาศมาให้ ถ้าไม่ระวัง ความหลอกลวงและความล้มเหลวจะรออยู่ข้างหน้า เพราะความล้มเหลวในชีวิตของคุณมักจะเกิดขึ้นจาการแนะนำที่ผิดๆจากเพื่อนฝูง ญาติมิตร หุ้นส่วน หมู่คณะ คุณต้องระวังและรอบคอบให้มากอย่าปล่อยตัวปล่อยใจให้ลุ่มหลงตามอารมณ์ตนตามปากตามใจคนจะเกิดเรื่องผิดพลาด หรือทำให้มีเบื้องหลังให้คนติฉินนินทาได้\r\n'),
(28, '27', 'R10', -75, 'หมายเลข 27 พลังแห่งความมุ่งมั่น', 'ชีวิตจะพบกับความสำเร็จได้ สิ่งที่เป็นความสำเร็จเป็นผลมากจากความตั้งใจ วิริยะอุตสาหะ เป็นคนรอบคอบ และนักจัดการที่ดี มักจะมีความคิดเห็นเป็นของตนเอง การดำเนินชีวิตมักจะเป็นไปอย่างรัดกุม เลยส่งผลทำให้เครียดไม่ค่อยมีความสุขกับความสำเร็จเท่าที่ควร ส่วนใหญ่ทุกข์ใจง่าย วุ่นวายกับการสร้างกฎเกณฑ์ต่างๆ ดวงชะตายังคงมีความผิดหวัง ความเศร้าอยู่บ้าง อาจจะต้องระวังการเจ็บป่วยอุบัติเหตุ บ้าง ไม่ควรประมาท', 'ด้านดี เลขนี้คือเลขหลอกลวง ดีต้นร้ายปลายเพราะเลขนี้จะบันดาลให้ชีวิตโชคดี ประสบความสำเร็จอย่างงดงาม คนที่ใช้จะเป็นผู้ที่ชอบคิดหรือวางแผนเกี่ยวกับการดำเนินชีวิตอยู่ตลอดเวลา เช่น การคิดสร้างงาน สร้างฐานะ \r\n\r\nด้านเสีย เลขผีหลอก เลขเจ็บป่วย อุบัติเหตุแรง เลขล้มเหลวหนี้สิน ทะเลาะเบาะแว้ง ซึ่งมักเกิดในภายหลังและค่อยๆรุนแรงขึ้นเรื่อยๆ คือ ชีวิตมักจะมีความกดดันอย่างรุนแรง ทำให้เหมือนคนอมทุกข์ มีโรคภัยไข้เจ็บเบียดเบียนเรื้อรังประจำตัว ระวังอุบัติเหตุ ระวังโรคจิตประสาท ชายใช้มักได้รับความเดือดร้อนจากผู้หญิงตลอดเวลา ชีวิตแอบแฝงไปด้วยความเศร้า เช่น แม่ เพื่อน พี่สาว ลูกสาว ทำให้เดือดร้อนกลัดกลุ้มหรือคิดมากตลอดเวลา ทำคุณคนไม่ขึ้น ตัวอย่าง ยืมเงินแล้วไม่ใช้คืน หรือทำกิจการร่วมกันแล้วถูกโกง บริวารมักก่อเรื่องมาให้เดือนร้อนวุ่นวายใจกายและทรัพย์ คนเลขนี้มักจะประสบโรคภัยหรือเรื่องร้ายอย่างกะทันหัน ต้องสูญเสียบุคคลที่รักหรือเสียทรัพย์เพื่อแลกกับโชคลาภหรือโชคดี เช่น สูญเสียบิดาหรือคู่ครอง ลูกหลาน บุคคลที่เคารพ หรือไม่ก็เสียเงินเสียทองก้อนโตจากโรคภัยไข้เจ็บ การผ่าตัดอุบัติเหตุ บั้นปลายชีวิตจะต้องทุกข์ทรมานกับโรคภัยไข้เจ็บให้ระมัดระวังเรื่องการผ่าตัด ระวังโรคผิวหนัง โรคเครียด ข้อ เอ็น กระดูก ระบบประสาท ซีส เนื้องอก มะเร็ง คนเลขนี้ชีวิตมักจะวุ่นวายมากรอวันตกต่ำ สูญเสียพลัดพราก\r\n'),
(29, '28', 'R7', -20, 'หมายเลข 28 พลังแห่งความแปรปรวน ', 'เป็นคนที่มีความรับผิดชอบน้อย ทำอะไรจับจด ไม่ได้นาน เบื่อง่าย คิดฝันการงานไว้มากมายแต่ไม่กระทำ ชอบเรื่องการพนัน เสี่ยงดวงทุกรูปแบบ ชีวิตลำบากไม่ประสบความสำเร็จ เป็นคนกล้าได้กล้าเสีย ชอบทำงานใหญ่โดยไม่ไตร่ตรอง ชอบคิดค้นของใหม่ๆ ไม่ชอบย่ำเท้าอยู่กับที่ ไม่ชอบสิ่งที่จำเจ เป็นคนเชื่อมั่นในตัวเอง แต่ไม่ไว้ใจผู้อื่นในชีวิตจึงเต็มไปด้วยความขัดแย้ง ชอบริเริ่มแต่ไม่ชอบรับผิดชอบเรื่องความรักก็ไม่ประสบความสำเร็จ จึงทำให้การดำเนินชีวิตไม่ค่อยเป็น มักจะกำพร้าหรือผิดหวังในเรื่องความรัก ทำให้พัดพรากจากมารดาไปเสี่ยงโชคยังต่างแดนเป็นคนที่มีความทุกข์ซ่อนอยู่ในใจเสมอ การทำอะไรต้องเริ่มใหม่หมดไม่ค่อยมีใครช่วยเหลือให้ความร่วมมือเท่าไหร่', 'ด้านดี  เป็นเลขที่ส่งผลเสียให้กับชีวิตมากกว่าดี ดีคือชอบของแปลกใหม่ไม่ซ้ำใคร มักจะเป็นผู้นำในการคิดค้นสิ่งใหม่ๆ โดยหวังจะให้มีสิ่งนั้นเกิดขึ้นเพื่อเป็นประโยชน์ต่อผู้อื่น มีความทันสมัย ชอบการเดินทาง ชอบท่องเที่ยว บุคคลหมายเลขนี้บทจะรุ่งโรจน์ มีลาภ ยศ สรรเสริญ ก็จะได้มาอย่างมากมาย บทดวงตก ลาภยศก็สามารถสูญสิ้นได้ในพริบตา ชีวิตจะประสบความสำเร็จหรือล้มเหลวขึ้นอยู่กับการกระทำ และการตัดสินใจของตนเอง ไม่ใช่สิ่งแวดล้อมพาไป \r\nด้านเสีย ใครที่ใช้ให้ระวัง คดี หนี้สิน ความพลัดพรากต่างๆ คนเลขนี้ชีวิตต้องเริ่มต้นใหม่อย่างซ้ำซาก เป็นคนกล้าได้กล้าเสีย ชอบทำงานใหญ่ไม่ไตร่ตรอง ชอบคิดค้นของใหม่ๆ ไม่ชอบย่ำอยู่กับที่ เบื่อง่าย ไม่ชอบสิ่งจำเจ มีความเชื่อมั่นในตัวเองสูง แต่ไม่ไว้ใจผู้อื่น ในชีวิตจึงเต็มไปด้วยความขัดแย้ง มักเป็นคนเจ้าอารมณ์ โมโห ฉุนเฉียวได้ง่าย อารมณ์แปรปรวน มีทั้งการคิดมาก อมทุกข์และความขมขื่นผิดหวังในชีวิต อยู่ไม่เป็นที่ชอบการเดินทาง หรือ มักได้เดินทางบ่อย มักผิดหวังในเรื่องความรักอยู่เสมอ ไม่มีความสุขในชีวิตสมรส ไม่มีเวลา ไม่เข้าใจกัน ระวังจะได้คู่เป็นหม้าย คนเลขนี้มักพลัดพรากจากคนรักไปอยู่กันคนละทิศละทางหรือจะไร้คู่ ระวังรักสามเศร้าเพราะเชื่อใจคนง่าย รักคนง่าย ทำให้ต้องเปลี่ยนคู่บ่อย มีเบื้องหลังให้ชาวบ้านติฉินนินทา ต้องการไปต่างประเทศหรือต่างถิ่นต่างแดน เพื่อเสี่ยงโชค มักกำพร้าหรือผิดหวังในเรื่องความรัก อาภัพมารดา ขาดความอบอุ่น หว้าเหว่หงอยเหงา มีคนคอยเบียดบังเอาความดีความชอบ บริวารจะสร้างปัญหาให้ จะมีหนี้สินอย่างมากมาย ระวังล้มละลาย หมดตัว หรือทำธุรกิจผิดพลาด ให้ระวังโรคหัวใจ\r\n'),
(30, '29', 'R10', -60, 'หมายเลข 29 พลังความรุนแรง ', 'ส่งผลเป็นคนที่มั่นใจจนอวดดี ชอบเหยียดหยามคนอื่นๆ หัวรุนแรง ไม่มีการให้อภัย มีศัตรูมาก และคนปองร้ายเสมอ เป็นคนชอบอาฆาต จนบางครั้งกลายเป็นคนอำมหิต ชีวิตมักจะหักกลาง ถูกปองร้ายจากศัตรู ยิ่งการแข่งขันทางธุรกิจจะยิ่งมีโอกาสสูงในการถูกทำร้ายถึงชีวิต เรื่องความรักก็ไม่ประสบความสำเร็จ จะไปมีชู้และทิ้งคุณไปในช่วงชีวิตอับจน ชีวิตยิ่งจะแย่มากขึ้น การงานไม่มั่นคง มีแต่คนไม่ชอบหน้า', 'ด้านดี เสียมากกว่าดี ดีที่โชคดีและประสบความสำเร็จในหน้าที่การงานการเงินและความรักพอสมควรแต่ไม่ปลอดภัยไม่มีความสุข \r\n\r\nด้านเสีย เป็นเส้นทางวิบากกรรมเป็นคนอ่อนนอกแข็งใน ดูภายนอกสดใส แต่ภายในอมทุกข์ คิดอย่าง พูดอย่าง ทำอย่าง เป็นคนเก่ง มีความมั่นใจในตัวเองสูงมาก หลงตัวเอง จิตใจเข้มแข็ง และอวดดี เผด็จการ ชอบทำตัวเร้นลับไม่เปิดเผย ชอบอาฆาตจนบางครั้งกลายเป็นอำมหิตอย่างไม่รู้ตัว ชอบดูถูกผู้อื่น เช่น คิดว่าตัวเองเก่งที่สุด ไม่มีใครเก่ง เท่าตัวเอง มองผู้อื่นว่าฉลาดน้อยกว่า บางครั้งเป็นคนจู้จี้ จนผู้อื่นปรับตัวตามไม่ทัน ทำให้ชีวิตพลิกผัน ถูกกดดันกลั่นแกล้ง อิจฉาริษยา จากคนอื่นเสมอ ในชีวิตให้ระวังเพื่อนที่ไม่ซื่อ และเพศตรงข้ามไว้ให้ดีเขาจะสร้างปัญหามาให้ ชีวิตมักจะหักกลาง ถูกปองร้ายจากศัตรู ถูกผู้อื่นโค่นอำนาจได้ง่าย และมักจะแพ้ภัยจากศัตรู และชายจะผิดหวัง เรื่องผู้หญิงต้องระวังไว้ให้มาก ชีวิตจะมีแต่ความระทมขมขื่นแอบแฝงอยู่ หญิงใช้ก็เช่นกัน แม้สวยแค่ไหนแฟนก็นอกใจ เลขจะทำให้ชีวิตอมทุกข์ คนเลขนี้ชีวิตไม่ลำบากแต่ก็ไม่มีความสุข เลข 29 จงระวังจากอุบัติเหตุให้มาก \r\n'),
(31, '30', 'R10', -80, 'หมายเลข 30 พลังแห่งอุบัติเหตุ ', 'สามารถส่งผลให้รุ่งโรจน์อย่างโลดโผนมากแต่ในขณะเดียวกัน ความรุ่งโรจน์ก็อาจล้มครืนลงมาอย่างฉับพลัน สุขภาพร่างกายไม่ค่อยดี เกิดล้มเจ็บอย่างกะทันหัน หรือเกิดอุบัติเหตุได้รับอันตราย เมื่อโอกาสช่วงชีวิตประสบความสำเร็จในหน้าที่การงานหรือความรัก ก็มักจะมีเหตุให้เจ็บป่วยทำให้พลาดงาน ตำแหน่งสำคัญๆได้โดยง่าย มีความพลิกผันแปรสูง สิ่งที่ราบรื่นจะมีอุปสรรคมาขวางกั้น ความรุ่งโรจน์ไม่ยั่งยืน พลังอุบัติเหตุแรงมากครับ ต้องระมัดระวังเรื่องอุบัติเหตุ การผ่าตัด และเหตุร้ายแรงอย่างฉับพลันไม่ควรประมาท', 'ด้านดี เป็นผู้ที่มีความกล้าหาญ มีความขยันขันแข็ง หัวคิดทันสมัย เป็นคนเก่ง เลขนี้สามารถส่งผลให้ชีวิตรุ่งโรจน์ได้อย่างผาดโผน ประสบความสำเร็จมีทุกสิ่งทุกอย่างทั้งเงินงานความรัก แต่…..\r\n\r\nด้านเสีย แต่ในขณะเดียวกันความรุ่งโรจน์ก็อาจล้มครืนลงมาได้อย่างฉับพลันเหมือนวิมานทลาย เช่น ธุรกิจการค้ากำลังเจริญรุ่งเรือง แต่ก็จะเกิดมีอุปสรรคมาปิดกั้นอย่างปัจจุบันทันด่วน หรือธุรกิจการงานกำลังประสบความสำเร็จแต่เจ้าของก็มีอันเป็นไป ได้แต่งงานได้เลื่อนตำแหน่งแต่ประสบอุบัติเหตุ เป็นต้น จึงต้องระวังไม่ควรที่จะประมาท เพราะดาวคู่นี้เป็นดาวคู่อุบัติเหตุเมื่อมาอยู่ร่วมกัน จึงต้องระมัดระวังเรื่องอุบัติเหตุ เช่น การบาดเจ็บ การผ่าตัด และมีเหตุร้ายแรงอย่างฉับพลัน ให้ระวังเรื่องอุบัติเหตุและการผ่าตัดให้มาก ระวังเรื่องอุบัติเหตุรถคว่ำ อาวุธ ถูกคนลอบทำร้าย จนทำให้สูญเสียชีวิตได้ ให้ระวังการทะเลาะวิวาท การเจ็บป่วยจากโรคประสาท โรคผิวหนัง และระวังการถูกแย่งชิงตำแหน่งหน้าที่การงานด้วย  และเรื่องอื้อฉาวเกี่ยวกับการครองชีวิตคู่ การทะเลาะวิวาทในครอบครัว ชีวิตสมรสไม่แน่นอน ไม่ได้แต่งงาน หรือแต่งไม่น้อยกว่าหนึ่งครั้ง การดำเนินชีวิตต้นร้ายปลายดี แต่กว่าจะผ่านวัยต้นของชีวิตอาจจะไม่มีชีวิตอยู่ ต้องรอบคอบและระมัดระวัง \r\n\r\nชีวิตหาความสมดุลได้ยากเพราะชีวิตมักจะเปลี่ยนแปลงอย่างรวดเร็ว ชีวิตมักจะหักกลาง มักมีปัญหาและอุปสรรคมากมาย มักล้มเหลวในหน้าที่การงาน มักถูกทรยศหักหลัง ถูกคดโกงไม่ซื่อสัตย์ กลายเป็นคนอมทุกข์ มักมีเรื่องสะเทือนใจอย่างรุนแรงในชีวิต ถูกเพื่อนฝูงญาติมิตร เกลียดชัง ดูถูกเหยียดหยาม ชีวิตมีเรื่องอื้อฉาว ความรักหักกลางคัน อาภัพรัก มากคู่หลายเมีย ด้านจิตใจมักได้รับความเจ็บซ้ำหรือ เจ็บปวดอย่างรุนแรงอยู่เสมอๆ ใครที่ใช้เลขนี้เป็นคนมีเพื่อนน้อย  เงียบขรึม ไม่ชอบแสดงตัว ชอบใช้ชีวิตอยู่ตามลำพัง ชีวิตมักจะพบกับจุดแตกหัก ได้อย่างไม่คาดฝัน มักจะมีอุปสรรค มาปิดกั้นอย่างปัจจุบันทันด่วน มีความไม่แน่นอนในชีวิต บางครั้งของจะได้อยู่แล้วกลับไม่ได้ มีความเปลี่ยนแปลงเกิดขึ้นอยู่ตลอดเวลา โดยเฉพาะชีวิตครอบครัวจะไม่อบอุ่น แตกร้าว ชีวิตมักจะมีทั้งเรื่องดีและเรื่องร้าย ชีวิตมักจะโชคร้ายเบื้องต้นก่อน ถ้าสามารถรักษาชีวิตให้รอดได้ทนความทุกข์ได้ จึงจะประสบความสำเร็จในบั้นปลายได้'),
(32, '31', 'R10', -85, 'หมายเลข 31 พลังแห่งความไม่แน่นอนของโชคชะตา ', 'ชีวิตขึ้นอยู่กับความไม่แน่นอนของชีวิต มีอุปสรรคมากมายมาขวางกั้น กว่าจะถึงจุดหมายปลายทางสำเร็จ ไม่มีความมั่นคงในชีวิต ชีวิตมักจะโชคร้ายในเบื้องต้นและประสบความสำเร็จในบั้นปลาย มีความสูญเสียและผิดพลาดได้ง่าย สุขภาพไม่แข็งแรงป่วยบ่อย หรือมีอุบัติเหตุไม่คาดฝัน ความรักจะเกิดข้อผิดพลาด ข่มขื่น ความสุขเรื่องรักไม่มั่นคงอยู่เพียงชั่วคราว คนรักมักจะนอกใจเสมอ แต่ก็มีโอกาสประสบความสำเร็จในบั้นปลายแต่ก็หนักหนาเอาการกว่าจะผ่านไปได้ครับ', 'ด้านดี คือมักจะส่งผลดีอย่างรวดเร็ว ร้ายก็รวดเร็ว (มีอิทธิพลจากกำลังดาวมหาอุจน์ 13) ทำให้มีโชค และมีอำนาจหน้าที่การงานสูง บ้างก็เป็นผู้บริหาร บ้างก็เป็นผู้จัดการ เป็นคนโดนเด่นในสายงานแต่………\r\n\r\nด้านเสีย แต่ในขณะเดียวกันก็จะตกต่ำล้มเหลวลงอย่างรวดเร็ว มีเหตุร้ายเกิดขึ้นอย่างไม่คาดฝันเช่นกัน เพราะเลข 1,3 เป็นดาวคู่ศัตรูกัน เมื่อมาอยู่ร่วมกัน  จะให้ทั้งคุณและโทษอย่างรวดเร็ว มักมีการเปลี่ยนแปลงอย่างรวดเร็ว  จึงทำให้เกิดทั้งเรื่องดี เรื่องร้ายได้อย่างฉับพลัน  ชีวิตที่ต้องวิ่งเต้นต่อสู้ หรือแข่งขันอยู่ตลอดเวลา เป็นคนที่รับผิดชอบต่อหน้าที่การงานดี แต่ชีวิตมักหักกลางคัน ซึ่งเกิดจากบุคคลที่ใกล้ชิดหรือผู้ที่ตนไว้วางใจ ชีวิตมักจะมีลูกน้องหรือมีผู้สนับสนุนเป็นอันดีในช่วงเริ่มต้นทำงาน แต่พอเริ่มจะดีก้าวหน้าขึ้น มักถูกหักหลังแทงข้างหลัง หมดความสำคัญหมดอำนาจในบั้นปลาย มีการเลื้อยขาก้าวอี้ หรือ ในกลุ่ใงานขาดความสามัคคีกัน จนเป็นเหตุให้สิ่งที่กำลังดำเนินอยู่ มีอันต้องล้มลง \r\n\r\nผู้ที่ใช้หมายเลข 31 13 ต้องระวังเรื่องชู้สาว การหย่าร้าง ครอบครัวแตกแยก การทรยศหักหลัง อุบัติเหตุรุนแรง หากมีบริวารลูกน้อง ก็ต้องระวังเขาจะโกงเงิน จะแทงข้างหลัง มีคดีความ มีการผ่าตัดซ้ำ ชีวิตตอนต้นดีบั้นปลายร้าย ใครมีเลข 31 13 จงระวังให้หนักเพราะเป็นดาวอุบัติเหตุที่รวดเร็วและรุนแรง ต้องระวังอุบัติเหตุทุกรูปแบบ ทั้งภัยจากเครื่องจักร ความเร็ว ของแหลมคม เขี้ยวงา ผ่าตัด ตัดเชื้อ ช่องท้องรังไข่ รถคว่ำ ถูกอาวุธ ถูกคนลอบทำร้าย  ครอบครัวมีปัญหาแตกร้าว ชีวิตคู่ไม่ปกติสุข  ผู้ใหญ่ให้โทษ สายตามีปัญหา ผู้ใหญ่กดดัน  \r\n\r\nเลข 13 31 จะได้มาซึ่งอำนาจ  แต่หากใช้อำนาจไปในทางที่ผิด มีความเห็นแก่ตัว  เอารัดเอาเปรียบไม่มีศีลธรรมแล้ว สุดท้ายจะมีอุปสรรคปัญหามาขวางกั้นชีวิตอยู่ตลอดเวลา หาความสมดุลให้กับชีวิตไม่ได้เลย ชีวิตขึ้นๆลงๆ หาความแน่นอนไม่ได้\r\n'),
(33, '32', 'R7', -35, 'หมายเลข 32 พลังแห่งเจ้าชู้มีเสน่ห์', 'เป็นเลขดีปานกลาง เหมาะกับผู้หญิง เป็นคนเจ้าชู้มีเสน่ห์งานทุกอย่างที่ลงมือทำจะประสบความสำเร็จด้วยตนเองมากกว่าการให้คนอื่นทำ เป็นคนมีหลักการดี ผู้ใหญ่จะเอ็นดู ชื่อนี้มีความเด่นในเรื่องคู่ครองเพศตรงข้ามอย่างมาก จะมีคนรักมาก ดึงดูดใจเพสตรงข้ามได้เป็นอย่างดี ผู้ชายต้องระวังผู้หญิงจะนำเรื่องตรงข้ามมาให้ ระวังเรื่องสุขภาพเพราะเรื่องทางเพศ และเรื่องอื่นๆ อาชีพที่เหมาะสมจะเกี่ยวเนื่องกับเพศตรงข้าม การความสัมพันธ์หรือที่ต้องมีความสัมพันธ์กับเพศตรงข้ามจะให้ผลดี', 'ด้านดี มีความหมายคล้ายกับเลข 23 แต่มีด้านเสียมากกว่า/แรงกว่า ด้านดี คือเป็นคนมีเสน่ห์ ใครเห็นใครก็รัก ใครเห็นใครก็ชอบ รักความยุติธรรม รักความถูกต้อง เป็นคนยึดมั่นในความคิดและอุดมการณ์ของตนเอง งานทุกอย่างหากไม่ลงมือทำงานเองมักจะประสบกับความล้มเหลว \r\n\r\nด้านเสีย คือ ระวังชีวิตจะป่วยจนได้รับการผ่าตัด ต้องประสบกับอุบัติเหตุ ผู้ที่ตกอยู่ภายใต้อิทธิพลของเลข 32 จงระวังอย่างมากๆ ในเรื่องการผิดศีลข้อสาม มักเป็นคนเจ้าชู้ เป็นคนอารมณ์เร่าร้อนรุนแรง เป็นคนมีเสน่ห์ ดึงดูดเพศตรงข้าม ถ้าหลงใหลใฝ่ต่ำเรื่องโลกีย์ ชีวิตก็จะพบกับความหายนะ ประเภทท่านไม่เข้าไปหาเขา เขาก็จะเข้ามาหาท่านเอง เพราะฉะนั้นสืบดูให้ดีก่อน เพราะคนในสังคม มักจะเอาเรื่องของท่านมาเล่า เพื่อความสนุกปาก คนเลขนี้ชีวิตมักจะมีอุบัติเหตุ มีโรคภัยไขเจ็บเบียดเบียนอย่างเรื้อรัง สุภาพสตรีใช้ มักจะเป็นคนขี้โรค  เจ็บป่วยบ่อย ถ้าเป็นชาย ต้องระวังจะถูกผู้หญิงสร้างปัญหาความทุกข์มาให้อย่างร้ายแรง สุขภาพไม่ดี มักจะกำพร้า ขาดความรักความอบอุ่น แต่ยังดีที่มีผู้ใหญ่ให้ความอุปถัมภ์เป็นอย่างดี \r\n'),
(34, '33', 'R10', -85, 'หมายเลข 33 พลังความฉุนเฉียวเร้าร้อน', 'เป็นคนที่อารมณ์ฉุนเฉียวเร่าร้อนรุนแรงทำอะไรชอบเอาแต่ใจตัวเอง ไม่ยอมยับยั้งใดๆ มุทะลุ ดุดัน เอาแต่ใจตัวเอง ขี้หงุดหงิด เพราะพลังของการแข่งขันมาซ้อนกันอยู่ถึง2เท่า เป็นคนไร้เหตุผล เอาแต่ใจ เป็นคนเลือดร้อน ชอบมีปากเสียงกับผู้อื่นได้ง่าย มีเรื่องการขัดวาจากันเสมอ โอกาสเกิดอุบัติเหตุมีสูงเนื่องจากความใจร้อน เป็นคนที่ซีเรียสจริงจังกับความรักมากเกินไปแล้วเป็นลักษณะรุนแรงมากด้วย เป็นคนชอบเสี่ยงไม่ระมัดระวัง', 'ด้านดี คือ ร้ายอันตรายมากกว่าดี ดีคือมีความโชคดีในการต่อสู้แข่งขัน มีโชคในเงินงานความรัก จึงส่งผลให้ชีวิตร่ำรวยมีความสำเร็จบนเส้นทางเงินตราได้อย่างดี เงินงานความรักหาง่าย แต่………………\r\n\r\nด้านเสีย คือ ใช้เงินเก่ง แถมมีคนมาช่วยใช้  และถ้าขี้เหนียว ถ้าอารมณ์เสียเงินจะไม่เข้าและจะมีเรื่องเสียเงินง่ายๆ คนเลข 33 มั่นใจในตัวเองสูง มีอารมณ์ฉุนเฉียวเร่าร้อนรุนแรง อารมณ์ร้อน ชอบเอาแต่ใจตนเองไม่ยอมยับยั้งใดๆ ทั้งสิ้น ดันทุรังเอาให้ได้แบบหัวชนฝา และมีความมุทะลุค่อนข้างมาก ถ้าจะเอาต้องได้ มีอารมณ์ทางเพศสูง รักมักมีมากกว่า 1 ระวังจะมีชู้มีกิ๊ก ทำให้ตกเป็นมือที่สามในชีวิตคู่ของคนอื่น \r\n\r\nด้วยอิทธิพลของดาวอังคารถึงสองดวงซึ่งเป็นดาวบาปเคราะห์จะทำให้เกิดอันตรายแก่ชีวิตได้อย่างฉับพลัน ระวังอันตรายแบบฉับพลันเพราะคนเลขนี้มักจะประสบอุบัติเหตุอย่างร้ายแรง มีภัยเครื่องจักรและความเร็ว เช่น รถชน รถคว่ำ ระวังภัยจากมีด ปืน การกระทบกระทั่ง  การทะเลาะวิวาท ฆ่าตัวตาย โดนฆ่าตาย ตายเพราะเงิน ตายเพราะโดนพลาด ตายเพราะโดนลูกหลง ตายเพราะเรื่องโลกีย์ ระวังโรคเกี่ยวกับเลือด มดลูก รังไข่ มะเร็ง ความสุขของชีวิตไม่ค่อยมี เพราะเป็นเลขแห่งการดิ้นรนไม่พอดี ดิ้นเพื่อให้ได้มาซึ่งทรัพย์สินเงินทองและความรัก รวยแต่ตาย รวยแต่ป่วย รวยแตอันตราย รวยแต่เหนื่อยใจตลอดทั้งชีวิต\r\n'),
(35, '34', 'R10', -60, 'หมายเลข 34 พลังแห่งความรอบรู้ครุ่นคิด ', 'เป็นคนที่มีสติปัญญาดี รอบรู้เรื่องราวหลากหลายใฝ่ศึกษาชอบค้นคว้าหาความรู้ ชอบอ่านหนังสือ ดูสิ่งที่มีสาระ มีปฏิภาณดี ตัดสินใจไว ว่องไวรวดเร็วเป็นบุคคลกล้าหาญ กล้าพูดกล้าทำ เป็นคนเปิดเผย ทำให้ชีวิตประสบความสำเร็จได้อย่างดี แม้ชีวิตจะพบอุปสรรคมากมาย แต่ก็สามารถเอาตัวรอดไปได้ด้วยสติปัญญาของตัวเองเสมอ มีโอกาสได้รับอุบัติเหตุทางสมอง เลขนี้ไม่ร้ายอะไรมากนักทำบุญ เจริญสมาธิ มีสติ ไม่ประมาท และไม่หมกมุ่นอะไรมากเกินไปจะช่วยได้', 'ด้านดี เป็นคนเก่ง เป็นคนมีสติปัญญาแตกฉาน ว่องไว มีปฏิภาณไหวพริบดี เป็นคนกล้าหาญ กล้าพูดกล้าทำ เป็นคนเปิดเผย ไม่มีเล่ห์เหลี่ยม รักงาน เป็นคนที่มีไหวพริบในการเอาตัวรอดเป็นอย่างดี เรียนรู้ได้อย่างรวดเร็ว ไม่ย่อท้อต่ออุปสรรค แม้ชีวิตจะพบอุปสรรคมากมาย \r\n\r\nด้านเสีย ระวังความซวยทั้งปวง เจ็บป่วยอุบัติเหตุ ต้องผ่าตัด ต้องรักษาตัว ระวังคุกตะราง ระวังคดีวาม ชีวิตมีอุปสรรคมาก เหน็ดเหนื่อยมาก ลำบากอยู่กับปัญหาตลอด ต้องใช้ความคิดอยู่ตลอดเวลา จนบางครั้งอาจเกิดความเครียด ต้องระวังอาการทางโรคประสาท โรคเกี่ยวกับสมอง กระดูก เอ็น ข้อ อาจได้รับการกระทบกระเทือนอย่างรุนแรงจากอุบัติเหตุหรือการพลัดตกหกล้มถึงขั้นทำให้เป็นอัมพาตได้ และมักจะมีปัญหาที่ไม่ดีเกิดขึ้นโดยฉับพลัน ผู้ที่ตกอยู่ภายใต้อิทธิพลของเลข 34 เลขนี้จะเป็นสาเหตุที่ก่อให้เกิดแห่งภาระและหนี้สิน มีความล้มเหลวตลอดเวลา เด็กที่มีเลข 34,43 มาตั้งแต่กำเนิดมักจะประสบอุบัติเหตุรุนแรงและโรคฟัน กระดูก บาดเจ็บจากสัตว์ที่มีเขี้ยวมีงาในวัยเด็กและวัยรุ่น \r\n'),
(36, '35', 'R5', -15, 'หมายเลข 35 พลังแห่งคุณและโทษ', 'เป็นคนกระฉับกระเฉงคล่องงานรอบตัว มีพรสวรรค์เข้ากับคนได้ทุกระดับชั้นชีวิต ระวังเรื่องเชื่อคนง่าย ผู้ใหญ่จะให้ทั้งคุณและโทษ มีทั้งคนที่หลอกใช้เพื่อประโยชน์กับคนที่ช่วยเหลืออย่างจริงจัง บั้นปลายจะประสบความสำเร็จดีจะมีผู้ใหญ่ให้การอุปถัมภ์ค้ำชู การตัดสินใจต่างๆควรจะรอบคอบมีโอกาสเสียการงานเพราะตัดสินใจผิดจากคนอื่นๆได้', 'ด้านดี คือ รวย เลขจะช่วยดึงดูดเงินงานให้เจ้าของได้ เลขจะทำมีชื่อเสียงโด่งดัง เป็นคนกระฉับกระเฉง คล่องงานรอบตัว มีพรสวรรค์เข้ากับคนได้ทุกระดับชั้นชีวิตในบั้นปลายจะประสบความสำเร็จดี จะมีผู้ใหญ่ ให้การอุปถัมภ์ค้ำชู เป็นผู้ที่แสวงหาความรู้ และมีอุดมการณ์พอสมควร \r\n\r\nด้านเสีย ต้องอาศัยผู้ใหญ่เป็นเครื่องเชิดชูความเป็นอยู่ของตัวเอง ชีวิตในวัยเด็กต้องพลัดพรากจากครอบครัว ต้องไปอาศัยอยู่กับปู่ย่าตายายลุงป้าน้าอา หรือบุคคลอื่นที่ไม่ใช่ญาติ มักหลงผิด ติดเพื่อน หูเบาเชื่อใจคนง่าย มักถูกคนอื่นหลอกลวงอยู่ตลอดเวลา อยู่ในสภาพแวดล้อมไม่ดี เพื่อนฝูงมักชักนำพาไปในทางที่ไม่ถูกไม่ควรได้ มักถูกเบียดบังความดีความชอบ  มักมีคนไม่ดีเข้ามาในชีวิตอยู่เสมอ อย่าคบหากับบุคคลที่ไม่น่าไว้วางใจไม่เช่นนั้นชีวิตจะดิ่งสู่หายนะจากหน้ามือเป็นหลังมือ  เลขนี้ต้นดีแต่บั้นปลายนั้นก็จะเริ่มเสื่อม ผู้อุปถัมภ์หรืออาจเรียกอีกอย่างหนึ่งว่าผู้สร้างผู้ส่งเสริมจะกลับกลายเป็นผู้ทำลายชีวิตคุณ ชีวิตมักล้มเหลวเพราะเพื่อนฝูงและหุ้นส่วน คนเลข 35 ชีวิตวุ่นวาย ระวังการเจ็บป่วย ระวังถูกกลั่นแกล้งอิจฉาริษยา แย่งงาน แย่งเงิน ระวังจะโดนหลอกโดนโกง มีหนี้สิน มีคดีความเพราะผู้อื่น ระวังอุบัติเหตุหรือการถูกลอบทำร้าย หนักเบาต่างกันที่ดวงกำเนิดและเลขร้ายคู่อื่นๆที่สะสม'),
(37, '36', 'D10', 75, 'หมายเลข 36 พลังแห่งความรักความอบอุ่น ', 'เป็นเลขดีมาก ความรักในค่าหมายเลขนี้เด่นมากๆ พื้นฐานครอบครัวดีอบอุ่น มีคู่ครอง มีหลักฐานมั่นคง มีความรู้ที่ดี ขยันขันแข็ง มีความเกื้อหนุนปรองดองกัน มีชื่อเสียง มีความสดชื่นของชีวิต มีคนช่วยเหลืออย่างดีทั้งเพื่อนและผู้ใหญ่ การงานก้าวหน้าเร็วมาก จะประสบความสำเร็จแบบก้าวกระโดดชีวิตจะประสบความสำเร็จเป็นอย่างดี มีมิตรสหายมาก เพศตรงข้ามมักจะให้ความอบอุ่นเป็นอย่างดี แต่เป็นคนเจ้าอารมณ์ มีความคิดเห็นรุนแรง อาจจะทำให้ความรักมีโอกาสไม่ราบรื่นควรระวังเรื่องอารมณ์ร้อนไว้และหมั่นทำบุญนั่งสมาธิจะดีเอง อาชีพที่เหมาะสมจะเกี่ยวกับนักปกครอง นักบริหาร ครูอาจารย์ นักจิตวิทยา อาชีพหลากหลายเพราะพลังความสำเร็จมีมากส่งเสริมเกือบทุกอาชีพ', 'ด้านดี เลขนี้จะทำให้กระตือรือร้น ถ้าเป็นเด็กจะฉลาดเรียนเก่ง  สติปัญญาดี มีหัวทางประดิษฐ์คิดค้น ขยันทำงาน ขยันหาทรัพย์สินเงินทอง ชีวิตจะประสบความสำเร็จเป็นอย่างดี มีมิตรสหายมากมีคนรักเคารพนับถือ  มีผู้ใหญ่คอยช่วยเหลือเกื้อกูลอุปถัมภ์ให้งานให้เงิน คนเลขนี้จะมีโชคลาภวิ่งหา มี โชคดีนำทาง จะทำให้มีการเงินการงานก้าวหน้ารุ่งเรือง งานดี งานเด่น มีตำแหน่งสูง และยังดีเด่นในด้านความรัก มีเสน่ห์มาก เป็นคนมีเสน่ห์ดึงดูดใจเพศตรงข้าม และเพศตรงข้ามมักให้ความอบอุ่นช่วยเหลือเป็นอย่างดี มีรักดี ได้คู่รวย คู่ครองดีมีความรู้ ช่วยเหลือเกื้อกูลเรา ใช้แล้วคนรักจะรักและเอาใจใส่มากขึ้น  และถ้าใครที่มีแฟนแล้วแต่งงานแล้วถ้าใช้เลขนี้จะทำให้รักครอบครัวมากขึ้น  หากเป็นหญิงใช้เลข 36 จะมีโอกาสดีมีชีวิตคู่ หรือได้แต่งงานสูงมาก และจะได้คู่ครองที่ดี โดยสรุปเลขนี้รักดี งานเด่น หาเงินง่าย เงินทองไม่ขาดมือ \r\n\r\nด้านเสีย คนที่ใช้เลขนี้จะเสียนิดหนึ่งคือ ต้องควบคุมตนเองให้ดีโดยเฉพาะอารมณ์ ปาก ใจ ระวังเรื่องการใช้เงิน เลขช่วยดูดเงินมาให้ เราก็ต้องเก็บเงินให้เป็น และระวังจะเจ้าชู้มากขึ้น เนื่องเพราะมีคนมารักชอบหลงใหลมาก \r\n'),
(38, '37', 'R10', -90, 'หมายเลข 37 พลังความวิบัติ', 'ชีวิตไม่สดใส ทำมิ่งใดก็ยากที่จะเจริญ มีแต่อุปสรรคมาขวางกั้น ถ้าเกี่ยวข้องกับผู้ใดให้พึงระวังการทะเลาะวิวาท ความวิบัติอันรุนแรง การขัดแย้งกัน จะมีเรื่องให้ทะเลาะเบอะแว้งกันประจำ มีโอกาสถูกทำร้ายร่างกาย ผ่าตัด อุบัติเหตุ การพลัดพราก มีแต่ผลร้ายต่อชีวิต ชีวิตมีมุมหักเหอยู่ตลอดเวลามักจะขึ้นๆลงๆ ไม่ค่อยราบรื่นนัก มักเกี่ยวข้องกับความตาย', 'ด้านเสีย สุดท้าย จะล้มละลาย หมดตัว หรือรวยแต่เสียชีวิตก่อนวัยอันควร ชีวิตมีแต่ความพลัดพราก อาภัพรัก รักพัง ทะเลาะบ่อย มีเลิกลาหย่าร้าง คนเลขนี้เป็นคนมั่นใจในตนเอง ใจร้อน ขี้โมโห เจ้าอารมณ์ หยิ่ง ถือตัว กล้าบ้าบิ่น พูดตรงพูดแรง เป็นนักสู้ทุกสถานการณ์ ชีวิตมักเกิดความขัดแย้ง กระทบกระทั่ง ทะเลาะวิวาทบ่อย  มักมีการสูญเสียและพ่ายแพ้ มักเกิดอุบัติเหตุบ่อยๆ ต้องทุกข์ทรมานจากโรคร้าย และมีการผ่าตัด มีอุบัติเหตุ ตลอดจนต้องทุกข์ทรมานจากโชคร้าย เกิดความเสียหายอย่างรุนแรง มีมุมหักเหตลอดเวลา ชีวิตขึ้นๆลงๆ ไม่ราบรื่น ชีวิตสมรสไม่แน่นอน บ้านแตก ครอบครัวแตกแยก\r\n\r\nเลขนี้อันตรายเพราะความซวยความตายมักมาเยือนก่อนเวลาอันควร หรือถ้าไม่ตายก็เลี้ยงไม่โต ให้ระวังโรคความดันโลหิต อัมพาต ระวังการทะเลาะวิวาท การตายที่ผิดปกติ มีความวิบัติอันรุนแรง จากอุบัติเหตุและการขัดแย้งกัน เลขนี้นอกจากทำร้ายตัวเองแล้ว ยังอาจทำให้คู่ครองมีเหตุอันเป็นไปได้ด้วย เพราะเขาคือเลขกินผัวกินเมีย ถ้าโชคดีคู่ครองดวงแข็งจะเลิกรากัน ถ้าโชคร้ายคู่ครองดวงอ่อนจะตายจากกัน ทำให้เจ้าตัวต้องเป็นหม้าย ในช่วงชีวิตต้องผ่านการมีคดีความ มีหนี้สิน หมดตัว ล้มละลายชีวิตต้องเริ่มต้นใหม่หลายครั้ง ต้องแบกรับภาระเงินงานของตนเองและบริวาร ทุกข์เพราะบริวาร โดดเดี่ยวเดียวดาย มีก็เหมือนไม่มี ระวังโรคเกี่ยวกับ กระดูก ข้อ เอ็น หลัง หัว ระบบประสาท สมอง \r\n'),
(39, '38', 'R10', -50, 'หมายเลข 38 พลังแห่งโมหะจริต ', 'มีกิเลสตัณหามาครอบงำให้คุณเดินทางที่ผิด ติดเหล้า บุหรี่การพนัน แสดงถึงถูกอำนาจของความลุ่มหลงโมหะจริตเข้าครอบงำ ชีวิตมีแต่ความวุ่นวาย เอาความคิดตัวเองเป็นใหญ่ไม่ฟังคำใคร เจ้าอารมณ์ มีความผันผวนในชีวิตอย่างรุนแรง จะหลงในกิเลศ ตัณหา ความมัวหมองมัวเมา และสิ่งเร้นลับต่างๆ', 'ด้านเสีย เป็นเลขร้าย ส่งผลในทางไม่ดี คือ หลงตน มักหมกมุ่นอยู่กับกามคุณ ชอบทำผิดทำนองคลองธรรม หลงผิด ติดเหล้ายา ติดการพนัน และอบายมุขทุกอย่าง เชื่อตัวเองมากเกินไป บางครั้งกลายเป็นอวดดี หมกมุ่นอยู่กับไสยศาสตร์ เวทมนต์คาถา จนส่งผลร้ายต่อชีวิต คนเลข 38 มักโกรธง่าย อารมณ์ร้อนฉุนเฉียว มักชอบใช้ความรุนแรง และมีอารมณ์วู่วาม เอาแต่ใจตัวเอง ครอบครัวแตกแยก แตกคอเพื่อนฝูง หุ้นส่วนเกิดความขัดแย้ง เพราะเกิดจากการที่เป็นคนไม่ยอมคน เป็นคนที่มีความเชื่อมั่นในตนเองสูง ทะเยอทะยานมาก คนธรรมดาใช้ชีวิตมักพัวพันกับสิ่งผิดกฎหมาย ชีวิตจะผันผวนต้องไปคบหากับนักเลง อันธพาล ทหาร ตำรวจ เช่น เป็นนักเลงคุมบ่อนการพนันจน หรือถ้าบุคคลหมายเลขนี้มักมีอาชีพเป็นทหาร ตำรวจ  นักกฎหมาย  ตลอดทั้งนักข่าวหนังสือพิมพ์จะดีขึ้น  แต่มักชอบใช้อำนาจไปในทางที่ผิด มักเร่ร่อน  โยกย้ายบ่อย มักไม่ประสบความสำเร็จ มักดำเนินชีวิตผิดพลาดอยู่เป็นประจำ ระวังจะโดนคดีความจากเพื่อนฝูงที่คบหา ให้ระวังอุบัติเหตุ เช่น อัคคีภัยที่เกิดขึ้นจากฝูงชน ภัยที่เกิดขึ้นจากสิ่งสาธารณะ ภัยที่เกิดในระหว่างปฏิบัติหน้าที่ ผู้ที่ได้เลขนี้ มักจะประสบอุบัติเหตุในหน้าที่ ในระหว่างการทำงาน เช่น รถคว่ำ รถชน ตกรถเมล์  ฯลฯ\r\n\r\nด้านดี จะทำให้มีหน้าที่การงานที่ดี มีตำแหน่ง มีบารมี มีโชคลาภหนุนนำ\r\n'),
(40, '39', 'R10', -70, 'หมายเลข 39 พลังแห่งความกดดัน ', 'เป็นเลขที่ให้พลังกลางๆไม่ร้ายหรือดีมาก ชะตาจะขึ้นอยู่กับกรรมเก่าและกรรมปัจจุบันมากกว่า ไม่ค่อยมีส่วนเสริมพลังชีวิตซักเท่าไหร่ มักจะพบกับความยุ่งยากในชีวิติยอยู่บ่อย ๆ และจะพบกับการกระทบกระเทือนใจอย่างรุนแรง ความกดดันจิตใจเมื่อถึงขีดสุดก็อาจจะวิปริตไปได้ง่ายๆ มีข้อดีคือมีมิตรสหายมากพอจะพึ่งพาอาศัยได้บ้างแต่ไม่มากแต่จะเป็นเพื่อนแท้ มักจะมีเรื่องให้ไม่สบายใจและเรื่องให้คิดเสมอๆ', 'ด้านเสีย เลข 39 เลขของความลุ่มหลงมัวเมา เมาเหล้า ติดยา ติดอบายมุข ติดการพนัน คบคนไม่ดี แฟนนอกใจ และเขาเองก็นอกใจแฟน มีคดีความ ติดคุกติดตะราง มักทำผิดกฎหมาย มักเกิดอุบัติเหตุรุนแรงที่มีไฟมีระเบิดเข้ามาเกี่ยวข้อง คนเลขนี้มักมั่นใจในตนเอง เจ้าอารมณ์ ใจร้อน เอาแต่ใจ ขี้บ่น เพ้อเจ้อ ชอบหาเรื่องทะเลาะ เจ้าทุกข์ คิดมาก เครียด เป็นผู้ที่มีความวุ่นวายและสับสนในชีวิต จิตใจ ชีวิตมักมีความกดดันสูง มีเรื่องกระทบกระเทือนใจในหลายๆเรื่องในเวลาเดียวกัน ซึ่งมาจากครอบครัวและบริวาร อาจถึงขั้นวิปริตเสียสติได้ง่าย หากไม่ควบคุมตนเอง ไม่รักษาสภาพจิตใจ คนเลขนี้อาจการทำร้ายตนเองหรือผู้อื่นด้วยอารมณ์เพียงชั่ววูบ เพราะจิตใจถูกกดดันมากเกินไป ชีวิตรักชีวิตสมรส เอาแน่เอานอนอะไรไม่ได้ มักมีกิ๊กมีชู้คนรักมักนอกใจ ชีวิตจะมีมือที่ 3 เข้ามาเกี่ยวข้องในชีวิตทำให้มีปัญหาอยู่เสมอ อาจไม่ได้แต่งงาน หรือแต่งไม่น้อยกว่าหนึ่งครั้ง คาดหวังอะไรไม่ได้ ผู้ที่ตกอยู่ภายใต้อิทธิพลของเลข 39 มักจะมีอาการเพี้ยนๆ เป็นผู้ที่มีมิตรสหายมาก แต่ก็ขาดความจริงใจ แต่ก็มีด้านดี คือ เด่นเรื่องเงินงาน เด่นเรื่องการต่อสู่แข่งขัน ดีที่มีผู้ใหญ่และเพื่อนบางคนคอยช่วยเหลือค้ำชู **39 ดีด้านการแข่งขัน การสอบ มีโชคการเงินงาน ถ้าจะใช้ต้องให้สำหรับคนที่ใช้เลข 3 ได้ และต้องมี 45,95,59 ประกบ และควรมีไว้ด้านหน้าของเบอร์\r\n\r\nด้านดี ดีต้นร้ายปลาย ประสบความสำเร็จในเงินงาน การทำธุรกิจ การแข่งขัน แต่จบไม่สวย \r\n\r\n'),
(41, '40', 'D5', -10, 'หมายเลข 40 พลังอำนาจมหัศจรรย์ ', 'มีจินตนาการถึงสิ่งแปลก ๆ ชอบสิ่งเร้นลับมหัศจรรย์ ชีวิตสะดวกสบาย รักสนุก ชอบลองสิ่งใหม่ๆ ที่ท้าทาย ชอบอะไรแปลกๆ ชอบเดินทางไม่ชอบอยู่กับบ้าน มีโอกาสถูกชักจูงได้ง่ายเพราะมีจิตใจที่อ่อนไหวและไม่ค่อยมีความมั่นคงเท่าไหร่ เพราะชีวิตจะเดินทางเสมอ เหมาะกับผู้ที่ทำงานไม่เป็นหลักแหล่ง เดินทางเสมอ เหมาะอยู่คอนโดมากกว่าบ้าน และเหมาะกับสาวโสดและหนุ่มโสดมากกว่าคนชอบมีคู่', 'ด้านดี ผู้ที่ใช้เลขนี้ คือ ฉลาด ปราดเปรียว วางตัวดี เอาตัวรอดเก่ง มีจินตนาการถึงสิ่งแปลก ๆ ชอบสิ่งเร้นลับมหัศจรรย์ รักสนุก ชอบลองสิ่งใหม่ๆ ที่ท้าทาย ชอบอะไรแปลกๆ ชีวิตประสบความสำเร็จดี ดีเรื่องการเงิน เก็บเงินเก่ง บริหารเงินดี ชีวิตมีความสุขสบาย ฐานะร่ำรวยดี เจ้าบทบาท เป็นคนใฝ่รู้ชอบค้นคว้าหาความรู้ ชอบสนุกสนาน ชอบเดินทางท่องเที่ยว ชอบสิ่งใหม่ๆ และแปลกๆ ไม่ชอบอยู่ติดที่ จะได้รับการส่งเสริมหนุนนำ ให้ได้รับความสำเร็จมีความโดดเด่น ตรึงตาตรึงใจของคนทั้งหลาย เป็นคนที่พูดเก่ง บางครั้งพูดจาจนหาสาระไม่ได้ เป็นบุคคลที่ชอบคิดฝัน จินตนาการกว้างไกล ชอบสร้างวิมานในอากาศ รักอิสระ มักอยู่ไม่ติดบ้าน ชอบทำอะไรแหวกแนว \r\n\r\nด้านเสีย คือ สับสนตัวเอง เหนื่อยกับชีวิตการงานและสังคม เป็นคนเปลี่ยนใจง่าย อ่อนไหว บางครั้งเชื่อคนง่ายและยึดถืออย่างจริงจังระวังโดนหลอก ระวังอุบัติเหตุ อาภัพรัก มักโสด  (ความรุนแรงมากน้อยต้องดูเลขอื่นประกอบ)'),
(42, '41', 'D10', 75, 'หมายเลข 41 พลังมหาจักรวาล ', 'เป็นเลขดีมาก มีพลังความทะเยอะทะยานเต็มเปี่ยมที่ไม่ให้ใครเห็น เป็นพลังความสำเร็จที่ยอดเยี่ยม มีความรุ่งโรจน์สำเร็จ มีสติปัญญาที่ดี ทำการงานสำเร็จ ชีวิตไม่ตกต่ำ เพรามีคนคอยช่วยเหลือเสมอ มีวาจาเป็นอาวุธ ใครได้ฟังจะหลงใหลได้ เข้ากับผู้อื่นได้เป็นอย่างดี สติปัญญาว่องไว มีสมองปราดเปรื่อง มีเพื่อนมาก เป็นตัวเลขที่มีพลังของมหาจักรวาลหนุนชะตาอยู่ ควรทำบุญนั่งสมาธิให้มากจะช่วยเสริมบารมีให้ราบรื่น', 'ด้านดี ดีมาก เพราะจะมีความสำเร็จเจริญรุ่งเรืองก้าวหน้ารุ่งโรจน์ สุขสบาย ติดต่อการงานราบรื่นง่ายดาย ชีวิตไม่ตกต่ำ มีคนคอยช่วยมากมาย เพื่อนมาก ผู้ใหญ่มักจะให้การอุปถัมภ์ช่วยเหลือเกื้อกูล จะทำให้ชีวิตประสบผลสำเร็จอย่างมั่นคง เป็นคนคนฉลาด ไหวพริบดี ความจำดีแม่นยำ เลขนี้จะนำพาชีวิตไปสู่ความสำเร็จได้ เพราะความทะเยอทะยาน มีความคิดริเริ่มสร้างสรรค์ ชอบไขว่คว้าค้นหาความก้าวหน้าอยู่เสมอ รักความถูกต้องชอบช่วยเหลือผู้อื่น เจรจาติดต่อเก่งมีมนุษย์สัมพันธ์ดี เป็นบุคคลที่มีสิ่งศักดิ์สิทธิ์คอยให้ความช่วยเหลืออยู่ตลอดเวลาถ้าทำดีจะยิ่งดี มีโอกาสได้เดินทางไปต่างประเทศหรือทำงานทำธุรกิจกับคนต่างประเทศ ต่างจังหวัด \r\n\r\nผู้ตกอยู่ภายใต้อิทธิพล ของหมายเลข 41 จะเป็นคนที่ชอบติดต่อ กับบุคคลอื่นอยู่ตลอดเวลา เช่น งานขาย งานโฆษณาประชาสัมพันธ์ งานที่ต้องใช้วาจา งานต่างประเทศ ถ้าจะให้ดีควรเสริมชะตาด้วยการทำบุญจะได้ยิ่งดี และดีไม่ตก'),
(43, '42', 'D10', 75, 'หมายเลข 42 พลังโรแมนติค ', 'เป็นเลขดีมาก เป็นดาวการเงิน เงินทองไม่ขาดมือ มีจิตใจดี  เข้าใจโลก เข้าใจธรรมชาติ มีจินตนาการไร้ขีดจำกัด ใจเย็นสุขุม มีโลกส่วนตัว ไม่ย่อท้อต่อความยากลำบาก ชะตาชีวิตจะประสบผลสำเร็จในหน้าที่การงานและการศึกษาและความรักหนุนนำซึ่งกันและกันการงานรุ่งเรือง ชอบคิดค้นสิ่งใหม่ๆ มีจิตใจละเอียดอ่อน สมองดี ชีวิตจะประสบความสำเร็จเป็นอย่างดี มีมิตรสหายมากมักเป็นที่รักของใครต่อใคร อาชีพที่ดีเหมาะกับศิลปิน ผู้ที่ต้องเกี่ยวข้องกับการออกแบบ ศาสตร์ความคิดสร้างสรรค์ นักโฆษณา นักประชาสัมพันธ์ ครีเอทีฟ นักเขียน นักการตลาด ธุรกิจการค้า จะดี', 'ด้านดี เลขนี้ดีมีมงคล จะทำให้เป็นคนใจเย็น ใจดี มองโลกในแง่ดี มีสติปัญญาดี พูดเก่ง มีมนุษย์สัมพันธ์ดี ฉลาดพูด มีนิสัยสุภาพอ่อนโยน เลขนี้จะทำให้โดดเด่นดูดี จะช่วยนำเกียรติ นำความรัก ความสุข นำเงิน นำงาน มาให้ผู้ใช้ เรื่องรักและการงานการเรียนสำเร็จดังใจ เงินทองหาง่าย มีเงินทองใช้ไม่ขาดมือ เรียกได้ว่าเงินไหลนองทองไหลมาสมใจ ถ้าตั้งใจและไม่หยุดนิ่ง เลขนี้นับเป็นเลขดีมากจะช่วยนำพาชีวิตให้พบกับความสำเร็จได้เป็นอย่างดี มักมีคนคอยให้ความช่วยเหลือสนับสนุนอยู่เสมอ และเป็นที่รักของบุคคลทั่วไป มีเสน่ห์เป็นที่รักใคร่ของคนทั้งมวล มีผู้ใหญ่เพื่อนฝูงบริวาร คอยให้ความช่วยเหลือมาก เป็นผู้ที่มีจินตนาการในด้านความคิด และชอบสร้างฝันในเรื่องของความรัก และการเงิน เป็นคนรักความสบาย ไม่หมกมุ่นในทุกข์ เศร้าผิดหวัง ไม่ชอบมีปัญหา ไม่ชอบโต้แย้ง เลขนี้จึงเหมาะมากสำหรับแก้ปัญหาคนใจร้อน ช่วยแก้ปัญหาคนที่หมุกมุ่นเจ้าทุกข์ คนอกหักรักคุด'),
(44, '43', 'R10', -60, 'หมายเลข 43 พลังวิปริต ', 'การทำงานผิดพลาดได้ง่าย สำเร็จยาก อุปสรรคมาก เพื่อนร่วมงานไม่ให้ความร่วมมือ และมักจะใส่ร้ายป้ายสีเสมอ ความเจริญรุ่งเรืองไม่มี ไม่มีความมั่นคง ไม่สำเร็จ มีความสุขได้ยาก ช่วงวัยรุ่นมีโอกาสเกิดอุบัติเหตุสูงและรุนแรงมากควรรีบเปลี่ยนชื่อสำหรับชื่อที่ได้เลขนี้ครับ', 'ด้านเสีย แต่อุปสรรคมาก เหนื่อย บางครั้งมักทำในสิ่งที่เชื่อจนแตกต่างมากเกินไปถ้าไม่พอดีชีวิตจะมีปัญหาอยู่ตลอดเวลา เลขนี้ใครใช้ ถึงดวงท่านจะดีมากหรือเป็นคนเก่งมากแค่ไหนก็ตาม (ยกเว้นว่าดวงจะถูกโฉลกจริงๆคือ ใช้เลข 7,3,4,ได้ นั่นจึงจะดีได้)  เพราะผลของเลขจะทำให้ท่านจะไม่สามารถสมหวังในสิ่งที่ปรารถนาได้  ท่านจะเป็นคนซึมลึก คิดมากเป็นเลขแห่งการอับโชค เลขซวย เลขคดี เลขคุกตะราง ทะเลาะวิวาท มีปัญหาและอุปสรรคมาก มีความทุกข์ถูกกลั่นแกล้งใส่ร้ายป้ายสีจากเพื่อนจากศัตรู และมักจะเกิดอุบัติเหตุรุนแรงทางด้านสมอง กระดูก จะต้องผ่าตัด เลข 43 ถือว่าเป็นเลขอันตราย และเป็นเลขอัปมงคลเป็นเลขอับโชค ในอนาคตมักจะพบกับความล้มเหลวยุ่งยากและมีทุกข์ภัยอยู่เนืองๆ มีความทุกข์ ความผิดหวังล้มเหลว จึงต้องระวังอนาคตเบื้องหน้าไว้ให้ดี อย่าประมาทเป็นอันขาด ชีวิตจะประสบอุบัติเหตุได้ง่ายล้มเหลวง่าย\r\n\r\nด้านดี เป็นบุคคลที่มีสติปัญญาแตกฉาน กล้าคิด กล้าทำ กล้าพูด มีหน้าที่การงานดี ตำแหน่งสูง\r\n'),
(45, '44', 'D10', 70, 'หมายเลข 44 พลังส่งเสริมความสำเร็จ ', 'เป็นเลขที่มีพลังส่งเสริมในทางดีในทุกๆด้านไม่ว่าจะเป็นการเรียนการศึกษา เสริมความรู้ ความสามารถ เสริมในเรื่องหน้าที่การงานการค้า เสริมเรื่องทรัพย์สมบัติ การเลื่อนขั้นเลื่อนตำแหน่ง   และช่วยเสริมในเรื่องความรักได้ดี แถมยังมีผู้ใหญ่ให้การสนับสนุนเสมอ บางครั้งคนเลขนี้ ทำผิดยังเป็นชอบได้ ไม่ลำบากอะไร แต่อย่าประมาทเพราะมีพลังจากดาวราหูที่อาจทำให้หลงรื่นเริงไปกับแสงสี สิ่งมัวเมาได้ง่ายจึงต้องระมัดระวังเอาไว้ด้วย อีกอย่างคนเลขนี้จะค่นข้างเอาแต่ใจขี้ใจน้อย ถ้าลดเรื่องนี้ได้ หรือควบคุมได้จะดีเยี่ยมต่อชีวิต', 'ด้านดี เป็นเลขให้คุณกับชีวิต มักจะมีผู้ให้การอุปถัมภ์ช่วยเหลืออยู่เสมอ คนที่ใช้เลขนี้จะ เป็นคนมีเสน่ห์ ทำงานเก่ง สติปัญญาดี พูดเก่ง มีฝีปากดีมาก พูดอะไรก็มักมีคนเชื่อฟัง เฉลียวฉลาด พูดจาอ่อนหวานมีคารมคมคาย มีไหวพริบปฏิภานดี ปรับตัวเก่ง เอาใจเก่ง เป็นคนมีมนุษย์สัมพันธ์ดี เข้ากับบุคคลต่างๆได้ง่าย ใจดี โอบอ้อมอารีย์ มองโลกในแง่ดี ใจบุญสุนทาน ช่างคิด ช่างวางแผน เป็นคนกล้าคิดกล้าทำ เพราะมีดาวพุธหนุนอยู่ ถึงสองดวง เหมาะเป็นนักประชาสัมพันธ์ เป็น นักพูด นักค้า นักขาย เหมาะกับงานที่ต้องใช้ปากใช้วาจา นักเขียน เล่นหุ้น เลข 44 เป็นเลขที่ส่งเสริมให้เกิดความสำเร็จในทุกๆด้าน ทั้งหน้าที่การงาน การเงิน การเรียน ความรัก ทำผิดยังเป็นถูก ไม่ลำบาก มีผู้ใหญ่คอยเกื้อหนุน แต่จงอย่าประมาณเพราะ 44 รวมกันได้ 8 ดวงชะตาถือว่าดี \r\n\r\nด้านเสีย มีเพียงจุดเสียเล็กน้อยเท่านั้น คือคุณเป็นคุณใจน้อย เอาแต่ใจตัวเอง ใจอ่อน หูเบา เชื่อใจคนง่าย ใจดีเกินไป บางครั้งก็ดื้อก็ดื้อแบบหัวชนฝา ไม่ยอมฟังใคร ถ้าแก้จุดนี้ได้จะดีมาก ระวังบางคนถ้ามีเลข 18,81,38,83,39,93,66,12,21,22 และเลขไม่ดีอื่นๆประกบเลข 44 จะกลายเป็นคนลุ่มหลงมัวเมาในอบายมุขได้ เพราะฉะนั้น แม้เลขจะดีแต่ท่านควรระวังการใช้ (ถ้ามีเลขร้ายอื่นๆในชีวิตไม่ควรใช้เลข 44 )  \r\n'),
(46, '45', 'D10', 85, 'หมายเลข 45 พลังการสู้อีกครั้ง ', 'เป็นเลขดีมาก สติปัญญาเฉียบแหลม รู้ทั้งวิชาการทางโลก และ ชีวิต ทำอะไรก็ได้รับความร่วมมือจากคนอื่น จะมีความเจริญในหน้าที่การงาน ความสำเร็จอย่างงดงาม มีความก้าวหน้าสูง เมื่อมีข้อผิดพลาด ไม่สมหวังจะไม่ซึมเศร้าแต่จะฮึดสู้ทันที เป็นคนมองโลกและชีวิตอย่างเข้าใจและเข้าใจการเป็นไปของโลกและชีวิต มีคนคอยให้ความช่วยเหลือมากมาย มีโชคลาภแบบไม่คาดฝัน ควรสวดมนตร์เสริมบารมีทำบุญเสมอจะช่วยให้มีความสบายใจมากขึ้น', 'ด้านดี เป็นเลขดีมาก ดีที่สุดในเลขศาสตร์ ใครได้ใช้เลขนี้การเงินการงานจะเจริญรุ่งเรืองก้าวหน้าสุขสำเร็จ ชีวิตมีแต่ก้าวหน้าตลอด มีตำแหน่งหน้าที่การงานมั่นคง อยู่ในตำแหน่งที่สูงเป็นเจ้าของธุรกิจ ผู้ใหญ่และคนรอบข้างให้ความยอมรับนับถือช่วยเหลือสนับสนุน มีโชคลาภหนุนนำ มักโชคดีมีลาภบ่อยๆเนืองๆ มักจะประสบโชคทุกด้าน ฟลุ๊คอยู่ตลอด เงินทองไม่ขาดมือ ความจำดี ปัญญาดี ฉลาดหลักแหลม มีสติปัญญาแจ่มใส เป็นคนกตัญญูรู้คุณคน มีความสามารถในการเป็นผู้นำ มีความคิดก้าวหน้า หมายเลข 45 จึงเป็นเลขที่ดีที่สุดอย่างแท้จริง ตามหลักเลขศาสตร์ ทำให้ชีวิตไม่ตกต่ำ หากท่านหมั่นทำบุญสร้างกุศล จะประสบความสำเร็จในชีวิตเป็นอย่างสูง ผู้ที่ใช้เลขนี้ต้องทำดี ถึงจะเกิดผลดีเต็มที่ ยิ่งทำดีจะยิ่งดี และสามารถคุ้มครองภัยพิบัติของชีวิตได้ คือ ไม่ตายโหง ต่อดีต่ออายุได้ ทำให้เกิดความร่ำรวย กิจการงานเจริญรุ่งเรือง\r\n\r\nด้านเสีย จริงๆไม่มีเลย มีแต่ดีมากมีมงคลมาก แต่ก็ไม่ควรมีมากเกิน 3 คู่ เพราะชีวิตจะขาดความสมดุลได้\r\n'),
(47, '46', 'D10', 70, 'หมายเลข 46 พลังแห่งโชค ', 'เป็นเลขดีมาก มากไปด้วยมิตรสหายคนรักใคร่ ชีวิตมีแนวโน้มประสบความสำเร็จดี การงาน การค้าขายมีกำไรดี การเรียนจะได้ผลสำเร็จอย่างดีเยี่ยม ชีวิตมีความสุข มีเพื่อนมากและสามารถพึ่งพาเพื่อนได้ แต่มักจะเป็นคนอ่อนไหวถูกชักจูงได้ง่าย จึงต้องระมัดระวังทำอะไรคิดให้รอบคอบก่อนตัดสินใจใดๆควรทำบุญ สวดมนตร์ นั่งสมาธิจะช่วยเรื่องการถูกชักจูงไปในทางเสื่อมได้ และช่วยเรื่องเหนื่อยใจกับคนอื่นๆ', 'ด้านดี ผู้ที่ได้หมายเลขนี้ไม่ว่าเสน่ห์แรง เป็นที่รัก ทั้งการเรียน การเงิน การงาน จะสำเร็จรุ่งเรืองราบรื่นด้วยดีจะได้เลื่อนขั้นเลื่อนตำแหน่งมีตำแหน่งสูงขึ้น มักจะเป็นเจ้าของธุรกิจ เจ้าของกิจการ หรือ ผู้บริหาร จะค้าขายก็มีกำไรดี ร่ำรวย มักมีชีวิตที่โชคดีอยู่บ่อยๆ มีโชคลาภหนุนนำ มีสติปัญญาแจ่มใส มีสมองไวรับรู้ได้อย่างรวดเร็ว ทำงานได้อย่างคล่องแคล่ว เป็นคนมีรสนิยมสูงไม่ชอบอยู่กับที่ เป็นผู้ที่มีมิตรสหายมาก เป็นคนที่มีคารมดี พูดเก่งทั้งเรื่องโกหกและเรื่องจริง บางครั้งพูดไม่ให้ตัวเองเสียได้เก่ง ชอบแสวงหาสิ่งใหม่ๆชอบการเดินทาง เป็นคนที่สามารถสร้างฐานะ ให้ประสบความสำเร็จ มีความสุขสบายดี \r\n\r\nด้านเสีย คนเลขนี้ต้องระวังอย่าใจอ่อน อย่าเหลิง อย่าปล่อยตามใจตัวเอง อย่าตามเพื่อนพ้องมาก ถ้าโลภมาก ลาภมักจะหาย จะนำพาชีวิตตัวเองให้วิบัติได้ ถ้าใช้ 46 ต้องพิจารณาหาตัวเลขมงคลประกบด้วย 45,41,14,36,59,95,15 ด้วยเสมอ\r\n'),
(48, '47', 'R7', -35, 'หมายเลข 47 พลังแห่งความเพียร ', 'เป็นคนจริงจังกับชีวิต มีความเพียรพยายามสูงสุด ชีวิตมีโอกาสประสบความสำเร็จได้จากความเพียร มีโอกาสถูกผู้อื่นหลอกได้ง่าย มีอุปสรรคมากแต่จะดีในเรื่องความเพียรพยายาม ความเหนื่อยยาก', 'ด้านดี 47 เป็นทั้งเลขร้าย และเลขดี อิทธิพลของหมายเลข 47 ด้านดี คือ เป็นคนจิตใจดี ชอบเอื้อเฟื้อ มีเสน่ห์ มีความอบอุ่น เป็นคนที่มีคารมคมคาย ทำให้คนเชื่อถืออยากอยู่ใกล้  เป็นคนทำงานจริงจัง มีความอดทน มีความขยัน มีความเพียรพยายาม ความสำเร็จของชีวิตขึ้นอยู่กับความเพียรพยายามความอดทนของตน ชีวิตจึงจะประสบความสำเร็จได้ตามปรารถนา \r\nด้านเสีย คือ ชีวิตมักเจออุปสรรคปัญหาเยอะ มักเจ็บตัวก่อนจึงจะสำเร็จได้ ทำให้มีความทุกข์ระทมขมขื่นแอบแฝงอยู่ มักเป็นคนใจอ่อน และหลงเชื่อคนง่าย ถ้าไม่ระวังจะโดนหลอกโดนโกงเกิดความผิดพลาดกลายเป็นคนอมทุกข์ เครียด วิตกกังวล คนเลขนี้พูดจากระทบกระเทียบเก่งและโต้เถียงเผ็ดร้อน ทิฐิเยอะ ถ้าดื้อรั้นขึ้นมาก็ยากที่จะหยุดได้ ต้องระวังการหลงผิด จะเป็นตัวทำลายอนาคตอันรุ่งเรือง ระวังโรคที่เกี่ยวกับ ระบบย่อยอาหาร ระบบขับถ่าย อุบัติเหตุ โดนทำร้าย\r\n'),
(49, '48', 'R10', -85, 'หมายเลข 48 พลังการหลง ', 'ถูกชักจูง และหวาดล้อม จากพวกหลงผิดให้ไปเข้าพวกเข้าฝูง จะทำให้ตกอยู่ในอำนาจ แห่งความหลง ถูกหลอกให้เสียทรัพย์ได้โดยง่าย หรือหลงเดินทางไปในอบายมุข และสุขภาพจะไม่แข็งแรงต้องเข้าๆออกๆโรงพยาบาลเป็นประจำ และต้องระวังการเกิดอุบัติเหตุในการเดินทางอีกด้วย มีทั้งพลังความหลงมัวเมาและพลังแห่งความรุนแรง อุบัติเหตุแผ่พลังให้ท่านที่ได้', 'เลข 48 เป็นเลขให้โทษมากกว่าให้คุณ อันตรายมาก เป็นเลขน่ากลัว เลขนี้มักจบไม่สวย เป็นเลขอาภัพรัก มักได้แต่งงานมากกว่า 1 ครั้ง มีแฟนมากกว่า 1 คน เป็นเลขหลงผิด ลุ่มหลงมัวเมา ภัยจ้องรอบด้าน ชีวิตจงอย่าเชื่อใจใครง่ายๆ จะถูกหว่านล้อมจากพวกคนไม่ดีทั้งปวงให้ไปเข้าพวกเข้าฝูง จนตกกระไดพลอยโจร ทำให้ตนตกบ่วงประพฤติผิดพลาด ถูกชักจูงไปในทางที่ผิด หลงแสงสี โลกีย์ การพนัน สิ่งเสพติด คดโกง และอาจได้รับอันตรายหรือมีคดีความเกิดจากความผิดพลาดนั้นๆ \r\n\r\nคนเลขนี้เป็นคนดื้อรั้น พูดจาตรงไปตรงมาแบบขวานผ่าซาก ทำให้ไม่เป็นที่พอใจของผู้ได้ยิน ทำให้ขาดผู้สนับสนุน จนทำให้กลายเป็นคนที่มีศัตรูมาก มีความไม่แน่นอนในชีวิตสูง โชคลาภน้อย อาจถูกใส่ร้ายป้ายสี ร่างกายอ่อนแอ ป่วยง่าย มีโรคภัยไข้เจ็บเบียดเบียน มักเป็นโรคที่รักษาหายยากและเป็นเรื้อรังจะได้รับทุกข์ทรมานจากโรคร้าย เข้าออกโรงพยาบาลบ่อย มีภัยอุบัติเหตุรุนแรง มีคดีความ ถูกโกงถูกหลอกให้เสียเงิน และมักโกงเขาหลอกเขาทั้งที่ตั้งใจและไม่ได้ตั้งใจจนมีคดีความด้วย'),
(50, '49', 'R7', -30, 'หมายเลข 49 พลังความยุ่งยาก ', 'ในชีวิตจะมีพลังความยุ่งยากทั้งปวงส่งผลให้มีอุปสรรคขวางหนามทำอะไรไม่เป็นชิ้นเป็นอันไม่ประสบผลสำเร็จ การค้า กิจการ ตำแหน่งหน้าที่การงานหยุดชะงัก ไม่เจริญรุ่งเรือง สุขภาพกายใจไม่แข็งแรง แม้แต่เรื่องความรักก็มีอุปสรรค ไม่ทะเลาะก็ต้องไม่ถูกใจกันในการกระทำอีกฝ่าย เลขนี้ไม่มีส่วนดีเลย', 'ด้านเสีย ผู้ที่ได้หมายเลขนี้ มักเป็นคนขี้หลง ขี้ลืม เป็นคนใจร้อน อับโชค ป่วยด้วยโรคทางใจทางกาย และเกิดเหตุร้ายอย่างไม่คาดฝันกับตนเอง และครอบครัว มีปัญหาและอุปสรรคมากในชีวิต โดยเฉพาะความรัก มักจะมีอุปสรรคมีปัญหา แตกแยก มีความขมขื่นเดือดร้อน เลขนี้ดีกับชายมากกว่าหญิง เพราะหญิงจะทุกข์เพราะสามี มีปัญหามีปากมีเสียงไม่ลงรอยกับญาติสามี จะถูกญาติสามีกดดันกลั่นแกล้งอยู่ตลอดเวลา จนทำให้ครอบครัวแตกแยก ใครได้เลขนี้ชีวิตมีมุมหักเหตลอดเวลา ชีวิตต้องเริ่มต้นใหม่อยู่เสมอๆ ชีวิตมักเกี่ยวข้อง กับความเป็นความตาย ชีวิตมีแต่ความขมขื่น ผิดหวังอมทุกข์ มีอุปสรรคมากเป็นเลขร้าย เป็นเลขอับโชคทำให้ชีวิตพบจุดจบที่ไม่ดี ให้ระวังอุบัติเหตุ การผ่าตัด โรคนิ่ว โรคไต โรคกระเพาะปัสสาวะ มักถูกอำนาจมืดคุกคาม \r\n\r\nด้านดี ประสบความสำเร็จในการงาน การเงินอย่างดี **ถ้าดวงชะตาสามารถใช้ได้ แต่ให้ระวังพลังร้ายดีๆ\r\n'),
(51, '50', 'D5', 30, 'หมายเลข 50 พลังแห่งปัญญาและความสามารถ ', 'เป็นเลขดีมาก เป็นคนมีปัญญาดี เป็นคนมีคุณธรรม มีโอกาสสูงได้เดินทางต่างประเทศ ไม่ไปศึกษาต่อก็ไปทำงาน แม้แต่ความรักก็มีโอกาสได้ชาวต่างชาติเป็นคู่ครอง มักจะไปใช้ชีวิตในต่างประเทศ มีโอกาสได้รู้จักติดต่อการค้ากับคนต่างชาติ ชอบค้นคิด แสวงหาธรรมะ เชื่อในความเร้นลับของธรรมชาติ มีโอกาสประสบความสำเร็จสูง และมีสัมผัสพิเศษสัมผัสกับสิ่งศักดิ์สิทธิ์ได้ ควรทำบุญเพื่อเป็นการเสริมบารมีครับ อาชีพที่เหมาะจะเกี่ยวกับผู้ที่ต้องเดินทางไปต่างประเทศบ่อยๆ นักการค้า นักการทูต นักเจรจาที่ต้องไปต่างประเทศบ่อย จะดีครับ', 'ด้านดี ผู้ที่ได้หมายเลขนี้ ดวงดีมาก เลขนี้จะนำพาไปสู่ความสำเร็จได้อย่างดี ผู้คนมักนิยมรักใคร่นับถือ โดยเฉพาะเรื่องสติปัญญา ว่องไว มีความสามารถ เป็นคนมีญาณพิเศษ มีบุญ มีความจำแม่นยำ มีความสุขุม เป็นคนรักความยุติธรรม ชอบไขว่คว้าหาความก้าวหน้าให้กับชีวิต ชอบการแสวงหาสนใจธรรมะ ชอบเดินทางต่างถิ่นต่างประเทศ สนใจในภาษาต่างประเทศ ชีวิตต้องเกี่ยวข้องกับต่างประเทศหรือคนต่างชาติต่างภาษาในหลายรูปแบบ ไม่ทำงานกับคนต่างชาติก็ทำงานหรือเรียนต่อต่างประเทศ ดีเด่นทางทำงานต่างประเทศ มักจะได้ไปใช้ชีวิตยังต่างประเทศ หรือคบหากับคนต่างชาติต่างภาษา คนเลขนี้ชีวิตต้องพบปะกับคนแปลกหน้าตลอดถึงจะดี เป็นคนที่ชอบเรียนรู้ศาสตร์เชิงปรัชญา หรือสิ่งลี้ลับ \r\n\r\nด้านเสีย แม้เลข 50 05 จะเป็นเลขดี แต่ห้ามมีเยอะมากกว่า 1 คู่ เพราะถ้ามีเยอะหรือไปจับคู่กับเลขร้ายๆจนเขาแสดงผลเต็มที่ ระวังจะหลงศาสนา สนใจธรรมะมากกว่าทางโลก ให้ระวังจะป่วยเกี่ยวกับตับ ถุงน้ำดี ไมเกรน กระเพาะ และ ซีส เนื้อ งอก มะเร็ง เพราะมีพลังของดาวมฤตยูเกาะ\r\n'),
(52, '51', 'D10', 75, 'หมายเลข 51 พลังความสมบูรณ์ ', 'เป็นเลขดีมากเป็นดาวการเงินเป็นเลขทีทำให้มีมีสติปัญญาแตกฉาน มีความสำเร็จ มีความสมบูรณ์ทั้งหน้าที่การงานการเงินความรักและการเรียน อำนวยให้เกิดความสำเร็จเป็นผู้ที่เก่งรอบด้าน ทำอะไรก็ประสบผลสำเร็จเสมอ และยังมีผู้คอยช่วยเหลือแนะนำอยู่เสมอด้วย ความรักก็มีความสำเร็จสูงมากได้คู่ที่ดี พลังนี้ส่งผลถึงความสามารถทางด้านศิลปะและการดนตรี มองโลกในเชิงบวก มีกำลังใจดี มีเพื่อนมาก ชีวิตประสบความสำเร็จอย่างสูง งานที่แนะนำจะเหมาะสมกับงานที่เกี่ยวข้องกับศิลปะ ดนตรี การพูด การเขียน การแสดง ความงาม ความบันเทิง จะเสริมดวงได้อย่างดี', 'ด้านดี ผู้ที่ได้หมายเลขนี้นับเป็นเลขดีมีมงคลมาก สมบูรณ์พูนสุข ชีวิตจะประสบความสำเร็จมีความเจริญก้าวหน้าทั้งในการเรียน การเงิน การงาน สารพัดสิ่งที่หวังมักราบรื่นสุขสำเร็จสมใจ ความรักดี เก่ง จิตใจดี มีสติปัญญาดี ฉลาด ทำงานเก่ง มีเสน่ห์แรง พูดจาดีมีเสน่ห์เป็นที่น่าฟังและเชื่อถือ เป็นที่รักใคร่ของผู้คนทั่วไป มักได้ของรับกำนัลจากคนรักใคร่อยู่เสมอ มีผู้ใหญ่รักใคร่เอ็นดูคอยช่วยเหลือเกื้อกูล เพราะเป็นดาวคู่มิตร มีเพื่อนฝูง คอยให้การสนับสนุน ช่วยเหลืออยู่ตลอดเวลา เป็นบุคคลที่ทรงภูมิรู้ และรักเกียรติของตัวเอง เป็นบุคคลที่มีความโชคดี เกี่ยวกับการเงิน เงินๆทองๆสามารถหาเงินได้ง่าย ไม่ต้องลงทุน หรือลงแรงอะไรมากนัก ความสำเร็จในชีวิต ต้องใช้ความรู้ ความสามารถของตนเอง จึงจะสามารถสร้างฐานะที่มั่นคง เป็นปึกแผ่นได้ คนเลขนี้มักจะได้ดีเพราะการพูดและภาษา มักต้องไปเกี่ยวข้องหรือทำงานติดต่อกับคนต่างชาติต่างภาษา ต้องเดินทางไปต่างถิ่นต่างจังหวัดหรือต่างประเทศจะดี\r\n\r\nด้านเสีย เมื่อมีเสน่ห์ดึงดูด ก็มักมีคนเข้าหามากหน้าหลายตา จึงควรระวังอย่าเชื่อใจทุกคน จงเลือก... ระวังความใจดี ใจอ่อนมากเกินไปจะทำให้ตัวเองเดือดร้อนในภายหลังได้\r\n'),
(53, '52', 'R5', -15, 'หมายเลข 52 พลังการสนับสนุนค้ำจุน ', 'ดูเผินๆ เป็นเลข ดีทำให้ชีวิตได้รับความสำเร็จอย่างดี แต่เลข 52 บวกกันได้เลข 7 ดาวเสาร์ทำให้ชีวิตมีมุมหักเหได้ง่าย มักจะทำให้ความทุกข์ของกรรมเก่าที่มองไม่เห็นมีอุปสรรคใหญ่หลวงรออยู่ข้างหน้า ทำให้ต้องใช้ ความพยายาม และความอดทนมากถึงจะผ่านพ้นไปได้ ถ้าเลข 52 เป็นเลขบุรุษ จะได้รับความเกื้อหนุนจากสตรีอย่างดีเยี่ยม เรียกว่า ดาวนารีอุปถัมภ์', 'ด้านดี ผู้ที่ได้หมายเลขนี้จะมีความสำเร็จด้านการงานและความรักดี ชีวิตประสบความสำเร็จเป็นอย่างดี ชีวิตจะมั่งมีศรีสุข ร่ำรวยพอประมาณ มีทรัพย์สินเงินทองใช้อย่างไม่ลำบาก ตัวเลขนี้จะทำให้คนที่ใช้เป็นคนสุขุมรอบคอบ เป็นผู้ที่มีความรู้ มีความสามารถฉลาด หากเป็นชายใช้จะมีผู้หญิงหรือเจ้านายคนใกล้ชิดที่เป็นหญิงสนับสนุนเป็นอย่างดี ถ้าเป็นหญิงสามีก็เกื้อหนุนดี\r\n\r\nด้านเสีย แต่...บางจังหวะต้องอดทนฟันฝ่าอุปสรรคบ้าง หากเป็นหญิงจะมีอุปสรรคปัญหามากกว่าชาย เลขนี้จึงเหมาะกับเหมาะกับชายมากกว่าหญิง ชีวิตต้องผ่านการต่อสู้อย่างเหน็ดเหนื่อยพอสมควรจึงจะสำเร็จ และมักมีความคิดเห็นขัดแย้งกับคู่ครองและผู้หลักผู้ใหญ่อยู่เสมอ แต่ไม่รุนแรง สุดท้ายเมื่อยามมีอุปสรรปัญหาเข้ามาก็กลับมาช่วยเหลือกันอย่างดี ใครที่ใช้เลขนี้ ถ้ามีสติ ยอมโอนอ่อนผ่อนตาม ยอมกันบ้าง ก็ผ่านไปได้ด้วยดี \r\n\r\nแต่คนที่ใช้เลขนี้ไม่ควรประมาท ห้ามมีเลขร้ายๆประกบคู่ เพราะตัวเลขถึงจะมีส่วนดี แต่ก็ยังมีส่วนเสีย อาจจะทำให้ชีวิตมีมุมหักเหได้ง่าย มักจะได้รับทุกข์จากกรรมเก่าที่มองไม่เห็น มีอุปสรรคอย่างใหญ่หลวงคอยขวางอยู่ข้างหน้าทำให้ต้องใช้ความพยายาม และความอดทนเป็นอย่างมากจึงจะผ่านพ้นไปได้ เลขนี้หากสะสมมากๆมักเจ็บป่วยบ่อย อุปสรรคปัญหามาก ไม่ลงรอยกับผู้ใหญ่และแฟน มีอุบัติเหตุจ้อง เลข 25 52 ต้องระวังอย่าไปจับคู่กับเลขร้ายอันตรายเป็นอันขาด เพราะจะยิ่งทำให้เขาแสดงผลด้านร้ายออกมาได้ และจะทำให้เกิดเรื่องร้ายๆมากกว่าดี ถ้าจะใช้ ควรเป็นเลขโฉลกจริงๆ และควรมีควรใช้เพียงคู่เดียวเท่านั้น และควรมีเลขดีๆช่วยดับจุดอ่อนของเลขนี้ได้เช่น 42 24 15 51 45 59 เป็นต้น'),
(54, '53', 'R5', -15, 'หมายเลข 53 พลังการหักเห ', 'คนที่ได้เลขนี้ต้องมีใจคอหนักแน่น เป็นเลขกลางๆมีทั้งดีและร้ายกลับกันไปแต่เลข 5 จะนำความสำเร็จในชีวิตมาให้เป็นอย่างดี แต่ต้องระวังเลข 3 จะทำให้อนาคตเบื้องหน้ามีมุมหักเห เปลี่ยนรูปได้ จะมีบุคคลที่ชั่วร้ายบางคนมาเบนชีวิตให้เป็นไปในทางเสื่อม อย่าหูเบาเชื่อใครง่ายนัก และอย่าได้สมาคมกับบุคคลที่ไม่น่าไว้วางใจ ระวังมักจะตกอยู่ในอารมณ์ลุ่มหลงอะไรได้ง่าย', 'ด้านดี คนรวยคนมีฐานะดีมักมีเลขนี้อยู่โดยกำเนิดและไม่ได้ตั้งใจ ข้อดีหนึ่งข้อจึงหมายถึง ความสำเร็จและความร่ำรวย เลขนี้ถ้ามุ่งทำดี มุ่งทางสว่าง ตัวเลขจะสามารถนำพาชีวิตให้ประสบความสำเร็จได้เป็นอย่างดี มีผู้ใหญ่คอยให้การสนับสนุนให้การอุปถัมภ์อยู่ คุณจะมีงาน มีเงิน มีเกียรติ มีชื่อเสียงได้\r\n\r\nแต่เลข 53 35 เขายังมีอันตราย จึงต้องระวังในการใช้ เพราะฉะนั้นถ้าใครมี ถ้าใครใช้อยู่ ห้ามมีเกิน 1 หรือ 2 คู่ ห้ามมีคู่เลขร้ายๆอื่นๆเยอะจนซ้ำเติมดวง และจงมีสติ รอบคอบ จงคบแต่คนดีๆ จงเดินทางสว่างไว้ อย่าหลงเชื่อใจใครง่ายๆ ชีวิตคุณจะดีไม่ดีมากน้อยแค่ไหน อยู่ที่การกระทำและอยู่ที่การเลือกการตัดสินใจของคุณด้วย ถ้ามีสติ ไม่ประมาท ไม่ใจอ่อน ไม่เชื่อใจคนง่ายเกินไป ถ้าไม่บ้างานเงินเกินไป นั่นจึงจะดี \r\n\r\nด้านเสีย เพราะคนเลขนี้ต้องระวัง มักจะถูกหลอกจากเพื่อนมิตรและคนใกล้ชิด เพราะมักมีศัตรูในร่างมิตร เข้ามาพัวพัน ชีวิตมักตกอยู่ในสภาพแวดล้อมที่ไม่ดี ระวังถูกเอารัดเอาเปรียบ ถูกอิจฉาริษยา จากคนรอบข้าง ความล้มเหลวส่วนใหญ่ มาจากเพื่อนฝูงหุ้นส่วน เลข 53 ชีวิตรักชีวิตสมรสจะมีปัญหารักสามเศร้า หรือ โสด เป็นเลขนำขี้โรค ป่วยบ่อย ต้องหาหมอรักษาอยู่ตลอดเวลา สุดท้าย รวยแต่ต้องเอาเงินมารักษาตนเอง รวยแต่มักมีหนี้สินคดีความอันเกิดจากความหลงผิด คบคนผิด ไว้ใจคนผิด\r\n'),
(55, '54', 'D10', 70, 'หมายเลข 54 พลังมหาราชาโชคความสำเร็จ', 'เป็นเลขดีมาก มีมงคลแก่ชีวิต จะประสบความสำเร็จได้โดยง่าย มีตำแหน่งหน้าที่การงานใหญ่โต มีคนเคารพนับถือมากมาย การศึกษาจะประสบความสำเร็จอย่างดีเยี่ยม มีโอกาสได้ทุนหรือทำงานต่างประเทศ มีคนคอยช่วยเหลือหนุนนำตลอด ชีวิตมักจะได้รับการคุ้มครองจากสิ่งศักดิ์สิทธิ์ เป็นคนเรียนรู้ง่าย มีความสนุกกับการเรียนรู้ ความรักก็จะราบรื่น มีโอกาสมีรักที่ต่างประเทศได้', 'ด้านดี เป็นเลขดีมากอีกเลขหนึ่ง ผู้ที่ได้เลขนี้ เรื่องเงินงานโชคลาภ ความรัก จะสำเร็จสมหวังดังปรารถนา มักเป็นคนโชคดี มีโชคลาภอยู่เนืองๆ ชีวิตมักประสบโชคดีอย่างไม่คาดฝันอยู่บ่อยๆ เป็นผู้ที่มีคุณธรรม จะมีตำแหน่งสูง มีคนเคารพนับถือ มีไหวพริบสติปัญญาดี เรียนอะไรก็แตกฉาน มีคนคอยค้ำจุนหนุนส่ง ไม่มีทางตกต่ำหรือขาดแคลน มีสิ่งศักดิ์สิทธิ์คุ้มครอง  มีสติปัญญาแตกฉาน มีบุคคลทุกวงการคอยให้ความเคารพช่วยเหลือและพร้อมสนับสนุน เป็นผู้ที่ชอบสร้างประโยชน์ให้แก่วงสังคม ผู้ที่ตกอยู่ภายใต้อิทธิพล ของหมายเลข 54 ชีวิตจะประสบความสำเร็จความเจริญรุ่งเรืองได้อย่างยอดเยี่ยม อุปสรรคปัญหาน้อย มีโอกาสได้ทุนหรือทำงานต่างประเทศ ความรักก็จะราบรื่น อาจมีโอกาสมีรักกับครต่างชาติหรือมีรักที่ต่างประเทศได้\r\n\r\nด้านเสีย เลขนี้ต้องวางเลขดีๆและเช็คดวงก่อน ถ้าใครที่มีดวงแรง แถมมีตัวเลขร้ายๆแรงๆอยู่แล้ว มีดวงอุบัติเหตุ ห้ามให้เลข 54 ไปคุ้มครองในจุดที่มีพลังสูง เพราะจะคุ้มครองไม่ได้ แถมเร่งให้เกิดอุบัติเหตุเร็วขึ้นด้วย เพราะเลขนี้มีพลังอุบัติเหตุจ้อง และต้องระวังเรื่องเกี่ยวกับสายตาด้วย\r\n'),
(56, '55', 'D10', 45, 'หมายเลข 55 พลังความสุขสมหวัง', 'เป็นเลขดีมาก มีความก้าวหน้าของชีวิตอย่างมั่นคง มีความสำเร็จ มีความเที่ยงธรรม และรักในคุณธรรมความดี มีการงานในตำแหน่งใหญ่โต การค้าขายกิจการกำไรดีมาก เรียนก็ได้ทุนสมองดีมาก มีโอกาสไปได้ดีในต่างประเทศหรือจากถิ่นที่ตนเกิด ในใจมักเลื่อมใสในสิ่งศักดิ์สิทธิ์ ชอบเดินทางไกล มีคุณธรรมจริยธรรม จะได้คู่ครองที่ดีฉลาด ส่งเสริมครอบครัวได้ดี แต่ระวังความเครียดจากการงานไว้บ้างพักผ่อนบ้างจะดี', 'ด้านดี ผู้ที่ได้หมายเลขนี้ ชีวิตจะเจริญรุ่งเรืองอย่างมั่นคง เพราะมีดาวพฤหัสบดี ถึงสองดวงคอยส่งเสริมหนุนนำ ให้ชีวิตมีความเป็นอยู่อย่างสุขสบาย มีฐานะมั่นคง มีความเจริญก้าวหน้าในชีวิตดี สมบูรณ์พูนสุข มีความสุขสำเร็จดังใจหวัง การงานดีมีตำแหน่งสูง ความรักดี มีแฟนฉลาดและดวงดี  ค้าขายก็จะได้กำไรเพิ่มพูนดี คนรักมากมาย มีเสน่ห์ มักเป็นผู้ที่มีภูมิรู้และมีคุณธรรม วิถีชีวิตมักเป็นผู้รับใช้สังคม และชอบช่วยเหลือผู้อื่น ชอบแนะนำผู้อื่นอยู่เสมอๆ เลื่อมใสในสิ่งศักดิ์สิทธิ์ ชอบทำบุญ ทำทานเอื้อเฟื้อ เผื่อแผ่แก่ผู้อื่นอยู่เสมอๆ เป็นคนที่มีจิตใจเที่ยงตรง รักในคุณงามความดี ชอบเดินทางไกล มักไปเกี่ยวข้องกับต่างประเทศ งานต่างประเทศรวมถึงคนต่างชาติต่างภาษา บั้นปลายชีวิตจะปลีกวิเวกแสวงบุญแสวงธรรม หรือ อยู่อย่างสงบกับครอบครัว\r\n\r\nด้านเสีย ถ้าใครดวงมีเลข 37,73,10,28,82,19,91 ตามห้ามให้เลข 55 เขาเด็ดขาด ยกเว้นว่าเปิดดวงแล้วเลข 5 ดีและถูกโฉลกมากจริงๆ \r\n'),
(57, '56', 'D8', 50, 'หมายเลข 56 พลังศิลป์และปัญญา ', 'เป็นเลขดีมาก ชีวิตจะประสบความสำเร็จเป็นอย่างดี มีความสามารถในเชิงศิลปะ ปัญญา มีความคิดที่เฉียบแหลม ทำงานรอบคอบ เรียนดี ทำงานเก่ง มองโลกในแง่ดี มีพลังกำลังใจไม่ย่อท้อ มีใจกว้าง มีโอกาสทำงานในหน้าที่ใหญ่โตเป็นที่รู้จักในวงสังคม งานที่แนะนำเหมาะกับด้านศิลปะ ปัญญาการวางแผนเป็นนักปกครอง นักบริหาร ศิลปินก็ทำได้ดี พลังของเลขนี้ส่งผลถึงศาสตร์หลายๆแขนงเพราะมีพลังมาก', 'ด้านดี เป็นเลขดีให้คุณเลขนึง ผู้ที่ได้หมายเลขนี้ มักมีดวงชะตาที่ดี ตัวเลขจะช่วยส่งเสริมให้มีความสุขมีความเจริญรุ่งเรืองก้าวหน้าได้ดีเยี่ยม เป็นผู้ที่มีวิชาความรู้อย่างกว้างขวาง เป็นผู้ที่มีเป้าหมายในชีวิตอย่างชัดเจน เป็นคนที่โชคดี ในเรื่องของทรัพย์สินเงินทองและความรัก เป็นคนมีเสน่ห์มาก จะประสบความสำเร็จทุกด้าน เช่น การเรียน การงาน การเงินและจะมีคนคอยให้ความอุปถัมภ์ คอยให้ความช่วยเหลืออยู่ตลอดเวลา มักมีโอกาสดีๆวิ่งหาวิ่งชน การงานควรต้องเปลี่ยนแปลงบ่อย หรือต้องเดินทางบ่อย จะยิ่งดี เมื่อเดินทางการเงินการงานจะบังเกิดผล คนเลขนี้จะมีความโดดเด่นด้านปฏิภาณไหวพริบ ทำอะไรมีความรอบคอบดี มองโลกในแง่ดี มีน้ำใจ สู้อย่างไม่ถอย นำชีวิตตนไปสู่จุดหมายคือความสำเร็จได้ จะผู้คนรักใคร่มากมาย ถือว่าเป็นเลขดี จะประสบความสำเร็จในชีวิต\r\n\r\nด้านเสีย คนที่จะใช้ 56 65 ต้องเช็คดวงให้ดี หรือ ต้องผ่านการปรับสมดุลเลขก่อนจึงจะดี ลดความเสี่ยงได้ หากอยากใช้ 56 อยากได้พลังของ 56 ให้ใช้เลข 65 ดีกว่า ปลอดภัยกว่า และห้ามมีเยอะ เพราะหากมีเยอะ แถมมีเลขร้ายแรงเกาะอยู่เยอะในชีวิต ให้ระวังพลังร้ายของเลข 11 ที่แฝงอยู่ คนเลขนี้ถ้าใช้ไปนาน ถ้ามีเยอะ จะชอบจู้จี้นิดๆ เดี๋ยวอ่อนเดี๋ยวแข็ง มีสองบุคลิก ถ้าใช้เลขนี้ โดยเฉพาะ 56 คนที่ใช้เลขนี้ถ้าขาดคุณธรรม ก็จะขาดทรัพย์สินและความรัก ทำให้ชีวิตถึงกับวิบัติลงได้ เขาเรียกว่าดี...จึงคู่ควร\r\n');
INSERT INTO `numbers` (`pairnumberid`, `pairnumber`, `pairtype`, `pairpoint`, `miracledesc`, `miracledetail`, `detail_vip`) VALUES
(58, '57', 'R10', -40, 'หมายเลข 57 พลังความมั่นใจในตัวเองสูง ', 'ด้วยอิทธิพลของดาว ๗ เสาร์ เป็นคนมีความคิดขัดแย้งในตัวเอง และส่วนรวมค่อนข้างดื้อรั้น เอาแต่ใจตนเอง มักไม่เชื่อใจใคร ทำอะไรมักจะทำแบบครึ่ง ๆ กลาง ๆ มักเป็นคนกำพร้าและเรียนอะไรไม่สำเร็จครึ่ง ๆ กลาง ๆ แต่อิทธิพลของเลขประธานดาวศุภเคราะห์และดาวบาปเคราะห์ ทำให้ชีวิตจะดำเนินไปอย่างมั่นคง มีความปรารถนาอย่างแรงกล้า', 'ด้านดี ช่วงเริ่มต้นชีวิตหรือหน้าที่การงานตอนแรกจะดี ดำเนินไปอย่างมั่นคง แต่บั้นปลายจะ…..ล้มเหลว\r\n\r\nด้านเสีย ผู้ที่ได้หมายเลขนี้จะเป็นคนมีความคิดเห็นขัดแย้งในตัวเอง และมักมีความคิดเห็นขัดแย้งต่อส่วนรวม มีทิฐิมานะสูง ดื้อรั้น ผูกใจเจ็บ เอาแต่ใจตัวเอง หลงตัวเอง มักไม่เชื่อใจใคร ชีวิตมักได้รับ ความขมขื่นอยู่ในสภาพกลืนไม่เข้าคายไม่ออก มักถูกใส่ร้าย ป้ายสี ถูกหลอกลวง ให้หลงมัวเมาไปในทางที่ผิด ถูกเอารัดเอาเปรียบ และถูกเบียดบังเอาความดีความชอบ ใช้ไปนานๆจะมีปัญหาอาจต้องตกจากตำแหน่งหน้าที่การงาน ถ้าเด็กใช้ มักจะเรียนไม่ค่อยสำเร็จ คือ ประเภทเรียนครึ่งๆกลางๆหรือคนเลขนี้ทำอะไรมักจะครึ่งๆกลางๆ ทำไม่เต็มที่ไม่ตั้งใจ ส่วนความรักมักมีรักสามเศร้า ชีวิตอาภัพในเรื่องความรัก จะทำให้แต่งงานช้าหรือไม่ได้แต่งงาน ให้ระวังโรคผิวหนังทุกรูปแบบ เจ็บป่วยบ่อย อุบัติเหตุ ระวังพลังของราหูเล่นงานซ้ำเติม\r\n'),
(59, '58', 'R10', -40, 'หมายเลข 58 พลังความลุ่มหลงงมงาย', 'ด้วยอิทธิพลของดาวราหู 8 เป็นเลขไม่ดี บ่งบอกถึงการชอบหลงผิด เห็นกงจักรเป็นดอกบัว ชอบลุ่มหลงไสยศาสตร์ต่างๆ ชอบเชื่อถือโชคลางสิ่งแปลกๆมากเกินไป เข้าลักษณะต้นตรงปลายคด จิตใจมักจะวิปริตเฉไฉออกนอกลู่นอกทางชอบคัดค้านด้านศาสนา จิตใจโน้มเอียงไปในด้านเดียรถีย์หรือมิฉะนั้นก็จะเป็นคนหลงศาสนาอย่างงมงาย จนไม่มีเหตุผลหลงผิดในพิธีกรรมต่าง ๆ มากกว่าแก่นแท้ของธรรมะ ทำให้เสียการงาน ความรุ่งเรืองลดน้อยลง ชอบมีความคิดที่แปลกประหลาดไม่เหมือนใคร', 'ด้านดี ผู้ที่ได้หมายเลขนี้ มักเป็นผู้ที่สนใจ ในหลักธรรมคำสอนของศาสนา เป็นนักค้นคว้าอย่างจริงจัง ถ้าต้องการที่จะรู้เรื่องใดหรือสิ่งใด ก็จะทำการค้นคว้าจนรู้จริง มีความสามารถเป็นนักปราชญ์ได้ คนเลขนี้เป็นนักค้าขายที่ดี เป็นคนมุมมานะเอาจริงเอาจัง\r\n\r\nด้านเสีย แต่สุดท้ายระวังจะเห็นกรงจักเป็นดอกบัว ลุ่มหลงมัวเมาไปในทางเสื่อมทรงเจ้าเข้าผี ไสยศาสตร์มนต์ดำ หรือ หลงศาสนามาก ชอบพูดตรงจนหักหาญความคิดของผู้อื่น เลขนี้หากใช้ไปนานๆ แม้เริ่มต้นดีแต่บั้นปลายชีวิตมักประสบกับความล้มเหลว ความรักมีปัญหา ครอบครัวแตกแยก มีเรื่องชู้สาว มีเรื่องทะเลาะเบาะแว้ง ให้ระวังอุบัติเหตุทางรถยนต์ คนปองร้ายใส่ร้ายป้ายสีนินทา มีปัญหาเรื่องโรคสายตา โรคลำไส้ โรคนิ่ว โรคไต อบายมุข คบคนพาล ถ้าใครมีเลขนี้เยอะมีเยอะใช้นาน ระวังจะคบคนผิด ระวังจะโดนหลอก และตนเองก็จะกลายเป็นคนหลอกลวงต้มตุ๋นไปได้ หากเป็นพระใช้จะกลายเป็นพระทุศีล มีเรื่องทำให้ผ้าเหลืองร้อนถึงขั้นอาบัติปราชิกได้\r\n'),
(60, '59', 'D10', 75, 'หมายเลข 59 พลังแห่งขนบธรรมเนียมประเพณี ', 'เป็นเลขดีมาก จิตใจดีมีเมตตาสูง มีศีลธรรม เสริมดวงด้านความรักดี ด้านการงานได้ดี จะทำให้มีคนเมตตาช่วยเหลือ เป็นเลขที่ดีใครมีจะเจริญรุ่งเรืองดี เลขนี้จะเอาไปควบคุมชายเจ้าชู้ให้อยู่หมัดได้แต่ต้องใช้หลายคู่ เพราะใครได้เลขนี้จะทำให้เป็นคนยึดมั่นในสิ่งศักดิ์สิทธิ์ มีจิตใจใฝ่ดีมากขึ้น เชื่อถือในศาสนา มีศีลธรรมสูง ชอบความถูกต้อง และศรัทธาความเร้นลับของธรรมชาติ กลายเป็นคนหัวเก่า รักความยุติธรรม เชื่อในวิญญาณ ชอบในเรื่องพิธีกรรมและโชคลางต่าง ๆ เลขนี้ถ้าไม่ใช่คนดวงปลาไหลจริงๆจะกลับกลายเป็นคนดีได้ อีกอย่างเลขนี้ดีเพราะมีเลขแฝง คือ 14 อยู่ในตัวดังนั้นคนที่ได้เลขนี้ไปถ้าใจบุญสุนทานจะก้าวหน้ารุ่งเรืองในหน้าที่การงานมาก ถ้าไม่เลวชั่วจริงๆยังไงก็ไม่ตายโหง ต้องมีอันให้แคล้วคลาดปลอดภัยมาได้เสมอ แต่ในขณะเดียวกันถ้าใครได้เลขนี้ไปทำดีจะเห็นเร็วทำชั่วจะเห็นเร็วเช่นกัน ต้องระวังถ้าไม่มั่นใจว่าตัวเองดีจริงก็ไม่ควรใช้', 'ด้านดี เป้นเลขดีมาก คนที่ใช้มักมีดวงชะตาดี ตัวเลขจะส่งเสริมให้ชีวิตประสบความสำเร็จ มีชะตาชีวิตรุ่งเรือง ทำการค้าก็จะร่ำรวย มีคนคอยช่วยเหลือ มีสุขภาพร่างกายแข็งแรง เป็นเลขที่ช่วยต่ออายุต่อชะตาช่วยคุ้มครองป้องกันได้ และด้วยตัวเลขจะทำให้ผู้ใช้ชอบศึกษาหาความรู้อยู่ตลอดเวลา รักความยุติธรรม รักความก้าวหน้า และมักเกี่ยวข้องกับคนต่างชาติต่างภาษา มักได้เรียนต่อหรือได้ทำงานหรือคบหากับคนต่างชาติ ได้ใช้ชีวิตในต่างแดน\r\n\r\nคนเลขนี้เป็นคนยึดมั่นในสิ่งศักดิ์สิทธิ์ เชื่อถือศาสนาและศรัทธาความเร้นลับของธรรมชาติ เชื่อในวิญญาณ ชอบในเรื่องพิธีกรรมและโชคลางต่างๆ  เป็นคนมีลางสังหรณ์ดีเยี่ยม มักจะอุทิศตัวให้กับการกุศลต่างๆ มีจิตใจดีมีเมตตาสูง มีศีลธรรมอันดี ดวงด้านความรักดี จะได้คู่ดีเกื้อกูลกัน คนเลขนี้ถ้าจะให้ดีที่สุดต้องทำบุญสวดมนต์บ่อยๆจะยิ่งดี\r\n\r\nด้านเสีย ถ้ามีเยอะเกินไปจิตจะใฝ่บุญมากเกินพอดี หลงบุญ หัวโบราญ ใจดีเกินไปในบางครั้ง เฉื่อยช้า\r\n'),
(61, '60', 'R5', 10, 'หมายเลข 60 พลังความเพ้อฝันและจินตนาการ ', 'การเงินการงานคล่อง แต่ต้องระวัง อย่าทำตามอารมณ์ตัวเองมากนัก จะพลาดได้ ใครที่มีเบอร์นี้อยู่ในตัวจะเป้นคนชอบฝัน ชอบอยู่ในโลกจินตนาการ มีความละเอียดอ่อนสูง เป็นคนฉลาด มองโลกแง่ดี รักธรรมชาติ มีอารมณ์ศิลปินมากๆ และมีความเชื่อในด้านไสยศาสตร์ทำนองว่าฟังหูไว้หู แต่บางครั้งการที่เพ้อฝันมากไปอาจจะทำให้งานที่จะปฏิบัติพลาดโอกาสดีๆไปได้ จึงควรปรับที่การดำเนินชีวิตให้ลงมือกระทำอย่างจริงจังจะดีและรุ่งเรืองตลอด', 'ด้านเสีย คือ งมงาย หลงผิด เพ้อฝันชอบจินตนาการ ใช้เงินเก่ง หรือ มักมีเหตุให้เสียเงินเสียทรัพย์ เก็บเงินไม่ค่อยอยู่ ทรัพย์สินสูญหายหรือถูกแย่งชิง หรือถูกคดโกงอย่างไม่คาดฝัน ชอบคิดแต่ไม่ลงมือทำ หรือแต่ทำแต่ช้า ทำไม่จริงจัง มักใช้อารมณ์เป็นใหญ่ หญิงใช้ดี แต่อย่าประมาท ชายใช้ระวังจะเป็นผิดเพศ หญิงชายใช้นานๆ หรือมีเยอะระวังจะหลงตัวเอง มีกิ๊กมีชู้ ระวังโรคภายในช่องท้อง โรคที่เกี่ยวกับช่องท้อง ไต กระเพาะปัสสาวะ อวัยวะเพศ ติดเชื้อ... ซีสเนื้องอก โรคมะเร็ง เอดส์ ลมพิษ ภูมิแพ้ \r\n\r\nด้านดี คือ จะเป็นคนที่มีเสน่ห์ มีแรงดึงดูดให้คนรักคนพอใจ มักมีความโชคดีในเรื่องเงินๆ ทองๆ มองโลกในแง่ดี มีอารมณ์ประณีตละเอียดละมัย มีความสุขุมรอบคอบ จิตใจดี มองโลกในแง่ดี ชอบในสถานที่โอ่อ่าหรูหราดูดี ชะตาชีวิตโดยทั่วไปถือว่าดี ไม่ต้องต่อสู้ฟันฝ่าอุปสรรคมากนัก มีความเป็นอยู่สุขสบาย แต่...ควรระวังแม้เลขนี้จะมีส่วนดี แต่ส่วนร้ายก็มาก เพราะถ้ามีเยอะถ้าใช้นาน ถ้าเลขอยู่ในตำแหน่งที่แสดงผลแรง ถ้าในชีวิตมีเลขร้ายคู่อื่นๆเยอะ ต้องระวังมันจะซ้ำเติมดวง ระวังจะเป็นโรค.....ข้างต้น หรือป่วยเรื้อรัง ป่วยง่าย ป่วยบ่อย แพ้ง่าย และจะขี้เกียจเฉื่อยชาติดหรูฟุ่มเฟือยใช้เงินเก่งได้ '),
(62, '61', 'R10', -60, 'หมายเลข 61 พลังบุคลิกซ้อน ', 'เป็นคนมีสองบุคลิกสองอารมณ์ในตัวเอง มีความขัดแย้งในตัวเอง บางครั้งมักจะปล่อยตัวปล่อยใจให้หลงระเริงไปกับแสงสีและสิ่งยั่วยวนของโลกีย์ แต่บางขณะชอบทำตัวเหมือนคนอมทุกข์ หนีสังคมทำให้เป็นคนสันโดษ จึงทำให้ดูเหมือนเป็นคนมีสองลักษณะในตัวเอง ชีวิตมักจะมีมุมหักเหได้ง่ายชอบทำตัวหยิ่งจนคนไม่ชอบหน้า จนบางครั้งวงสังคมไม่ยอมรับ ระวังบั้นปลาย มักจะถูกเบียดเบียน ประสบแต่ความทุกข์ และอุปสรรค โรคภัยไข้เจ็บ', 'ด้านดี เก่งในการวางแผนการทำงาน รวยดีประสบความสำเร็จในชีวิต มีความหมายด้านดี เหมือนเลข 16 เลขนี้เป็นเลขคนรวย เพราะคนที่มีมาแต่กำเนิด เขามักรวย เป็นเศรษฐี หรือ มีอันจะกิน (ต้องดูพื้นดวงประกอบด้วย) หรือ เกิดเป็นลูกคนรวย แม้จะดีทำให้รวย แต่…ควรระวังในการใช้ ถ้าดวงใช้ได้ถูกโฉลกกับชะตา ท่านควรมีแค่คู่เดียวและห้ามอยู่ช่วงสุดท้ายของเบอร์ โทร ทะเบียนรถ บ้านเลขที่ \r\n\r\nด้านเสีย ถ้ามีเยอะ ถ้าอยู่ในจุดสำคัญ แถมเป็นเลขร้ายตรงดวง ระวังความเจ็บป่วยเรื้อรังหรือพิการ สุขภาพอ่อนแอ ระวังอุบัติเหตุ อาภัพรัก เป็นเมียน้อย มีกิ๊ก มีชู้  ครอบครัวต้องแตกแยก เลิกลาหย่าร้าง หรือแต่งงานช้า หรือไม่ได้แต่ง มีลูกยาก ไม่มีบุตร มีคดีความไม่เป็นโจทย์ก็เป็นจำเลย โดนทำร้ายจากแฟน หรือคนอื่น โดนปองร้ายจากศัตรูในคราบมิตร  ตัวเลขจะทำให้เป็นคนสองบุคลิก เป็นคนสองอารมณ์ มีความขัดแย้งในตัวเอง บางครั้งมักปล่อยตัวปล่อยใจให้หลงระเริงไปกับแสงสีและสิ่งเย้ายวนทางโลกีย์ แต่บางทีก็ชอบทำตัวเหมือนคนอมทุกข์ หนีสังคม หยิ่ง คนไม่ชอบหน้า สังคมไม่ยอมรับ เป็นคนอารมณ์ร้อน รักศักดิ์ศรีรักเกียรติของตัวเอง ใช้จ่ายฟุ่มเฟือย มีรสนิยมสูง จนบางครั้งทำให้เกิดหนี้สินได้  ต้องระวังโรคภัยไข้เจ็บเบียดเบียน หรืออุบัติเหตุรุนแรง อุปสรรคปัญหาเยอะ เครียด บั้นปลายชีวิตจะตกต่ำและเหน็ดเหนื่อย\r\n'),
(63, '62', 'R5', -25, 'หมายเลข 62 พลังการเกื้อกูลและพลิกผัน ', 'มีมิตรสหายมาก ถ้าเป็นเลขนี้ผู้ชายใช้มักจะเป็นมีเสน่ห์ต่อเพศตรงข้ามสูง มีพลังทำให้คุณไม่เป็นหลักแหล่งไม่เป็นหลักเป็นฐาน ขาดสติถืออารมณ์เป็นใหญ่ เป็นคนชอบปล่อยตัวปล่อยใจล่องลอยไปเรื่อย ๆ หากลุ่มหลงสิ่งใดแล้ว มักไม่มีสติยับยั้ง มักมัวเมาในอารมณ์ หลงผิดได้ง่ายและท้ายที่สุด คือความหายนะ แต่ก็มีโอกาสได้รับความช่วยเหลือจากผู้ใหญ่ได้อย่างดี', 'ด้านดี คือ มีเสน่ห์มาก เจ้าชู้ ผู้ใหญ่และเพศตรงข้ามมักให้การสนับสนุนอุปถัมภ์ช่วยเหลือ จะประสบความสำเร็จในหน้าที่การงาน การเงิน เป็นอย่างดี มีความหมายเหมือนเลข 26\r\n\r\nด้านเสีย ขาดสติ ถืออารมณ์เป็นใหญ่ ถ้าได้รักได้หลงใคร หรืออะไรแล้วมักขาดสติลุ่มหลงมัวเมาจนทำให้เกิดหายนะ เกิดความพลาดมีเรื่องเสียหายฉาวโฉ่มีปัญหาเสื่อมเสียเพราะตัวเองและเพศตรงข้าม คนเลขนี้มักอาภัพรัก มีมือทที่สาม มีกิ๊กมีชู้ แฟนนอกใจ มีรักมากกว่าหนึ่งครั้งแต่งงานมากกว่า 1 คน ติดหรู ใช้เงินเก่ง คนไม่ชอบหน้า มีคนอิจฉาริษยาเยอะ\r\n'),
(64, '63', 'D10', 75, 'หมายเลข 63 พลังความรักไม่มีสิ้นสุด', 'เป็นเลขดีมากเป็นเลขพลังเต็ม มีเสน่ห์ มีโชค มีโอกาสสมหวังหวานชื่น ชีวิตประสบความสำเร็จอย่างดี ในทุกๆด้าน หน้าที่การงานก็เจริญก้าวหน้าได้เลื่อนขั้นเลื่อนตำแหน่งทำงานในตำแหน่งใหญ่โต  การเงินก็ดีมีเงินใช้ไม่ขาดมือ (มากน้อยตามพื้นดวงเกิด) เลขนี้เป็นเลขที่เอื้อต่อนักเรียนนักศึกษานักวิชาการเพราะจะทำให้การเรียนรู้การศึกษาประสบความสำเร็จดี แต่จะเด่นมากในเรื่องความรัก จะโชคดีเรื่องความรักมากๆ ดังนั้นคนทีมีดวงเจ้าชู้ หรือ คนที่มีชื่อสกุลมีทะเบียนรถ เป็นเลข 63 ,36 ,23,32,56,65 อยู่แล้วห้ามใช้เด็ดขาดเพราะจะทำให้กลายเป็นคนเจ้าชู้หลายเมียหลายผัวได้ถ้าจิตใจไม่เข้มแข็งพอ เพราะข้อดีอีกอย่างของเลขนี้ คือ จะทำให้เป็นคนละเอียดอ่อน น่าหลงใหล ทำอะไรดูดี มีเสน่ห์ ดึงดูด โดดเด่น อบอุ่น สร้างความประทับใจให้คนรอบข้างเสมอ จึงทำให้กลายเป็นที่สนใจใฝ่ปองของคนทั่วไป ใครที่ใช้เลขนี้อย่าหลงระเริงควรทำบุญเสริมบารมีเข้าไว้จะทำให้ชีวิตรุ่งเรืองมากขึ้นไปอีก เลขนี้คนที่มีเลขอริตามพื้นดวงเกิดเป็นเลข 3 ห้ามใช้', 'ด้านดี ผู้ที่ได้หมายเลขนี้ ถือว่าเป็นดาวคู่มิตรกัน ทั้งการงานการเงินการเรียนความรักจะราบรื่นสุขสำเร็จสมหวัง ชีวิตประสบความสำเร็จอย่างดี โดยเฉพาะเรื่องความรัก คนเลขนี้จะมีทรัพย์สินเงินทองไหลมาไม่ขาดสาย หน้าที่การงานก็เจริญก้าวหน้ารุ่งเรือง จะได้เลื่อนขั้นเลื่อนตำแหน่ง ถ้าเป็นเด็กใช้การเรียนจะดี ถ้าเป็นหญิงโสดใช้จะมีคู่ จะได้แต่งงาน ถ้าใครแต่งงานแล้วใช้เลขนี้จะรักครอบครัวและแฟนจะรักเรามากขึ้น ตัวเลขนี้ใครใช้ใครถูกโฉลกจะทำให้มีสติปัญญาไหวพริบดี ดูดีโดดเด่น เป็นคนมีเสน่ห์ ดึงดูดเพศตรงข้ามได้ดี ใครเห็นก็รัก ใครเห็นก็หลง จึงทำให้จะได้ทั้งความรักความอบอุ่นและการช่วยเหลือจากผู้ใหญ่เพศตรงข้ามและคนรอบข้างเป็นอย่างดี จึงทำให้มีมิตรสหายมาก แต่ต้องระวัง จะมีคนเข้ามาชอบมารัก จงวางตัวให้ดี \r\n\r\nด้านเสีย ห้ามใช้สำหรับคนที่ดวงมีอุบัติเหตุ และคนที่มีเลขร้ายแรงอยู่ ห้ามใช้กับคนที่ใจร้อน ถ้าจะใช้ต้องเช็คดวงก่อนให้ดีและปรับสมดุลเลขก่อนจ้า \r\n'),
(65, '64', 'D8', 60, 'หมายเลข 64 พลังความอ่อนไหวและการเปลี่ยนแปลง ', 'เป็นเลขดีมาก เป็นดาวคู่มิตรที่ให้คุณมาก เลข 64 เป็นคนมีรสนิยมสูง มีเสน่ห์ ไม่ชอบหยุดนิ่งอยู่กับที่ ชองแสวงหาสิ่งใหม่ ๆ อยู่เสมอ ชอบการเปลี่ยนแปลง หารสชาติใหม่ ๆ ของชีวิต แต่ชอบคิดเพ้อฝัน มักใจอ่อน ทำให้ตกอยู่ใต้อิทธิพลผู้อื่นได้ง่าย บางครั้งอาจจะต้องเหนื่อยกับคนรอบข้างจนไม่ได้ดูแลตัวเอง เลข 64 จะทำให้ชีวิตพบความสำเร็จ มีความสุข มีความราบรื่นแห่งชีวิต', 'ด้านดี ผู้ที่ได้หมายเลขนี้ มักเป็นทั้งตัวเลขดี และตัวเลขเสีย ด้านดี คือ ตัวเลขจะคอยส่งเสริมให้ชีวิตมีความรุ่งเรืองก้าวหน้ามีโชคลาภวาสนา มีอำนาจบารมี มีฐานะความเป็นอยู่ร่ำรวย เป็นเจ้าของธุรกิจหรือกิจการ ถ้าค้าขายก็ขายได้ขายดี ได้ดีเพราะปาก มีมนุษย์สัมพันธ์ดี มองโลกในแง่ดี รักความก้าวหน้า ไม่ชอบหยุดนิ่งอยู่กับที่ ชอบแสวงหาสิ่งใหม่ๆอยู่ตลอดเวลา เป็นคนมีเสน่ห์มาก น่ารักน่าคบหา \r\n\r\nด้านเสีย คือ ระวังเจ้าชู้เป็นคนมากรัก ชอบสนุกใจอ่อน อาจทำให้เกิดปัญหาต่างๆ ตามมาได้อีกมากมาย เป็นคนไม่เคยหยุดนิ่งในเรื่องของความรัก ชีวิตดีมากถ้าปล่อยวางเป็น ถ้าไม่ประมาทในเรื่องของชีวิตคู่ ถ้าไม่ไปยุ่งเรื่องของคนอื่น ไม่แบกรับภาระของคนอื่นใส่บ่าตน\r\n'),
(66, '65', 'D10', 75, 'หมายเลข 65 พลังความก้าวหน้าและเสน่ห์ ', 'เป็นเลขดีมาก ดาวพฤหัสบดี ดาวศุภเคราะห์ หมายถึง สติปัญญา ความรอบรู้ ผู้ใหญ่ ดาวศุกร์ ดาวศุภเคราะห์ หมายถึง ความรัก บ่งบอกถึงความสำเร็จอย่างดีเยี่ยม ได้รับความสนับสนุนจากผู้หลักผู้ใหญ่เป็นอย่างดี หรือมีผู้ใหญ่ให้การช่วยเหลืออย่างลับๆ แต่คิดที่เป็นคนช่างฝันและหลงใหลในศิลป์ แต่เลขนี้บางครั้งก็ดูเหมือนเป็นคนนิ่มนวล แต่บางครั้งก็แข็งกร้าว ในด้านความรัก บุคคลใต้อิทธิพล เลข 65 จะเป็นนักรักตัวฉกาจ', 'ด้านดี ผู้ที่ได้หมายเลขนี้ ทำให้ชีวิตมีแต่ความเจริญก้าวหน้ารุ่งเรือง ประสบความสำเร็จในการเงินการงานอย่างดีเยี่ยม เป็นดาวคู่ทรัพย์ คู่โชค มีรายได้หลายทาง มีโอกาสดีๆวิ่งชน มีทรัพย์มีสมบัติเพิ่มพูน จะทำกิจการงานใดๆก็พบแต่ความสะดวกสบาย ราบรื่น ไร้ปัญหายุ่งยาก มีผู้ใหญ่ให้ความช่วยเหลืออุปถัมภ์ส่งเสริมอยากให้งาน อยากให้เงิน ทั้งทางตรงทางอ้อม ทั้งเบื้องล่างเบื้องบน เลขจะนำรักนำสุขนำทรัพย์มาให้ ชีวิตรักดี จะได้คู่ครองที่ดี เป็นที่หมายปองของเพศตรงข้าม จะไปทางก็มีแต่คนรักใคร่ เพราะดูดีมีเสน่ห์ เป็นคนฉลาด มีไหวพริบดี รักความก้าวหน้า เลขนี้จะดีเด่นเรื่องความก้าวหน้าในการงานการเงิน และ เรื่องของความรัก มีเสน่ห์แก่เพศตรงข้ามมากเป็นพิเศษ ชีวิตมักเดินทางบ่อย หรือเปลี่ยนตำแหน่งหน้าที่บ่อย เมื่อเดินทาง เมื่อเปลี่ยนตำแหน่งมักจะได้ทรัพย์ มักจะได้ตำแหน่งดีขึ้นกว่าเดิม\r\n\r\nด้านเสีย คนเลขนี้บางครั้งจึงดูเหมือนเป็นคนนุ่มนวล บางครั้งดูเหมือนเป็นคนแข็งกร้าว ระวังให้ดีหากมีเยอะจะกลายเป็นคนมากรัก เจ้าชู้หาตัวจับยาก จะเกิดอันตรายจากพลังของเลข 11 ถ้ามีสิ่งดีๆเกิดขึ้นควรทำบุญทำทาน และเพื่อความปลอดภัยควรจัดสมดุลเลขในชีวิตให้ดีจะดีตลอด \r\n'),
(67, '66', 'R10', -65, 'หมายเลข 66 พลังแห่งอารมณ์และความรู้สึก ', 'รวมกันได้ 12 ซึ่งเป็นกำลังดาวของพระราหู เลข 66 เป็นคนที่รักอะไรก็รักอย่างลุ่มหลง เป็นคนที่หลงมอมเมาได้ง่าย เพราะไม่ค่อยพิจารณาไตร่ตรองอะไรให้รอบคอบรักอะไรก็มักจะทุ่มเทลงไปทั้งตัว เป็นคนมัวเมาแต่โลกีย์ถือเป็นเลขอันตราย ต้องระมัดระวังให้มาก เพราะใต้อิทธิพลของเลขนี้จะทำให้พัวพันกับสิ่งยั่วเย้าอารมณ์ทั้งปวง', 'ด้านดี ผู้ที่ได้หมายเลขนี้ หมายถึง มีเสน่ห์ เจ้าชู้ เงินเยอะแต่……เพราะมี 6 เยอะไป เพราะแฝงด้วยราหู\r\n\r\nด้านเสีย …ใช้เงินเก่ง รักสบาย มีกิ๊ก มีชู้ เลขนรก อุบัติเหตุ คดีความ ระวังความเจ็บป่วยในช่องท้อง และอวัยวะเพศ มดลูก ไต กระเพาะปัสสาวะ ต่อมลูกหมาก ติดเชื้อ ติดโรคทางเพศสัมพันธุ์ เป็นลมพิษ ภูมิแพ้ ซีสเนื้องอก มะเร็ง  เพราะมีดาวศุกร์ถึงสองดวงคอยหนุนนและส่งเสริมให้ จะทำให้เกิดความลุ่มหลง จนบางครั้ง ถึงกับขาดสติไม่พิจารณาไตร่ตรองให้รอบคอบ ยิ่งในเรื่องของความรัก จะลุ่มหลงเป็นอย่างมากทุ่มเทไปทั้งตัว ตามใจตนไม่สนถูกผิดไม่สนเหตุผล มัวเมาแต่กิเลส และโลกีย์ กลายเป็นคน ตามืดบอด หลงแสงสี ชอบการพนันและอบายมุข ชอบเสี่ยงชอบลอง ระวังจะป่วยเจ็บและธุรกิจการงานจะมีปัญหาหรือจะล้มเหลวอย่างฉับพลัน เป็นเลขอันตรายเลขหนึ่ง จะต้องระมัดระวังให้มาก มักเกี่ยวพันกับสิ่งยั่วยวน อารมณ์แปรปรวนและมีความผันผวนสูง\r\n'),
(68, '67', 'R10', -90, 'หมายเลข 67 พลังแห่งความผิดหวัง ทุกข์เศร้า ', 'เป็นเลขแห่งความผิดหวัง ทุกข์เศร้า เพราะดาวเสาร์ (7) รวมกันได้ 13 เป็นเลขไม่ดีอีก มองดูเป็นเลขครึ่งๆกลางๆ จะดีก็ไม่ใช่ จะร้ายก็ไม่เชิง เพราะมีทั้งดาวโภคทรัพย์และดาวแห่งทุกข์ และอุปสรรคมารวมกัน แต่ชีวิตมักพบอุปสรรคมากมาย จะผิดหวังในความรัก ครอบครัวจะแตกร้าว บ้านแตกสาแหรกขาด เป็นเลขที่แสดงออกถึงความขัดแย้งกันเอง อย่างรุนแรง จะตกต่ำในบั้นปลายของชีวิต ระวังอุบัติเหตุด้วย', 'ด้านเสีย ผู้ที่ได้หมายเลขนี้ อันตรายมาก เพราะจะทะเลาะแฟน เลิกแฟน พลัดพราก ผิดหวัง ทุกข์เศร้า ป่วย ผ่าตัด อุบัติเหตุ มักจะแสดงถึงอาการสุขๆ ดิบๆ จะดีก็ไม่ใช่ดี จะร้ายก็ไม่เชิงร้าย สุขไม่นานชีวิตก็จะมีแต่ปัญหารุมเร้าอยู่ตลอดเวลา มักมีอุปสรรคในเรื่องของความรัก ครอบครัวแตกร้าว ไม่มีความสุขในชีวิตรัก บ่งบอกถึงบ้านแตกสาแหรกขาด เป็นตัวเลขที่แสดงถึงความขัดแย้งอย่างรุนแรงและความตกต่ำของชีวิตในบั้นปลาย สุดท้ายจะต้องอยู่คนเดียวแม้รวยได้ตามพื้นดวงแต่มักป่วย รักไม่สมหวัง และยังมีโรคภัยไข้เจ็บเข้ามาเบียดเบียน ต้องผ่าตัดบริเวณช่องท้อง ต้องระมัดระวังโรคไต โรคลำไส้อักเสบ และระเบิด ฟืนไฟและอุบัติเหตุแรง้ร้ายทั้งปวง\r\n\r\nด้านดี เป็นร้ายแต่มักหลอกลวง เพราะจะนำโชคมาให้ แต่จะกลายเป็นทุกขลาภ ควรระวัง\r\n'),
(69, '68', 'R7', -30, 'หมายเลข 68 พลังแห่งอบายมุข ', 'หลงตัวเอง คลั่งอะไรไม่มีเหตุผล เป็นเลขมัวเมาอีกเลขหนึ่ง โดยเฉพาะจะมัวเมาในอุดมคติ หลงใหลปลื้มกับอบายมุข เป็นเลขที่แสดงถึงหลักการมีศรัทธาจริตอันลุ่มหลง บ้าคลั่งในศาสนา หลงตัวเอง หลงในสังคม มักชอบทำตัวให้เด่น ชีวิตสำเร็จยากเพราะมีพลังความมัวเมาแฝงอยู่ การทำการสิ่งใดให้สำเร็จต้องอาศัยแรงกายตัวเองล้วนๆไม่มีผู้ใหญ่ให้การช่วยเหลือใดๆ ความรักเป็นไปแบบหลงมากกว่ารัก', 'ด้านเสีย ระวังเพราะมักจะประพฤติผิดศีลธรรมอันดีงาม จะพ่ายแพ้ทางด้านโลกีย์ ถ้าไม่รู้จักความพอดี มักจะหลงใหลมัวเมาในโลกีย์และอบายมุข ระวังจะมีกิ๊กมีชู้ ชอบความตื่นเต้นเร้าใจ เป็นคนไม่ชอบอยู่นิ่งเฉย ย้ายที่อยู่บ่อยๆ วิถีชีวิตมักเปลี่ยนแปลงอยู่ตลอดเวลา มักจะลุ่มหลงบ้าคลั่งในศาสนา และมัวเมาในอุดมคติ หลงในสังคม ทำตัวโดดเด่น ให้ระวังโรคถุงน้ำดี เจ็บกล้ามเนื้อ ใช้เงินเก่ง \r\n\r\nด้านดี มีเสน่ห์ การเงินการงานดี สติปัญญาดี แก้ปัญหาเฉพาะหน้าได้เก่ง คิดเร็ว ตัดสินใจเร็ว ขยัน แก้ปัญหาเก่ง ผู้ใหญ่มักช่วยเหลืออุปถัมภ์\r\n'),
(70, '69', 'D5', 4, 'หมายเลข 69 พลังความอ่อนไหว ', 'เป็นเลขดี ปานกลาง เป็นคนช่างอ่อนไหว ช่างฝันมองโลกในแง่ดี ระวังการถูกชักจูงได้ง่าย แต่จะมีผู้ใหญ่ให้การสนับสนุนอยู่ ทำให้ชีวิตไม่ลำบากนักแต่ก็ไม่สำเร็จแบบพรุแตกเสียทีเดียว เป้นพลังทางกลางๆอยู่ที่ตัวคุณในการดำเนินชีวิตมากกว่าต้องใจแข็งมีสติ', 'ด้านดี ผู้ที่ได้หมายเลขนี้ จะมีเสน่ห์ มองโลกในแง่ดี ผู้ใหญ่หนุนนำช่วยเหลืออุปถัมภ์ ชีวิตประสบความสำเร็จได้ หาเงินเก่ง ใช้เงินเก่ง ปรับตัวเก่งเข้าได้กับคนทุกระดับ ดูดีโดดเด่น มักเป็นคนที่มีสติปัญญาดี ชอบการเรียนรู้ รักการเรียน เพื่อนฝูงรักใคร่ เป็นคนมีน้ำใจเอื้อเฟื้อเผื่อแผ่ \r\n\r\nด้านเสีย ถ้ามีเยอะชีวิตจะลุ่มๆดอนๆ จะดีก็ไม่ดีจะร้ายก็ไม่ร้าย บางครั้งก็ทำให้หลงผิดได้ง่าย แต่มักตกอยู่ภายใต้อิทธิพล ของผู้อื่นได้ง่าย ขี้เหงา มักมีความโดดเดียวในตัวเองสูงมาก เป็นตัวเลขที่แสดงถึงความ ลังเล ใจอ่อน ขี้สงสาร ติดเพ้อฝัน จึงมักถูกหลอกได้ง่าย 96 69 ถ้ามีเยอะชีวิตจะหมุนวนอยู่จุดเดิมไม่ไปไหน\r\n'),
(71, '70', 'R10', -80, 'หมายเลข 70 พลังแห่งเคราะห์กรรม ', 'เป็นเลขแห่งความทุกโศกอย่างแท้จริง ไม่สามารถประสบความสำเร็จในชีวิตได้ และยังมีอุปสรรคต่างๆเกิดขึ้น และมีกรรมเก่าที่ให้ผลรุนแรง บ่งบอกถึงความอำมหิต โรคประสาท อำนาจเร้นลับ อำนาจมืด โรคภัยร้ายแรง การอัตวินิบาตกรรม การถูกคุมขัง ถูกปล้น และภัยธรรมชาติอย่างร้ายแรง มักถูกปล่อยเกาะไว้อย่างโดดเดี่ยว ไม่มีใครให้ความช่วยเหลือ', 'ด้านเสีย 70 07 ผู้ที่ได้หมายเลขนี้ มักมีภัยอุบัติเหตุจ้อง มักเจ็บป่วย มีโรคร้าย หรือมีโรคประจำตัวเรื้อรัง เช่น กระเพาะ ภูมิแพ้ มะเร็ง หรือ มีปัญหาที่เอ็น ข้อต่อ กระดูก หลัง คอ หัว ระบบประสาท เส้นประสาท สมอง กระดูกแตกร้าว เอ็นพลิกเอ็นขาด เป็นต้น คนเลขนี้ใช้ไปนานๆชีวิตมักมีอุปสรรคปัญหารุมเร้า มีคนไม่ชอบหน้าและปองร้าย อาภัพโดดเดี่ยว ชีวิตมีความกดดันสูงมากจนอาจถึงขั้นทำร้ายตนเอง ฆ่าตัวตาย โดนฆ่าตาย หรือทำร้ายผู้อื่นได้ คนเลขนี้มักมีเรื่องให้เครียด คิดมาก ฟุ้งซ่าน เก็บกด กดดัน ทุกข์ เศร้า อมทุกข์ อาภัพรัก มักมีอุบัติเหตุ โดนเอาเปรียบ โดนรังแกโดนทำร้าย มีคดีความ ทะเลาะ ถูกคุมขัง ติดคุกติดตะราง ถูกปล้นจี้ และภัยธรรมชาติอันร้ายแรง ใครที่มีเลขนี้ใช้เลขนี้นานๆ จะมีอำนาจเร้นลับมีอำนาจมืดครอบงำให้คิดผิดตัดสินใจผิด และทำให้เป็นคนเห็นแก่ตัว ใจร้ายใจดำ อาฆาตจองเวร ใช้อารมณ์มากกว่าเหตุผล มักเป็นโรคเครียด หรือเป็นโรคจิตเป็นโรคประสาทอ่อนๆ\r\n\r\nเลขนี้เป็นเลขที่อันตราย แรงกรรมรุนแรง ผู้ได้เลขนี้ถ้ารักตัวเองควรเปลี่ยนออก แต่ถ้าเปลี่ยนไม่ได้ ต้องพยายามควบคุมอารมณ์ให้ได้ ต้องมีสติ ต้องมีสติสมาธิ ต้องทำบูญบ่อยๆเพราะแรงกรรมและความคิดชั่ววูบ อาจก่อให้เกิดปัญหาร้ายแรงอย่างคาดไม่ถึง จนทำให้ทุกข์และเกิดความสูญเสียทั้งชื่อเสียง เงิน งาน แม้แต่ชีวิตของตนเอง\r\n'),
(72, '71', 'R7', -30, 'หมายเลข 71 พลังแห่งการถูกโจมตี', 'การทำงาน ความรัก การเงิน ตำแหน่งหน้าที่การงานจะมีคนขัดขวางไม่ให้ได้ถึงเรา ประสบความสำเร็จยาก มีสิ่งยั่วยุ กิเลสต่างๆมากมาย เข้ามาในชีวิต', 'ด้านเสีย ผู้ที่ได้หมายเลขนี้ เลขคดีความ มีภัยอุบัติเหตุ แสดงถึง การถูกจำกัดอำนาจ การตกจากตำแหน่ง การถูกใส่ร้ายป้ายสี การถูกคุมขังในหน้าที่การงาน การงานจะไม่มั่นคง อุปสรรคจากคนมาก เป็นหมายเลขที่แสดงถึง กาลวิบัติ การหลงมัวเมา ไปในทางผิดๆ ต้องตกอยู่ในสภาพแวดล้อมที่ไม่ดี ถูกเอารัดถูกเอาเปรียบ ถูกเบียดเบียนเอาความดีความชอบ จะมีปัญหาเรื่องรักสามเศร้า ชีวิตจะอาภัพผิดหวังในเรื่องของความรัก แต่งงานช้าหรือไม่ได้แต่ง เป็นเมียน้อย ระวังโรคถุงน้ำดี ไมเกรน\r\n\r\nด้านดี จะมีตำแหน่งหน้าที่การเงินดี การงานดี ตำแหน่งหน้าที่การงานสูง มักจะมีสติปัญญาแตกฉาน เข้าใจอะไรได้ง่าย สามารถหยั่งรู้เหตุการณ์ล่วงหน้าได้อย่างรวดเร็ว'),
(73, '72', 'R10', -70, 'หมายเลข 72 พลังชะตาแข็ง ', 'เป็นเจ้าชะตาที่มีดวงแข็ง ทำอะไรก็ประสบความสำเร็จ ตำแหน่งใหญ่โต อำนาจมาก เงินทอง ลูกน้องมากมาย จึงมักมีปัญหาของลูกน้องเสมอ ให้ระวังสุขภาพด้วย หมั่นทำบุญ นั่งสมาธิจะช่วยให้จิตใจเป็นสุขขึ้น', 'ด้านดี ผู้ที่ได้หมายเลขนี้ แม้จะส่งผลให้ชีวิตประสบความสำเร็จเจริญรุ่งเรืองดี มีดวงชะตาเข้มแข็ง \r\n\r\nด้านเสีย จะมีพลังร้ายเหมือนเลข 27 คือ ชีวิตมักจะวุ่นวายมักจะพบกับอุบัติเหตุ เจ็บตัว ป่วยเรื้อรัง อาภัพรัก บ้านแตกมีการพลัดพราก ขี้เหงา  มักเป็นคนที่มีความคิดเห็นเป็นคนตนเองไม่เชื่อใครง่ายๆ มีความเชื่อมั่นในตนเองสูงมาก ชีวิตมีแต่ความกดดันอย่างรุนแรง มีความทุกข์อยู่ตลอดเวลา บุรุษจะได้รับทุกข์และเสียใจจากเพศตรงข้ามอยู่ตลอด ทั้งเสียใจ เสียเงิน เสียชื่อเสียง ให้ระวังโรคภัยไข้เจ็บเรื้อรัง ในชีวิตมีโชคลาภเข้ามา แต่ก็ต้องสูญเสียสิ่งใดสิ่งหนึ่ง ควบคู่กันไป เรียกว่าทุกขลาภ '),
(74, '73', 'R10', -90, 'หมายเลข 73 พลังดาวบาปเคราะห์ที่ร้ายแรง ', 'ชีวิตมักจะหักเหกลางคัน เป็นอุบัติเหตุ การผ่าตัด การล้ม', 'ด้านเสีย ผู้ที่ได้หมายเลขนี้จะมีชะตาชีวิตเหมือนกับคนเลข 37 ตามอิทธิพลของตัวเลขบ่งบอกถึงการความแตกแยก การทะเลาะวิวาท วิถีชีวิตไม่ค่อยราบเรียบ ลุ่มๆ ดอนๆ อุปสรรคเยอะ ชีวิตหักลงกลางคันด้วยเรื่องร้ายโรคร้าย อุบัติเหตุ หรือเกิดความล้มเหลวผิดพลาดอย่างฉับพลัน ผู้ที่ได้เลขนี้ มักอาภัพรัก บ้านแตก ต้องเลิกรา เลิกร้างไป ไม่จากเป็นก็จากตาย ชีวิตต้องเริ่มต้นใหม่ๆ อยู่เสมอ ต้องระมัดระวังอุบัติเหตุ เจ็บตัวบ่อย การผ่าตัด การล้มละลาย หมดตัว ขาดทุน  ชีวิตมีแต่ความขมขื่น บุตรบริวารมักนำเรื่องเดือดร้อนมาให้ ต้องแบกภาระหนี้สินภาระในครอบครัวแต่เพียงลำพัง อย่าได้จริงจังต่อชีวิตให้มากนัก ระวังโรคที่เกี่ยวข้องกับหัวใจ ความดันโลหิต โรคกรรม โรคมะเร็ง  การผ่าตัด ชีวิตมักมีแต่การสูญเสีย มีการเจ็บป่วยบาดเจ็บที่ขา ช่วงล่าง\r\n\r\nด้านดี เหมือนหมายเลข 37 มีเงินมีฐานะประสบความสำเร็จความสำเร็จในการเงินการงานอย่างได้ แต่จะรวยแล้วล้มซ้ำๆ และอาจรวยแต่ไม่ได้อยู่ใช้ให้คุ้มค่า\r\n'),
(75, '74', 'R7', -20, 'หมายเลข 74 พลังอารมณ์ที่อ่อนไหว ', 'เป็นพลังในด้านดีแต่จะไม่แรงมากคือไม่ลำบากแต่ก็ไม่ถึงกับรุ่งเรืองมาก หน้าที่การงานเงินทองจะพอมีพอใช้ไม่ขัดสน การที่จะให้สำเร็จอย่างก้าวหน้าต้องลดความกังวลและความหวั่นไหวของอารมณ์ออกให้ได้ ทำตนให้หนักแน่นมากยิ่งขึ้น หมั่นสวดมนตร์ภาวนา เจริญสมาธิจะทำให้จิตใจกล้าแกร่งขึ้น', 'ด้านเสีย ระวังจะถูกหลอก จะทำให้ตนเองเป็นทุกข์ มักมีทุกข์ทางใจเกาะกุม มักเพ้อฝันและรวนเร หูเบา ใจอ่อน เชื่อใจคนง่าย ไว้ใจคนอื่นมากเกินไป  เลขนี้ให้ระวังอุบัติเหตุ โดนหักหลัง โดนคนทำร้าย คดีความ ระวังให้ดีหากจับคู่หรือในชีวิตมีเลขร้าย จะยิ่งร้ายและแสดงผลง่าย\r\n\r\nด้านดี ผู้ที่ได้หมายเลขนี้ โดยแท้จริงแล้ว ควรถือว่าเป็นเลขดีด้วยซ้ำ เพราะดาวเสาร์กับดาวพุธเป็นดาวคู่สมพล ย่อมผสมกลมกลืนกันดี จัดว่าเป็นเลขให้ความสำเร็จในการเงินการงานพอสมควร ถ้า.....ปล่อยวางได้ ถ้าตัดความคิดมากเจ้าทุกข์เจ้ากังวล ขี้หงุดหงิดเจ้าอารมณ์ได้จะดีมาก เพราะตัวเลขจักทำเป็นคนที่ใช้เป็นคนที่มีความน้ำใจ เจ้าระเบียบ ขยันหมั่นเพียร มีความมานะพยายามและอดทน สามารถต่อสู้ชีวิต ให้ประสบความสำเร็จได้ ชีวิตเด่นดังได้ และมีคนรักมีคนช่วยเหลือส่งเสริมให้ \r\n\r\n\r\n'),
(76, '75', 'R10', -35, 'หมายเลข 75 พลังต้นร้ายปลายดี ', 'การเดินทางของชีวิตไม่ราบรื่นนักมักจะพบกับอุปสรรค ให้ต้องฟันฝ่า ทั้งการเรียน ความรัก เงินทอง ธุรกิจ ล้วนต้องต่อสู้ทั้งสิ้น ต้องอดทนในการกระทำสิ่งใดๆ แล้วชีวิตจะดีขึ้น ระวังเรื่องวาจากับผู้ใหญ่ อย่าใจร้อนจะดี และตอนท้ายของชีวิตจะดีเอง', 'ผู้ที่ได้หมายเลขนี้ ต้นร้ายปลายดี ถ้าอดทนได้ถึงวันนั้น เพราะตัวเลขบ่งบอกถึงความยุ่งเหยิงปั่นป่วน ปัญหาและอุปสรรคมาก ต้องใช้ความพยายามความอดทนมากจึงจะสำเร็จได้ในทุกอย่าง ถ้าไม่ระวังจะต้องตกจากตำแหน่งหน้าที่การงาน มักถูกใส่ร้ายป้ายสี มีคดีความ ถูกคุมขัง ถูกเอารัดเอาเปรียบ ชีวิตจะประสบความวุ่นวาย ความโกลาหลต่างๆมากมาย แล้วจึงได้ดีในภายหลัง มักกำพร้า มักไม่พอใจในตัวตน มักมีปากเสียงมีข้อขัดแย้งกับผู้ใหญ่ ผู้ใหญ่ให้โทษ ถูกเบียนบังความดีความชอบ ชีวิตจะมีปัญหาเรื่องรักสามเศร้า ถูกคนรักทอดทิ้ง จะผิดหวังในเรื่องของความรัก ป่วย ถูกโกง ความหมายคล้ายๆกับเลข 57'),
(77, '76', 'R10', -90, 'หมายเลข 76 พลังความยากลำบาก', 'เป็นพลังอาถรรพณ์ ส่งผลให้ชีวิตยากลำบาก ไม่สุขสบายมีแต่เรื่องทุกข์ร้อน หาความสุขได้ยาก ลงทุนมักจะขาดทุนเสมอ ความรักไม่สมหวัง โอกาสพลัดพรากสูง', 'ด้านร้าย ผู้ที่ได้หมายเลขนี้ เป็นเลขอันน่ากลัว ด้วยดาวเสาร์กับดาวศุกร์เป็นคู่ศัตรูกัน และดาวสองดวงนี้ ก็บวกกันได้ 13 เป็นเลขให้โทษ ทำให้ชีวิตต้องตกยากลำบากนานและบ่อย ความสุขมีน้อย การเงินติดขัด จะลงทุนทำธุรกิจการงานใดๆก็มักล้มเหลวขาดทุน ต้องพลัดพรากจากคนรักและครอบครัว ต้องโดดเดี่ยว ไร้ที่อยู่มั่นคง ระวังบ้านแตกสาแหรกขาด ครอบครัวแตกแยก ชีวิตอับเฉา ไม่มีความสุขในการสมรส มักร้างคู่หรือขาดความสุขขาดความอบอุ่น มีรักสามเศร้าฉาวโฉ่ เป็นเลขที่มีความขัดแย้งอย่างรุนแรง หมายถึงความตกต่ำในบั้นปลายของชีวิต และให้ระวังโรคภัยไข้เจ็บ ที่เข้ามาเบียดเบียน ระวังโรคกระเพาะปัสสาวะอักเสบ ถุงน้ำดี โรคนิ่ว และโรคไต ผ่าตัด อุบัติเหตุ เกิดปัญหาหนี้สิน ซวยจริงๆสำหรับเลขนี้ แม้มีโชคก็ยังเป็นทุกขลาภ ความหมายคล้ายๆกับเลข 67'),
(78, '77', 'R10', -80, 'หมายเลข 77 พลังแห่งความกดดัน', 'จะประสบความสำเร็จยากเพราะได้รับแรงกดดันสูงถึง 2 เท่า มีอุปสรรคบ่อนทำลายสูง สุขภาพไม่ดี ถูกผู้อื่นเอาเปรียบบ่อยครั้งแต่จะมีคนนับถือสูง บารมีมาก มีเคราะห์ร้ายในชีวิตหลายครั้ง', 'ด้านร้าย อันตรายมากๆ ความหมายคล้ายกับเลข 70 07 เพราะผู้ที่ได้หมายเลขนี้ หมายถึง ดาวเสาร์สององค์ เป็นเครื่องหมายของทุกข์อันทวีตัวสองเท่า ผู้ที่ได้เลขนี้ มักเป็นคน ยึดมั่นถือมั่น ทุกข์สองเท่า เหนื่อย ชอบเก็บกดกดดัน คิดมาก อมทุกข์ ทุกข์เศร้า ฟุ้งซ่าน เจ้าคิดเจ้าแค้น อาฆาตจองเวร อารมณ์แปรปรวน บางครั้งอาจเป็นโรคประสาทได้  วิถีชีวิตมักจะประสบชะตากรรมร้ายๆ ขวางหน้าอยู่เสมอ ต้องต่อสู้กับอุปสรรค และปัญหาอย่างมาก มีความกดดันในชีวิตสูงมาก มีภาระที่ต้องรับผิดชอบมาก มักถูกคุกคามจากคนพาลคนไม่ดี คนเลขนี้มักเจ็บป่วยเป็นโรคร้าย โรคมะเร็ง โรคกรรม โรคแปลกๆ หรือ เกิดอุบัติเหตุรุนแรง โดนคนทำร้าย ระวังการจี้ ปล้น ฆ่า ใครดวงอ่อนห้ามใช้เลขนี้เด็ดขาด\r\n\r\nด้านดี เพราะมีดาวเสาร์สองดวง จึงย่อมจะคุ้มครองตน ให้เข้มแข็ง มีคนยำเกรง และมีอำนาจวาสนา มีตำแหน่งหน้าที่การงานสูง แต่...ก็ไม่เสมอไปทุกคน เพราะต่างคนมีพื้นดวงชะตาต่างกัน คนดวงดี ใช้เลขร้ายก็ยังพอดีได้เพราะพื้นดวงดี แต่คนดวงไม่ดีหรือมีดวงร้าย...เมื่อมาใช้เลขร้ายคือจบเห่เลยนะ เพราะฉะนั้นก่อนจะใช้เลขตามใครๆ โปรดดูดวงตัวเองด้วย และจงพิจารณาถึงข้อเสียของมัน\r\n'),
(79, '78', 'R7', -35, 'หมายเลข 78 พลังแห่งความเดือดร้อน', 'จะมีความระส่ำระสาย วุ่นวาย โกลาหลของชีวิต ประสบแต่สิ่งร้าย ๆ เป็นคนที่อ่อนแอ จิตใจอ่อนไหว มีแต่เรื่องร้ายๆเข้ามาในชีวิต ตกอยู่ในอิทธิพลผู้อื่น อาจจะเกิดคดีความ เสียทรัพย์', 'ด้านร้าย ผู้ที่ได้หมายเลขนี้ เป็นตัวเลขฝ่ายบาปเคราะห์โดยแท้ เพราะเลข 7 คือเลขกรรมเลขทุกข์ เศร้า โรคภัย อุปสรรค เมื่อเจอพลังของราหูคือเลข 8 เข้ามาร่วมด้วย ผลจะทำให้คุณจะเป็นคนหัวรุนแรง เก็บกดกดดัน ผู้ใหญ่ให้โทษ แม้ทำถูกคนยังว่าผิด ชอบใช้อำนาจที่มีไปในทางที่ผิด ทำให้คนอื่นเดือดร้อน ทำกิจการงานใดๆมักสำเร็จยาก อยู่ใกล้ใครมักจะทำให้เขาเดือดร้อนขมขื่นไปด้วย ตัวเลขจะทำให้เกิดความมัวเมาลุ่มหลงได้ง่าย เห็นผิดเป็นถูก เห็นถูกเป็นผิด เป็นคนอ่อนแอ ชีวิตต้องต่อสู้กับอุปสรรคที่ตนเองก่ออย่างเหน็ดเหนื่อย ชีวิตจะต้องประสบกับเรื่องอันร้ายกาจ จงระวังการทำร้ายตัวเอง ฆ่าตัวตาย ฆ่าผู้อื่น ระวังจะเสียทรัพย์ จะมีอุบัติเหตุ หรือคดีความ จงรอบคอบและระมัดระวังเอกสารสัญญา จงอย่าไว้ใจใครแม้แต่ตัวเอง โดยเฉพาะเพื่อนหรือคนข้างกาย ซึ่งจะต้องระวังให้มากอย่าใจอ่อน เชื่อใจคนง่าย เพราะเรื่องร้าย ต่างๆ ที่เกิดขึ้น เป็นเพราะจิตใจท่านอ่อนแอ ปล่อยให้คนอื่นชักจูงชี้นำได้ง่าย ดีต้นร้ายปลาย\r\n\r\nด้านดี 7 กับ 8 เป็นคู่มิตรกัน ตัวเลขจะช่วยสนับสนุนให้มีเสน่ห์ มีโชคลาภ มีเงินทองได้แต่ จงดูดูด้านเสีย\r\n'),
(80, '79', 'D8', 25, 'หมายเลข 79 พลังทรัพย์และสุขภาพ', 'มีโอกาสสำเร็จได้ ฐานะมั่นคง มีเพื่อนมาก มีเงินทองทรัพย์สิน มีมรดกดี ความสำเร็จจะเกิดจากลาภลอยหรือเสี่ยงโชค แต่ระวังการมีสุขภาพไม่ดีหมั่นทำบุญ สวดมนตร์ นั่งสมาธิจะช่วยได้', 'ด้านดี ผู้ที่ได้หมายเลขนี้ เป็นตัวเลขที่ให้คุณปานกลาง ไม่ดีไม่เสีย ถ้าเป็นเลขถูกโฉลกจะแสดงผลดีเต็มที่ คือมักเดินทางบ่อย เป็นคนรักอิสระ ชอบทำบุญ มีจิตใจดีเอื้อเฟื้อ เผื่อแผ่มักมีมิตรสหายมาก มีฐานะมั่นคง จะได้มรดกของเก่าแก่ ดวงจะมีทรัพย์ มีลาภยศขจรไกล การเงิน ลงทุนทำธุรกิจอะไรก็จะประสบความสำเร็จ\r\n\r\nด้านร้าย แต่.....จะต้องเหน็ดเหนื่อย และอดทนในการต่อสู้กับอุปสรรค จึงจะประสบความสำเร็จในชีวิต และความสำเร็จนั้นก็เป็นไปอย่างผาดโผน ให้ระมัดระวัง โรคภัยไข้เจ็บ ป่วยบ่อย มีอุบัติเหตุ จะมีเรื่องมีราว หรือมีคดีความ คนรักนอกใจ มีกิ๊กมีชู้ รักสามเศร้า อาภัพรัก คิดมาก อมทุกข์อมเศร้า มีเงินแต่ขาดรักขาดความสุขที่แท้จริง มิฉะนั้นบุคคลในครอบครัว คงจะเคราะห์ร้ายเจ็บอยู่บ่อยๆ เป็นประจำ\r\n'),
(81, '80', 'R10', -69, 'หมายเลข 80 พลังอัปมงคล ', 'มักจะตกอยู่ในสิ่งแวดล้อมที่ไม่ดี มีความทุกข์ยาก อุปสรรคเสมอๆ ถูกข่มขู่รอบด้าน ถูกคนใช้อำนาจกดขี่ แถมยังมีวิญญาณร้ายมารบกวนอยู่ตลอดเวลา หรือคนเลวมาคอยรังควานเสมอๆ ทำให้ชีวิตไม่มีความสุข', 'ด้านร้าย ผู้ที่ได้หมายเลขนี้มักมีกรรมเก่าหนัก เพราะ 80 มักมีวิญญาณแค้นตามรังควาน บ่งถึงทุกข์ยาก อุปสรรคปัญหารออยู่เบื้องหน้า มักเป็นสัญญาณของภัยพิบัติอันใหญ่หลวง มักถูกครอบงำจากผู้ที่มีอิทธิพล อันธพาล มักถูกคุกคมข่มเหงจากคนไม่ดี ถูกข่มขู่รอบด้านจากอันธพาล หรือ วิญญาณร้ายมักก่อกวน มักจะตกอยู่ในสิ่งแวดล้อมที่ไม่ดี ถูกข่มขู่รอบด้าน มีคนใช้อำนาจทางกฎหมายมากดขี่ข่มเหง ระวังมักถูกหลอกใช้ จะถูกหักหลัง ปล้นจี้ มักหลงผิด ลุ่มหลง มัวเมาชอบท้าทาย ไม่สนคำเตือน กลับโกรธด้วยซ้ำ คุณจะต้องพัวพันกับโบราณสถาน หรือบ้านเก่าวังเก่าๆ ชีวิตวุ่นวาย ระวังโรคตับ โรคถุงน้ำดี ไมเกรน  ระวังอุบัติเหตุร้ายแรง '),
(82, '81', 'R10', -45, 'หมายเลข 81 พลังการพลัดพราก ', 'ชีวิตมักมีการโยกย้ายบ่อย ๆ มักไม่ค่อยได้อยู่กับที่ ไม่ค่อยได้อยู่กับบ้านเกิดเมืองนอน ไม่ว่าหญิงหรือชายจะมีเหตุให้พลัดพรากจากกันไม่จากเป็นก็จากตาย  ยิ่งถ้าเป็นหญิงจะตกเป็นหม้ายไร้สามีหรือต้องไปอยู่ในคนละถิ่นห่างไกล การทำงานจะมีอุปสรรคมีคนกลั่นแกล้งปองร้ายใส่ความ ทำดีให้ตายเขาก็ไม่เห็นค่า ทำคุณคนไม่ขึ้น ปิดทองหลังพระ บางครั้งจึงทำให้ตกงาน ล้มเหลว ขาดทุนได้ ทำให้ชีวิตที่เคย รุ่งโรจน์ตกต่ำลงมาได้อย่าง่ายดาย ไม่แน่นอนขึ้น ๆ ลง ๆ มีสิทธิ์ล้มละลายหมดตัวได้  ทำให้ต้องมีการปลี่ยนแปลงชีวิตบ่อย คนเลขนี้ระวังการทรยศหักหลังและการถูกหลอกลวงจากคนที่เป็นเพื่อน และศัตรูใน ร่างเดียวกัน บางคนอาจเหมือนคนเร่ร่อน ไม่มีความมั่นคง ส่วนเรื่องความรักมักอาภัพคู่มาก ขอให้ระวังอบุัติเหตุฉับพลัน ความล้มเหลว โรคร้ายอย่างฉับพลัน  ชีวิตมักจะพบกับสิ่งที่ไม่คาดคิดเสมอ(ทางร้าย) ทำอะไรต้องรอบคอบ มักจะถูกกดดันและถูกคุกคามจากผู้มีอำนาจเร้นลับ และผู้มีอำนาจไม่เป็นธรรม ถูกศัตรูปองร้าย ชีวิตครอบครัวมีปัญหาแตกร้าว การทะเลาะ วิวาททำให้ชีวิตต้องตกพุ่มหม้ายหรือไร้คู่ ถ้าเป็นชายจะมี่แม่หม้ายเข้ามาพัวพันในชีวิต จะพบกับความขมขื่นในเรื่องความรัก ผิดหวังต้องพลัดพรากจากกันเสมอ คนเลข 18,81 ไม่เหมาะกับการทำงานเสี่ยง ถ้าหลีกเลี่ยงได้ควรจะหลีกเลี่ยง เป็นเลขที่เกี่ยวกับการทะเลาะอย่างรุนแรง ประสบ ปัญหาครอบครัว รวมไปถึงวงศาคณาญาติ  และแถมยังมีอันตรายจากหลาย ๆ สิ่ง เช่น พายุ อันตรายจากน้ำ ไฟและระเบิด ขอให้ระวังโรคเกี่ยวกับตาเอาไว้ด้วย', 'ผู้ที่ได้หมายเลขนี้ มักเป็นเลขอาภัพอับเฉา อีกเลขหนึ่งในบรรดากลุ่มตัวเลขที่ขึ้นต้นด้วยเลข 8 บ่งบอกถึง อุบัติเหตุ ถูกโกง หักหลัง การพนัน การกำพร้า ขาดหลักประกันของชีวิต ไม่มีความแน่นอน มักจะต้องพลัดพรากจากบิดามารดา ชีวิตต้องโยกย้ายบ่อย หรือเดินทางบ่อย อยู่ไม่เป็นที่ ชีวิตเปลี่ยนแปลงบ่อยๆ จะเป็นโรคทางสายตา มีภรรยาหลายคน หญิงจะอาภัพรัก เป็นหม้ายไร้สามี หรือพลัดพรากจากกัน หรือ ต้องทุกข์ใจ มีปัญหาเพราะสามี เลขนี้จะก่อให้เกิดความยุ่งยากวุ่นวายตลอดเวลา แต่คนเลขนี้หากได้เลขมาตั้งแต่กำเนิด บ่งบอกได้ว่าเขามีบุญมากพอสมควร ยังมีโอกาสเปลี่ยนแปลง ชีวิตรุ่งเรืองจะดีขึ้นมาก ถ้ายอมเปลี่ยนแปลงชีวิต เปลี่ยนแปลงพฤติกรรมของ เปลี่ยนความเชื่อและเปลี่ยนความคิดของตน '),
(83, '82', 'R7', -20, 'หมายเลข 82 พลังที่ไม่มั่นคง ', 'ขาดหลักประกันของชีวิต ถูกกดดันทางจิตใจ ไม่มีความมั่นคง ขาดหลักยึดเหนี่ยว ไม่มีความสุขทางใจ ถูกมองข้ามเสมอๆ มีผู้คอยเบียดบังคดี ความชอบ ชีวิตมักจะปล่อยตัวลอยละล่องไปตามบุญตามกรรม ต้องเหนื่อยกับการดูแลให้คนอื่นๆได้สบาย', 'ความหมายเหมือนกับเลข 28 ผู้ที่ได้หมายเลขนี้ มักต้องเจอกับปัญหา บริวารให้โทษ คดีความ หนี้สิน ถ้าไม่ระวังจะล้มละลายเจ็บป่วย คนเกลียดชัง มีปัญหาครอบครัว เกิดความพลัดพรากของคนในครอบครัว พ่อไปทางแม่ไปทาง ลูกไปทาง ชีวิตมักจะพบกับหว้าเหว่ หงอยเหงาถูกกดดันจิตใจ มีผู้เบียดบังความดีความชอบ มักปล่อยตนเอง ให้ลอยละล่องไปตามกระแสน้ำ ไม่ทำใจให้เข้มแข็ง ชายจะไร้คู่ หรือได้คู่แม่หม้าย มีตำหนิ หรือตกพุ่มม่าย ก่อให้เกิดความยุ่งยาก คิดจะทำอะไร มักจะดีตอนแรกพอทำไปนานๆ จะเสีย ลักษณะของชีวิตจะขึ้นๆลงๆ  มักต้องเริ่มต้นใหม่อยู่เสมอ มักกำพร้ามารดา ชีวิตมักจะขาดเสน่ห์ มีอารมณ์ลุ่มหลง มีความทุกข์แอบแฝงอยู่ เป็นคนใจกว้าง กล้าได้กล้าเสีย…'),
(84, '83', 'R10', -60, 'หมายเลข 83 พลังความผิดพลาด', 'ผิดพลาด ใจอ่อนเชื่อใจคนง่าย มีข้อผิดพลาดในชีวิตเสมอทั้งในเรื่องการเรียนการทำงาน ความรักไม่เป็นอย่างที่หวัง ระวังการมีปากเสียงกับผู้อื่นเพราะจะถึงขั้นรุนแรงทำร้ายกันได้ การคบเพื่อนก็ต้องเลือกคบ เพราะคุณจะใจอ่อนชักจูงได้ง่าย ระวังอุบัติเหตุไม่ควรประมาท', 'ความหมายเหมือนกับเลข 38 ผู้ที่ได้หมายเลขนี้ มักเป็นตัวเลข แห่งความแปรปรวน เปรียบเหมือนพายุร้าย ก่อให้เกิดโทสะ เจ้าอารมณ์ เอาแต่ใจตน เกิดการวิวาท ครอบครัวมักแตกแยก แตกหักจากเพื่อนและหุ้นส่วน ชีวิตมักเกิดการทะเลาะเบาะแว้งบ่อยๆ มักมีเหตุให้แตกหักเสียหายอยู่เสมอ แต่บางครั้งก็ใจอ่อน เชื่อใจคนง่าย ระวังอัคคีภัย และภัยจากฝูงชน จากสิ่งสาธารณะเจ็บหรือเสียชีวิตในหน้าที่ ระวังอุบัติเหตุอันร้ายแรงไฟระเบิด ระวังจะต้องผ่าตัด มักถูกคุกคามโดยอันธพาล วิญญาณ หรือชีวิตมักเกี่ยวข้องกับนักเลงอันธพาล ทหารและตำรวจ นักกฎหมาย '),
(85, '84', 'R10', -65, 'หมายเลข 84 พลังเลขร้าย', 'ชีวิตวัยรุ่นจะลุ่มหลงมัวเมา เดินทางผิดติดยา มีแต่ความผิดพลาด ทำการงานใดๆก็ไม่ก้าวหน้า ถูกกลั่นแกล้งไร้ผู้สนับสนุน มีโอกาสเกิดอุบัติเหตุและสุขภาพไม่แข็งแรงมีเรื่องให้ต้องเสียชื่อเสียงความรักไม่ราบรื่นจะอาภัพมาก', 'ความหมายเหมือนกับเลข 48 ผู้ที่ได้หมายเลขนี้ อันตรายมาก ความวิบัติรุนแรงรออยู่เบื้องหน้า คนเลขนี้มัก คิด ทำ ผิดพลาดได้ง่าย และอาจได้รับอันตรายได้ง่ายๆอันเกิดจากตนเองและคนรอบข้าง โดยเฉพาะในวัยเด็ก เพราะฉะนั้นจงเลือกคบแต่เพื่อนที่ดีและให้หลีกหนีคนไม่ดี เพราะจะถูกชักจูง หว่านล้อมจากพวกหลงผิดให้เข้าไปเป็นพวก ทำให้ตกอยู่ในอำนาจแห่งความหลง และจะกระทำสิ่งที่ไม่ถูกต้อง เช่น หลงแสงสี การพนัน ยาเสพติด ชีวิตจะได้รับความเดือดร้อน สูญเสียอย่างใหญ่หลวง ระวังอุบัติเหตุ รุนแรง คดีความ เจ็บป่วยเรื่อรัง โดนหลอกโดนโกง ความซวยทั้งปวง'),
(86, '85', 'R10', -35, 'หมายเลข 85 พลังความหลงผิด ', 'ชีวิตจะหลงผิดไม่มีหลักไม่มีฐาน ต้องย้ายที่อยู่เสมอ การงานต้องเปลี่ยนบ่อยไม่ลงตัว ขาดความอดทน ไม่มีความมั่นคงทางอารมณ์ ความรักฉาบฉวยเดี๋ยวมีเดี๋ยวเลิก มีความเสื่อมเสียเสมอ ตัดสินใจเรื่องใดๆจะผิดพลาดเสมอ', 'ความหมายเหมือนกับเลข 58 ผู้ที่ได้หมายเลขนี้ มักจะเป็นคนหลักลอย เป็นคนหลงผิดได้ง่ายลืมตัว หลงตนเอง มีอุดมคติแบบผิดๆ เอาแต่ใจตัวเองเป็นใหญ่ ไม่ยอมฟังคนอื่น การงานต้องเปลี่ยนบ่อยไม่ลงตัว มักคบคนพาล จะเห็นกงจักรเป็นดอกบัว สุดท้ายจะนำพาชีวิต เข้าสู่ความหายนะได้ หากไม่ระวัง มักจะเป็นเด็กกำพร้าและขาดที่พึ่ง ชีวิตจะมีแต่ความทุกข์วุ่นวาย ชีวิตสมรสมักไม่แน่นอน มักทะเลาะวิวาท อาจทำให้ครอบครัวแตกแยก มีเรื่องชู้สาว รักสามเศร้า ความรักฉาบฉวยเดี๋ยวมีเดี๋ยวเลิก คบควบคู่ ให้ระวังอุบัติเหตุ การถูกลอบทำร้าย จะปองร้ายกลั่นแกล้งและใส้ร้ายนินทา ระวังอุบัติเหตุ ระวังปัญหาหรือโรคที่เกี่ยวกับสายตา ผ่าตัด โรคลำไส้ กระเพาะปัสสาวะอักเสบ โรคไต อัมพฤกษ์\r\n'),
(87, '86', 'R5', -10, 'หมายเลข 86 พลังสำเร็จที่ต้องตั้งใจ ', 'ชีวิตรุ่งเรืองดี มีความมั่นคงสูง ฐานะความเป็นอยู่ดีมาก มีชื่อเสียง อำนาจ วาสนา แต่ต้องระวังในด้านตัณหาต่างๆจะเข้าครอบงำ ต้องมีความมั่นคงไม่ประมาทจะดี', 'ความหมายเหมือนกับเลข 68 ผู้ที่ได้หมายเลขนี้ มักเป็นคนที่มีบุคลิกสองลักษณะ ในทางโลกจะส่งผลดีให้กับชีวิต ส่งผลให้พบกับความสำเร็จได้ง่าย เงินทองหาง่าย ใช้เงินเก่ง  แต่ในอีกด้านหนึ่ง ก็มักประพฤติผิดศีลธรรม ลุ่มหลงมัวเมา เสพอบายมุข ทางด้านโลกีย์ ชอบคบชู้ มักมากในกาม เอาแต่ใจตนเอง เป็นคนจู้จี้ ขี้บ่น เบื่อกับการอยู่กับที่เป็นเวลานาน ชอบความเปลี่ยนแปลงอยู่ตลอดเวลา ให้ระวังระบบย่อยอาหาร'),
(88, '87', 'R7', -35, 'หมายเลข 87 พลังรักลวง ', 'จะถูกชักจูงได้ง่ายไปในทางเสื่อมเพราะขาดความหนักแน่น ตัดสินใจผิดเสมอๆ ชอบฟังคนอื่นมากกว่าความคิดเห็นตัวเอง เป็นคนดึงดูดเพศตรงข้ามมากแต่หาคนจริงใจยาก', 'ผู้ที่ได้หมายเลขนี้ เป็นเลขกำลังของดาวเคราะห์สองตัว เมื่อนำมาบวกกันจะได้เลข 15 คือกำลังของดาวจันทร์ ซึ่งบ่งบอกได้ว่าเป็นคนใจอ่อน หัวอ่อน เห็นใจคนง่ายมักอมทุกข์ เจ้าอารมณ์เชื่อคนง่าย ดูโดยรวมแล้วเป็นคนไม่กล้าตัดสินใจ โลเลเป็นไม่หลักปักเลน อาศัยให้เป็นหลักไม่ได้ โอนไปแล้วก็โอนมา เอนไปแล้วก็เอนมา ไม่หยุดนิ่ง ทำให้เป็นคนอ่อนแอ วิถีชีวิตจะต้องประสบปัญหาต่างๆ มากมาย ถูกกลั่นแกล้งถูกเอารัดเอาเปรียบ มักเสียเปรียบคนอื่นอยู่เสมอมักถูกกดดันให้โทษ ชีวิตบั้นปลายจะตกต่ำ และอาจมีชีวิตไม่ถึงบั้นปลาย หากมีเลขร้ายอื่นๆเยอะ เพราะตัวเลขนี้มักประสบอุบัติเหตุ และมักทำร้ายตัวเอง หรือ ทำร้ายผู้อื่น \r\n'),
(89, '88', 'R10', -75, 'หมายเลข 88 ความสำเร็จที่แฝงอันตรายร้ายแรง ', 'การทำสิ่งใดๆจะสำเร็จได้อย่างดีแต่จะต้องมีอุปสรรคอย่างมาก เป็นคนเก่งในทุกๆด้าน มั่นคงในชีวิตสูง ทำอะไรดีได้ผลเกินคาด ทะเยอะทะยานสูง เมื่อถึงขีดสุดจะเจออุบัติเหตุร้ายแรงได้', 'ด้านเสีย อันตรายมากๆ หมายเลข 88 หมายถึง ดาวราหูสองตัว และหมายถึงดาวอังคารสองตัว บ่งบอกถึงดาวราหูบวกดาวอังคารกำลังสอง คนที่ใช้จะใจร้อย หงุดหงิดง่าย เจ้าอารมณ์ ชีวิตจึงจะเหนื่อยวุ่นวายมาก ทั้งตัวเองและบริวารมักทำให้เดือดร้อนวุ่นวาย สุดท้ายจะมีคดีความ ถูกจับ ถูกตรวจสอบ อาจติดคุกติดตะรางได้ และเลขยังทำให้เจ้าชู้ มีกิ๊กมีชู้ โดนหลอกโดนโกงโดนหักหลัง เกิดอุบัติเหตุหรือเจ็บป่วยตายผิดธรรมชาติ\r\n\r\nเลขนี้แม้ชีวิตจะดีรวยมั่นคงในเบื้องต้น แต่ถ้าประมาทไม่ระวัง สุดท้ายก็รวยน้อยลงแทบทุกคน บางคนหนักถึงขนาดหมดตัว ล้มละลายลงได้เลย หรือที่ร้ายแรงที่สุด คือ เสียชีวิตไปก่อนเวลาอันควร เพราะเลขนี้จะทำให้หลงผิด ตัดสินใจได้ง่าย ลืมตัว หลงตัวเอง เอาแต่ใจตัวเองเป็นสำคัญ โลภ มักเห็นกงจักรเป็นดอกบัว มักไปข้องเกี่ยวกับคนไม่ดีคนพาล หรือ สิ่งผิดกฎหมาย อบายมุข การพนัน เหล้ายา ผู้หญิง และเรื่องผิดศีลธรรม จึงมักตกต่ำลงในที่สุด และทำให้มีอุปสรรคปัญหาและเรื่องร้ายๆเกิดขึ้นอย่างที่ไม่ควรจะเกิด หมายเลขนี้ไม่เหมาะกับทั้งชายและหญิง เพราะจะมีปัญหาเรื่องคู่ อาจได้แต่งงานช้าหรือไม่ได้แต่ง หรือแต่งแล้วปัญหาเยอะจนอาจต้องเลิกกัน ส่วนมากจะพลัดพรากจากกันไม่จากเป็นก็ตาย หลายคนมักเป็นเมียน้อย หรือสามีมีกิ๊กมีชู้จนต้องเลิกลาหย่าร้างเป็นหม้าย รักมักไม่สมหวัง และมักจะเสียชีวิตโดยผิดปกติไม่เหลือซาก หรือ สูญหาย โดนฆ่า โดนอุ้มหาย ฆ่าตัวเอง ติดคุก หนีคดี  ถ้าดวงแข็งมักจะเจ็บป่วยด้วยโรคร้าย โรคมะเร็ง โรคกรรม มีคดีติดตัว\r\n\r\nด้านดี ผู้ที่ได้หมายเลขนี้ มักเป็นตัวเลขที่จะนำท่านไปพบกับความสำเร็จในแบบผาดโผน ชีวิตจะเจริญรุดหน้าอย่างรวดเร็ว รวย มั่งคั่งด้วยเงินทอง แต่ไม่ยั่งยืน\r\n'),
(90, '89', 'R7', -35, 'หมายเลข 89 พลังแห่งความเชื่อ ', 'ทำอะไรมักจะทำตามคำพยากรณ์ต่างๆ เชื่อถือในโชคชะตาอย่างมาก บางครั้งเชื่ออย่างไม่ฟังใครเลย เป็นคนมีสติปัญญาดี เป็นคนมีความทะเยอทะยานมากเกินไปเลยทำให้ไม่ค่อยมีความสุข และไม่ค่อยมีใครเข้าใจมากนัก เป็นคนเข้มงวดกับชีวิต', 'ด้านเสีย จะเอาแต่ใจตัวเอง ดื้อ ไม่ค่อยมีความสุข ไร้มิตรแท้จริงใจ เข้ากับผู้อื่นไม่ค่อยได้ พวกพ้องที่มีล้วนเข้าหาเพราะผลประโยชน์และเงินตรา สุดท้ายมักจะมีปัญหาเรื่องความรัก มีปัญหาคดีความแทบทุกคน มีภัยอุบัติเหตุ โดนกลั่นแกล้ง หักหลัง โดนโกงโดนหลอก ปองร้าย และมักไปข้องเกี่ยวหรือเขาเข้ามาเกี่ยวข้องพัวพันกับเราทั้งกับคนพาล ผู้มีอิทธิพล อบายมุข เหล้ายา เรื่องเทาๆ เป็นต้น\r\n\r\nด้านดี 89 ผู้ที่ได้หมายเลขนี้ เป็นตัวเลขดีให้คุณปานกลาง ถ้าจะใช้ต้องระวัง ห้ามมีเยอะ และอย่านำไปใช้กับเลขอันตราย เพราะความร้ายแรงจะเพิ่มเท่าทวี แต่ถ้านำไปใช้กับเลขดี ความดีก็จะเพิ่มเท่าทวีเช่นกัน คนที่ได้หมายเลขนี้ จะฉลาด มีสติ มีไหวพริบปฎิภาณเป็นเลิศ ช่างสังเกต ช่างวิเคราะห์มีเหตุมีผล สนใจใฝ่เรียนรู้กว้างขวาง เรียนรู้ไม่หยุดนิ่ง มีความมุ่งมั่นสูง อดทนสูง รับผิดชอบงานต่างๆได้เป็นอย่างดี มีลางสังหรณ์ ดวงมักมีโชคลาภอย่างไม่คาดฝัน ทำเรื่องเก่าๆเรื่องเทาๆจะเจริญรุ่งเรืองดีอย่างโลดโผน มีพวกพ้องมาก ชอบสังคม และลุ่มหลงมัวเมา ถ้าใช้กับคู่เลขดีก็ดี แต่ถ้าใช้กับคู่เลขร้ายก็ร้าย จะลุ่มหลงไปในทางเสื่อม\r\n\r\n'),
(91, '90', 'D8', 45, 'หมายเลข 90 พลังสิ่งศักดิ์สิทธิ์คุ้มครอง', 'ชีวิตมักจะพัวพันกับสิ่งศักดิ์สิทธิ์และวิญญาณตลอดเวลา ได้รับอิทธิพลจากไสยศาสตร์ โชคลางต่างๆมาก เป็นคนดวงดีสิ่งที่มองไม่เห็นจะปกป้อง ในชีวิตจะประสบความสำเร็จพอสมควร แคล้วคลาดจากอันตรายทั้งปวงเสมอ แต่ก็ไม่สำเร็จแบบที่สุดชีวิตเรียบง่ายค่อยๆเป็นไป', 'ด้านดี ผู้ที่ได้หมายเลขนี้ จะมีสิ่งศักดิ์สิทธิ์คอยให้ความช่วยเหลืออยู่ตลอดเวลาทั้งเทพเทวา และผีวิญญาณ ชะตาชีวิตราบรื่นดี หยิบจับอะไร มักจะประสบความสำเร็จลุล่วงได้เป็นอย่างดี มีผู้หลักผู้ใหญ่ให้การสนับสนุน ส่งเสริมให้ประสบความสำเร็จ ในหน้าที่การงาน มีความเป็นอยู่ที่สุขสบาย ชีวิตมีอุปสรรคน้อย มักลำบากไม่นาน เพราะมีสิ่งศักดิ์สิทธิ์คอยคุ้มครอง ส่งเสริมหนุนนำชีวิต ให้มีความสุข ความเจริญ และร่ำรวยมั่นคงพอสมควร\r\n\r\nด้านเสีย ถ้าเป็นคนดีจะดี ถ้าเป็นคนไม่ดีผีและเทพเทวาจะให้โทษ เลขนี้จะทำให้คนที่ใช้ชีวิตประสบความสำเร็จดี แต่เหมือนยังดีไม่สุด ต้องระวังอย่านำไปใช้กับเลขร้ายๆ เช่น ทะเบียนรถ 9037 ถ้าเจอแบบนี้จะประสบอุบัติเหตุได้ง่าย เพราะเลข 90 เป็นเหมือนประตูเปิดไปหาทั้งนรกสวรรค์ ถ้ามีกรรมเก่าแรงต้องระวังเพราะเลขนี้ถ้าจับคู่กับเลขดีจะยิ่งดี เลขดีจะช่วยลดพลังของดาวมฤตยูได้ แต่ถ้านำไปใช้คู่กับคู่เลขร้าย ความร้ายก็จะเพิ่มทวีเช่นกัน\r\n'),
(92, '91', 'R5', -14, 'หมายเลข 91 พลังความ', 'รักความก้าวหน้าความสำเร็จ มีความมุ่งมั่นสูง แสวงหาความสำเร็จให้ชีวิต เชื่อเรื่องสิ่งมองไม่เห็น ชอบเก็บตัว เก็บความทุกข์ไว้กับตัว ไม่สบายบ่อย ต้องรักษาสุขภาพให้ดี เป็นคนขี้เหงามาก', 'ด้านดี ผู้ที่ได้หมายเลขนี้ มักบ่งบอกถึง ความทะเยอทะยาน ความก้าวหน้าในชีวิต มักแสวงหาของแปลกๆ ใหม่ๆ อยู่เสมอ ชอบศึกษาหาความรู้ชีวิตจะประสบความสำเร็จได้ไม่ยาก มักได้รับการอุปการะ จากผู้หลักผู้ใหญ่หรือผู้มีอำนาจ เป็นหมายเลข ที่ให้โชคลาภเสมอ ได้รับเกียรติในแวดวงสังคม ส่งผลให้ชีวิตประสบความสำเร็จ การงานดีมาก แต่………เพราะมีพลังแฝงของเลข 10 (1+9)\r\n\r\nด้านเสีย ของเลข 19 91 จึงมีผลทำให้คนที่มักมีปัญหาครอบครัว บริวารมักทำให้ทุกข์ใจและกาย ชีวิตไม่ค่อยมีความสุข ต้องมีเรื่องทุกข์ใจกังวลใจ มีภาระหนักอึ้งที่ต้องรับผิดชอบคนเดียว ครอบครัวขาดความอบอุ่นและไม่ค่อยเข้าใจกัน ไม่มีเวลาให้กัน เป็นคนชอบเก็บตัว อมทุกข์ โลกส่วนตัวสูง หญิงหรือชายใช้มักมีมือที่สาม หย่าร้าง เป็นหม้าย ต้องระวังคำพูด ถ้าอดทนได้อยู่กันได้ ก็มักทะเลาะกันไม่ลงรอยกัน ไม่เข้าใจกัน มักมีโรคภัยไข้เจ็บคอยเบียดเบียน มีพลังอุบัติเหตุตาม ระวังโรคตา ความดัน โรคหัวใจ โรคข้อ ป่วยบ่อย คนเลขนี้แม้จะมีเพื่อนเยอะก็รู้สึกเหงาและรู้สึกโดดเดี่ยว ระวังจะมีปัญหากับพ่อแม่แฟนและญาติแฟน คนเลขนี้บั้นปลายมักโดดเดี่ยวเดียวดาย\r\n'),
(93, '92', 'R7', -25, 'หมายเลข 92 พลังอนุรักษ์นิยม ', 'ชอบสิ่งแปลก ๆ ใหม่ ๆ สนใจในศาสตร์แปลก ๆ สนใจประวัติศาสตร์ ชอบของโบราณ สนใจเรื่องราวในอดีต ชอบศึกษาในขนบธรรมเนียมประเพณีโบราณอย่างจริงจัง ชอบท่องเที่ยว สร้างสีสันให้กับชีวิตอ่อนโยนแต่ระวังการถูกชักจูงง่าย', 'ด้านดี ผู้ที่ได้หมายเลขนี้ เป็นเลขเดียวกับเลข 29 ชีวิตมักชอบเดินทางท่องเที่ยว ชอบสิ่งแปลกๆ ใหม่ๆ มักสนใจในศาสตร์แปลกๆ และมักชอบของโบราณ สนใจประวัติศาสตร์ ขนมธรรมเนียมประเพณีโบราณ ใจอ่อน ชอบบทกวีนิพนธ์ ทำอะไรมักจะดีตอนต้น \r\n\r\nด้านเสีย ดีต้นตอนปลายจะตกต่ำลง ชีวิตมักจะอยู่ในสภาวะแวดล้อมที่ไม่ดี มักถูกกลั่นแกล้ง ชอบถูกเอารัดเอาเปรียบจากเพศตรงข้าม และตัวตนก็เป็นคนไม่ดีชอบเบียดเบียนสร้างปัญหาให้คนอื่นอยู่ตลอดเวลา ต้องระมัดระวังในการไว้วางใจคน เพราะอาจจะถูกหลอกได้ง่าย แฟนนอกใจ พลังอุบัติเหตุแรง\r\n'),
(94, '93', 'R10', -45, 'หมายเลข 93 หลังความสำเร็จที่รุ่มร้อน ', 'ชีวิตมักจะประสบผลสำเร็จอยู่เสมอมีความก้าวหน้าในหน้าที่การงาน จะสร้างสร้างเนื้อสร้างตัวได้ดี แต่ระวังอารมณ์ที่รุนแรงไม่ยอมใคร จึงไม่ค่อยมีคนช่วยเหลือเท่าที่ควร ระวังโรงภัยสุขภาพด้วย หมั่นใจเย็นสวดมนตร์ทำสมาธิจะดี', 'ด้านเสีย เป็นคนมุทะลุ ลุ่มหลงมัวเมา เป็นคนที่มีความแข็งกร้าวเจ้าคิดเจ้าแค้น จะมีเรื่องกระทบจิตใจ หรือกดดันทางจิตใจอยู่ตลอดเวลา คิดมาก หมกมุ่นแต่ในเรื่องอดีต  เรื่องที่ไม่ดี ส่วนเรื่องที่ดีกลับไม่คิด ระวังชีวิตมักจะประสบกับอุบัติเหตุอยู่เสมอ ทำอะไรมักใช้อารมณ์ ชีวิตสมรสมักไม่แน่นอน แฟนนอกใจ มีชู้ ตัวเองก็มักมีชู้ คาดหวังอะไรกับชีวิต มักไม่ได้ตามนั้น แต่สิ่งที่ไม่ได้คาดหวังกับได้ และมักเป็นโรคแปลกๆ ต้องผ่าตัด เมาเหล้า ติดยา ติดอบายมุข ติดการพนัน คบคนไม่ดี มีคดีความ ติดคุกติดตะราง มักทำผิดกฎหมาย มักเกิดอุบัติเหตุรุนแรงที่มีไฟมีระเบิดเข้ามาเกี่ยวข้อง คนเลขนี้มักมั่นใจในตนเอง เจ้าอารมณ์ ใจร้อน เอาแต่ใจ ขี้บ่น เพ้อเจ้อ ชอบหาเรื่องทะเลาะ เจ้าทุกข์ คิดมาก เครียด เป็นผู้ที่มีความวุ่นวายและสับสนในชีวิต จิตใจ ชีวิตมักมีความกดดันสูง คิดมากจนเป็นประสาท จนทำร้ายตัวเอง ทำร้ายผู้อื่น ถ้าจะใช้เลขนี้ต้องให้สำหรับคนที่ใช้เลข 3 ได้ และต้องมี 45,95,59 ประกบ และควรมีไว้ด้านหน้าของเบอร์โทรเท่านั้น\r\n\r\nด้านดี ประสบความสำเร็จในเงินงาน การทำธุรกิจ เลขนี้ดีเด่นเรื่องเงินงาน เด่นเรื่องการต่อสู่แข่งขัน แข่งงาน แข่งสอบมักจะชนะคู่แข่ง จะที่มีผู้ใหญ่และเพื่อนบางคนคอยช่วยเหลือค้ำชู \r\n'),
(95, '94', 'R10', -15, 'หมายเลข 94 พลังหลงงมงาย ', 'ชีวิตก้าวหน้าไปด้วยดีแต่มักจะมีอุปสรรคตามมาเป็นเงาตามตัว สนใจทั้งศาสตร์เร้นลับมากเกินไปทำให้ความเจริญด้านอื่นๆไม่เต็มที่ ความรักไม่ราบรื่นนัก มีอุปสรรคค่อนข้างมาก บางครั้งมีสิ่งพลิกผันกับชีวิตได้', 'ด้านเสีย ความหมายเหมือนเลข 49 ผู้ที่ได้หมายเลขนี้ หมายเลขนี้บวกกันได้ 13 ถือเป็นสัญลักษณ์ของความเสื่อม ความผิดหวังความอมทุกข์ ความอับโชค ความขัดข้องทั้งมวล แม้ชีวิตจะสามารถเจริญก้าวหน้าไปได้ด้วยดี แต่อุปสรรคก็มักจะติดตามมาเป็นเงาตามตัว ชีวิตมักมีมุมหักเหอยู่เสมอ ชีวิตมักถูกกดดัน ถูกกลั่นแกล้งอยู่เสมอ ต้องเริ่มต้นใหม่เสมอ ชีวิตสมรสมักไม่แน่นอน ครอบครัวแตกแยก ชอบทำอะไรตามใจตนเอง ให้ระวังจะเจ็บป่วย ระวังการผ่าตัด และโรคนิ่ว โรคไต โรคกระเพาะปัสสาวะ อุบัติเหตุ\r\n\r\nด้านดี ประสบความสำเร็จในการงาน การเงินเป็นอย่างดี **ถ้าดวงชะตาสามารถใช้ได้'),
(96, '95', 'D10', 80, 'หมายเลข 95 พลังความสำเร็จบารมี ', 'เป็นเลขมงคล มีพลังเต็มที่ มีผลดีมากๆ ใครได้เบอร์นี้เลขนี้จะเป็นผู้โชคดีอยู่เสมอ มีคนคอยช่วยเหลือเกื้อกูลและเมตตาคุ้มครองทั้งเบื้องบนและเบื้องล่าง อนาคตดี มีเกียติยศชื่อเสียง มีคนนับถือมาก เข้ากับผู้ใหญ่ได้ดี  คิดทำสิ่งใดก็สมหวัง เสริมดวงการงานและช่วยเสริมดวงเรื่องคู่ครองให้ดีขึ้นให้รักคุณมากขึ้นจะได้เกื้อกูลกันตลอดไป หรือ เสริมให้ได้คู่ครองที่ดีได้ มีความรักที่สดใสเสมอ มีคู่ครองที่ดี อยู่เคียงข้างกันไม่ทิ้งกัน ที่สำคัญ ควรรู้ไว้คนที่ใช้เลขนี้จะฝักใฝ่ในความดี อยู่ในศีลธรรมอันดี แม้ไม่ชอบทำบุญก็จะมีมิตรที่ดีมาชักจูงให้เข้าสู้ทางธรรมเสมอ ถ้าหมั่นทำบุญสวดมนต์จะหยั่งรู้เหตุการณ์ล่วงหน้าได้ ตกน้ำไม่ไหลตกไฟไม่ไหม้ เจริญรุ่งเรืองยิ่ง  มักได้รับการยกย่องจากปวงชน  มีชื่อเสียงมาก  มีความสุขในชีวิต เหมาะสำหรับ นักการเมือง เจ้าของธุรกิจ หัวหน้างาน ลูกน้อง ผู้บริหารเจ้าของกิจการ ดารานักแสดง พ่อค้าแม่ค้า นับว่าเหมาะเกือบทุกอาชีพ แต่ขอเตือนว่าถ้าคุณเป็นคนชั่วห้ามใช้เพราะจะเลขนี้ถ้าทำบุญจะเห็นเร็ว ทำชั่วก็จะยิ่งเห็นเร็วกว่าคนอื่นเขาเช่นกัน แต่ถ้าในอีกแง่หนึ่ง เลขนี้จะสามารถทำให้คนที่ยังชั่วไม่มากกลับกลายเป็นคนดีได้', 'ด้านดี เป็นเลขดีมากๆ ผู้ที่ได้หมายเลขนี้ จะเป็นผู้โชคดีอยู่เสมอ เงินงานดีอุดมสมบูรณ์ จะมีคนคอยช่วยเหลือและคุ้มครอง มีเกียติยศชื่อเสียง มีคนนับถือมาก อยู่ในศีลธรรมอันดี หยั่งรู้เหตุการณ์ล่วงหน้า จะมีคู่ครองดีรักคุณมาก เกื้อกูลกันตลอดไป ตกน้ำไม่ไหลตกไฟไม่ไหม้ เลข 95 เป็นตัวเลขที่บ่งบอกถึงความสำเร็จ มักเลื่อมใสและสนใจทางด้านศาสนา ชอบความเร้นลับ ชอบความบริสุทธิ์ยุติธรรม เชื่อเรื่องวิญญาณ ชอบในพิธีกรรมและโชคลาภต่างๆ เป็นคนมีลางสังหรณ์ ถ้าเป็นนักบวชที่มีศีลก็จะประสบความสำเร็จได้อย่างดีเยี่ยม มักจะได้รับการยกย่องจากปวงชน เป็นเลขศักดิ์สิทธิ์เป็นเลขต่ออายุ ต่อชะตา จะเป็นยันต์คุ้มภัย คุ้มครองตนเอง ให้แคล้วคลาดจากภัยอันตรายได้ ความหมายคล้ายเลข 59'),
(97, '96', 'D5', 1, 'หมายเลข 96 พลังที่อ่อนแอ ', 'เป็นคนใจอ่อน มักถูกชักจูงให้หลงผิดได้ง่าย ไม่ความความเชื่อมั่นในตนเองขาดความแกร่งทางจิตใจ อารมณ์อ่อนไหว มีโอกาสเดินทางผิดมัวเมาลุ่มหลงได้ มีความคิดฝันที่ดีเป็นประโยชน์กับตนเองแต่นำมาใช้ดูแลตนไม่ได้ ทำอะไรครึ่งๆกลางๆ', 'ด้านเสีย ผู้ที่ได้หมายเลขนี้ เป็นเลขที่บ่งบอกถึง ความขัดแย้งในตนเอง การเข้ากันไม่ได้ ความสับสนในการกระทำของตัวเอง จิตใจอ่อนแอโลเลเปลี่ยนใจง่าย ทำอะไรไม่เป็นชิ้นเป็นอัน ชีวิตไม่มีพลังในตัวเอง ชีวิตสุกๆ ดิบๆ เอาดีไม่ได้ ครึ่งๆ กลางๆ เป็นคนที่มีจิตใจอ่อน ถูกชักจูงได้ง่าย ประเภทพวกมากลากไป ถ้าพบคนดีก็ดีไปตามเขา ถ้าพบคนชั่วก็ชั่วไปตามเขา ทำอะไรก็ขอให้ตั้งใจ ในการกระทำนั้นอย่าทำเล่นๆ เลือกคบคนดี ชีวิตก็สามารถประสบความสำเร็จได้ไม่ยาก ถ้าจะใช้เลข 96 69 ต้องระวังอย่าให้มีมากกว่าหนึ่งคู่ในชีวิต หรือ ในเบอร์ ไม่งั้นชีวิตจะไม่ไปไหนวนเวียนกลับไปกลับมา\r\n\r\nด้านดี เงินดี มีเสน่ห์ มีคนรักมาก มองโลกในแง่ดี สติปัญญาดี ใฝ่รู้ ดีที่ผู้ใหญ่ให้ความอุปถัมภ์ค้ำชู'),
(98, '97', 'D8', 35, 'หมายเลข 97 พลังความรุ่งโรจน์ ', 'ชีวิตจะก้าวหน้ารุ่งโรจน์ดี มีเพื่อนฝูงมาก คิดการงานสิ่งใดจะประสบผลสำเร็จ การค้าขายมีกำไร จะได้ทำงานในตำแหน่งสำคัญๆ มีคนเคารพ มีเพื่อนมาก มักเข้มแข็งในหน้าที่การงาน มีสมรรถภาพดีเยี่ยม แต่ในชีวิตต้องระวังอุบัติเหตุ อย่าประมาท อาจถูกทำร้ายจากวิบากกรรมเก่าได้ ต้องหมั่นทำบุญจะช่วยได้ดี', 'ด้านดี ผู้ที่ได้หมายเลขนี้ เป็นตัวเลขที่บ่งบอกถึง ความสำเร็จอีกเลขหนึ่งให้คุณปานกลาง ชีวิตจะก้าวหน้ารุ่งโรจน์ดี ประสบความสำเร็จในตำแหน่งหน้าที่การงาน ค้าขายดี มีกำไรงาม ถ้าตัวเลขถูกโฉลกผู้นั้นใช้ได้ จะทำให้ร่ำรวยด้วยทรัพย์สินเงินทอง มีคนเคารพนับถือ มีเกียรติในสังคม มีเพื่อนมากมาย ชอบท่องเที่ยวชอบเดินทาง มีสมัครพรรคพวกมาก เป็นคนจริงใจพูดอะไรตรงไปตรงมา มักมีจิตใจเข้มแข็งในการทำงาน มีสมรรถภาพที่ดีเยี่ยม เป็นหัวหน้าที่ลูกน้องยำเกรงเป็นคนดวงมีทรัพย์ มีมรดก จะมีลาภยศขจรกระจายไปทั่ว ชีวิตจะประสบความยากลำบากในชีวิตก่อนแล้วจึงค่อยประสบความสำเร็จในภายหลัง\r\n\r\nด้านเสีย หากจะใช้ต้องมั่นใจว่า เลขถูกโฉลก แม้ถูกโฉลกก็ต้องทำบุญต่ออายุทุกปี เพราะเลขนี้หากตัวเลขเขาแสดงผล หากมีเยอะ จะทำให้ผู้ที่ครอบครองมีคดี มีเรื่องวิวาทบาดหมาง มีกิ๊ก มีชู้ เจ็บป่วย ระวังชีวิตจะประสบอุบัติเหตุ อาจโดนปองร้ายจากศัตรู เนื่องเพราะกรรมเก่า\r\n'),
(99, '98', 'R10', -35, 'หมายเลข 98 พลังลาภลอย ', 'จะประสบความสำเร็จอย่างดีกับการทำงาน การค้า การลงทุนต่างๆ มีโอกาสได้ลาภลอย ชอบทำอะไรไม่ตามใครพิเศษน่าสนใจ มีคนคบค้าสมาคมมาก มีความสุขดี แต่อาจจะมีโอกาสหลงมัวเมาในบางเรื่องมากเกินไป ระวังการคบเพื่อนที่ไม่ดี', 'ด้านเสีย ให้ระวังอย่าคบคนเลวคนพาลเพราะจะพาชีวิตตกต่ำ จะซวย จะมีคดีความ มีเรื่องมีราว ถูกทำร้ายได้ คนเลขนี้เมื่อได้ขึ้นหลังเสือแล้วชีวิตจะถอนตัวจากสิ่งเลวร้ายได้ยาก มักสนใจในสิ่งศักดิ์สิทธิ์จนลุ่มหลง จนถอนตัวไม่ขึ้น และชีวิตจะตกอยู่ในสภาพแวดล้อมที่ไม่ดี ถูกกลั่นแกล้ง ถูกกดดันได้ง่าย มีอารมณ์ฉุนเฉียว และขัดแย้งกับคนอื่นได้ง่าย ที่สำคัญระวังจะไปหลอกลวงผู้อื่น\r\n\r\nด้านดี ผู้ที่ได้หมายเลขนี้ เป็นเลขดีอีกเลขหนึ่ง ชีวิตจะสำเร็จได้อย่างโลดโผน ชีวิตจะประสบความสำเร็จได้ดี มีโชคลาภ มีเงินทองมีพวกพ้องมาก มักทำอะไรแปลกๆ มักแหวกแนว ความหมายคล้ายเลข 89'),
(100, '99', 'D8', 60, 'หมายเลข 99 พลังการหยั่งรู้', 'เป็นเลขบ่งถึงความสำเร็จอย่างมหัศจรรย์ ได้พลังจากสิ่งเร้นลับในจักรวาลให้การช่วยเหลือ มีพรสวรรค์ทางอำนาจจิต สนใจเรื่องศาสตร์และศาสนา จะมีโชคลาภฟลุ๊ก ๆ อยู่เสมอ เป็นคนมีลางสังหรณ์ติดต่อกับวิญญาณได้ ทำอะไรมักจะพลัง ไปอยู่ที่ไหนมักจะเจอแต่เรื่องของขลัง แม้สถานที่อยู่ก็มีวิญญาณดีสถิตอยู่สามารถสัมผัสกับสิ่งที่มนุษย์ทั่วไปไม่สามารถรู้ได้ มีลางสังหรณ์หรือญาณพิเศษดีเยี่ยม มีพลังดีต่อจิตใจ อำนาจจิตเข้มแข็ง ทำอะไรก็มีสิ่งที่มองไม่เห็นคุ้มครองอยู่ สนใจในศาสนา ปรัชญา  เลขนี้ถ้าเป็นคนที่สนใจใฝ่ธรรมจะดีมากจะเจริญรุ่งเรืองมีความสุขดีตลอด แต่ถ้าทำไม่ดีก็จะเห็นเร็วเช่นกัน แนะนำว่าก่อนใช้ให้เช็คพื้นดวงก่อนเพราะเลขนี้แม้จะดีแต่ก็มีอันตรายแอบแฝง คนที่จะใช้ต้องเป็นคนดี และต้องหมั่นทำบุญอยู่เสมอ ต้องมีดวงเศรษฐีเจ้าใหญ่นายโต ถ้าคนทั่วไปอนุญาติให้มีได้แค่คู่เดียวเท่านั้นและต้องไม่ใช่เลขคู่สุดท้ายในเบอร์', 'ด้านดี ผู้ที่ได้หมายเลขนี้ ถือว่าเป็นเลข 9 สองตัว บ่งบอกถึงความสำเร็จอย่างน่ามหัศจรรย์ ได้รับพลังสิ่งเร้นลับในจักรวาล ทำดีเห็นผลไว ได้ผลเร็ว เป็นผู้ที่มีพรสวรรค์ทางด้านโลกเร้นลับ มีอำนาจจิตหยั่งรู้ล่วงหน้า ฝันแม่น ใฝ่เรียนรู้ ชีวิตมีความทะเยอทะยาน มีความมั่งคั่ง ร่ำรวยได้เร็ว เป็นเจ้าของกิจการ สนใจทางด้านศาสนา มักมีโชคลาภแบบฟลุ๊กๆอยู่เสมอ มักมีลางสังหรณ์และติดต่อกับวิญญาณได้ ทำอะไรมักมีความขลัง ไปอยู่ที่ใดดูจะหนีไปพ้นเรื่องของขลังๆ ผูกพันกับเรื่องเก่า คนเก่า สถานที่เก่าแก่ ของเก่า รวมไปจนถึงเรื่องอดีต\r\n\r\nด้านเสีย ทำชั่วเห็นผลเร็ว ถ้าดีไม่พอนับว่าอันตรายมาก ถ้าดวงมีวิญญาณตาม มีกรรมเก่าแรง เคยฆ่าคน ฆ่าสัตว์ใหญ่ไว้ จะทำให้เกิดเรื่องร้ายมากกว่าดี และไม่เหมาะสำหรับคนที่มีแฟนแล้ว เพราะจะทำให้แฟนไม่อยากเข้าใกล้เพราะร้อนมีปัญหาเลิกราทะเลาะกันได้ เลขนี้ระวังอุบัติเหตุไว้ด้วย\r\n');
INSERT INTO `numbers` (`pairnumberid`, `pairnumber`, `pairtype`, `pairpoint`, `miracledesc`, `miracledetail`, `detail_vip`) VALUES
(101, '1', 'R10', -10, 'หมายเลข 1 ดาวอาทิตย์ดาวพลังความเชื่อมั่น ', 'เป็นเลขแห่งผู้นำ ได้รับอิทธิพลจากดาวอาทิตย์ เป็นเลขแห่งความเชื่อมั่นในตัวเองสูง มีไหวพริบปฏิภาณดีเยี่ยม สติปัญญาว่องไวใจนักเลง กล้าหาญ มีความทะเยอทะยานที่จะเป็นใหญ่เป็นโต กล้าเสี่ยง ชอบออกหน้า ถือความคิดอ่านตนเป็นใหญ่ เป็นผู้นำคน ชอบเด่นชอบดัง เป็นที่เคารพนับถือคนทั่วไป ใจคอเด็ดเดี่ยว คิดการเช่นไรมักจะรีบทำเดี๋ยวนั้น มั่นคงมีการตัดสินใจได้รวดเร็ว ไม่โลเล ชีวิตมักจะมีการเดินทางไม่เกรงกลัวต่ออุปสรรคต่างๆ เป็นเลขของเจ้าชะตะตาที่มีความแข็งแรงมีพลังร้อนแรงไม่มีขีดจำกัดอยู่ ชีวิตประสบความสำเร็จดี มีชื่อเสียง มีสมบัติทรัพย์ มีความสุข ดีได้ด้วยปัญญาความสามารถของ ทำงานด้านรับราชการ ทหาร ตำรวจ เป็นเจ้าคนนายคน ดีนักแล', 'ตามหลักโหราศาสตร์เลข 1 คือ ดาวอาทิตย์\r\n\r\nด้านดี มักเป็นใหญ่ เป็นผู้นำ มีเกียรติยศชื่อเสียง มีหน้ามีตาในสังคม ดีคือถ้าใครดวงถูกโฉลกเมื่อใช้แล้วจะทำให้ได้เป็นข้าราชการ นักการเมือง เจ้าของกิจการ หรือถ้าเป็นลูกจ้างก็จะมีตำแหน่งเป็นผู้บริหาร ผู้จัดการ เป็นต้น คนเลขนี้จะอดทน กระตือรือร้น ปราดเปรียว ไม่หยุดนิ่ง มีความคิดริเริ่มอยู่เสมอ ใจคอหนักแน่น \r\n\r\nด้านเสีย เลข 1 เจ้าชู้ ดื้อ หยิ่งในศักดิ์ศรี ถือตัว ใจใหญ่ พูดตรงบางครั้งแรง เป็นคนที่อารมณ์ร้อนใจร้อนใจนักเลงแต่โกรธง่ายหายเร็ว เมื่ออายุยังน้อยมักมีปัญหาในการประกอบธุรกิจการงานตั้งตัวได้ช้า เพราะอารมณ์ เพราะไม่ยอมคน และมักผิดพลาดเพราะคิดแล้วทำทันทีขาดการวางแผนไม่คิดไตร่ตรองก่อน คนที่มีเลข 1 เยอะสะสมเยอะ มักมากผัวมากเมีย มักเดินทางบ่อย ร้อนแรงในกามา มักเป็นหนี้เป็นสิน ครอบครัวไม่อบอุ่น ถ้าไม่ระวังไม่รู้ตัวมักล้มละลาย หมดตัว มีหนี้สิน\r\n'),
(102, '2', 'R5', -25, 'หมายเลข 2 ดาวจันทร์ดาวพลังแห่งจินตนาการ ', 'มักเป็นคนมีจินตนาการสูง จิตใจอ่อนไหว มองโลกในแง่ดี บางครั้งคิดมาก คิดเล็กคิดน้อย ขี้น้อยใจ ช่างคิด ช่างฝัน ชอบศิลปะ ชอบของละเอียดอ่อน มีอารมณ์ศิลปิน ไวต่อความรู้สึกสูง เปลี่ยนแปลงอารมณ์ง่าย ด้วยเหตุนี้จึงเชื่อใจคนอื่นได้ง่าย ชอบชีวิตอิสระ ใครอยู่ใกล้แล้วจะมีความสุข เป็นคนอ่อนไหวแต่ถึงอย่างไรก็ตามเมื่อมีเหตุการณ์ไม่คาดคิด จะควบคุมสติได้ดี มีความกล้าหาญ เข็มแข็ง หลิกผันสถานการณ์ได้ดี ทำงานเป็นอาร์ตทิส ศิลปิน ดีไซด์เนอร์ นักออกแบบ สถาปนิก ครีเอทีฟ อาร์ตไดเร็คเตอร์ ฝ่ายศิลป์ทั้งหลาย นักออกแบบ ผู้ที่ต้องใช้ศาสตร์และศิลปะมาประกอบอาชีพจะรุ่งเรือง ติดที่เป็นคนดื้อรั้นแบบดื้อเงียบ ช่างฝันและขี้อาย เจ้าระเบียบ ขี้จุกจิก ต้องลดความดื้อและความอายลงบ้างจะดี', 'ตามหลักโหราศาสตร์เลข 2 คือ ดาวจันทร์\r\n\r\nด้านดี  มักพูดช้า พูดจาอ่อนหวาน ปากหวาน สุภาพ น่ารัก มีเสน่ห์ ใจดี ใจบุญ โอบอ้อมอารีย์ มักโชคดีมักได้รับความรักจากคนรอบข้าง มักมีโชคจากคู่ครองมีโชคเพราะความรักความเมตตาจากผู้ใหญ่ลูกค้าและคนรอบข้าง ในสถานการณ์ฉุกเฉินคนเลข 2 จะเป็นคนที่เข้มแข็งมาก สามารถควบคุมจิตใจได้เป็นอย่างดี\r\n\r\nด้านเสีย ขี้สงสารอ่อนไหวง่าย โลเล รักง่ายหน่ายเร็ว จิตใจมักไม่อยู่กับร่องกับรอย โดนเป่าหูได้ง่าย เลข 2 จะมีอิทธิพลต่ออารมณ์มาก ถ้ามีเยอะจะทำให้เคลิบเคลิ้มอย่างรุนแรง ลุ่มหลงมัวเมา เข้าขั้นงมงาย จึงมักโดนหลอกได้ง่าย คนเลขนี้มักมีอารมณ์เพ้อฝันอยู่ในโลกของจิตนาการมากกว่าอยู่กับความเป็นจริง ชอบสร้างวิมานในอากาศ รักอิสระ มีอารมณ์แปรปรวน หลอกตัวเองและอาจหลอกผู้อื่น ดื้อเงียบ ภายนอกอาจดูอ่อนหวานอ่อนไหวว่านอนสอนง่าย คล้ายเข้าใจ แต่ภายในมักไม่ใช้ แต่ถ้ามีเยอะจะทำให้คนที่ได้เลขนี้ตาบอดใจบอด คือ ถ้าเขาได้เชื่อได้รักได้หลงอะไรแล้ว มักจะเปลี่ยนใจยากมาก \r\n\r\nระวังคนที่มีเลข 2 หรือ 2X, X2 ซึ่งเป็นกลุ่มเลขร้ายเยอะ ระวังจะป่วยหรือสุขภาพไม่ดีด้วยโรคภัยที่เกี่ยวกับ ระบบเลือดและน้ำเหลืองไม่ดี มักเป็นริดสีดวงทวาร กระเพาะและลำไส้ระบบย่อยระบบดูดซึมมีปัญหา มักเป็นซีสต์ เนื้องอก มะเร็ง มักเป็นโรคเบาหวาน ดวงตามีปัญหา มักมีปัญหาที่ช่วงหน้าอก เต้านม ปอด มดลูก อวัยวะเพศ หลายคนมักเบี่ยงเบนทางเพศ หรือ มีกิ๊กมีชู้ เป็นเมียน้อยเขา  \r\n'),
(103, '3', 'R10', -50, 'หมายเลข 3 ดาวอังคารดาวพลังแห่งความกล้าหาญชาญชัย', 'มักเป็นคนมีจินตนาการสูง จิตใจอ่อนไหว มองโลกในแง่ดี บางครั้งคิดมาก คิดเล็กคิดน้อย ขี้น้อยใจ ช่างคิด ช่างฝัน ชอบศิลปะ ชอบของละเอียดอ่อน มีอารมณ์ศิลปิน ไวต่อความรู้สึกสูง เปลี่ยนแปลงอารมณ์ง่าย ด้วยเหตุนี้จึงเชื่อใจคนอื่นได้ง่าย ชอบชีวิตอิสระ ใครอยู่ใกล้แล้วจะมีความสุข เป็นคนอ่อนไหวแต่ถึงอย่างไรก็ตามเมื่อมีเหตุการณ์ไม่คาดคิด จะควบคุมสติได้ดี มีความกล้าหาญ เข็มแข็ง หลิกผันสถานการณ์ได้ดี ทำงานเป็นอาร์ตทิส ศิลปิน ดีไซด์เนอร์ นักออกแบบ สถาปนิก ครีเอทีฟ อาร์ตไดเร็คเตอร์ ฝ่ายศิลป์ทั้งหลาย นักออกแบบ ผู้ที่ต้องใช้ศาสตร์และศิลปะมาประกอบอาชีพจะรุ่งเรือง ติดที่เป็นคนดื้อรั้นแบบดื้อเงียบ ช่างฝันและขี้อาย เจ้าระเบียบ ขี้จุกจิก ต้องลดความดื้อและความอายลงบ้างจะดี', 'ตามหลักโหราศาสตร์เลข 3 คือ ดาวอังคาร \r\n\r\nด้านดี คือบุคคลที่ใช้หมายเลข 3 มักเป็นคนที่มีอำนาจ หรือตบะ มีเดชมาก เป็นคนมีมานะพยายาม เป็นคนขยันขันแข็ง อดทน กล้าแสดงความคิดเห็น เป็นคนเปิดเผย มักจะชนะเมื่อต้องแข่งขัน \r\n\r\nด้านเสีย บ่งบอกถึงเจ้าตัวจะเป็นคนพูดจาตรง เด็ดขาด รุนแรงบางครั้งติดก้าวร้าว ชอบค้าน เสียงดัง มักมีความขัดแย้งเสมอ ใจร้อน เจ้าอารมณ์ เจ้าโทสะ เอาแต่ใจตน  มั่นใจในตัวเอง ไม่ง้อใคร กล้าได้กล้าเสีย ไม่ยอมคน ถ้าไม่ได้อย่างใจจะสู้อย่างหัวชนฝา มีอารมณ์รุนแรง เซ็กส์จัด รักแรงเกลียดแรง เป็นคนมุทะลุ ชอบความตรงไปตรงมา ถ้าไม่ใช่คนธรรมะธรรมโม ถ้าไม่มีการศึกษาจะชอบใช้กำลัง เป็นอันธพาล และระวัง ถ้าใครมีเลข 3 เยอะแถมจับคู่ไม่ดี จะเจ้าชู้ โมโหร้าย มักมีเรื่องทะเลาะบาดหมาง มีคดีความ ถูกจับ ถูกตรวจสอบ ติดคุกตะราง ศัตรูเยอะ มีภัยจากเครื่องจักร มีภัยจากความเร็ว ปืน มีด มีอุบัติเหตุง่ายๆ ถูกฆ่า หรือฆ่าเขา ต้องมีการเลือดตกยางออกมีการผ่าตัดเกิดขึ้นบ่อย\r\n'),
(104, '4', 'D5', 25, 'หมายเลข 4 ดาวพุธพลังแห่งดาวสติปัญญา ', 'เป็นคนเฉลียวฉลาด ว่องไว ทันเกมคนอื่นๆ ใครก็หลอกไม่ได้ เอาตัวรอดได้ดีมาก ชีวิตประสบความสำเร็จดี รู้จักวางตัว ทันคนชอบติดต่อคบหาสมาคม ทำงานด้านการติดต่อสื่อสาร เป็นฝ่ายบริหารงานลูกค้า การตลาด ประชาสัมพันธ์ เซลขายของต่างๆ อาจารย์ งานที่ต้องติดต่อกับคนมากๆ มนุษย์สัมพันธ์เป็นเลิศ ใครๆก็ชอบอยู่ใกล้ ชอบเข้ามาคบค้าสมาคมด้วย มีความคล่องตัวสูง ติดตรงที่จะเหนื่อยกับการเดินทางเสมอ เหนื่อยกับการติดต่อสื่อสาร บางครั้งจิตใจสับสนบอกความต้องการของตัวเองไม่ถูก', 'ตามหลักโหราศาสตร์เลข 4 คือ ดาวพุธ \r\n\r\nด้านดี คือ ทำงานเก่ง สติปัญญาดี พูดเก่ง เฉลียวฉลาด พูดจาอ่อนหวานมีคารมคมคาย มีไหวพริบปฏิภาณดี ปรับตัวเก่ง เอาใจเก่ง เป็นคนมีมนุษย์สัมพันธ์ดี เข้ากับบุคคลต่างๆได้ง่าย ชอบแสดงความคิดเห็น ชอบวิจารณ์ เป็นนักพูด เป็นนักเขียน เป็นนักประชาสัมพันธ์ได้ดี ใจดี โอบอ้อมอารีย์ มองโลกในแง่ดี ใจบุญสุนทาน นอกจากนี้เลข 4 ยังหมายถึง เทพเจ้าแห่งการค้าขาย หมายถึงนักธุรกิจ นักบริหาร การติดต่อสื่อสาร ข้อมูลข่าวสาร \r\n\r\nด้านเสีย คือ ใจอ่อน เชื่อใจคนง่าย ใจดีเกินไป\r\n'),
(105, '5', 'D8', 25, 'หมายเลข 5 ดาวพลังแห่งปัญญาปัญญาทางธรรมะ ', 'ปัญญาทางด้านคุณธรรม ด้วยปัญญาที่มีอยู่จะทำให้ชีวิตประสบความสำเร็จ ประกอบการทำงานใดๆจะราบรื่นรุ่งเรือง มีจริยธรรมดี มีความยุติธรรม ไม่ทำร้าย เอาเปรียบใคร ชอบสิ่งเร้นลับ ไสยศาสตร์ สิ่งศักดิ์สิทธิ์ สิ่งเหนือธรรมชาติ พิสูจน์ไม่ได้ด้วยวิทยาศาสตร์ เป็นคนมีความสุขุมเยือกเย็น เป็นคนมองโลกในแง่ดี ให้ความสำคัญกับศาสนาทำงานด้านอาจารย์ นักปกครอง งานที่ต้องอาศัยความสุขุมรอบคอบดี ถ้าเป็นพระจะชอบพิธีกรรมทางศาสนาต่างๆ ติดที่เป็นคนโกรธง่าย เชื่อมั่นในตัวเองค่อนข้างสูงทำให้ขาดเสน่ห์ไปได้', 'ตามหลักโหราศาสตร์เลข 5 คือ ดาวพฤหัสบดี \r\n\r\nด้านดี พูดตรง มีเหตุผลน่าเชื่อถือ ชอบสอน มีความยุติธรรม สติปัญญาดีใจดี ซื่อตรงซื่อสัตย์สุจริต ใจบุญสุนทาน โอบอ้อมอารีย์ กตัญญู ใฝ่รู้ใฝ่เรียน ใฝ่ธรรม บุคคลที่มีหมายเลข 5 จะชอบช่วยเหลือผู้อื่น สุภาพอ่อนน้อมถ่อมตน เกลียดคนที่ชอบเอาเปรียบผู้อื่น เป็นคนที่รักความยุติธรรมมาก เป็นคนใจเย็น ไม่ชอบหักหาญใจใคร ชอบรับฟังความคิดเห็นของผู้อื่น ชอบตักเตือนชี้แนะผู้อื่นอยู่เสมอ ใฝ่ทางด้านศาสนา ชอบทำบุญทำทาน ช่วยเหลือสังคม และเลข 5 ยังหมายถึงสิ่งศักดิ์สิทธิ์คุ้มครองและเป็นเลขนำเงินนำความอุดมสมบูรณ์มาให้ด้วย เลข 5 เป็นตัวแทนของความรู้ ความคิด หมอ ศาล กฎหมาย ครู โหราศาสตร์ ศาสนา โรงพยาบาล \r\n\r\nด้านเสีย บางครั้ง ซื่อเกินไป(แกล้งโง่ก็มี) ไม่ทันคน\r\n'),
(106, '6', 'D5', -10, 'หมายเลข 6 ดาวแห่งศิลปะวิทยาการ ', 'มีเสน่ห์ รักสวยรักงาม มีจินตนาการความฝัน ชอบศิลปะ ชื่นชมในงานศิลปะต่างๆ ทำอะไรก็จะคำนึงภาพลักษณ์ตนเองเป็นอย่างแรก มีรสนิยมดีชอบศิลปะ และดนตรี สนุกบันเทิง เป็นคนที่ชอบความรักสบายอย่างมาก มีโลกส่วนตัว เจ้าสำราญเสมอ ไม่ชอบเอาเปรียบเบียดเบียนใคร ชื่อนี้ดีมากจะส่งเสริมเงินทองไหลมาเทมา มีเสน่ห์ ชื่อเสียง มีความสำเร็จที่งดงาม ทำงานด้านช่างแต่งหน้า ศิลปิน สไตล์ริส นักประชาสัมพันธ์ ฝ่ายศิลป์ต่างๆ จะดี', 'ตามหลักโหราศาสตร์เลข 6 คือ ดาวศุกร์ ดาวแห่งความรัก การเงิน \r\n\r\nด้านดี บุคคลที่ได้หมายเลข 6 มักพูดจาสนุกสนาน ร่าเริง บางครั้ง อ่อนหวาน มีเสน่ห์ ใจดี รักสวยรักงาม เจ้าชู้ ขี้หึง เซ็กส์จัด มักมีอารมณ์อ่อนไหว ไปทางด้านศิลป์การแสดงการดนตรี ความสวยความงาม ชอบบทกวี เป็นคนมีอารมณ์รุนแรง แต่รักสงบ ชอบการประนีประนอม มีความละเอียดในการทำงาน มีรสนิยมในการแต่งตัว หมายเลขเลข 6 หมายถึง เสน่ห์เงินทอง เป็นเทพเจ้าแห่งความสวยความงาม เลขการเงินการคลัง ธนาคาร โรงแรม การแสดง ภาพยนตร์ การบันเทิงทุกชนิด ความรักปนความใคร่\r\n\r\nด้านเสีย บางครั้งเอาแต่ใจตนเอง ชอบตั้งความหวังให้ตนเองเสมอ แต่บางครั้งมักมองโลกแคบ ไม่ชอบคิดการณ์ไกล ไม่ชอบวางแผนระยะยาว เป็นคนกล้าได้กล้าเสีย\r\n'),
(107, '7', 'R10', -60, 'หมายเลข 7 ดาวเสาร์ดาวพลังแห่งทุกข์โศก ', 'โรคภัยไข้เจ็บ ป่วยง่าย เป็นหวัดบ่อย ปวดหัวตัวร้อยเสมอ ทำอะไรก็ติดขัดไปหมด มีการสูญเสียเสมอ ไม่เป็นที่ มักเดือดร้อนเป็นประจำ ไม่สมหวังเรื่องความรัก และครอบครัว ต้องแยกกันอยู่ไม่ค่อยได้อยู่พร้อมหน้าพร้อมตา แต่มีดีเรื่อง มีสติปัญญาและความอดทนเป็นเลิศ ใช้ภาษาการติดต่อสื่อสารเก่งประคับประคองตัวแต่เป็นแบบลุ่มๆดอนๆไม่มั่นคง การตั้งชื่อให้หลีกเลี่ยงเลข 7 ไว้ได้เลยเพราะถือว่าเป็นดาวบาปเคราะห์ จะมีผลทางลบมากกว่าทางบวกจะนำความยุ่งยากให้แก่ชีวิต มีความไม่มั่นคงในชีวิต', 'ตามหลักโหราศาสตร์เลข 7 คือ ดาวเสาร์ \r\n\r\nด้านเสีย เสียในทางโหราศาสตร์ ถือว่าเป็นดาวแห่งความทุกข์ ผู้ที่ได้เลขนี้จะนิ่ง เงียบขรึม พูดน้อย ปากหนัก แต่ถ้าได้พูดจะพูดจาตรง จริงจังแตกหัก ปากร้าย พูดจาไม่เกรงใจใคร ค่อนข้างดุร้าย ไม่ยอมคน อาฆาตพยาบาท ซาดิสท์ เทพเจ้าแห่งความทุกข์ และความไม่แน่นอน ใครใช้มักมีอุปสรรคปัญหาในชีวิตบ่อย มักเป็นคนที่วิตกกังวลง่าย เครียด คิดมาก หวาดระแวงเก่ง ขี้ระแวง ขี้สงสัย เจ้าทุกข์ จริงจัง ซีเรียสไปหมดทุกเรื่องกลายเป็นคนอมทุกข์ เป็นโรคประสาท โรคเครียด มักจะทำตัวแก่ก่อนวัย มักโยกย้ายที่อยู่หรือตำแหน่งหน้าที่การงานบ่อย เลขร้ายจะทำให้เจ็บป่วยเป็นโรคร้ายเรื้อรัง เป็นมะเร็ง มักมีปัญหาที่ข้อ กระดูก เอ็น หัว หลัง ระบบประสาท กระเพาะ ภูมิแพ้ และระวังมีอุบัติเหตุ โดนทำร้าย โดนปองร้าย ทำร้ายตัวเอง\r\n\r\nด้านดี มักเป็นนักต่อสู้ชีวิตตัวฉกาจ กล้าหาญ ไม่ยอมท้อถอยต่ออุปสรรคง่ายๆ ส่วนใหญ่เป็นคนรักสงบ รักความสันโดษ มีตำแหน่งหน้าที่การงานสูง เป็นนักวางแผน นักบริหาร '),
(108, '8', 'R5', -10, 'หมายเลข 8 ดาวราหูพลังแห่งความลุ่มหลงมัวเมา ', 'โมโหง่าย ถูกครอบงำทางเสื่อมได้ง่าย การงานความรักมีแต่อุปสรรค โดนคนใส่ร้ายก็บ่อย ศัตรูมาก คนไม่ชอบหน้าเยอะ และจะถูกชักจูงได้ง่าย ไปในทางอบายมุข พนันบอล เล่นมวย เที่ยวกลางคืนบ่อยๆจนเสียงานเสียการ มีความทุกข์ในใจสูง ถ้าจะเป็นใหญ่เป็นโตได้แต่ต้องลำบากฝ่าฟันมากกว่าจะสำเร็จ', 'ตามหลักโหราศาสตร์เลข 8 คือ ดาวราหู หมายถึง ประมุขแห่งเหล่าพาล วิญญาณ ไสยศาสตร์ \r\n\r\nด้านดี คือ ความมั่งคั่งร่ำรวย ด้านดีภายนอกเป็นนักต่อสู้ชีวิตคนหนึ่ง มีความอดทน อีกทั้งเป็นคนใจกว้าง ให้อะไรใครไม่เคยเสียดาย ชอบเข้าสังคม เป็นคนที่ชอบคบเพื่อน  มีเพื่อนมาก รักพวกพ้อง คบกับใครได้ทุกคน ใจกล้า กล้าได้กล้าเสีย \r\n\r\nด้านเสีย มักเหน็ดเหนื่อยเดือดร้อนวุ่นวายกับงานและบริวาร บุคคลที่ได้หมายเลข 8 จะเป็นคนเจ้าอารมณ์ มุทะลุ พูดจาเผ็ดร้อน ขวานผ่าซากออกนักเลง แต่ไม่นานก็หาย จึงมีศัตรูเยอะ ลุ่มหลงมัวเมา ขาดสติ หลงตัวหลงตน เมารัก เมาเหล้า การพนัน ชอบอบายมุข สิ่งผิดกฎหมาย เจ้าโทสะ ชีวิตมักถูกใส่ร้ายป้ายสี ชีวิตมักจะผิดพลาดอยู่เสมอ เลขนี้ถ้าใครสะสมไว้มากๆ มักจะมีชู้มีกิ๊ก ทำผิดกฎหมายและศีลธรรม มีคดี โดนหลอกโดนโกง หมดตัว ล้มละลาย มักตัดสินใจผิดพลาด เจ็บป่วยด้วยโรคร้าย โรคมะเร็ง โรคกรรม หรือประสบอุบัติเหตุรุนแรงกะทันหันอาจไม่เหลือซาก สูญหาย หรือ โดนอุ้ม ภัยมืด \r\n'),
(109, '9', 'D10', 30, 'หมายเลข 9 พลังดาวเกตุพลังแห่งความลึกลับ ', 'เลขนี้เป็นมงคลมาก เพราะได้พลังจากสิ่งที่มองไม่เห็นมาช่วยดูแลคุ้มครอง ช่วยทำให้กิจการงานใดๆประสบผลสำเร็จ บางครั้งมีอุบัติเหตุก็ทำให้รอดพ้นอย่างไม่น่าเชื่อ มีอายุยืนมั่นคง มีความคิดรวดเร็วว่องไว มีลางสังหรณ์ที่แม่นยำ เลื่อมใส ศรัทธา สนใจในศาสนาเร้นลับสนใจของเก่าแก่ เลขนี้ทำให้อยู่สบาย เรื่องราวชีวิตราบรื่นได้โชคลาภแบบไม่คาดฝัน เพราะมีสิ่งพลังเร้นลับช่วยอยู่ ชอบสะสมของเก่า ของโบราณต่างๆ ถ้าสวดมนตร์บ่อยๆและแผ่เมตตาบารมี พลังสวดมนตร์บำบัดจะช่วยให้พลังของสิ่งที่มองไม่เห็นช่วยคุณได้มากขึ้นไปอีก การทำงานเป็นนักค้าของเก่า นักโบราณคดี โหราจารย์ ผู้ที่ต้องยุ่งเกี่ยวกับเรื่องเร้นลับหรือของเก่าของขลังจะดี', 'ตามหลักโหราศาสตร์เลข 9 คือ ดาวเกตุ \r\n\r\nหมายถึง ความสำเร็จ แต่ถ้ามีมากจะหมกมุ่นในธรรมมากเกินไป มักสับสนวุ่นวาย เป็นคนที่ชอบเอาแต่ใจตนเอง ชอบกามารมณ์ ชอบสะสมของเก่า ถ้าใครสะสมเลข 9 เยอะมักจะประสบอุบัติเหตุถ้าไม่ดีพอโดยเฉพาะ 99 \r\n\r\nด้านดี เลข 9 เลขนี้เป็นเลขที่ใช้สื่อถึงเบื้องบนและเบื้องล่าง(เทพและวิญญาณ) ดังนั้น จึงมักจะมีอะไรแปลกๆ เข้ามาสู่ชีวิตอยู่บ่อยๆ เพราะเลข 9 เป็นตัวเลขมหัศจรรย์เลขหนึ่ง มีความหมายถึง ผู้ที่มีอายุยืนยาว การศาสนา การต่างประเทศ ถ้าผู้ใช้ทำดีทำบุญมากยิ่งทำจะยิ่งดีเห็นผลเร็ว ในขณะเดียวกัน\r\nด้านเสีย ถ้าทำชั่วก็จะเห็นผลเร็วเช่นกัน เลข 9 เป็นเลขที่คอยช่วยเหลือ หรือส่งเสริมเลขอื่น ให้มีอำนาจมากยิ่งขึ้นตามความหมายของเลขนั้นๆ เช่น ถ้าเลข 9 อยู่กับเลขที่ดี ก็จะส่งเสริมให้ดียิ่งขึ้น แต่ถ้าไปอยู่กับเลขไม่ดี ก็จะไม่ดีเพิ่มมากยิ่งขึ้นเป็นทวีคูณ\r\n'),
(110, '0', 'R10', -30, 'หมายเลข 0 ดาวอาทิตย์ดาวพลังความเชื่อมั่น ', 'เป็นเลขแห่งผู้นำ ได้รับอิทธิพลจากดาวอาทิตย์ เป็นเลขแห่งความเชื่อมั่นในตัวเองสูง มีไหวพริบปฏิภาณดีเยี่ยม สติปัญญาว่องไวใจนักเลง กล้าหาญ มีความทะเยอทะยานที่จะเป็นใหญ่เป็นโต กล้าเสี่ยง ชอบออกหน้า ถือความคิดอ่านตนเป็นใหญ่ เป็นผู้นำคน ชอบเด่นชอบดัง เป็นที่เคารพนับถือคนทั่วไป ใจคอเด็ดเดี่ยว คิดการเช่นไรมักจะรีบทำเดี๋ยวนั้น มั่นคงมีการตัดสินใจได้รวดเร็ว ไม่โลเล ชีวิตมักจะมีการเดินทางไม่เกรงกลัวต่ออุปสรรคต่างๆ เป็นเลขของเจ้าชะตะตาที่มีความแข็งแรงมีพลังร้อนแรงไม่มีขีดจำกัดอยู่ ชีวิตประสบความสำเร็จดี มีชื่อเสียง มีสมบัติทรัพย์ มีความสุข ดีได้ด้วยปัญญาความสามารถของ ทำงานด้านรับราชการ ทหาร ตำรวจ เป็นเจ้าคนนายคน ดีนักแล', 'ตามหลักโหราศาสตร์เลข 0 คือ ดาวมฤตยู \r\n\r\nคือ เทพเจ้าแห่งความตาย เป็นสาเหตุให้เกิดการเปลี่ยนแปลงกะทันหัน มักมีเหตุการณ์เกิดขึ้น แบบไม่คาดฝันโดยไม่รู้ตัว\r\n\r\nด้านเสีย บุคคลที่ได้เลข 0  หรือ สะสมเลข 0 อยู่ในชีวิตเยอะ มักจะเกิดอุบัติเหตุร้ายแรง หรือ เจ็บป่วยกะทันหัน ป่วยด้วยโรคร้ายที่รักษาไม่หาย หรือเป็นโรคร้ายเรื้อรัง โรคกรรม โรคมะเร็ง ซีส เนื้องอก ชีวิตมักไม่ราบรื่น ถ้ามีเลขร้ายเยอะชีวิตจะลุ่มๆดอนๆ\r\n\r\nด้านดี คนที่มีรหัส 0 จะเป็นคนที่ชอบแสวงหาความรู้แปลกๆ ใหม่ๆ อยู่เสมอ ไม่ชอบหยุดนิ่งอยู่กับที่ ชอบงานที่เสี่ยงอันตราย ชอบค้นคว้า ชอบสำรวจ ชอบติดต่อพบปะกับคนต่างชาติ หากใช้ชีวิตอยู่ต่างแดนจะประสบความสำเร็จมากกว่าอยู่ในประเทศไทย เพราะ  เลข 0 ยังหมายถึง ต่างประเทศ,วิญญาณ,โหราศาสตร์\r\n');
